oFF.ButterflyRecordingManager.prototype.initSession = function()
{
	this.m_sessions = oFF.XList.create();
	oFF.ButterflyRecordingManager.m_publishedSessions = this.m_sessions;
};
oFF.ButterflyRecordingManager.prototype.isRecording = function()
{
	return this.m_isRecording;
};
oFF.ButterflyRecordingManager.prototype.startRecording = function()
{
	if (!this.isRecording())
	{
		this.m_currentSession = oFF.RecordingSessionEntry.create();
		oFF.ButterflyRecordingManager.m_currentPublicSession = this.m_currentSession;
		this.m_isRecording = true;
	}
};
oFF.ButterflyRecordingManager.prototype.stopRecording = function()
{
	if (this.isRecording())
	{
		if (oFF.notNull(this.m_currentSession))
		{
			this.m_sessions.add(this.m_currentSession);
			this.m_currentSession = null;
			oFF.ButterflyRecordingManager.m_currentPublicSession = null;
		}
		this.m_isRecording = false;
	}
};
oFF.ButterflyRecordingManager.prototype.getCurrentSession = function()
{
	return this.m_currentSession;
};
oFF.ButterflyRecordingManager.prototype.handleRawEvent = function(event, eventType)
{
	if (!this.isRecording() || oFF.isNull(this.m_currentSession))
	{
		return;
	}
	var entry = oFF.ButterflyRecordEntry.create(event, eventType);
	this.m_currentSession.addEntry(entry);
};

