{
	var docStruct = null;
	if (oFF.notNull(docType))
	{
		var docName = docType.getName();
		docStruct = this.m_currentConfiguration.getStructureByKey(docName);
		if (oFF.isNull(docStruct))
		{
			docStruct = this.m_currentConfiguration.putNewStructure(docName);
		}
	}
	return docStruct;
};
oFF.AuGdsConfigurationTool.prototype.getConfigurationString = function()
{
	var tmpSerializer = oFF.PrSerializerFactory.newSerializer(false, false, 0);
	var stringifiedConfig = tmpSerializer.serialize(this.m_currentConfiguration);
	oFF.XObjectExt.release(tmpSerializer);
	return stringifiedConfig;
};

