{
	if (oFF.notNull(existingFileStruct))
	{
		this.m_fileStructure = existingFileStruct.clone();
		if (!this.isValid())
		{
			throw oFF.XException.createIllegalStateException("Invalid file!");
		}
	}
	this.setupInternal();
};
oFF.AuGdsDocContentBase.prototype.setupInternal = function()
{
	if (oFF.isNull(this.m_fileStructure))
	{
		this.m_fileStructure = oFF.PrFactory.createStructure();
	}
	this.addCreationDateIfNecessary();
};
