oFF.AuGdsQueryResultMessageMapper = {

	getMessageStringRsState:function(localization, state)
	{
			var result = "";
		if (state === oFF.ResultSetState.INVALID_QUERY_VIEW_STATE)
		{
			result = localization.getText(oFF.AuGdsQueryBuilderI18n.MSG_INVALID_QUERY_VIEW_STATE);
		}
		else if (state === oFF.ResultSetState.DATA_ACCESS_PROBLEMS)
		{
			result = localization.getText(oFF.AuGdsQueryBuilderI18n.MSG_DATA_ACCESS_PROBLEMS);
		}
		else if (state === oFF.ResultSetState.ERROR)
		{
			result = localization.getText(oFF.AuGdsQueryBuilderI18n.MSG_ERROR);
		}
		else if (state === oFF.ResultSetState.INVALID_VARIABLE_VALUES)
		{
			result = localization.getText(oFF.AuGdsQueryBuilderI18n.MSG_INVALID_VARIABLE_VALUES);
		}
		else if (state === oFF.ResultSetState.NO_DATA_AVAILABLE)
		{
			result = localization.getText(oFF.AuGdsQueryBuilderI18n.MSG_NO_DATA_AVAILABLE);
		}
		else if (state === oFF.ResultSetState.SIZE_LIMIT_EXCEEDED)
		{
			result = localization.getText(oFF.AuGdsQueryBuilderI18n.MSG_RESULTSET_SIZE_LIMIT_EXCEEDED);
		}
		else if (state === oFF.ResultSetState.UNSUBMITTED_VARIABLES)
		{
			result = localization.getText(oFF.AuGdsQueryBuilderI18n.MSG_UNSUBMITTED_VARIABLES);
		}
		else if (state === oFF.ResultSetState.USER_NOT_AUTHORIZED)
		{
			result = localization.getText(oFF.AuGdsQueryBuilderI18n.MSG_USER_NOT_AUTHORIZED);
		}
		return result;
	}
};

