oFF.AuGdsQbConditionalFormattingRuleUIValidator = {

	EPSILON:0.0000000000000002,
	getRangeValidation:function(rangeA)
	{
			if (rangeA.getLowerBound() === null && rangeA.getUpperBound() === null)
		{
			return oFF.AuGdsQbCfRuleValidationState.NULL;
		}
		var lowerBound = oFF.AuGdsQbConditionalFormattingRuleUIValidator.getLowerBound(rangeA);
		var upperBound = oFF.AuGdsQbConditionalFormattingRuleUIValidator.getUpperBound(rangeA);
		if (lowerBound > upperBound)
		{
			return oFF.AuGdsQbCfRuleValidationState.INVALID;
		}
		return oFF.AuGdsQbCfRuleValidationState.VALID;
	},
	getRangeListOverlapValidation:function(rangeInfoList)
	{
			var validationResults = oFF.XSimpleMap.create();
		var orderedRangeInfoList = oFF.XList.create();
		orderedRangeInfoList.addAll(rangeInfoList);
		for (var i = 0; i < orderedRangeInfoList.size(); i++)
		{
			var rangeInfoAIndex = oFF.XIntegerValue.create(i);
			var rangeInfoA = orderedRangeInfoList.get(i);
			for (var j = 0; j < orderedRangeInfoList.size(); j++)
			{
				var rangeInfoBIndex = oFF.XIntegerValue.create(j);
				var rangeInfoB = orderedRangeInfoList.get(j);
				if (rangeInfoA === rangeInfoB)
				{
					continue;
				}
				var overlapResult = oFF.AuGdsQbConditionalFormattingRuleUIValidator.getRangesOverlapValidation(rangeInfoA, rangeInfoB);
				if (overlapResult !== oFF.AuGdsQbCfRuleValidationState.VALID)
				{
					var rangeInfoValidationRes = validationResults.getByKey(rangeInfoAIndex);
					if (oFF.isNull(rangeInfoValidationRes))
					{
						validationResults.put(rangeInfoAIndex, overlapResult);
					}
					else
					{
						var newValidationResA = oFF.AuGdsQbConditionalFormattingRuleUIValidator.adjustValidationResults(rangeInfoValidationRes, rangeInfoValidationRes);
						validationResults.put(rangeInfoAIndex, newValidationResA);
					}
					rangeInfoValidationRes = validationResults.getByKey(rangeInfoBIndex);
					if (oFF.notNull(rangeInfoValidationRes))
					{
						var newValidationResB = oFF.AuGdsQbConditionalFormattingRuleUIValidator.adjustValidationResults(rangeInfoValidationRes, oFF.AuGdsQbConditionalFormattingRuleUIValidator.getOppositeOverlap(overlapResult));
						validationResults.put(rangeInfoBIndex, newValidationResB);
					}
				}
			}
		}
		for (var k = 0; k < rangeInfoList.size(); k++)
		{
			var index = oFF.XIntegerValue.create(k);
			if (!validationResults.containsKey(index))
			{
				validationResults.put(index, oFF.AuGdsQbCfRuleValidationState.VALID);
			}
		}
		return validationResults;
	},
	getRangesOverlapValidation:function(rangeA, rangeB)
	{
			var comparator = oFF.AuGdsQbConditionalFormattingRangeComparator.create();
		var resultRangeA = oFF.AuGdsQbConditionalFormattingRuleUIValidator.getRangeValidation(rangeA);
		var resultRangeB = oFF.AuGdsQbConditionalFormattingRuleUIValidator.getRangeValidation(rangeB);
		if (resultRangeA === oFF.AuGdsQbCfRuleValidationState.NULL || resultRangeB === oFF.AuGdsQbCfRuleValidationState.NULL)
		{
			return oFF.AuGdsQbCfRuleValidationState.VALID;
		}
		var newRangeA = rangeA;
		var newRangeB = rangeB;
		var hasBeenOrdered = false;
		if (comparator.compare(rangeA, rangeB) > 0)
		{
			hasBeenOrdered = true;
			newRangeA = rangeB;
			newRangeB = rangeA;
		}
		var result = oFF.AuGdsQbConditionalFormattingRuleUIValidator.getRangesOverlapValidationOrderedRange(newRangeA, newRangeB, hasBeenOrdered);
		return hasBeenOrdered ? oFF.AuGdsQbConditionalFormattingRuleUIValidator.getOppositeOverlap(result) : result;
	},
	getLowerBound:function(range)
	{
			if (range.getLowerBound() === null)
		{
			return oFF.XDouble.getNegativeInfinity();
		}
		var lowerBound = range.getLowerBound().getDouble();
		if (range.getLowerBoundOperator() === oFF.ComparisonOperator.GREATER_THAN)
		{
			lowerBound = lowerBound + oFF.AuGdsQbConditionalFormattingRuleUIValidator.EPSILON;
		}
		return lowerBound;
	},
	getUpperBound:function(range)
	{
			if (range.getUpperBound() === null)
		{
			return oFF.XDouble.getPositiveInfinity();
		}
		var upperBound = range.getUpperBound().getDouble();
		if (range.getUpperBoundOperator() === oFF.ComparisonOperator.LESS_THAN)
		{
			upperBound = upperBound - oFF.AuGdsQbConditionalFormattingRuleUIValidator.EPSILON;
		}
		return upperBound;
	},
	getRangesOverlapValidationOrderedRange:function(rangeA, rangeB, hasBeenOrdered)
	{
			var lowerBoundA = oFF.AuGdsQbConditionalFormattingRuleUIValidator.getLowerBound(rangeA);
		var upperBoundA = oFF.AuGdsQbConditionalFormattingRuleUIValidator.getUpperBound(rangeA);
		var lowerBoundB = oFF.AuGdsQbConditionalFormattingRuleUIValidator.getLowerBound(rangeB);
		var upperBoundB = oFF.AuGdsQbConditionalFormattingRuleUIValidator.getUpperBound(rangeB);
		if ((rangeA.getUpperBoundOperator() !== null && rangeA.getUpperBoundOperator().isRangeInclusive()) && (rangeB.getLowerBoundOperator() !== null && rangeB.getLowerBoundOperator().isRangeInclusive()))
		{
			if (upperBoundA < lowerBoundB)
			{
				return oFF.AuGdsQbCfRuleValidationState.VALID;
			}
		}
		else
		{
			if (upperBoundA <= lowerBoundB)
			{
				return oFF.AuGdsQbCfRuleValidationState.VALID;
			}
		}
		if (lowerBoundB > lowerBoundA && upperBoundA >= lowerBoundB)
		{
			if (hasBeenOrdered && upperBoundB <= upperBoundA)
			{
				return oFF.AuGdsQbCfRuleValidationState.OVERLAP_TOTAL;
			}
			return oFF.AuGdsQbCfRuleValidationState.OVERLAP_UPPER;
		}
		if (lowerBoundB >= lowerBoundA && upperBoundB <= upperBoundA)
		{
			return oFF.AuGdsQbCfRuleValidationState.OVERLAP_TOTAL;
		}
		return oFF.AuGdsQbCfRuleValidationState.VALID;
	},
	getOppositeOverlap:function(overlapError)
	{
			if (overlapError === oFF.AuGdsQbCfRuleValidationState.OVERLAP_UPPER)
		{
			return oFF.AuGdsQbCfRuleValidationState.OVERLAP_LOWER;
		}
		if (overlapError === oFF.AuGdsQbCfRuleValidationState.OVERLAP_LOWER)
		{
			return oFF.AuGdsQbCfRuleValidationState.OVERLAP_UPPER;
		}
		return overlapError;
	},
	adjustValidationResults:function(oldValidationRes, newValidationRes)
	{
			if (oldValidationRes === newValidationRes)
		{
			return newValidationRes;
		}
		if (oldValidationRes === oFF.AuGdsQbCfRuleValidationState.OVERLAP_TOTAL || newValidationRes === oFF.AuGdsQbCfRuleValidationState.OVERLAP_TOTAL)
		{
			return oFF.AuGdsQbCfRuleValidationState.OVERLAP_TOTAL;
		}
		if (oldValidationRes === oFF.AuGdsQbCfRuleValidationState.OVERLAP_LOWER && newValidationRes === oFF.AuGdsQbCfRuleValidationState.OVERLAP_UPPER)
		{
			return oFF.AuGdsQbCfRuleValidationState.OVERLAP_TOTAL;
		}
		if (oldValidationRes === oFF.AuGdsQbCfRuleValidationState.OVERLAP_UPPER && newValidationRes === oFF.AuGdsQbCfRuleValidationState.OVERLAP_LOWER)
		{
			return oFF.AuGdsQbCfRuleValidationState.OVERLAP_TOTAL;
		}
		throw oFF.XException.createIllegalStateException(oFF.XStringUtils.concatenate4("validation result not compatible - old: ", oldValidationRes.getName(), " new: ", newValidationRes.getName()));
	},
	validateName:function(queryModel, structureMember, nameToValidate)
	{
			var crudlApi = oFF.AuGdsQbConditionalFormattingCRUDLAPI.create(queryModel);
		var allStructRules = crudlApi.listAllRulesForMember(structureMember);
		var matchRuleName = oFF.XStream.of(allStructRules).filter( function(structRule){
			return oFF.XString.isEqual(structRule.getName(), nameToValidate);
		}.bind(this)).collect(oFF.XStreamCollector.toList());
		if (matchRuleName.size() > 0)
		{
			return oFF.AuGdsQbCfRuleValidationState.INVALID;
		}
		return oFF.AuGdsQbCfRuleValidationState.VALID;
	}
};

