oFF.AuGdsQbConditionalFormattingRuleActivationManager.prototype.disableAllRulesForMember = function(structureMember)
{
	oFF.XObjectExt.assertNotNullExt(structureMember, "structure member is null");
	oFF.XStream.of(this.m_queryModel.getFormulaExceptionManager()).forEach( function(fException){
		if (oFF.notNull(fException))
		{
			var baseMeasure = fException.getBaseMeasure();
			if (oFF.isNull(baseMeasure))
			{
				baseMeasure = this.m_queryModel.isAccountModel() ? this.m_queryModel.getAccountDimension().getStructureMember(fException.getBaseMeasureName()) : this.m_queryModel.getMeasureDimension().getStructureMember(fException.getBaseMeasureName());
			}
			if (structureMember.isEqualTo(baseMeasure))
			{
				fException.setActive(false);
			}
		}
	}.bind(this));
	oFF.XStream.of(this.m_queryModel.getExceptionManager()).forEach( function(exception){
		if (oFF.notNull(exception) && structureMember.isEqualTo(exception.getMeasure()))
		{
			exception.setActive(false);
		}
	}.bind(this));
};
