oFF.AuGdsQbConditionalFormattingRuleActivationManager.prototype._setActiveRuleForMember = function(structureMember, ruleId, isActive)
{
	var formulaException = this.m_queryModel.getFormulaExceptionManager().getByKey(ruleId);
	if (oFF.notNull(formulaException))
	{
		formulaException.setActive(isActive);
	}
	else
	{
		var exception = this.m_queryModel.getExceptionManager().getByKey(ruleId);
		if (oFF.notNull(exception))
		{
			exception.setActive(isActive);
		}
		else
		{
			oFF.XStream.of(this.m_queryModel.getFormulaExceptionManager()).forEach( function(fException){
				if (oFF.XString.containsString(fException.getName(), ruleId))
				{
					fException.setActive(isActive);
				}
			}.bind(this));
			oFF.XStream.of(this.m_queryModel.getExceptionManager()).forEach( function(excptn){
				if (oFF.XString.containsString(excptn.getName(), ruleId))
				{
					excptn.setActive(isActive);
				}
			}.bind(this));
		}
	}
};
