oFF.AuGdsQbConditionalFormattingNumberRuleCreator = function() {};
oFF.AuGdsQbConditionalFormattingNumberRuleCreator.prototype = new oFF.XObject();
oFF.AuGdsQbConditionalFormattingNumberRuleCreator.prototype._ff_c = "AuGdsQbConditionalFormattingNumberRuleCreator";

oFF.AuGdsQbConditionalFormattingNumberRuleCreator.createNumberRule = function(queryModel)
{
	oFF.XObjectExt.assertNotNullExt(queryModel, "queryModel is null");
	var ruleCreator = new oFF.AuGdsQbConditionalFormattingNumberRuleCreator();
	ruleCreator.m_queryModel = queryModel;
	return ruleCreator;
};
oFF.AuGdsQbConditionalFormattingNumberRuleCreator.prototype.m_queryModel = null;
oFF.AuGdsQbConditionalFormattingNumberRuleCreator.prototype.createRule = function(newRule)
{
	oFF.XObjectExt.assertNotNullExt(newRule, "rule is null");
	var formulaException = this.createFormulaException(newRule);
	var ranges = newRule.getThreshold().getThresholdRanges();
	for (var rangeIdx = 0; rangeIdx < ranges.size(); rangeIdx++)
	{
		this.createRange(formulaException, newRule, rangeIdx, -1);
	}
};
oFF.AuGdsQbConditionalFormattingNumberRuleCreator.prototype.createThresholdId = function(ruleId, rangeIdx, rangePart, ruleIdx)
{
	var rangeIdxStr = oFF.XInteger.convertToString(rangeIdx);
	var ruleIdxStr = ruleIdx !== -1 ? oFF.XInteger.convertToString(ruleIdx) : "";
	return oFF.XStringUtils.concatenate4(ruleId, rangeIdxStr, rangePart, ruleIdxStr);
};
oFF.AuGdsQbConditionalFormattingNumberRuleCreator.prototype.createRange = function(formulaException, newRule, rangeIdx, ruleIdx)
{
	var tableDefinition = oFF.XStream.of(this.m_queryModel.getVisualizationManager().getVisualizationDefinitions()).find( function(vizDef){
		return vizDef.getProtocolBindingType().isEqualTo(oFF.ProtocolBindingType.SAC_TABLE_GRID);
	}.bind(this)).get();
	if (oFF.isNull(tableDefinition))
	{
		throw oFF.XException.createRuntimeException("Table definition cannot be null when creating range for conditional formatting");
	}
	var range = newRule.getThreshold().getThresholdRanges().get(rangeIdx);
	var lowerBoundOperator = range.getLowerBoundOperator();
	var upperBoundOperator = range.getUpperBoundOperator();
	var lowerBoundValue = range.getLowerBound();
	var upperBoundValue = range.getUpperBound();
	var baseThresholdId = this.createThresholdId(newRule.getId(), rangeIdx, oFF.AuGdsQbConditionalFormattingConstants.NO_RANGE_PART, ruleIdx);
	if (oFF.notNull(lowerBoundOperator) && oFF.notNull(upperBoundOperator))
	{
		if (lowerBoundOperator.isRangeInclusive() === upperBoundOperator.isRangeInclusive())
		{
			var operator = lowerBoundOperator.isRangeInclusive() ? oFF.ComparisonOperator.BETWEEN : oFF.ComparisonOperator.BETWEEN_EXCLUDING;
			this.createThreshold(formulaException, baseThresholdId, operator, lowerBoundValue, upperBoundValue);
			oFF.AuGdsQbConditionalFormattingStyleCreator.createDataPointStyle(tableDefinition, baseThresholdId, newRule.getName(), range, newRule.getStyle());
		}
		else
		{
			var inclusiveValue = lowerBoundOperator.isRangeInclusive() ? lowerBoundValue : upperBoundValue;
			var thresholdIdA = this.createThresholdId(newRule.getId(), rangeIdx, oFF.AuGdsQbConditionalFormattingConstants.FIRST_RANGE_PART, ruleIdx);
			this.createThreshold(formulaException, thresholdIdA, oFF.ComparisonOperator.BETWEEN, inclusiveValue, inclusiveValue);
			oFF.AuGdsQbConditionalFormattingStyleCreator.createDataPointStyle(tableDefinition, thresholdIdA, newRule.getName(), range, newRule.getStyle());
			var thresholdIdB = this.createThresholdId(newRule.getId(), rangeIdx, oFF.AuGdsQbConditionalFormattingConstants.SECOND_RANGE_PART, ruleIdx);
			this.createThreshold(formulaException, thresholdIdB, oFF.ComparisonOperator.BETWEEN_EXCLUDING, lowerBoundValue, upperBoundValue);
			oFF.AuGdsQbConditionalFormattingStyleCreator.createDataPointStyle(tableDefinition, thresholdIdB, newRule.getName(), range, newRule.getStyle());
		}
	}
	else
	{
		if (oFF.notNull(lowerBoundOperator))
		{
			this.createThreshold(formulaException, baseThresholdId, lowerBoundOperator, lowerBoundValue, null);
			oFF.AuGdsQbConditionalFormattingStyleCreator.createDataPointStyle(tableDefinition, baseThresholdId, newRule.getName(), range, newRule.getStyle());
		}
		else
		{
			this.createThreshold(formulaException, baseThresholdId, upperBoundOperator, upperBoundValue, null);
			oFF.AuGdsQbConditionalFormattingStyleCreator.createDataPointStyle(tableDefinition, baseThresholdId, newRule.getName(), range, newRule.getStyle());
		}
	}
};
oFF.AuGdsQbConditionalFormattingNumberRuleCreator.prototype.createFormulaException = function(newRule)
{
	var exceptionId = newRule.getId();
	var ruleName = newRule.getName();
	var structureMember = newRule.getStructureMember();
	var formulaExceptionManager = this.m_queryModel.getFormulaExceptionManager();
	var formulaException = formulaExceptionManager.addNewFormulaException(exceptionId, ruleName);
	formulaException.setAutoSignFlip(this.m_queryModel.getAccountDimension() !== null);
	formulaException.setBaseMeasure(structureMember);
	formulaException.setIsPrimaryMeasure(structureMember.getDimension().isEqualTo(this.m_queryModel.getPrimaryCalculationDimension()));
	formulaException.setFormulaExceptionType(oFF.FormulaExceptionType.BASE_MEASURE_ONLY);
	oFF.XStream.of(newRule.getFilters()).forEach( function(filterItem){
		oFF.XStream.of(filterItem.getValues()).forEach( function(filterItemValue){
			var evaluate = formulaException.addNewEvaluate(filterItem.getDimension(), filterItemValue);
			if (oFF.isNull(filterItemValue))
			{
				evaluate.setOperator(oFF.ComparisonOperator.IS_NULL);
			}
		}.bind(this));
	}.bind(this));
	formulaException.setEvaluateDefault(newRule.getEvaluateType());
	return formulaException;
};
oFF.AuGdsQbConditionalFormattingNumberRuleCreator.prototype.createThreshold = function(formulaException, thresholdId, operator, low, high)
{
	var threshold = formulaException.newThresholdWithName(thresholdId, low.getDouble(), oFF.AlertLevel.GOOD_1);
	threshold.setOperator(operator);
	if (oFF.notNull(high))
	{
		threshold.setHighValue(high.getDouble());
	}
	formulaException.addThreshold(threshold);
	return threshold;
};

oFF.AuGdsQbConditionalFormattingRuleCreatorBW = function() {};
oFF.AuGdsQbConditionalFormattingRuleCreatorBW.prototype = new oFF.XObject();
oFF.AuGdsQbConditionalFormattingRuleCreatorBW.prototype._ff_c = "AuGdsQbConditionalFormattingRuleCreatorBW";

oFF.AuGdsQbConditionalFormattingRuleCreatorBW.prototype.createRule = function(newRule)
{
	oFF.XObjectExt.assertNotNullExt(newRule, "rule is null");
	var primaryStructureMembers = this.getPrimaryStructureMembersFromFilters(newRule);
	var secondaryStructureMembers = this.getSecondaryStructureMembersFromFilters(newRule);
	if (primaryStructureMembers.size() === 0 && secondaryStructureMembers.size() === 0)
	{
		this.createRuleBase(newRule);
		return;
	}
	if (primaryStructureMembers.size() === 0)
	{
		primaryStructureMembers.add(newRule.getStructureMember());
	}
	var structIdx = 1;
	var primaryStructMembersIterator = primaryStructureMembers.getIterator();
	while (primaryStructMembersIterator.hasNext())
	{
		var measure = primaryStructMembersIterator.next();
		var secondaryStructMembersIterator = secondaryStructureMembers.getIterator();
		if (!secondaryStructMembersIterator.hasNext())
		{
			this.createFormulaExceptionSegment(newRule, measure, null, structIdx);
			structIdx = structIdx + 1;
		}
		while (secondaryStructMembersIterator.hasNext())
		{
			var structure = secondaryStructMembersIterator.next();
			this.createFormulaExceptionSegment(newRule, measure, structure, structIdx);
			structIdx = structIdx + 1;
		}
	}
};
oFF.AuGdsQbConditionalFormattingRuleCreatorBW.prototype.getPrimaryStructureMembersFromFilters = function(newRule)
{
	var filterOnPrimaryStruct = oFF.XStream.of(newRule.getFilters()).find( function(filter1){
		return filter1.getDimension().isStructure() && filter1.getDimension().isEqualTo(newRule.getStructureMember().getDimension());
	}.bind(this));
	var primaryStructureMembers = oFF.XList.create();
	if (filterOnPrimaryStruct.isPresent())
	{
		var primaryDimension = filterOnPrimaryStruct.get().getDimension();
		primaryStructureMembers = oFF.XStream.of(filterOnPrimaryStruct.get().getValues()).map( function(value1){
			return primaryDimension.getStructureMember(value1.getStringRepresentation());
		}.bind(this)).collect(oFF.XStreamCollector.toList());
	}
	return primaryStructureMembers;
};
oFF.AuGdsQbConditionalFormattingRuleCreatorBW.prototype.getSecondaryStructureMembersFromFilters = function(newRule)
{
	var filtersOnSecondaryStruct = oFF.XStream.of(newRule.getFilters()).find( function(filter2){
		return filter2.getDimension().isStructure() && !filter2.getDimension().isEqualTo(newRule.getStructureMember().getDimension());
	}.bind(this));
	var secondaryStructureMembers = oFF.XList.create();
	if (filtersOnSecondaryStruct.isPresent())
	{
		var secondaryDimension = filtersOnSecondaryStruct.get().getDimension();
		secondaryStructureMembers = oFF.XStream.of(filtersOnSecondaryStruct.get().getValues()).map( function(value2){
			return secondaryDimension.getStructureMember(value2.getStringRepresentation());
		}.bind(this)).collect(oFF.XStreamCollector.toList());
	}
	return secondaryStructureMembers;
};
oFF.AuGdsQbConditionalFormattingRuleCreatorBW.prototype.createFormulaExceptionSegment = function(newRule, measure, structure, structIdx)
{
	var formulaException = this.createFormulaException(newRule);
	var ranges = newRule.getThreshold().getThresholdRanges();
	for (var rangeIdx = 0; rangeIdx < ranges.size(); rangeIdx++)
	{
		this.createRange(formulaException, newRule, rangeIdx, structIdx);
	}
	var exceptionId = oFF.XStringUtils.concatenate3(formulaException.getName(), "#", oFF.XInteger.convertToString(structIdx));
	formulaException.setName(exceptionId);
	if (oFF.notNull(measure))
	{
		formulaException.setMeasure(measure);
	}
	if (oFF.notNull(structure))
	{
		formulaException.setStructure(structure);
	}
};

oFF.AuGdsQbConditionalFormattingRuleCreatorFactory = {

	createByCompareType:function(compareType, queryModel)
	{
			if (compareType.isEqualTo(oFF.AuGdsQbConditionalFormattingThresholdCompareType.NUMBER_RANGE))
		{
			if (queryModel.getSystemType().isTypeOf(oFF.SystemType.BW))
			{
				return oFF.AuGdsQbConditionalFormattingNumberRuleCreatorBW.createNumberRuleBW(queryModel);
			}
			return oFF.AuGdsQbConditionalFormattingNumberRuleCreator.createNumberRule(queryModel);
		}
		else if (compareType.isEqualTo(oFF.AuGdsQbConditionalFormattingThresholdCompareType.MEASURE))
		{
			if (queryModel.getSystemType().isTypeOf(oFF.SystemType.BW))
			{
				return oFF.AuGdsQbConditionalFormattingCompareRuleCreatorBW.createCompareToMeasureRuleBW(queryModel);
			}
			return oFF.AuGdsQbConditionalFormattingCompareRuleCreator.createCompareToMeasureRule(queryModel);
		}
		return null;
	}
};

oFF.AuGdsQbConditionalFormattingRuleDeleter = function() {};
oFF.AuGdsQbConditionalFormattingRuleDeleter.prototype = new oFF.XObject();
oFF.AuGdsQbConditionalFormattingRuleDeleter.prototype._ff_c = "AuGdsQbConditionalFormattingRuleDeleter";

oFF.AuGdsQbConditionalFormattingRuleDeleter.create = function(queryModel)
{
	var ruleDeleter = new oFF.AuGdsQbConditionalFormattingRuleDeleter();
	ruleDeleter.m_queryModel = queryModel;
	return ruleDeleter;
};
oFF.AuGdsQbConditionalFormattingRuleDeleter.prototype.m_queryModel = null;
oFF.AuGdsQbConditionalFormattingRuleDeleter.prototype.deleteRule = function(ruleId)
{
	this.deleteFromFormulaExceptionManager(ruleId);
	this.deleteFromExceptionManager(ruleId);
};
oFF.AuGdsQbConditionalFormattingRuleDeleter.prototype.deleteFromFormulaExceptionManager = function(ruleId)
{
	var exceptionsToDelete = oFF.XList.create();
	var formulaExceptionManager = this.m_queryModel.getFormulaExceptionManager();
	var exception = formulaExceptionManager.getByKey(ruleId);
	if (oFF.notNull(exception))
	{
		exceptionsToDelete.add(exception);
	}
	else
	{
		oFF.XStream.of(formulaExceptionManager).forEach( function(fException1){
			if (oFF.XString.containsString(fException1.getName(), ruleId))
			{
				exceptionsToDelete.add(fException1);
			}
		}.bind(this));
	}
	var tableDefinition = oFF.XStream.of(this.m_queryModel.getVisualizationManager().getVisualizationDefinitions()).find( function(vizDef){
		return vizDef.getProtocolBindingType().isEqualTo(oFF.ProtocolBindingType.SAC_TABLE_GRID);
	}.bind(this)).get();
	oFF.XStream.of(exceptionsToDelete).forEach( function(fException2){
		var thresholdIterator = fException2.getThresholds().getIterator();
		while (thresholdIterator.hasNext())
		{
			var threshold = thresholdIterator.next();
			this.deleteDataPointStyles(tableDefinition, threshold, threshold.getName());
		}
		formulaExceptionManager.removeFormulaException(fException2.getName());
	}.bind(this));
};
oFF.AuGdsQbConditionalFormattingRuleDeleter.prototype.deleteFromExceptionManager = function(ruleId)
{
	var exceptionsToDelete = oFF.XList.create();
	var exceptionManager = this.m_queryModel.getExceptionManager();
	var exception = exceptionManager.getByKey(ruleId);
	if (oFF.notNull(exception))
	{
		exceptionsToDelete.add(exception);
	}
	else
	{
		oFF.XStream.of(exceptionManager).forEach( function(fException1){
			if (oFF.XString.containsString(fException1.getName(), ruleId))
			{
				exceptionsToDelete.add(fException1);
			}
		}.bind(this));
	}
	var tableDefinition = oFF.XStream.of(this.m_queryModel.getVisualizationManager().getVisualizationDefinitions()).find( function(vizDef){
		return vizDef.getProtocolBindingType().isEqualTo(oFF.ProtocolBindingType.SAC_TABLE_GRID);
	}.bind(this)).get();
	oFF.XStream.of(exceptionsToDelete).forEach( function(fException2){
		var thresholdIterator = fException2.getThresholds().getIterator();
		while (thresholdIterator.hasNext())
		{
			var threshold = thresholdIterator.next();
			this.deleteDataPointStyles(tableDefinition, threshold, threshold.getException().getName());
		}
		exceptionManager.removeElement(fException2);
	}.bind(this));
};
oFF.AuGdsQbConditionalFormattingRuleDeleter.prototype.deleteDataPointStyles = function(tableDefinition, threshold, thresholdName)
{
	var dataPointStyleIterator = tableDefinition.getDataPointStyleByExceptionName(threshold.getName()).getIterator();
	while (dataPointStyleIterator.hasNext())
	{
		var tableStyle = dataPointStyleIterator.next().getFormattingStyle();
		if (oFF.notNull(tableStyle))
		{
			tableDefinition.removeFormattingStyleByName(tableStyle.getName());
		}
	}
	tableDefinition.removeDataPointStylesByExceptionName(thresholdName);
};

oFF.AuGdsQbConditionalFormattingRuleLister = function() {};
oFF.AuGdsQbConditionalFormattingRuleLister.prototype = new oFF.XObject();
oFF.AuGdsQbConditionalFormattingRuleLister.prototype._ff_c = "AuGdsQbConditionalFormattingRuleLister";

oFF.AuGdsQbConditionalFormattingRuleLister.create = function(queryModel)
{
	var ruleLister = new oFF.AuGdsQbConditionalFormattingRuleLister();
	ruleLister.m_queryModel = queryModel;
	return ruleLister;
};
oFF.AuGdsQbConditionalFormattingRuleLister.prototype.m_queryModel = null;
oFF.AuGdsQbConditionalFormattingRuleLister.prototype.listAllRules = function()
{
	return this.listAllRulesForMember(null);
};
oFF.AuGdsQbConditionalFormattingRuleLister.prototype.listAllRulesForMember = function(structureMember)
{
	var validRules = oFF.XList.create();
	validRules.addAll(this.readFormulaExceptionManager((structureMember)));
	validRules.addAll(this.readExceptionManager(structureMember));
	return validRules;
};
oFF.AuGdsQbConditionalFormattingRuleLister.prototype.readFormulaExceptionManager = function(structureMember)
{
	var formulaExceptionManager = this.m_queryModel.getFormulaExceptionManager();
	var vizDef = oFF.XStream.of(this.m_queryModel.getVisualizationManager().getVisualizationDefinitions()).find( function(vizDef2){
		return vizDef2.getProtocolBindingType().isEqualTo(oFF.ProtocolBindingType.SAC_TABLE_GRID);
	}.bind(this));
	if (!vizDef.isPresent())
	{
		oFF.XLogger.println("Conditional Formatting: No table definition found");
		return oFF.XList.create();
	}
	var tableDefinition = vizDef.get();
	var ruleReader = oFF.AuGdsQbConditionalFormattingRuleReader.create(this.m_queryModel);
	var validRules = oFF.XList.create();
	var exceptionIterator = formulaExceptionManager.getIterator();
	while (exceptionIterator.hasNext())
	{
		var exception = exceptionIterator.next();
		var baseMeasure = exception.getBaseMeasure();
		if (oFF.isNull(baseMeasure))
		{
			baseMeasure = this.m_queryModel.isAccountModel() ? this.m_queryModel.getAccountDimension().getStructureMember(exception.getBaseMeasureName()) : this.m_queryModel.getMeasureDimension().getStructureMember(exception.getBaseMeasureName());
		}
		if (this.isValidExceptionName(exception.getName()) && (oFF.isNull(structureMember) || baseMeasure.isEqualTo(structureMember)))
		{
			var thresholdIterator = exception.getThresholds().getIterator();
			var areThresholdsValid = true;
			while (thresholdIterator.hasNext())
			{
				var threshold = thresholdIterator.next();
				var dataPointStyles = tableDefinition.getDataPointStyleByExceptionName(threshold.getName());
				if (dataPointStyles.size() === 0 || dataPointStyles.get(0).getFormattingStyle() === null)
				{
					areThresholdsValid = false;
				}
			}
			if (areThresholdsValid)
			{
				validRules.add(ruleReader.readRuleFromFormulaExceptionManager(this.getExceptionName(exception.getName())));
			}
		}
	}
	return validRules;
};
oFF.AuGdsQbConditionalFormattingRuleLister.prototype.readExceptionManager = function(structureMember)
{
	var exceptionManager = this.m_queryModel.getExceptionManager();
	var vizDef = oFF.XStream.of(this.m_queryModel.getVisualizationManager().getVisualizationDefinitions()).find( function(vizDef2){
		return vizDef2.getProtocolBindingType().isEqualTo(oFF.ProtocolBindingType.SAC_TABLE_GRID);
	}.bind(this));
	if (!vizDef.isPresent())
	{
		oFF.XLogger.println("Conditional Formatting: No table definition found");
		return oFF.XList.create();
	}
	var ruleReader = oFF.AuGdsQbConditionalFormattingRuleReader.create(this.m_queryModel);
	var validRules = oFF.XList.create();
	var exceptionIterator = exceptionManager.getIterator();
	while (exceptionIterator.hasNext())
	{
		var exception = exceptionIterator.next();
		var measure = exception.getMeasure();
		if (this.isValidExceptionName(exception.getName()) && (oFF.isNull(structureMember) || measure.isEqualTo(structureMember)))
		{
			var rule = ruleReader.readRuleFromExceptionManager(this.getExceptionName(exception.getName()));
			var foundRule = oFF.XStream.of(validRules).find( function(validRule){
				return (oFF.XString.isEqual(validRule.getName(), rule.getName()) && validRule.getStructureMember().isEqualTo(rule.getStructureMember()));
			}.bind(this));
			if (!foundRule.isPresent())
			{
				validRules.add(rule);
			}
		}
	}
	return validRules;
};
oFF.AuGdsQbConditionalFormattingRuleLister.prototype.isValidExceptionName = function(exceptionName)
{
	if (oFF.isNull(exceptionName))
	{
		return false;
	}
	if (!oFF.XString.containsString(exceptionName, "#"))
	{
		return true;
	}
	return oFF.XString.containsString(exceptionName, "#1");
};
oFF.AuGdsQbConditionalFormattingRuleLister.prototype.getExceptionName = function(exceptionName)
{
	if (oFF.XString.containsString(exceptionName, "#"))
	{
		return oFF.XString.substring(exceptionName, 0, oFF.XString.indexOf(exceptionName, "#"));
	}
	return exceptionName;
};

oFF.AuGdsQbConditionalFormattingRuleReader = function() {};
oFF.AuGdsQbConditionalFormattingRuleReader.prototype = new oFF.XObject();
oFF.AuGdsQbConditionalFormattingRuleReader.prototype._ff_c = "AuGdsQbConditionalFormattingRuleReader";

oFF.AuGdsQbConditionalFormattingRuleReader.create = function(queryModel)
{
	var ruleReader = new oFF.AuGdsQbConditionalFormattingRuleReader();
	ruleReader.m_queryModel = queryModel;
	return ruleReader;
};
oFF.AuGdsQbConditionalFormattingRuleReader.prototype.m_queryModel = null;
oFF.AuGdsQbConditionalFormattingRuleReader.prototype.readRule = function(ruleId)
{
	var formulaException = this.readFormulaException(ruleId);
	if (formulaException.isPresent())
	{
		return this.readRuleFromFormulaExceptionManager(ruleId);
	}
	else
	{
		var exception = this.readException(ruleId);
		if (exception.isPresent())
		{
			return this.readRuleFromExceptionManager(ruleId);
		}
		else
		{
			throw oFF.XException.createRuntimeException(oFF.XStringUtils.concatenate2("No rule found with id: ", ruleId));
		}
	}
};
oFF.AuGdsQbConditionalFormattingRuleReader.prototype.readRuleFromFormulaExceptionManager = function(ruleId)
{
	var formulaException = this.readFormulaException(ruleId).get();
	var ruleBuilder = oFF.AuGdsQbConditionalFormattingRuleBuilder.create();
	ruleBuilder.setId(ruleId);
	var ruleName = this.getRuleName(ruleId);
	if (ruleName.isPresent())
	{
		ruleBuilder.setName(ruleName.get().toString());
	}
	else
	{
		ruleBuilder.setName(formulaException.getText());
	}
	ruleBuilder.setEvaluateType(formulaException.getEvaluateDefault());
	ruleBuilder.setIsEditable(true);
	var baseMeasure = formulaException.getBaseMeasure();
	if (oFF.isNull(baseMeasure))
	{
		baseMeasure = this.m_queryModel.isAccountModel() ? this.m_queryModel.getAccountDimension().getStructureMember(formulaException.getBaseMeasureName()) : this.m_queryModel.getMeasureDimension().getStructureMember(formulaException.getBaseMeasureName());
	}
	ruleBuilder.setStructureMember(baseMeasure);
	var compareType = formulaException.getFormulaExceptionType().isEqualTo(oFF.FormulaExceptionType.BASE_MEASURE_ONLY) ? oFF.AuGdsQbConditionalFormattingThresholdCompareType.NUMBER_RANGE : oFF.AuGdsQbConditionalFormattingThresholdCompareType.MEASURE;
	var refMeasure = compareType.isEqualTo(oFF.AuGdsQbConditionalFormattingThresholdCompareType.MEASURE) ? formulaException.getReferenceMeasure() : null;
	ruleBuilder.setThreshold(oFF.AuGdsQbConditionalFormattingThreshold.create(compareType, this.readRanges(formulaException.getThresholds(), ruleBuilder, compareType), refMeasure));
	var dimensions = oFF.XSetOfNameObject.create();
	oFF.XStream.of(formulaException.getEvaluates()).forEach( function(evaluate){
		dimensions.add(evaluate.getDimension());
	}.bind(this));
	oFF.XStream.of(dimensions).forEach( function(dimension){
		ruleBuilder.addFilter(oFF.AuGdsQbConditionalFormattingFilterItem.createFromEvaluate(dimension, formulaException.getEvaluates()));
	}.bind(this));
	return ruleBuilder.build();
};
oFF.AuGdsQbConditionalFormattingRuleReader.prototype.readFormulaException = function(ruleId)
{
	var formulaExceptionManager = this.m_queryModel.getFormulaExceptionManager();
	var matchedFormulaException;
	var formulaException = formulaExceptionManager.getByKey(ruleId);
	if (oFF.isNull(formulaException))
	{
		formulaException = formulaExceptionManager.getByKey(oFF.XStringUtils.concatenate2(ruleId, "#1"));
		if (oFF.isNull(formulaException))
		{
			matchedFormulaException = oFF.XOptional.empty();
		}
		else
		{
			matchedFormulaException = oFF.XOptional.of(formulaException);
		}
	}
	else
	{
		matchedFormulaException = oFF.XOptional.of(formulaException);
	}
	return matchedFormulaException;
};
oFF.AuGdsQbConditionalFormattingRuleReader.prototype.readRuleFromExceptionManager = function(ruleId)
{
	var exception = this.readException(ruleId).get();
	var ruleBuilder = oFF.AuGdsQbConditionalFormattingRuleBuilder.create();
	ruleBuilder.setId(ruleId);
	var ruleName = this.getRuleName(ruleId);
	if (ruleName.isPresent())
	{
		ruleBuilder.setName(ruleName.get().toString());
	}
	else
	{
		ruleBuilder.setName(exception.getText());
	}
	ruleBuilder.setEvaluateType(exception.getEvaluateDefault());
	ruleBuilder.setIsEditable(exception.isChangeable());
	var baseMeasure = exception.getMeasure();
	ruleBuilder.setStructureMember(baseMeasure);
	var compareType = oFF.AuGdsQbConditionalFormattingThresholdCompareType.NUMBER_RANGE;
	var refMeasure = null;
	var thresholds = this.getAllThresholdsForException(exception);
	ruleBuilder.setThreshold(oFF.AuGdsQbConditionalFormattingThreshold.create(compareType, this.readRanges(thresholds, ruleBuilder, compareType), refMeasure));
	var dimensions = oFF.XSetOfNameObject.create();
	oFF.XStream.of(exception.getEvaluates()).forEach( function(evaluate){
		dimensions.add(evaluate.getDimension());
	}.bind(this));
	oFF.XStream.of(dimensions).forEach( function(dimension){
		ruleBuilder.addFilter(oFF.AuGdsQbConditionalFormattingFilterItem.createFromEvaluate(dimension, exception.getEvaluates()));
	}.bind(this));
	return ruleBuilder.build();
};
oFF.AuGdsQbConditionalFormattingRuleReader.prototype.readException = function(ruleId)
{
	var exceptionManager = this.m_queryModel.getExceptionManager();
	var exception = exceptionManager.getByKey(ruleId);
	if (oFF.isNull(exception))
	{
		return oFF.XOptional.empty();
	}
	else
	{
		return oFF.XOptional.of(exception);
	}
};
oFF.AuGdsQbConditionalFormattingRuleReader.prototype.getRuleName = function(ruleId)
{
	var tableDefinition = oFF.XStream.of(this.m_queryModel.getVisualizationManager().getVisualizationDefinitions()).find( function(vizDef){
		return vizDef.getProtocolBindingType().isEqualTo(oFF.ProtocolBindingType.SAC_TABLE_GRID);
	}.bind(this)).get();
	var dataPointStyle = tableDefinition.getDataPointStyles();
	var matchedDataPointStyle = oFF.XStream.of(dataPointStyle).find( function(style){
		return oFF.XString.containsString(style.getExceptionName(), ruleId);
	}.bind(this));
	var ruleName = oFF.XOptional.empty();
	if (matchedDataPointStyle.isPresent())
	{
		ruleName = oFF.XOptional.of(oFF.XStringValue.create(matchedDataPointStyle.get().getName()));
	}
	return ruleName;
};
oFF.AuGdsQbConditionalFormattingRuleReader.prototype.getAllThresholdsForException = function(exception)
{
	var thresholds = oFF.XList.create();
	var exceptions = this.m_queryModel.getExceptionManager().getAllExceptionsOfMeasure(exception.getMeasure());
	var exceptionNameToMatch = oFF.XString.substring(exception.getName(), 0, oFF.XString.indexOf(exception.getName(), ":"));
	oFF.XStream.of(exceptions).forEach( function(xcptn){
		if (oFF.XString.containsString(xcptn.getName(), exceptionNameToMatch))
		{
			thresholds.addAll(xcptn.getThresholds());
		}
	}.bind(this));
	return thresholds;
};
oFF.AuGdsQbConditionalFormattingRuleReader.prototype.readRanges = function(thresholds, ruleBuilder, compareType)
{
	var tableDefinition = oFF.XStream.of(this.m_queryModel.getVisualizationManager().getVisualizationDefinitions()).find( function(vizDef){
		return vizDef.getProtocolBindingType().isEqualTo(oFF.ProtocolBindingType.SAC_TABLE_GRID);
	}.bind(this)).get();
	if (oFF.notNull(tableDefinition))
	{
		var thresholdIterator = thresholds.getIterator();
		var rangeMap = oFF.XHashMapByString.create();
		var rangeIdList = oFF.XList.create();
		while (thresholdIterator.hasNext())
		{
			this.processThreshold(thresholdIterator.next(), tableDefinition, rangeMap, rangeIdList, ruleBuilder, compareType);
		}
		return oFF.XStream.of(rangeIdList).map( function(rangeIdString){
			return rangeMap.getByKey(rangeIdString.toString());
		}.bind(this)).collect(oFF.XStreamCollector.toList());
	}
	return oFF.XList.create();
};
oFF.AuGdsQbConditionalFormattingRuleReader.prototype.processThreshold = function(threshold, tableDefinition, rangeMap, rangeIdList, ruleBuilder, compareType)
{
	var thresholdDataPointStyle = tableDefinition.getDataPointStyleByExceptionName(threshold.getName());
	var dataPointStyle;
	if (thresholdDataPointStyle.size() === 0)
	{
		thresholdDataPointStyle = tableDefinition.getDataPointStyleByExceptionName(threshold.getException().getName());
	}
	if (thresholdDataPointStyle.size() === 0)
	{
		dataPointStyle = oFF.AuGdsQbConditionalFormattingStyleCreator.createDataPointStyleForBWExceptionFromThreshold(tableDefinition, threshold);
	}
	else
	{
		dataPointStyle = thresholdDataPointStyle.get(0);
	}
	var dataPointTableStyle = dataPointStyle.getFormattingStyle();
	var rangeId = dataPointTableStyle.getName();
	if (!rangeMap.containsKey(rangeId))
	{
		rangeIdList.add(oFF.XStringValue.create(rangeId));
	}
	rangeMap.put(rangeId, this.readRange(threshold, dataPointTableStyle, rangeMap, ruleBuilder, compareType));
};
oFF.AuGdsQbConditionalFormattingRuleReader.prototype.readRange = function(threshold, dataPointTableStyle, rangeMap, ruleBuilder, compareType)
{
	var rangeBuilder = oFF.AuGdsQbConditionalFormattingRangeBuilder.create();
	var rangeId = dataPointTableStyle.getName();
	var thresholdOperator = threshold.getOperator();
	rangeBuilder.setId(rangeId);
	rangeBuilder.setName(dataPointTableStyle.getText());
	var fillColor = oFF.UiColor.create(dataPointTableStyle.getFillColor());
	var lowValue = threshold.getLowXValue() !== null ? oFF.XDoubleValue.create(threshold.getLowValue()) : null;
	var highValue = threshold.getHighXValue() !== null ? oFF.XDoubleValue.create(threshold.getHighValue()) : null;
	if (compareType.isEqualTo(oFF.AuGdsQbConditionalFormattingThresholdCompareType.MEASURE))
	{
		lowValue = oFF.notNull(lowValue) ? oFF.XDoubleValue.create(lowValue.getDouble()) : null;
		highValue = oFF.notNull(highValue) ? oFF.XDoubleValue.create(highValue.getDouble()) : null;
	}
	if (dataPointTableStyle.getAlertSymbol() !== null)
	{
		ruleBuilder.setStyle(oFF.AuGdsQbConditionalFormattingStyleType.SYMBOL);
		rangeBuilder.setIcon(dataPointTableStyle.getAlertSymbol());
		rangeBuilder.setColor(dataPointTableStyle.getAlertColor());
	}
	else if (oFF.notNull(fillColor) && fillColor.getAlpha() === oFF.AuGdsQbConditionalFormattingStyleConstants.CELL_FILL_ALPHA)
	{
		ruleBuilder.setStyle(oFF.AuGdsQbConditionalFormattingStyleType.CELL_FILL);
		rangeBuilder.setColor(fillColor.getHexColor());
	}
	else if (dataPointTableStyle.getFillColor() !== null && dataPointTableStyle.getFontColor() !== null)
	{
		ruleBuilder.setStyle(oFF.AuGdsQbConditionalFormattingStyleType.CELL_FILL_AND_FONT_COLOR);
		rangeBuilder.setColor(dataPointTableStyle.getFillColor());
	}
	else if (dataPointTableStyle.getFillColor() !== null)
	{
		ruleBuilder.setStyle(oFF.AuGdsQbConditionalFormattingStyleType.CELL_FILL_WITHOUT_TRANSPARENCY);
		rangeBuilder.setColor(dataPointTableStyle.getFillColor());
	}
	else if (dataPointTableStyle.getFontColor() !== null)
	{
		ruleBuilder.setStyle(oFF.AuGdsQbConditionalFormattingStyleType.FONT_COLOR);
		rangeBuilder.setColor(dataPointTableStyle.getFontColor());
	}
	if (thresholdOperator.isEqualTo(oFF.ComparisonOperator.BETWEEN) || thresholdOperator.isEqualTo(oFF.ComparisonOperator.BETWEEN_EXCLUDING))
	{
		var isBetween = thresholdOperator.isEqualTo(oFF.ComparisonOperator.BETWEEN);
		if (rangeMap.containsKey(rangeId))
		{
			var rangePart = rangeMap.getByKey(rangeId);
			rangeBuilder.copyFromRange(rangePart);
			if (oFF.notNull(lowValue) && lowValue.getDouble() === rangePart.getLowerBound().getDouble())
			{
				rangeBuilder.setLowerBoundOperator(oFF.ComparisonOperator.GREATER_EQUAL);
				rangeBuilder.setUpperBoundOperator(oFF.ComparisonOperator.LESS_THAN);
			}
			else if (oFF.notNull(highValue) && highValue.getDouble() === rangePart.getUpperBound().getDouble())
			{
				rangeBuilder.setLowerBoundOperator(oFF.ComparisonOperator.GREATER_THAN);
				rangeBuilder.setUpperBoundOperator(oFF.ComparisonOperator.LESS_EQUAL);
			}
			if (!isBetween)
			{
				rangeBuilder.setLowerBound(lowValue);
				rangeBuilder.setUpperBound(highValue);
			}
		}
		else
		{
			rangeBuilder.setLowerBound(lowValue);
			rangeBuilder.setLowerBoundOperator(isBetween ? oFF.ComparisonOperator.GREATER_EQUAL : oFF.ComparisonOperator.GREATER_THAN);
			rangeBuilder.setUpperBound(highValue);
			rangeBuilder.setUpperBoundOperator(isBetween ? oFF.ComparisonOperator.LESS_EQUAL : oFF.ComparisonOperator.LESS_THAN);
		}
	}
	else if (thresholdOperator.isEqualTo(oFF.ComparisonOperator.GREATER_EQUAL) || thresholdOperator.isEqualTo(oFF.ComparisonOperator.GREATER_THAN))
	{
		rangeBuilder.setLowerBound(lowValue);
		rangeBuilder.setLowerBoundOperator(thresholdOperator);
	}
	else if (thresholdOperator.isEqualTo(oFF.ComparisonOperator.LESS_EQUAL) || thresholdOperator.isEqualTo(oFF.ComparisonOperator.LESS_THAN))
	{
		rangeBuilder.setUpperBound(lowValue);
		rangeBuilder.setUpperBoundOperator(thresholdOperator);
	}
	else if (thresholdOperator.isEqualTo(oFF.ComparisonOperator.EQUAL) || thresholdOperator.isEqualTo(oFF.ComparisonOperator.NOT_EQUAL))
	{
		rangeBuilder.setLowerBound(lowValue);
		rangeBuilder.setLowerBoundOperator(thresholdOperator);
	}
	else if (thresholdOperator.isEqualTo(oFF.ComparisonOperator.NOT_BETWEEN))
	{
		if (oFF.notNull(lowValue))
		{
			rangeBuilder.setLowerBoundOperator(oFF.ComparisonOperator.LESS_THAN);
			rangeBuilder.setLowerBound(lowValue);
		}
		else if (oFF.notNull(highValue))
		{
			rangeBuilder.setUpperBoundOperator(oFF.ComparisonOperator.GREATER_THAN);
			rangeBuilder.setUpperBound(highValue);
		}
	}
	return rangeBuilder.build();
};

oFF.AuGdsQbConditionalFormattingStyleCreator = {

	SAP_UI_POSITIVE_ELEMENT:"#2b7c2b",
	SAP_UI_CRITICAL_ELEMENT:"#e78c07",
	SAP_UI_BAD_ELEMENT:"#bb0000",
	createDataPointStyleForBWExceptionFromThreshold:function(tableDefinition, threshold)
	{
			if (oFF.notNull(tableDefinition))
		{
			var formattingStyle = oFF.AuGdsQbConditionalFormattingStyleCreator.createFormattingStyleBWExceptions(tableDefinition, threshold);
			var exceptionName = threshold.getException().getText();
			var dataPointText = oFF.XStringUtils.concatenate2(exceptionName, "-NAME");
			var dataPointStyle = tableDefinition.addNewDataPointStyle(exceptionName, dataPointText);
			dataPointStyle.setExceptionName(threshold.getException().getName());
			dataPointStyle.setFormattingStyle(formattingStyle);
			return dataPointStyle;
		}
		return null;
	},
	createFormattingStyleBWExceptions:function(tableDefinition, threshold)
	{
			var formattingStyle = tableDefinition.addNewFormattingStyle(threshold.getException().getName(), threshold.getName());
		var mappedColor = null;
		var alertLevel = threshold.getAlertLevel();
		if (alertLevel.isEqualTo(oFF.AlertLevel.GOOD_1) || alertLevel.isEqualTo(oFF.AlertLevel.GOOD_2) || alertLevel.isEqualTo(oFF.AlertLevel.GOOD_3))
		{
			var sapUiPositiveElement = oFF.UiFramework.currentFramework().getThemeParameter("sapUiPositiveElement");
			mappedColor = oFF.notNull(sapUiPositiveElement) ? sapUiPositiveElement : oFF.AuGdsQbConditionalFormattingStyleCreator.SAP_UI_POSITIVE_ELEMENT;
		}
		else if (alertLevel.isEqualTo(oFF.AlertLevel.CRITICAL_1) || alertLevel.isEqualTo(oFF.AlertLevel.CRITICAL_2) || alertLevel.isEqualTo(oFF.AlertLevel.CRITICAL_3))
		{
			var sapUiCriticalElement = oFF.UiFramework.currentFramework().getThemeParameter("sapUiCriticalElement");
			mappedColor = oFF.notNull(sapUiCriticalElement) ? sapUiCriticalElement : oFF.AuGdsQbConditionalFormattingStyleCreator.SAP_UI_CRITICAL_ELEMENT;
		}
		else if (alertLevel.isEqualTo(oFF.AlertLevel.BAD_1) || alertLevel.isEqualTo(oFF.AlertLevel.BAD_2) || alertLevel.isEqualTo(oFF.AlertLevel.BAD_3))
		{
			var sapUiNegativeElement = oFF.UiFramework.currentFramework().getThemeParameter("sapUiNegativeElement");
			mappedColor = oFF.notNull(sapUiNegativeElement) ? sapUiNegativeElement : oFF.AuGdsQbConditionalFormattingStyleCreator.SAP_UI_BAD_ELEMENT;
		}
		formattingStyle.setFillColor(mappedColor);
		return formattingStyle;
	},
	createDataPointStyle:function(tableDefinition, exceptionId, ruleName, range, styleType)
	{
			var formattingStyle = tableDefinition.getFormattingStyle(range.getId());
		if (oFF.isNull(formattingStyle))
		{
			formattingStyle = oFF.AuGdsQbConditionalFormattingStyleCreator.createFormattingStyle(tableDefinition, range, styleType);
		}
		var dataPointText = oFF.XStringUtils.concatenate2(range.getName(), "-NAME");
		var dataPointStyle = tableDefinition.addNewDataPointStyle(ruleName, dataPointText);
		dataPointStyle.setExceptionName(exceptionId);
		dataPointStyle.setFormattingStyle(formattingStyle);
		return dataPointStyle;
	},
	createFormattingStyle:function(tableDefinition, range, styleType)
	{
			var formattingStyle = tableDefinition.addNewFormattingStyle(range.getId(), range.getName());
		if (styleType.isEqualTo(oFF.AuGdsQbConditionalFormattingStyleType.SYMBOL))
		{
			formattingStyle.setAlertSymbol(range.getIcon());
			formattingStyle.setAlertColor(range.getColor());
		}
		else if (styleType.isEqualTo(oFF.AuGdsQbConditionalFormattingStyleType.FONT_COLOR))
		{
			formattingStyle.setFontColor(range.getColor());
		}
		else if (styleType.isEqualTo(oFF.AuGdsQbConditionalFormattingStyleType.CELL_FILL))
		{
			var fillColor = oFF.UiColor.create(range.getColor());
			if (oFF.notNull(fillColor))
			{
				fillColor.setAlpha(oFF.AuGdsQbConditionalFormattingStyleConstants.CELL_FILL_ALPHA);
				formattingStyle.setFillColor(fillColor.getRgbaColor());
			}
			else
			{
				formattingStyle.setFillColor(range.getColor());
			}
		}
		else if (styleType.isEqualTo(oFF.AuGdsQbConditionalFormattingStyleType.CELL_FILL_WITHOUT_TRANSPARENCY))
		{
			formattingStyle.setFillColor(range.getColor());
		}
		else if (styleType.isEqualTo(oFF.AuGdsQbConditionalFormattingStyleType.CELL_FILL_AND_FONT_COLOR))
		{
			formattingStyle.setFillColor(range.getColor());
			formattingStyle.setFontColor(oFF.AuGdsQbConditionalFormattingStyleConstants.FONT_COLOR_INVISIBLE);
		}
		return formattingStyle;
	}
};

oFF.AuGdsQbConditionalFormattingRuleValidator = function() {};
oFF.AuGdsQbConditionalFormattingRuleValidator.prototype = new oFF.XObject();
oFF.AuGdsQbConditionalFormattingRuleValidator.prototype._ff_c = "AuGdsQbConditionalFormattingRuleValidator";

oFF.AuGdsQbConditionalFormattingRuleValidator.create = function()
{
	var validator = new oFF.AuGdsQbConditionalFormattingRuleValidator();
	return validator;
};
oFF.AuGdsQbConditionalFormattingRuleValidator.validateStructureMember = function(structureMember)
{
	var queryModel = structureMember.getQueryModel();
	var messageManager = oFF.MessageManagerSimple.createMessageManager();
	var isStructValid = structureMember.validate(queryModel, messageManager, true, true);
	if (isStructValid)
	{
		return oFF.AuGdsQbCfRuleValidationState.VALID;
	}
	return oFF.AuGdsQbCfRuleValidationState.INVALID;
};
oFF.AuGdsQbConditionalFormattingRuleValidator.validateMeasureVisibility = function(structureMember)
{
	if (oFF.notNull(structureMember) && structureMember.getResultVisibility() !== oFF.ResultVisibility.HIDDEN)
	{
		return oFF.AuGdsQbCfRuleValidationState.VALID;
	}
	return oFF.AuGdsQbCfRuleValidationState.INVALID;
};
oFF.AuGdsQbConditionalFormattingRuleValidator.getLocalization = function()
{
	return oFF.AuGdsQbConditionalFormattingI18n.getLocalization();
};
oFF.AuGdsQbConditionalFormattingRuleValidator.prototype.validate = function(rule)
{
	var structureMember = rule.getStructureMember();
	var queryModel = structureMember.getQueryModel();
	var formulaExceptionManager = queryModel.getFormulaExceptionManager();
	var validationResult = oFF.MessageManager.createMessageManagerExt(queryModel.getSession());
	var ruleId = rule.getId();
	var formulaException = formulaExceptionManager.getByKey(ruleId);
	if (oFF.notNull(formulaException))
	{
		validationResult = formulaException.validateWithDataModelScope(queryModel);
	}
	if (oFF.AuGdsQbConditionalFormattingRuleValidator.validateStructureMember(structureMember) === oFF.AuGdsQbCfRuleValidationState.INVALID)
	{
		validationResult.addError(oFF.ErrorCodes.THRESHOLD_STRUCTURE_MEASURE_INVALID, oFF.AuGdsQbConditionalFormattingRuleValidator.getLocalization().getText(oFF.AuGdsQbConditionalFormattingI18n.RULE_DIALOG_ERR_THRESHOLD_MEASURE_INVALID));
	}
	if (oFF.AuGdsQbConditionalFormattingRuleValidator.validateMeasureVisibility(structureMember) === oFF.AuGdsQbCfRuleValidationState.INVALID)
	{
		validationResult.addError(oFF.ErrorCodes.THRESHOLD_MEASURE_NOT_FOUND, oFF.AuGdsQbConditionalFormattingRuleValidator.getLocalization().getTextWithPlaceholder(oFF.AuGdsQbConditionalFormattingI18n.RULE_DIALOG_ERR_THRESHOLD_MEASURE_NOT_FOUND, structureMember.getText()));
	}
	return validationResult;
};

