oFF.AuGdsQbSacContentlibErrorMessageUtil = {

	ERROR_KEY_PREFIX:"FF_GDS_QB_CONTENT_LIB_",
	ERROR_KEY_POSTFIX:"_ERROR",
	getLocalisedMessageKey:function(errorText)
	{
			var parser = oFF.JsonParserFactory.newInstance();
		var jsonStartIndex = oFF.XString.indexOf(errorText, "{");
		if (jsonStartIndex === -1)
		{
			return errorText;
		}
		var errorJson = oFF.XString.substring(errorText, jsonStartIndex, oFF.XString.size(errorText));
		var errorElement = parser.parse(errorJson);
		var errorKey = errorElement.asStructure().getListByKey("errorDetails").get(0).asStructure().getStringByKey("messageId");
		errorKey = oFF.XStringUtils.concatenate3(oFF.AuGdsQbSacContentlibErrorMessageUtil.ERROR_KEY_PREFIX, errorKey, oFF.AuGdsQbSacContentlibErrorMessageUtil.ERROR_KEY_POSTFIX);
		return errorKey;
	}
};

oFF.AuGdsQbSacInsightHandler = function() {};
oFF.AuGdsQbSacInsightHandler.prototype = new oFF.XObject();
oFF.AuGdsQbSacInsightHandler.prototype._ff_c = "AuGdsQbSacInsightHandler";

oFF.AuGdsQbSacInsightHandler.create = function()
{
	var formatter = new oFF.AuGdsQbSacInsightHandler();
	return formatter;
};
oFF.AuGdsQbSacInsightHandler.isValidInsight = function(file, fileContent)
{
	if (oFF.notNull(file))
	{
		if (file.getAttributes() !== null && !file.getAttributes().isEmpty())
		{
			var resourceSubtype = file.getAttributes().getStringByKeyExt(oFF.XFileAttribute.NODE_SUB_TYPE.getName(), "");
			if (!oFF.XString.isEqual(oFF.AuGdsQbSacContentlibConstants.INSIGHT, resourceSubtype))
			{
				return false;
			}
		}
	}
	if (oFF.isNull(fileContent))
	{
		return false;
	}
	var isValid = false;
	var hasName = fileContent.containsKey(oFF.AuGdsQbSacContentlibConstants.NAME) || fileContent.containsKey(oFF.AuGdsQbSacContentlibConstants.TITLE);
	var hasDescription = fileContent.containsKey(oFF.AuGdsQbSacContentlibConstants.DESCRIPTION);
	var hasContent = fileContent.containsKey(oFF.AuGdsQbSacContentlibConstants.CONTENT);
	if (hasName && hasDescription && hasContent)
	{
		var content = fileContent.getStructureByKey(oFF.AuGdsQbSacContentlibConstants.CONTENT);
		var hasSourceTool = content.containsKey(oFF.AuGdsQbSacContentlibConstants.SOURCETOOL);
		var hasMetadata = content.containsKey(oFF.AuGdsQbSacContentlibConstants.METADATA);
		var hasEntities = content.containsKey(oFF.AuGdsQbSacContentlibConstants.ENTITIES);
		if (hasSourceTool && hasMetadata && hasEntities)
		{
			var entities = content.getListByKey(oFF.AuGdsQbSacContentlibConstants.ENTITIES);
			isValid = entities.size() > 0;
		}
	}
	return isValid;
};
oFF.AuGdsQbSacInsightHandler.addFileAttributes = function(file, resourceInfo)
{
	if (oFF.isNull(resourceInfo))
	{
		throw oFF.XException.createIllegalStateException(oFF.AuGdsQbSacContentlibConstants.ILLEGAL_STATE);
	}
	file.getAttributes().putString(oFF.XFileAttribute.DISPLAY_NAME.getName(), resourceInfo.getName() !== null ? resourceInfo.getName() : file.getName());
	file.getAttributes().putString(oFF.XFileAttribute.DESCRIPTION.getName(), resourceInfo.getDescription() !== null ? resourceInfo.getDescription() : "");
	file.getAttributes().putString(oFF.XFileAttribute.NODE_TYPE.getName(), oFF.AuGdsQbSacContentlibConstants.STORY);
	file.getAttributes().putString(oFF.XFileAttribute.NODE_SUB_TYPE.getName(), oFF.AuGdsQbSacContentlibConstants.INSIGHT);
};
oFF.AuGdsQbSacInsightHandler.appendModelDataset = function(insightContentJson, docContent, queryManager)
{
	var dataset = oFF.PrFactory.createStructure();
	var qbDocContent = docContent;
	dataset.putString("type", oFF.AuGdsQbSacContentlibConstants.DATASET);
	var data = dataset.putNewStructure(oFF.AuGdsQbSacContentlibConstants.DATA);
	data.putBoolean("forcePrompt", docContent.getFileStructure().getBooleanByKey("forcePrompt"));
	var queryodel = oFF.notNull(queryManager) ? queryManager.getQueryModel() : null;
	if (docContent.getCustomStructure(oFF.AuGdsQbSacContentlibConstants.MODEL_DEPENDENCY) !== null && oFF.notNull(queryodel))
	{
		var modelJson = docContent.getCustomStructure(oFF.AuGdsQbSacContentlibConstants.MODEL_DEPENDENCY);
		var datasetId = queryodel.getDatasetId() !== null ? queryodel.getDatasetId() : qbDocContent.getDataSource();
		dataset.putString(oFF.AuGdsQbSacContentlibConstants.ID, datasetId);
		data.putString(oFF.AuGdsQbSacContentlibConstants.ID, datasetId);
		data.putString(oFF.AuGdsQbSacContentlibConstants.IS_REMOTE, modelJson.getStringByKey(oFF.AuGdsQbSacContentlibConstants.IS_REMOTE));
		data.putString(oFF.AuGdsQbSacContentlibConstants.DATASOURCE_PACKAGE_NAME, modelJson.getStringByKey(oFF.AuGdsQbSacContentlibConstants.DATASOURCE_PACKAGE_NAME));
		data.putString(oFF.AuGdsQbSacContentlibConstants.MODELID, modelJson.getStringByKey(oFF.AuGdsQbSacContentlibConstants.NAME));
		if (!oFF.XString.isEqual(insightContentJson.getStringByKey(oFF.AuGdsQbSacContentlibConstants.MODELTYPE), oFF.AuGdsQbSacContentlibConstants.PERSISTED))
		{
			insightContentJson.remove(oFF.AuGdsQbSacContentlibConstants.MODELTYPE);
			insightContentJson.putString(oFF.AuGdsQbSacContentlibConstants.MODELTYPE, oFF.AuGdsQbSacContentlibConstants.PERSISTED);
		}
	}
	insightContentJson.getStructureByKey(oFF.AuGdsQbSacContentlibConstants.CONTENT).getListByKey(oFF.AuGdsQbSacContentlibConstants.ENTITIES).add(dataset);
	return insightContentJson;
};
oFF.AuGdsQbSacInsightHandler.loadModelDependencyToDocument = function(fileContent, docContent)
{
	if (oFF.notNull(fileContent))
	{
		var content = fileContent.getStructureByKey(oFF.AuGdsQbSacContentlibConstants.CONTENT);
		var entities = oFF.notNull(content) ? content.getListByKey(oFF.AuGdsQbSacContentlibConstants.ENTITIES) : null;
		if (oFF.notNull(entities))
		{
			for (var i = 0; i < entities.size(); i++)
			{
				var entity = entities.getStructureAt(i);
				if (oFF.XString.isEqual(entity.getStringByKey(oFF.AuGdsQbSacContentlibConstants.TYPE), oFF.AuGdsQbSacContentlibConstants.DATASET))
				{
					docContent.setCustomStructure(oFF.AuGdsQbSacContentlibConstants.MODEL_DEPENDENCY, entity);
				}
			}
		}
	}
};
oFF.AuGdsQbSacInsightHandler.prototype.m_formatErrorConsumer = null;
oFF.AuGdsQbSacInsightHandler.prototype.formatToInsight = function(content, outputFile)
{
	var formattedContent = oFF.PrFactory.createStructure();
	formattedContent.putString(oFF.AuGdsQbSacContentlibConstants.NAME, outputFile.getAttributes().getStringByKey(oFF.XFileAttribute.DISPLAY_NAME.getName()));
	formattedContent.putString(oFF.AuGdsQbSacContentlibConstants.TITLE, outputFile.getAttributes().getStringByKey(oFF.XFileAttribute.DISPLAY_NAME.getName()));
	formattedContent.putString(oFF.AuGdsQbSacContentlibConstants.MODELTYPE, oFF.AuGdsQbSacContentlibConstants.TRANSIENT);
	formattedContent.putString(oFF.AuGdsQbSacContentlibConstants.DESCRIPTION, outputFile.getAttributes().getStringByKey(oFF.XFileAttribute.DESCRIPTION.getName()));
	var insightContent = formattedContent.putNewStructure(oFF.AuGdsQbSacContentlibConstants.CONTENT);
	var entities = insightContent.putNewList(oFF.AuGdsQbSacContentlibConstants.ENTITIES);
	entities.add(content);
	var metadata = insightContent.putNewStructure(oFF.AuGdsQbSacContentlibConstants.METADATA);
	metadata.putString(oFF.AuGdsQbSacContentlibConstants.STRATEGY, oFF.AuGdsQbSacContentlibConstants.DRAGONFLY_STRATEGY);
	metadata.putString(oFF.AuGdsQbSacContentlibConstants.VERSION, oFF.AuGdsQbSacContentlibConstants.INSIGHT_VERSION);
	var sourceTool = insightContent.putNewStructure(oFF.AuGdsQbSacContentlibConstants.SOURCETOOL);
	sourceTool.putString(oFF.AuGdsQbSacContentlibConstants.NAME, oFF.AuGalaxyDataStudio.DEFAULT_PROGRAM_NAME);
	var sourceToolMetadata = sourceTool.putNewStructure(oFF.AuGdsQbSacContentlibConstants.METADATA);
	var toolmetadata = sourceToolMetadata.putNewStructure(oFF.AuGdsQbSacContentlibConstants.TOOLMETADATA);
	toolmetadata.putString(oFF.AuGdsQbSacContentlibConstants.DOCTYPE, oFF.AuGdsDocumentType.QUERY_BUILDER.getName());
	toolmetadata.putString(oFF.AuGdsQbSacContentlibConstants.VERSION, oFF.AuGdsQbConstants.GDF_QD_DOC_VERSION);
	var isValidInsight = oFF.AuGdsQbSacInsightHandler.isValidInsight(outputFile, formattedContent);
	if (!isValidInsight)
	{
		this.m_formatErrorConsumer(oFF.AuGdsQbSacContentlibConstants.EMPTY_SERIALIZED_STATE);
		return null;
	}
	return formattedContent;
};
oFF.AuGdsQbSacInsightHandler.prototype.formatToDragonflySerializedState = function(fileContent, file)
{
	var serializedState = null;
	if (oFF.notNull(fileContent))
	{
		var content = fileContent.getStructureByKey(oFF.AuGdsQbSacContentlibConstants.CONTENT);
		var entities = oFF.notNull(content) ? content.getListByKey(oFF.AuGdsQbSacContentlibConstants.ENTITIES) : null;
		serializedState = oFF.notNull(entities) ? entities.getStructureAt(0) : null;
		if (oFF.isNull(serializedState))
		{
			this.m_formatErrorConsumer(oFF.AuGdsQbSacContentlibConstants.EMPTY_SERIALIZED_STATE);
		}
		else
		{
			return serializedState;
		}
	}
	return serializedState;
};
oFF.AuGdsQbSacInsightHandler.prototype.setErrorConsumer = function(errorConsumer)
{
	this.m_formatErrorConsumer = errorConsumer;
};
oFF.AuGdsQbSacInsightHandler.prototype.setupHandler = function()
{
	this.setErrorConsumer( function(errorCode){
		throw oFF.XException.createIllegalStateException(errorCode);
	}.bind(this));
};
oFF.AuGdsQbSacInsightHandler.prototype.validate = function(fileJson, file)
{
	return oFF.AuGdsQbSacInsightHandler.isValidInsight(file, fileJson);
};
oFF.AuGdsQbSacInsightHandler.prototype.format = function(fileJson, file)
{
	return this.formatToInsight(fileJson, file);
};
oFF.AuGdsQbSacInsightHandler.prototype.extract = function(fileJson, file)
{
	return this.formatToDragonflySerializedState(fileJson, file);
};

oFF.AuGdsQbSacModelHandler = function() {};
oFF.AuGdsQbSacModelHandler.prototype = new oFF.XObject();
oFF.AuGdsQbSacModelHandler.prototype._ff_c = "AuGdsQbSacModelHandler";

oFF.AuGdsQbSacModelHandler.DEFAULT_SYSTEM_NAME = "EHS";
oFF.AuGdsQbSacModelHandler.isValidModel = function(file, modelJson)
{
	if (oFF.notNull(file))
	{
		if (file.getAttributes() !== null && !file.getAttributes().isEmpty())
		{
			var resourceType = file.getAttributes().getStringByKeyExt(oFF.XFileAttribute.NODE_TYPE.getName(), "");
			if (!oFF.XString.isEqual(oFF.AuGdsQbSacContentlibConstants.MODEL, resourceType))
			{
				return false;
			}
		}
	}
	if (oFF.isNull(modelJson))
	{
		return false;
	}
	var modelContent = modelJson;
	if (modelJson.containsKey(oFF.AuGdsQbSacContentlibConstants.CDATA))
	{
		modelContent = modelJson.getStructureByKey(oFF.AuGdsQbSacContentlibConstants.CDATA);
	}
	var hasId = modelContent.containsKey(oFF.AuGdsQbSacContentlibConstants.ID);
	var hasName = modelContent.containsKey(oFF.AuGdsQbSacContentlibConstants.NAME);
	var hasType = modelContent.containsKey(oFF.AuGdsQbSacContentlibConstants.TYPE);
	var hasMode = modelContent.containsKey(oFF.AuGdsQbSacContentlibConstants.MODE);
	var isValidStatus = modelContent.containsKey(oFF.AuGdsQbSacContentlibConstants.STATUS) && oFF.XString.isEqual(oFF.AuGdsQbSacContentlibConstants.VALID, modelContent.getStringByKey(oFF.AuGdsQbSacContentlibConstants.STATUS));
	return hasId && hasName && hasType && hasMode && isValidStatus;
};
oFF.AuGdsQbSacModelHandler.isFlexibleTimeDimensionModel = function(modelJson)
{
	if (oFF.isNull(modelJson))
	{
		return false;
	}
	var modelContent = modelJson;
	if (modelJson.containsKey(oFF.AuGdsQbSacContentlibConstants.CDATA))
	{
		modelContent = modelJson.getStructureByKey(oFF.AuGdsQbSacContentlibConstants.CDATA);
	}
	if (modelContent.containsKey(oFF.AuGdsQbSacContentlibConstants.DIMENSIONS))
	{
		var dimensions = modelContent.getListByKey(oFF.AuGdsQbSacContentlibConstants.DIMENSIONS);
		var dimensionsSize = dimensions.size();
		var dimension;
		for (var i = 0; i < dimensionsSize; i++)
		{
			dimension = dimensions.get(i).asStructure();
			var isUserManaged = dimension.containsKey(oFF.AuGdsQbSacContentlibConstants.IS_USER_MANAGED) && dimension.getBooleanByKey(oFF.AuGdsQbSacContentlibConstants.IS_USER_MANAGED);
			var hasWeekPatternEnabled = dimension.containsKey(oFF.AuGdsQbSacContentlibConstants.HAS_WEEK_PATTERN_ENABLED) && dimension.getBooleanByKey(oFF.AuGdsQbSacContentlibConstants.HAS_WEEK_PATTERN_ENABLED);
			var isTimeConfigEnablePattern = dimension.containsKey(oFF.AuGdsQbSacContentlibConstants.IS_TIME_CONFIG_ENABLE_PATTERN) && dimension.getBooleanByKey(oFF.AuGdsQbSacContentlibConstants.IS_TIME_CONFIG_ENABLE_PATTERN);
			if (isUserManaged || hasWeekPatternEnabled || isTimeConfigEnablePattern)
			{
				return true;
			}
		}
	}
	return false;
};
oFF.AuGdsQbSacModelHandler.isWorkspaceModel = function(file)
{
	if (oFF.notNull(file))
	{
		if (file.getAttributes() !== null && !file.getAttributes().isEmpty())
		{
			var resourceType = file.getAttributes().getStringByKeyExt(oFF.XFileAttribute.NODE_TYPE.getName(), "");
			var isModel = oFF.XString.isEqual(oFF.AuGdsQbSacContentlibConstants.MODEL, resourceType);
			var isWorkspaceFile = file.getAttributes().getBooleanByKey(oFF.XFileAttribute.IS_WORKSPACE_FILE.getName());
			return isModel && isWorkspaceFile;
		}
	}
	return false;
};
oFF.AuGdsQbSacModelHandler.isUniverseModel = function(systemLandscape, modelDataSource)
{
	return systemLandscape.getSystemDescription(modelDataSource.getSystemName()).getSystemType().isTypeOf(oFF.SystemType.UNV);
};
oFF.AuGdsQbSacModelHandler.isBPCModel = function(systemLandscape, modelDataSource)
{
	var systemType = systemLandscape.getSystemDescription(modelDataSource.getSystemName()).getSystemType();
	return systemType.isTypeOf(oFF.SystemType.BPCE) || systemType.isTypeOf(oFF.SystemType.BPCS);
};
oFF.AuGdsQbSacModelHandler.getDataSourceFromRepoJson = function(inaRepoJson, file)
{
	if (oFF.notNull(inaRepoJson) && inaRepoJson.hasElements())
	{
		var newDataSource = oFF.QFactory.createDataSource();
		newDataSource.setSystemName(oFF.AuGdsQbSacModelHandler.DEFAULT_SYSTEM_NAME);
		newDataSource.deserializeFromElementExt(oFF.QModelFormat.INA_REPOSITORY, inaRepoJson);
		oFF.AuGdsQbSacModelHandler._adjustDataSourceSystemIfNecessary(newDataSource, file);
		return newDataSource;
	}
	return null;
};
oFF.AuGdsQbSacModelHandler.getInaRepoJsonFromModelJson = function(application, modelJson)
{
	var jsonToProcess = modelJson;
	if (!jsonToProcess.containsKey(oFF.AuGdsQbSacContentlibConstants.CDATA))
	{
		jsonToProcess = oFF.PrFactory.createStructure();
		jsonToProcess.put(oFF.AuGdsQbSacContentlibConstants.CDATA, modelJson);
	}
	var modellerResponse = oFF.XContent.createJsonObjectContent(oFF.QModelFormat.SFX, jsonToProcess);
	var docConverter = oFF.DocConverterFactory.createDocConverter(oFF.QModelFormat.SFX, oFF.QModelFormat.INA_REPOSITORY);
	var extConverterResult = docConverter.convert(application, modellerResponse, oFF.QModelFormat.INA_REPOSITORY);
	var inaRepoData = extConverterResult.getData();
	if (oFF.notNull(inaRepoData))
	{
		var inaRepoJson = inaRepoData.getJsonContent();
		if (oFF.notNull(inaRepoJson) && inaRepoJson.isStructure())
		{
			return inaRepoJson.asStructure();
		}
	}
	return null;
};
oFF.AuGdsQbSacModelHandler._adjustDataSourceSystemIfNecessary = function(dataSource, file)
{
	if (oFF.notNull(file))
	{
		var originSystem = null;
		if (file.getAttributes() !== null && file.getAttributes().containsKey(oFF.XFileAttribute.SYSTEM_NAME.getName()))
		{
			originSystem = file.getAttributes().getStringByKey(oFF.XFileAttribute.SYSTEM_NAME.getName());
		}
		if (oFF.XString.isEqual(dataSource.getSystemName(), oFF.AuGdsQbSacModelHandler.DEFAULT_SYSTEM_NAME) && !oFF.XString.isEqual(originSystem, oFF.AuGdsQbSacModelHandler.DEFAULT_SYSTEM_NAME))
		{
			dataSource.setSystemName(originSystem);
		}
	}
};
oFF.AuGdsQbSacModelHandler.prototype.setupHandler = function() {};
oFF.AuGdsQbSacModelHandler.prototype.validate = function(fileJson, file)
{
	return oFF.AuGdsQbSacModelHandler.isValidModel(file, fileJson);
};
oFF.AuGdsQbSacModelHandler.prototype.format = function(fileJson, file)
{
	return fileJson;
};
oFF.AuGdsQbSacModelHandler.prototype.extract = function(fileJson, file)
{
	return fileJson;
};

