oFF.AuGdsQbOrcaInteropHandler = {

	applyOrcaSfxMetadataToQueryManager:function(qbDocContent, queryManager)
	{
			var orcaInteropSettings = qbDocContent.getCustomStructure(oFF.AuGdsQbOrcaInteropConstants.GDF_QD_ORCA_INTEROP_SETTTINGS_KEY);
		if (oFF.isNull(orcaInteropSettings) || oFF.isNull(queryManager))
		{
			return;
		}
		var sfxMetadata = orcaInteropSettings.getStructureByKey(oFF.AuGdsQbOrcaInteropConstants.GDF_QD_ORCA_SFX_METADATA);
		if (oFF.notNull(sfxMetadata))
		{
			var contentSFX = oFF.XContent.createJsonObjectContent(oFF.QModelFormat.SFX, sfxMetadata);
			var docConverter = oFF.DocConverterFactory.createDocConverter(oFF.QModelFormat.SFX, oFF.QModelFormat.INA_REPOSITORY);
			var extConverterResult = docConverter.convert(queryManager.getApplication(), contentSFX, oFF.QModelFormat.INA_REPOSITORY);
			var inaRepoData = extConverterResult.getData();
			var originalIsBasicMeasureAggregationExportedInRepo = queryManager.getQueryModel().isBasicMeasureAggregationExportedInRepo();
			var originalIsBasicMeasureSettingsExportedInRepo = queryManager.getQueryModel().isBasicMeasureSettingsExportedInRepo();
			queryManager.getQueryModel().setBasicMeasureAggregationExportForRepo(true);
			queryManager.getQueryModel().setBasicMeasureSettingsExportedInRepo(true);
			queryManager.getQueryModel().stopEventing();
			queryManager.getQueryModel().deserializeFromContent(inaRepoData);
			queryManager.getQueryModel().resumeEventing();
			queryManager.getQueryModel().setBasicMeasureAggregationExportForRepo(originalIsBasicMeasureAggregationExportedInRepo);
			queryManager.getQueryModel().setBasicMeasureSettingsExportedInRepo(originalIsBasicMeasureSettingsExportedInRepo);
		}
	},
	addModelInformationToDocContenIfExists:function(docContent)
	{
			var orcaspecificInteropSettings = docContent.getCustomStructure(oFF.AuGdsQbOrcaInteropConstants.GDF_QD_ORCA_INTEROP_SETTTINGS_KEY);
		var sfxMetadata = orcaspecificInteropSettings.containsKey(oFF.AuGdsQbOrcaInteropConstants.GDF_QD_ORCA_SFX_METADATA) ? orcaspecificInteropSettings.getStructureByKey(oFF.AuGdsQbOrcaInteropConstants.GDF_QD_ORCA_SFX_METADATA) : null;
		var data = oFF.notNull(sfxMetadata) ? sfxMetadata.getStructureByKey(oFF.AuGdsQbSacContentlibConstants.DATA) : null;
		var cdata = oFF.notNull(data) ? data.getStructureByKey(oFF.AuGdsQbSacContentlibConstants.CDATA) : null;
		if (oFF.notNull(cdata))
		{
			var datasource = cdata.getStructureByKey(oFF.AuGdsQbSacContentlibConstants.DATASOURCE);
			var datsetPackageName = cdata.getStringByKey(oFF.AuGdsQbSacContentlibConstants.DATASOURCE_PACKAGE_NAME);
			var datasourceObjectType = oFF.notNull(datasource) ? datasource.getStringByKeyExt(oFF.AuGdsQbSacContentlibConstants.DATASOURCE_TYPE, "") : "";
			var isTransient = oFF.XStringUtils.isNotNullAndNotEmpty(datsetPackageName) && oFF.XString.indexOf(datsetPackageName, "Transient.") === 0;
			var isDatasourceOfModelType = oFF.XString.isEqual(datasourceObjectType, oFF.AuGdsQbSacContentlibConstants.MODEL_TYPE_PLANNING) || oFF.XString.isEqual(datasourceObjectType, oFF.AuGdsQbSacContentlibConstants.MODEL_TYPE_ANALYTIC);
			if (!isTransient || isDatasourceOfModelType)
			{
				docContent.setCustomStructure(oFF.AuGdsQbSacContentlibConstants.MODEL_DEPENDENCY, cdata);
				var modelInfo = oFF.PrStructure.create();
				modelInfo.putString(oFF.OuQueryInformationDialogConstants.MODEL_DISPLAY_NAME_KEY, cdata.getStringByKey(oFF.AuGdsQbSacContentlibConstants.DISPLAY_NAME));
				modelInfo.putString(oFF.OuQueryInformationDialogConstants.MODEL_SUBTYPE_KEY, cdata.getStringByKey(oFF.AuGdsQbSacContentlibConstants.TYPE));
				docContent.setCustomStructure(oFF.AuGdsQbSacContentlibConstants.MODEL_INFO, modelInfo);
			}
		}
	}
};

oFF.AuGdsQbViewFactory = {

	createByViewType:function(viewType, qbDoc, genesis)
	{
			var newView = null;
		if (oFF.notNull(viewType) && oFF.notNull(qbDoc))
		{
			var documentConfigJson = qbDoc.getConfiguration().getConfigJsonForDocumentType(qbDoc.getDocumentType());
			var queryController = qbDoc.getQueryController();
			if (viewType === oFF.AuGdsViewType.TABLE)
			{
				var tableView = oFF.AuGdsQbInteractiveTableView.create(genesis);
				tableView.addContextFiller(qbDoc);
				tableView.setMenuPopulator(qbDoc.getMenuManager());
				tableView.setInteractiveTableListener(qbDoc);
				tableView.registerOnSelectionChange(qbDoc);
				tableView.setLocalizationProvider(qbDoc.getLocalizationProvider());
				tableView.queryManagerUpdated(qbDoc.getQueryManager());
				qbDoc.getTableStylingTemplateManager().setTableDefinition(tableView.getTableDefinition());
				tableView.setDefaultSettings(qbDoc.getDefaultSettings());
				tableView.setEnableDragDropFromBuilderToTable(documentConfigJson.getBooleanByKey(oFF.AuGdsQbConstants.CONFIG_DRAG_DROP_FROM_BUILDER_PANEL_TO_TABLE));
				var defaultSetting = qbDoc.getDefaultSettings();
				if (oFF.notNull(defaultSetting))
				{
					tableView.setSupportsComments(defaultSetting.getBooleanByKeyExt(oFF.AuGdsQbConstants.DEFAULT_SETTINGS_LOAD_COMMENTING_DOCUMENTS, false));
				}
				tableView.setWindowingConfig(documentConfigJson.getStructureByKey(oFF.AuGdsQbConstants.CONFIG_WINDOWING));
				tableView.setUpdateProcedure( function(){
					qbDoc.updateQueryResultSet();
				}.bind(this));
				tableView.setQueryExecutedListener(qbDoc.getQueryController());
				tableView.setQueryExecutionIdentifier(qbDoc.getQueryController().getUniqueExecutionIdentifier());
				queryController.registerResultEmptyListener(tableView);
				queryController.registerRenderingPauseEndListener(tableView);
				queryController.setInitialColumnWindowSize(tableView.getDefaultColumnsWindowSize());
				queryController.setInitialRowWindowSize(tableView.getDefaultRowsWindowSize());
				newView = tableView;
			}
			else if (viewType === oFF.AuGdsViewType.CHART)
			{
				newView = oFF.AuGdsQbChartView.create(qbDoc);
			}
			else if (viewType === oFF.AuGdsViewType.SPREADSHEET)
			{
				var spreadSheetView = oFF.AuGdsQbSpreadsheetView.createForQb(qbDoc);
				spreadSheetView.setTableDefinition(qbDoc.getTableView().getTableDefinition());
				spreadSheetView.setSourceSelectionProvider(qbDoc.getTableView());
				queryController.registerResultReadyListener(spreadSheetView);
				newView = spreadSheetView;
			}
		}
		return newView;
	},
	createViewByViewData:function(viewData, qbDoc, genesis)
	{
			var newView = null;
		if (oFF.notNull(viewData) && oFF.notNull(qbDoc))
		{
			var viewTypeStr = viewData.getStringByKey(oFF.AuGdsQbConstants.QD_VIEW_DATA_VIEW_TYPE);
			var viewType = oFF.AuGdsViewType.lookup(viewTypeStr);
			if (oFF.notNull(viewType))
			{
				newView = oFF.AuGdsQbViewFactory.createByViewType(viewType, qbDoc, genesis);
				if (oFF.notNull(newView))
				{
					newView.setupFromSaveData(viewData);
				}
			}
		}
		return newView;
	}
};

oFF.AuGdsQbContextResolveUtil = {

	getAxisTypeLocal:function(contextStructure)
	{
			return contextStructure.getLocalContext().getCustomObject();
	},
	getLocalStructureMember:function(contextAccess)
	{
			var localContext = contextAccess.getLocalContext();
		return oFF.isNull(localContext) ? null : localContext.getCustomObject();
	},
	getSingleSelectedMeasure:function(availableContext)
	{
			var subContexts = availableContext.getLocalContext().getSubContextsByType(oFF.AuGdsQbDfContextConstants.OLAP_ELEMENT_TYPE_MEMBER_MEASURE);
		if (oFF.XCollectionUtils.hasElements(subContexts) && subContexts.size() === 1)
		{
			return subContexts.get(0).getCustomObject();
		}
		return null;
	},
	getSingleSelectedSecondaryStructureMember:function(availableContext)
	{
			var subContexts = availableContext.getLocalContext().getSubContextsByType(oFF.AuGdsQbDfContextConstants.OLAP_ELEMENT_TYPE_MEMBER_STRUCTURE);
		if (oFF.XCollectionUtils.hasElements(subContexts) && subContexts.size() === 1)
		{
			return subContexts.get(0).getCustomObject();
		}
		return null;
	},
	getSingleSelectedTuple:function(context)
	{
			var result = null;
		var subContext = context.getGlobalContext().getSubContextsByTypeAndName(oFF.AuGdsQbDfContextConstants.OLAP_TUPLE_SELECTION, oFF.AuGdsQbDfContextConstants.SELECTION_SINGLE);
		if (oFF.XCollectionUtils.hasElements(subContext) && subContext.size() === 1)
		{
			var actionContext = subContext.get(0).getSubContextsByType(oFF.AuGdsQbDfContextConstants.OLAP_ELEMENT_TYPE_TUPLE);
			if (oFF.XCollectionUtils.hasElements(actionContext) && actionContext.size() === 1)
			{
				result = actionContext.get(0).getCustomObject();
			}
		}
		return result;
	},
	getSelectedDimensions:function(context)
	{
			var result = null;
		var subContext = context.getGlobalContext().getSubContextsByType(oFF.AuGdsQbDfContextConstants.OLAP_DIMENSION_SELECTION);
		if (oFF.XCollectionUtils.hasElements(subContext) && subContext.size() === 1)
		{
			var actionContext = subContext.get(0).getSubContextsByType(oFF.AuGdsQbDfContextConstants.OLAP_ELEMENT_TYPE_DIMENSION);
			if (oFF.XCollectionUtils.hasElements(actionContext))
			{
				result = oFF.XStream.of(actionContext).map( function(el){
					return el.getCustomObject();
				}.bind(this)).collect(oFF.XStreamCollector.toList());
			}
		}
		return result;
	},
	getLocalField:function(context)
	{
			var subContext = context.getLocalContext();
		return subContext.getCustomObject();
	},
	getLocalAttribute:function(context)
	{
			var subContext = context.getLocalContext();
		return subContext.getCustomObject();
	},
	getLocalFieldContainer:function(context)
	{
			var subContext = context.getLocalContext();
		return subContext.getCustomObject();
	},
	getDimensionLocal:function(context)
	{
			var subContext = context.getLocalContext();
		return subContext.getCustomObject();
	},
	getHierarchyLocal:function(context)
	{
			var subContext = context.getLocalContext();
		return subContext.getCustomObject();
	}
};

