oFF.AuGdsFilterLineConfig.CONFIG_KEY_FILTER_TOKENS = "filterTokens";
oFF.AuGdsFilterLineConfig.CONFIG_KEY_SHOWTYPE = "showType";
oFF.AuGdsFilterLineConfig.CONFIG_KEY_FILTERTYPE = "filterType";
oFF.AuGdsFilterLineConfig.CONFIG_KEY_READMODE = "readMode";
oFF.AuGdsFilterLineConfig.CONFIG_SHOW_FILTER_LINE_MENU_TREE = "ShowFilterLineMenuTree";
oFF.AuGdsFilterLineConfig.create = function()
{
	var instance = new oFF.AuGdsFilterLineConfig();
	instance.setupInitialConfig();
	return instance;
};
oFF.AuGdsFilterLineConfig.prototype.m_filterLineConfig = null;
oFF.AuGdsFilterLineConfig.prototype.releaseObject = function()
{
	this.m_filterLineConfig = oFF.XObjectExt.release(this.m_filterLineConfig);
	oFF.XObject.prototype.releaseObject.call( this );
};
oFF.AuGdsFilterLineConfig.prototype.getFilterLineStructure = function()
{
	return this.m_filterLineConfig.getStructureByKey(oFF.AuGdsFilterLineConfig.CONFIG_KEY_FILTER_TOKENS);
};
oFF.AuGdsFilterLineConfig.prototype.getStructureForDimension = function(dimensionName)
{
	var structure = this.getFilterLineStructure().getStructureByKey(dimensionName);
	if (oFF.isNull(structure))
	{
		structure = this.getFilterLineStructure().putNewStructure(dimensionName);
	}
	return structure;
};
oFF.AuGdsFilterLineConfig.prototype.setDisplayTypeForDimension = function(dimensionName, displayType)
{
	this.getStructureForDimension(dimensionName).put(oFF.AuGdsFilterLineConfig.CONFIG_KEY_SHOWTYPE, oFF.PrFactory.createString(displayType));
};
oFF.AuGdsFilterLineConfig.prototype.getDisplayTypeForDimension = function(dimensionName)
{
	return this.getStructureForDimension(dimensionName).getStringByKey(oFF.AuGdsFilterLineConfig.CONFIG_KEY_SHOWTYPE);
};
oFF.AuGdsFilterLineConfig.prototype.setFilterTypeForDimension = function(dimensionName, filterType)
{
	this.getStructureForDimension(dimensionName).put(oFF.AuGdsFilterLineConfig.CONFIG_KEY_FILTERTYPE, oFF.PrFactory.createString(filterType));
};
oFF.AuGdsFilterLineConfig.prototype.isFilterLineTreeMenuVisible = function(isVisible)
{
	this.m_filterLineConfig.putBoolean(oFF.AuGdsFilterLineConfig.CONFIG_SHOW_FILTER_LINE_MENU_TREE, isVisible);
};
oFF.AuGdsFilterLineConfig.prototype.getFilterTypeForDimension = function(dimensionName)
{
	return this.getStructureForDimension(dimensionName).getStringByKey(oFF.AuGdsFilterLineConfig.CONFIG_KEY_FILTERTYPE);
};
oFF.AuGdsFilterLineConfig.prototype.setReadModeForDimension = function(dimensionName, readMode)
{
	this.getStructureForDimension(dimensionName).put(oFF.AuGdsFilterLineConfig.CONFIG_KEY_READMODE, oFF.PrFactory.createString(readMode));
};
oFF.AuGdsFilterLineConfig.prototype.getReadModeForDimension = function(dimensionName)
{
	return this.getStructureForDimension(dimensionName).getStringByKey(oFF.AuGdsFilterLineConfig.CONFIG_KEY_READMODE);
};
oFF.AuGdsFilterLineConfig.prototype.getCascadingSetting = function()
{
	var settingString = this.m_filterLineConfig.getStringByKey(oFF.AuGdsFilterLineConfig.CONFIG_KEY_FILTER_CASCADING_SETTING);
	if (oFF.isNull(settingString))
	{
		settingString = this.setCascadingSetting(oFF.AuGdsFilterLineCascadingSetting.getInitialSetting());
	}
	return settingString;
};
oFF.AuGdsFilterLineConfig.prototype.setCascadingSetting = function(setting)
{
	oFF.XObjectExt.assertNotNullExt(setting, "The given cascading behaviour setting should not be null");
	var settingToSet = setting.getName();
	this.m_filterLineConfig.putString(oFF.AuGdsFilterLineConfig.CONFIG_KEY_FILTER_CASCADING_SETTING, settingToSet);
	return settingToSet;
};
oFF.AuGdsFilterLineConfig.prototype.getConfig = function()
{
	return oFF.PrFactory.createStructureDeepCopy(this.m_filterLineConfig);
};
oFF.AuGdsFilterLineConfig.prototype.setConfig = function(config)
{
	if (oFF.notNull(config))
	{
		this.m_filterLineConfig = oFF.PrFactory.createStructureDeepCopy(config);
		if (oFF.isNull(this.m_filterLineConfig) || this.getFilterLineStructure() === null)
		{
			throw oFF.XException.createRuntimeException("FilterLine configuration is invalid!");
		}
	}
	else
	{
		this.setupInitialConfig();
	}
};
oFF.AuGdsFilterLineConfig.prototype.isDimensionConfigSet = function(dimensionName)
{
	return this.getFilterLineStructure().containsKey(dimensionName);
};
oFF.AuGdsFilterLineConfig.prototype.setupInitialConfig = function()
{
	this.m_filterLineConfig = oFF.PrFactory.createStructure();
	this.m_filterLineConfig.putNewStructure(oFF.AuGdsFilterLineConfig.CONFIG_KEY_FILTER_TOKENS);
	this.m_filterLineConfig.putBoolean(oFF.AuGdsFilterLineConfig.CONFIG_SHOW_FILTER_LINE_MENU_TREE, false);
	this.setCascadingSetting(oFF.AuGdsFilterLineCascadingSetting.getInitialSetting());
};

oFF.AuGdsFilterLineDimensionDisplayTypeRetriever = function() {};
oFF.AuGdsFilterLineDimensionDisplayTypeRetriever.prototype = new oFF.XObject();
oFF.AuGdsFilterLineDimensionDisplayTypeRetriever.prototype._ff_c = "AuGdsFilterLineDimensionDisplayTypeRetriever";

oFF.AuGdsFilterLineDimensionDisplayTypeRetriever.create = function(dimension, filterLineConfig)
{
	var instance = new oFF.AuGdsFilterLineDimensionDisplayTypeRetriever();
	instance.m_dimension = oFF.XObjectExt.assertNotNull(dimension);
	instance.m_filterLineConfig = oFF.XObjectExt.assertNotNull(filterLineConfig);
	return instance;
};
oFF.AuGdsFilterLineDimensionDisplayTypeRetriever.prototype.m_dimension = null;
oFF.AuGdsFilterLineDimensionDisplayTypeRetriever.prototype.m_filterLineConfig = null;
oFF.AuGdsFilterLineDimensionDisplayTypeRetriever.prototype.releaseObject = function()
{
	this.m_dimension = null;
	this.m_filterLineConfig = null;
	oFF.XObject.prototype.releaseObject.call( this );
};
oFF.AuGdsFilterLineDimensionDisplayTypeRetriever.prototype.getDisplayType = function(useFallbackIfNotFound)
{
	var result = oFF.XOptional.empty();
	if (useFallbackIfNotFound)
	{
		result = oFF.XOptional.of(oFF.FilterDialogDimensionDisplayInfo.DESCRIPTION);
	}
	if (this.m_filterLineConfig.isDimensionConfigSet(this.m_dimension.getName()))
	{
		var showType = this.m_filterLineConfig.getDisplayTypeForDimension(this.m_dimension.getName());
		if (oFF.XString.isEqual(showType, oFF.FilterDialogDimensionDisplayInfo.ID.getName()))
		{
			result = oFF.XOptional.of(oFF.FilterDialogDimensionDisplayInfo.ID);
		}
		else if (oFF.XString.isEqual(showType, oFF.FilterDialogDimensionDisplayInfo.DESCRIPTION.getName()))
		{
			result = oFF.XOptional.of(oFF.FilterDialogDimensionDisplayInfo.DESCRIPTION);
		}
		else if (oFF.XString.isEqual(showType, oFF.FilterDialogDimensionDisplayInfo.ID_AND_DESCRIPTION.getName()))
		{
			result = oFF.XOptional.of(oFF.FilterDialogDimensionDisplayInfo.ID_AND_DESCRIPTION);
		}
		else if (oFF.notNull(showType))
		{
			throw oFF.XException.createRuntimeException("The stored filter dialog display info is invalid");
		}
	}
	return result;
};

oFF.AuGdsFilterLineDimensionReadModeRetriever = function() {};
oFF.AuGdsFilterLineDimensionReadModeRetriever.prototype = new oFF.XObject();
oFF.AuGdsFilterLineDimensionReadModeRetriever.prototype._ff_c = "AuGdsFilterLineDimensionReadModeRetriever";

oFF.AuGdsFilterLineDimensionReadModeRetriever.create = function(dimension, filterLineConfig)
{
	var instance = new oFF.AuGdsFilterLineDimensionReadModeRetriever();
	instance.m_dimension = oFF.XObjectExt.assertNotNull(dimension);
	instance.m_filterLineConfig = oFF.XObjectExt.assertNotNull(filterLineConfig);
	return instance;
};
oFF.AuGdsFilterLineDimensionReadModeRetriever.prototype.m_dimension = null;
oFF.AuGdsFilterLineDimensionReadModeRetriever.prototype.m_filterLineConfig = null;
oFF.AuGdsFilterLineDimensionReadModeRetriever.prototype.releaseObject = function()
{
	this.m_dimension = null;
	this.m_filterLineConfig = null;
	oFF.XObject.prototype.releaseObject.call( this );
};
oFF.AuGdsFilterLineDimensionReadModeRetriever.prototype.getReadMode = function(useFallbackIfNotFound)
{
	var result = oFF.XOptional.empty();
	var cascadingSettingOptional = oFF.AuGdsFilterLineCascadingSettingRetriever.create(this.m_filterLineConfig).getCascadingSetting();
	if (cascadingSettingOptional.isPresent())
	{
		var cascadingSetting = cascadingSettingOptional.get();
		if (cascadingSetting !== oFF.AuGdsFilterLineCascadingSetting.NONE)
		{
			if (cascadingSetting === oFF.AuGdsFilterLineCascadingSetting.DEFAULT)
			{
				result = oFF.XOptional.of(oFF.OlapUiReadMode.QUERY_DEFAULT);
			}
			else if (cascadingSetting === oFF.AuGdsFilterLineCascadingSetting.ALWAYS)
			{
				result = oFF.XOptional.of(oFF.OlapUiReadMode.BOOKED_CASCADING);
			}
		}
	}
	if (!result.isPresent() && this.m_filterLineConfig.isDimensionConfigSet(this.m_dimension.getName()))
	{
		var readMode = this.m_filterLineConfig.getReadModeForDimension(this.m_dimension.getName());
		if (oFF.notNull(readMode))
		{
			result = oFF.XOptional.of(oFF.OlapUiReadMode.lookup(readMode));
		}
	}
	if (!result.isPresent() && useFallbackIfNotFound)
	{
		result = oFF.XOptional.of(oFF.OlapUiReadMode.QUERY_DEFAULT);
	}
	return result;
};

