oFF.AuGdsDimensionMemberDetailsGenerator.prototype = new oFF.XObject();
oFF.AuGdsDimensionMemberDetailsGenerator.prototype._ff_c = "AuGdsDimensionMemberDetailsGenerator";

oFF.AuGdsDimensionMemberDetailsGenerator.DISPLAY = "DISPLAY";
oFF.AuGdsDimensionMemberDetailsGenerator.FILTER_PART_LOW = "LOW";
oFF.AuGdsDimensionMemberDetailsGenerator.FILTER_PART_HIGH = "HIGH";
oFF.AuGdsDimensionMemberDetailsGenerator.create = function(allMemberElementsInFilter, thisMemberElement, dimension)
{
	var instance = new oFF.AuGdsDimensionMemberDetailsGenerator();
	instance.m_allMemberElementsInFilter = allMemberElementsInFilter;
	instance.m_filterOperation = oFF.XObjectExt.assertNotNull(thisMemberElement);
	instance.m_dimension = oFF.XObjectExt.assertNotNull(dimension);
	return instance;
};
oFF.AuGdsDimensionMemberDetailsGenerator.prototype.m_filterOperation = null;
oFF.AuGdsDimensionMemberDetailsGenerator.prototype.m_allMemberElementsInFilter = null;
oFF.AuGdsDimensionMemberDetailsGenerator.prototype.m_dimension = null;
oFF.AuGdsDimensionMemberDetailsGenerator.prototype.releaseObject = function()
{
	this.m_filterOperation = null;
	this.m_allMemberElementsInFilter = null;
	this.m_dimension = null;
	oFF.XObject.prototype.releaseObject.call( this );
};
oFF.AuGdsDimensionMemberDetailsGenerator.prototype.generateDisplayValuesFromFilterValueBag = function(filterPart)
{
	var filterValueBag = oFF.XString.isEqual(filterPart, oFF.AuGdsDimensionMemberDetailsGenerator.FILTER_PART_HIGH) ? this.m_filterOperation.getHigh() : this.m_filterOperation.getLow();
	var fieldValue = filterValueBag.getFieldValue();
	var description = null;
	var displayId = null;
	var key = fieldValue.getString();
	if (this.m_filterOperation.getOlapComponentType() === oFF.FilterComponentType.DATE_RANGE_OPERATION)
	{
		var dateRange = this.m_filterOperation.getDateRange();
		if (oFF.notNull(dateRange))
		{
			displayId = oFF.FilterDialogI18nUtils.getDateRangeTextForDimension(dateRange, this.m_filterOperation.getDimension());
			description = displayId;
		}
	}
	if (oFF.notNull(this.m_allMemberElementsInFilter) && filterValueBag.getSupplementValues().size() > 0)
	{
		description = filterValueBag.getTextSupplement(this.m_allMemberElementsInFilter);
		var displayKeyValuePair = oFF.XStream.of(filterValueBag.getSupplementValues().getValuesAsReadOnlyList()).find( function(item){
			return oFF.XString.containsString(item.getKey().toString(), oFF.AuGdsDimensionMemberDetailsGenerator.DISPLAY);
		}.bind(this));
		if (displayKeyValuePair.isPresent() && displayKeyValuePair.get() !== null)
		{
			displayId = displayKeyValuePair.get().getValue().toString();
		}
	}
	var dimensionMember = fieldValue.getDimensionMember();
	if (oFF.notNull(dimensionMember))
	{
		var dimensionMemberValueExtractor = oFF.AuGdsDimensionMemberValueExtractor.create(dimensionMember);
		description = oFF.isNull(description) ? dimensionMemberValueExtractor.getDescription() : description;
		displayId = oFF.XStringUtils.isNullOrEmpty(displayId) ? dimensionMemberValueExtractor.getDisplayId() : displayId;
		key = oFF.isNull(key) ? dimensionMemberValueExtractor.getKey() : key;
	}
	if (oFF.isNull(key) && oFF.isNull(displayId))
	{
		displayId = oFF.UiLocalizationCenter.getCenter().getText(oFF.AuGdsFilterLineI18n.NULL_VALUE);
		key = oFF.AuGdsDimensionMemberDetails.NULL_KEY;
	}
	if (oFF.XStringUtils.isNullOrEmpty(displayId))
	{
		displayId = key;
	}
	if (oFF.XString.isEqual(description, ""))
	{
		description = displayId;
	}
	var memberDetails = oFF.AuGdsDimensionMemberDetails.create(key, displayId, description);
	memberDetails.setDimension(this.m_dimension);
	memberDetails.setValueType(fieldValue.getValueType());
	return memberDetails;
};
oFF.AuGdsDimensionMemberDetailsGenerator.prototype.generateFromLow = function()
{
	return this.generateDisplayValuesFromFilterValueBag(oFF.AuGdsDimensionMemberDetailsGenerator.FILTER_PART_LOW);
};
oFF.AuGdsDimensionMemberDetailsGenerator.prototype.generateFromHigh = function()
{
	if (this.m_filterOperation.getComparisonOperator() === oFF.ComparisonOperator.BETWEEN && this.m_filterOperation.getOlapComponentType() !== oFF.FilterComponentType.DATE_RANGE_OPERATION)
	{
		return this.generateDisplayValuesFromFilterValueBag(oFF.AuGdsDimensionMemberDetailsGenerator.FILTER_PART_HIGH);
	}
	return null;
};

