oFF.DfAuGdsFilterLineItem.prototype.getTokenString = function(htmlFormat)
{
	var result = "";
	var size = this.getMembers().size();
	for (var i = 0; i < size; i++)
	{
		var member = this.getMembers().get(i);
		var addedComma = i < size - 1 ? ", " : "";
		result = oFF.XStringUtils.concatenate3(result, this.getMemberTextFormatted(htmlFormat, member.getDescription(this.getDisplayType()), member.isExcludeFilter()), addedComma);
	}
	return result;
};
oFF.DfAuGdsFilterLineItem.prototype.getMemberTextFormatted = function(htmlFormat, memberText, isExcludeMember)
{
	var formattedText = memberText;
	if (htmlFormat)
	{
		formattedText = isExcludeMember ? oFF.XStringUtils.concatenate3("<span style=\"text-decoration: line-through\">", memberText, "</span>") : oFF.XStringUtils.concatenate3("<span>", memberText, "</span>");
	}
	return formattedText;
};
