oFF.DfAuGdsFilterLineItemDescriptionUpdater = function() {};
oFF.DfAuGdsFilterLineItemDescriptionUpdater.prototype = new oFF.XObject();
oFF.DfAuGdsFilterLineItemDescriptionUpdater.prototype._ff_c = "DfAuGdsFilterLineItemDescriptionUpdater";

oFF.DfAuGdsFilterLineItemDescriptionUpdater.filterMemberDetailsWithCachedDescriptions = function(memberDetailsToFilter)
{
	return oFF.DfAuGdsFilterLineItemDescriptionUpdater.filterMemberDetails(memberDetailsToFilter, ( function(memberDetails){
		return oFF.XBooleanValue.create(!memberDetails.needsDescriptionRetrieval());
	}.bind(this)));
};
oFF.DfAuGdsFilterLineItemDescriptionUpdater.filterMemberDetailsMissingDescriptions = function(memberDetailsToFilter)
{
	return oFF.DfAuGdsFilterLineItemDescriptionUpdater.filterMemberDetails(memberDetailsToFilter, ( function(memberDetails){
		return oFF.XBooleanValue.create(memberDetails.needsDescriptionRetrieval());
	}.bind(this)));
};
oFF.DfAuGdsFilterLineItemDescriptionUpdater.filterMemberDetails = function(memberDetailsByDimensionToFilter, condition)
{
	var filteredMembersByDimension = oFF.XSimpleMap.create();
	oFF.XCollectionUtils.forEach(memberDetailsByDimensionToFilter.getKeysAsReadOnlyList(),  function(dimension){
		var memberDetailsToFilter = memberDetailsByDimensionToFilter.getByKey(dimension);
		var filteredMembers = oFF.XHashMapByString.create();
		oFF.XCollectionUtils.forEach(memberDetailsToFilter,  function(memberDetails){
			if (condition(memberDetails).getBoolean())
			{
				filteredMembers.put(memberDetails.getKey(), memberDetails);
			}
		}.bind(this));
		if (!filteredMembers.isEmpty())
		{
			filteredMembersByDimension.put(dimension, filteredMembers);
		}
	}.bind(this));
	return filteredMembersByDimension;
};
oFF.DfAuGdsFilterLineItemDescriptionUpdater.prototype.m_descriptionCache = null;
oFF.DfAuGdsFilterLineItemDescriptionUpdater.prototype.m_hierarchyName = null;
oFF.DfAuGdsFilterLineItemDescriptionUpdater.prototype.m_membersList = null;
oFF.DfAuGdsFilterLineItemDescriptionUpdater.prototype.m_memberDetailsList = null;
oFF.DfAuGdsFilterLineItemDescriptionUpdater.prototype.setupCommon = function()
{
	this.m_descriptionCache = oFF.AuGdsDimensionMemberDescriptionCache.create();
};
oFF.DfAuGdsFilterLineItemDescriptionUpdater.prototype.releaseObject = function()
{
	this.m_descriptionCache = oFF.XObjectExt.release(this.m_descriptionCache);
	this.m_hierarchyName = null;
	this.m_membersList = null;
	this.m_memberDetailsList = null;
	oFF.XObject.prototype.releaseObject.call( this );
};
oFF.DfAuGdsFilterLineItemDescriptionUpdater.prototype.setHierarchyName = function(hierarchyName)
{
	this.m_hierarchyName = hierarchyName;
};
oFF.DfAuGdsFilterLineItemDescriptionUpdater.prototype.setMembersList = function(members)
{
	this.m_membersList = members;
};
oFF.DfAuGdsFilterLineItemDescriptionUpdater.prototype.setMemberDetailsList = function(memberDetails)
{
	this.m_memberDetailsList = memberDetails;
};
oFF.DfAuGdsFilterLineItemDescriptionUpdater.prototype.updateInternal = function(fli)
{
	var memberDetailsToRetrieve = this.getAllMemberDetailsByDimension();
	var retrievalPromise = this.retrieveMissingDescriptions(memberDetailsToRetrieve);
	var updatedMemberDetailsFromCache = this.retrieveMemberDetailsFromCache(memberDetailsToRetrieve);
	this.updateFLIInternal(fli, retrievalPromise, updatedMemberDetailsFromCache);
};
oFF.DfAuGdsFilterLineItemDescriptionUpdater.prototype.getUpdateFliWrapper = function()
{
	return  function(fliToUpdate, memberDetailsByDimension){
		return !memberDetailsByDimension.isEmpty() ? this.updateFLI(fliToUpdate, memberDetailsByDimension) : fliToUpdate;
	}.bind(this);
};
oFF.DfAuGdsFilterLineItemDescriptionUpdater.prototype.updateFLIInternal = function(fli, retrievalPromise, updatedMemberDetailsFromCache)
{
	var updateFLIFunction = this.getUpdateFliWrapper();
	var memberDetailsWithCachedDescriptionsByDimension = oFF.DfAuGdsFilterLineItemDescriptionUpdater.filterMemberDetailsWithCachedDescriptions(updatedMemberDetailsFromCache);
	var updatedFli = updateFLIFunction(fli, memberDetailsWithCachedDescriptionsByDimension);
	var onRetrieved =  function(memberDetailsWithRetrievedDescriptionsByDimension){
		var memberDetailsMissingDescriptionsByDimension = oFF.DfAuGdsFilterLineItemDescriptionUpdater.filterMemberDetailsMissingDescriptions(updatedMemberDetailsFromCache);
		if (!memberDetailsWithRetrievedDescriptionsByDimension.isEmpty() && !memberDetailsMissingDescriptionsByDimension.isEmpty())
		{
			var memberDetailsToUpdate = this.getMemberDetailsToUpdate(memberDetailsWithRetrievedDescriptionsByDimension, memberDetailsMissingDescriptionsByDimension);
			updateFLIFunction(updatedFli, memberDetailsToUpdate);
			return memberDetailsToUpdate;
		}
		else
		{
			return oFF.XSimpleMap.create();
		}
	}.bind(this);
	retrievalPromise.then(onRetrieved, null);
};
oFF.DfAuGdsFilterLineItemDescriptionUpdater.prototype.getMemberDetailsToUpdate = function(memberDetailsWithRetrievedDescriptionsByDimension, memberDetailsMissingDescriptionsByDimension)
{
	var memberDetailsToUpdate = oFF.XSimpleMap.create();
	oFF.XCollectionUtils.forEach(memberDetailsMissingDescriptionsByDimension.getKeysAsReadOnlyList(),  function(dimension){
		var memberDetailsList = memberDetailsMissingDescriptionsByDimension.getByKey(dimension);
		oFF.XCollectionUtils.forEach(memberDetailsList,  function(memberDetails){
			if (memberDetailsWithRetrievedDescriptionsByDimension.containsKey(dimension))
			{
				var memberDetailsForDimension = memberDetailsWithRetrievedDescriptionsByDimension.getByKey(dimension);
				var memberKey = memberDetails.getKey();
				if (memberDetailsForDimension.containsKey(memberKey))
				{
					if (!memberDetailsToUpdate.containsKey(dimension))
					{
						memberDetailsToUpdate.put(dimension, oFF.XHashMapByString.create());
					}
					memberDetailsToUpdate.getByKey(dimension).put(memberKey, memberDetailsForDimension.getByKey(memberKey));
				}
			}
		}.bind(this));
	}.bind(this));
	return memberDetailsToUpdate;
};
oFF.DfAuGdsFilterLineItemDescriptionUpdater.prototype.retrieveMissingDescriptions = function(memberDetailsByDimension)
{
	var retrievalPromises = oFF.XList.create();
	oFF.XCollectionUtils.forEach(memberDetailsByDimension.getKeysAsReadOnlyList(),  function(dimension){
		var descriptionRetriever = oFF.AuGdsDimensionMemberDescriptionRetriever.create(dimension, this.m_descriptionCache);
		descriptionRetriever.setHierarchySelector(this.m_hierarchyName);
		retrievalPromises.add(descriptionRetriever.retrieve(memberDetailsByDimension.getByKey(dimension)).then( function(updatedDimensionMemberDetails){
			var memberDetailsPartialMap = oFF.XSimpleMap.create();
			memberDetailsPartialMap.put(dimension, updatedDimensionMemberDetails);
			return memberDetailsPartialMap;
		}.bind(this), null));
	}.bind(this));
	return oFF.XPromise.all(retrievalPromises).then( function(retrievalResults){
		var retrievedDescriptionsByDimension = oFF.XSimpleMap.create();
		oFF.XCollectionUtils.forEach(retrievalResults,  function(retrievalResult){
			var memberDimension = retrievalResult.getKeysAsReadOnlyList().get(0);
			retrievedDescriptionsByDimension.put(memberDimension, retrievalResult.getByKey(memberDimension));
		}.bind(this));
		return retrievedDescriptionsByDimension;
	}.bind(this), null);
};
oFF.DfAuGdsFilterLineItemDescriptionUpdater.prototype.retrieveMemberDetailsFromCache = function(memberDetailsByDimension)
{
	var retrievedMemberDetails = oFF.XSimpleMap.create();
	oFF.XCollectionUtils.forEach(memberDetailsByDimension.getKeysAsReadOnlyList(),  function(dimension){
		var memberDetailsList = memberDetailsByDimension.getByKey(dimension);
		var updatedMemberDetails = oFF.XHashMapByString.create();
		oFF.XCollectionUtils.forEach(memberDetailsList,  function(memberDetails){
			memberDetails.setDimension(dimension);
			var cachedDescription = this.m_descriptionCache.getDescription(memberDetails.getDimension().getName(), memberDetails.getDescription());
			var updatedMemberDetailsFromCache = cachedDescription.isPresent() ? oFF.AuGdsDimensionMemberDetailsUpdater.create(memberDetails).updateDescription(cachedDescription.get().getString()) : memberDetails;
			updatedMemberDetails.put(updatedMemberDetailsFromCache.getKey(), updatedMemberDetailsFromCache);
		}.bind(this));
		if (!updatedMemberDetails.isEmpty())
		{
			retrievedMemberDetails.put(dimension, updatedMemberDetails);
		}
	}.bind(this));
	return retrievedMemberDetails;
};

