oFF.AuGdsFilterLineItemUiTokenGrid.create = function(widgetWrapper)
{
	var instance = new oFF.AuGdsFilterLineItemUiTokenGrid();
	var gridLayoutData = oFF.UiBasicGridLayout.create();
	gridLayoutData.setGridTemplateColumns("repeat(auto-fit, 12.5rem)");
	gridLayoutData.setGridGap("0.5rem 0.5rem");
	instance.m_grid = widgetWrapper.addNewItemOfType(oFF.UiType.GRID_LIST);
	instance.m_grid.setGridLayout(gridLayoutData);
	instance.m_grid.setMargin(oFF.UiCssBoxEdges.create("0 1rem 0 0"));
	instance.m_grid.setVisible(false);
	instance.m_grid.setSelectionMode(oFF.UiSelectionMode.SINGLE_SELECT_MASTER);
	instance.m_grid.registerOnSelect(oFF.UiLambdaSelectListener.create( function(controlEvent){
		var fli = controlEvent.getSelectedItem().getCustomObject();
		fli.openFilter(controlEvent.getSelectedItem());
		instance.m_grid.clearSelectedItems();
	}.bind(this)));
	instance.m_fliList = oFF.XList.create();
	return instance;
};
oFF.AuGdsFilterLineItemUiTokenGrid.prototype.m_fliList = null;
oFF.AuGdsFilterLineItemUiTokenGrid.prototype.m_grid = null;
oFF.AuGdsFilterLineItemUiTokenGrid.prototype.addItem = function(fliElement)
{
	this.m_fliList.add(fliElement);
	this.m_grid.addItem(fliElement.getRootUiElement());
};
oFF.AuGdsFilterLineItemUiTokenGrid.prototype.removeItem = function(fliElement)
{
	var fliToRemove = oFF.XStream.of(this.m_fliList).find( function(fli){
		return fli.getRootUiElement().isEqualTo(fliElement);
	}.bind(this));
	this.m_fliList.removeElement(fliToRemove.get());
	this.m_grid.removeItem(fliElement);
};
oFF.AuGdsFilterLineItemUiTokenGrid.prototype.clearItems = function()
{
	this.m_fliList = oFF.XList.create();
	this.m_grid.clearItems();
};
oFF.AuGdsFilterLineItemUiTokenGrid.prototype.setGridVisible = function(visible)
{
	this.m_grid.setVisible(visible);
};
oFF.AuGdsFilterLineItemUiTokenGrid.prototype.getFliTokenByDimensionName = function(dimensionName)
{
	var result = oFF.XStream.of(this.m_fliList).find( function(fli){
		var dimension = fli.getRootUiElement().getCustomObject().getDimension();
		return oFF.notNull(dimension) && oFF.XString.isEqual(dimension.getName(), dimensionName);
	}.bind(this));
	return result.isPresent() ? result.get() : null;
};
oFF.AuGdsFilterLineItemUiTokenGrid.prototype.getItemCount = function()
{
	return this.m_grid.getItemCount();
};

