{
	return new oFF.AuGdsGlobalActionsRegistrator();
};
oFF.AuGdsGlobalActionsRegistrator.prototype.registerActions = function(registry, localizationProvider)
{
	this.registerAppMaximize(registry, localizationProvider);
	this.registerAppMinimize(registry, localizationProvider);
	this.registerAppToggleMaximize(registry, localizationProvider);
	this.registerDocumentClose(registry, localizationProvider);
	this.registerDocumentExport(registry, localizationProvider);
	this.registerDocumentExportExcel(registry, localizationProvider);
	this.registerDocumentExportPdf(registry, localizationProvider);
	this.registerDocumentExportCsv(registry, localizationProvider);
	this.registerDocumentSave(registry, localizationProvider);
	this.registerDocumentSaveAs(registry, localizationProvider);
	this.registerDocumentLoad(registry, localizationProvider);
	this.registerDocumentNew(registry, localizationProvider);
	this.registerStateRedo(registry, localizationProvider);
	this.registerStateUndo(registry, localizationProvider);
	this.registerClipboardCopy(registry, localizationProvider);
	this.registerClipboardPaste(registry, localizationProvider);
	this.registerClipboardCut(registry, localizationProvider);
};
oFF.AuGdsGlobalActionsRegistrator.prototype.registerClipboardCut = function(registry, localizationProvider)
{
	var action = oFF.CMEFactory.createTriggerAction();
	action.setNameProvider( function(nameContext){
		return oFF.AuGdsGlobalActionsRegistrator.CLIPBOARD_CUT;
	}.bind(this));
	action.setIconProvider( function(iconContext){
		return "scissors";
	}.bind(this));
	action.setTextProvider( function(textContext){
		return localizationProvider.getText(oFF.AuGalaxyDataStudioI18n.GLOBAL_MENU_CLIPBOARD_CUT);
	}.bind(this));
	action.setAvailableProvider( function(availableContext){
		return true;
	}.bind(this));
	action.setEnabledProvider( function(enabledContext){
		return this.canClipboardCut(enabledContext);
	}.bind(this));
	action.setTrigger( function(triggerContext){
		this.executeClipboardCut(triggerContext);
	}.bind(this));
	registry.registerAction(oFF.AuGdsGlobalActionsRegistrator.CLIPBOARD_CUT, action);
};
