oFF.AuGdsGlobalActionsRegistrator.prototype.canClipboardCut = function(context)
{
	var document = oFF.AuGdsGenericContextResolveUtil.resolveDocument(context);
	return oFF.notNull(document) && document.canClipboardCut();
};
oFF.AuGdsGlobalActionsRegistrator.prototype.canClipboardPaste = function(context)
{
	var document = oFF.AuGdsGenericContextResolveUtil.resolveDocument(context);
	return oFF.notNull(document) && document.canClipboardPaste();
};
oFF.AuGdsGlobalActionsRegistrator.prototype.canClipboardCopy = function(context)
{
	var document = oFF.AuGdsGenericContextResolveUtil.resolveDocument(context);
	return oFF.notNull(document) && document.canClipboardCopy();
};
oFF.AuGdsGlobalActionsRegistrator.prototype.executeClipboardCopy = function(context)
{
	var document = oFF.AuGdsGenericContextResolveUtil.resolveDocument(context);
	if (oFF.notNull(document) && document.canClipboardCopy())
	{
		var data = document.executeClipboardCopy();
		document.getClipboardManager().setClipboardData(data);
	}
};
oFF.AuGdsGlobalActionsRegistrator.prototype.executeClipboardCut = function(context)
{
	var document = oFF.AuGdsGenericContextResolveUtil.resolveDocument(context);
	if (oFF.notNull(document) && document.canClipboardCut())
	{
		var data = document.executeClipboardCut();
		document.getClipboardManager().setClipboardData(data);
	}
};
oFF.AuGdsGlobalActionsRegistrator.prototype.executeClipboardPaste = function(context)
{
	var document = oFF.AuGdsGenericContextResolveUtil.resolveDocument(context);
	if (oFF.notNull(document) && document.canClipboardPaste())
	{
		var data = document.getClipboardManager().getClipboardData();
		if (oFF.notNull(data))
		{
			document.executeClipboardPaste(data);
		}
	}
};
oFF.AuGdsGlobalActionsRegistrator.prototype.canUndo = function(context)
{
	var document = oFF.AuGdsGenericContextResolveUtil.resolveDocument(context);
	return oFF.notNull(document) && document.hasUndoSteps();
};
oFF.AuGdsGlobalActionsRegistrator.prototype.canRedo = function(context)
{
	var document = oFF.AuGdsGenericContextResolveUtil.resolveDocument(context);
	return oFF.notNull(document) && document.hasRedoSteps();
};
oFF.AuGdsGlobalActionsRegistrator.prototype.executeUndo = function(context)
{
	var document = oFF.AuGdsGenericContextResolveUtil.resolveDocument(context);
	if (oFF.notNull(document) && document.hasUndoSteps())
	{
		document.executeUndo();
	}
};
oFF.AuGdsGlobalActionsRegistrator.prototype.executeRedo = function(context)
{
	var document = oFF.AuGdsGenericContextResolveUtil.resolveDocument(context);
	if (oFF.notNull(document) && document.hasRedoSteps())
	{
		document.executeRedo();
	}
};
oFF.AuGdsGlobalActionsRegistrator.prototype.canSaveDocument = function(context)
{
	var document = oFF.AuGdsGenericContextResolveUtil.resolveDocument(context);
	return oFF.notNull(document) && document.hasSaveData() && (!document.hasFile() || document.canSaveFile()) && this.hasSavePrivilege(document);
};
oFF.AuGdsGlobalActionsRegistrator.prototype.canSaveDocumentAs = function(context)
{
	var document = oFF.AuGdsGenericContextResolveUtil.resolveDocument(context);
	return oFF.notNull(document) && document.hasSaveData() && document.hasFile() && this.hasSavePrivilege(document);
};
oFF.AuGdsGlobalActionsRegistrator.prototype.saveDocumentAs = function(context)
{
	var document = oFF.AuGdsGenericContextResolveUtil.resolveDocument(context);
	var gds = oFF.AuGdsGenericContextResolveUtil.resolveGdsProgram(context);
	if (oFF.notNull(document) && document.hasSaveData())
	{
		document.executeSaveAs( function(extResult){
			gds.handleDocumentSave(extResult);
		}.bind(this));
	}
};
oFF.AuGdsGlobalActionsRegistrator.prototype.saveDocument = function(context)
{
	var document = oFF.AuGdsGenericContextResolveUtil.resolveDocument(context);
	var gds = oFF.AuGdsGenericContextResolveUtil.resolveGdsProgram(context);
	var saveHandler =  function(extResult){
		gds.handleDocumentSave(extResult);
	}.bind(this);
	if (oFF.notNull(document) && document.hasSaveData())
	{
		if (document.hasFile())
		{
			document.executeSave(saveHandler);
		}
		else
		{
			document.executeSaveAs(saveHandler);
		}
	}
};
oFF.AuGdsGlobalActionsRegistrator.prototype.loadDocument = function(triggerContext)
{
	var program = oFF.AuGdsGenericContextResolveUtil.resolveGdsProgram(triggerContext);
	program.openPressed();
};
oFF.AuGdsGlobalActionsRegistrator.prototype.closeDocument = function(triggerContext)
{
	var program = oFF.AuGdsGenericContextResolveUtil.resolveGdsProgram(triggerContext);
	program.closeActiveDocumentSafe();
};
oFF.AuGdsGlobalActionsRegistrator.prototype.hasSavePrivilege = function(document)
{
	var hasSavePrivilege = true;
	if (oFF.notNull(document))
	{
		var userProfile = document.getProcess().getUserProfile();
		if (document.getFeatureManager().isSacIntegration() && oFF.notNull(userProfile) && userProfile.arePrivilegesAvailable())
		{
			hasSavePrivilege = userProfile.hasPrivilegeOnType("PUBLICFILE", "create") || userProfile.hasPrivilegeOnType("PRIVATEFILE", "create") || userProfile.hasPrivilegeOnType("PRIVATEINSIGHT", "create");
		}
	}
	return hasSavePrivilege;
};

oFF.AuGdsLambdaFdBeforeFilterChangeListener = function() {};
oFF.AuGdsLambdaFdBeforeFilterChangeListener.prototype = new oFF.XObject();
oFF.AuGdsLambdaFdBeforeFilterChangeListener.prototype._ff_c = "AuGdsLambdaFdBeforeFilterChangeListener";

oFF.AuGdsLambdaFdBeforeFilterChangeListener.create = function(procedure)
{
	var result = new oFF.AuGdsLambdaFdBeforeFilterChangeListener();
	result.m_procedure = procedure;
	return result;
};
oFF.AuGdsLambdaFdBeforeFilterChangeListener.prototype.m_procedure = null;
oFF.AuGdsLambdaFdBeforeFilterChangeListener.prototype.onBeforeChange = function(settings)
{
	if (oFF.notNull(this.m_procedure))
	{
		this.m_procedure(settings);
	}
};
oFF.AuGdsLambdaFdBeforeFilterChangeListener.prototype.releaseObject = function()
{
	this.m_procedure = null;
	oFF.XObject.prototype.releaseObject.call( this );
};

oFF.AuGdsQbSubContextFillerUtil = {

	extendAttributeAndFieldContext:function(context, queryModel, attributesAllSelected, attributesLastSelected, fieldsAllSelected, selectionHasGaps)
	{
			var i;
		var subContext;
		var attributes = attributesAllSelected.getValuesAsReadOnlyList();
		var selectionType;
		if (attributesAllSelected.size() > attributesLastSelected.size())
		{
			selectionType = oFF.AuGdsContextConstants.OLAP_ATTRIBUTE_MULTI_GAPS;
		}
		else if (attributesAllSelected.size() === 1)
		{
			selectionType = oFF.AuGdsContextConstants.OLAP_ATTRIBUTE_SINGLE;
		}
		else
		{
			selectionType = oFF.AuGdsContextConstants.OLAP_ATTRIBUTE_MULTI_CONNECTED;
		}
		for (i = 0; i < attributes.size(); i++)
		{
			var curAttribute = attributes.get(i);
			subContext = context.addSubContext();
			subContext.setType(selectionType);
			subContext.setCustomObject(curAttribute);
			if (curAttribute === curAttribute.getDimension().getMainAttribute())
			{
				subContext = context.addSubContext();
				subContext.setType(oFF.AuGdsContextConstants.OLAP_ATTRIBUTE_MAIN);
				subContext.setCustomObject(curAttribute);
			}
		}
		var fieldList = fieldsAllSelected.getValuesAsReadOnlyList();
		if (selectionHasGaps)
		{
			selectionType = oFF.AuGdsContextConstants.OLAP_FIELD_MULTI_GAPS;
		}
		else if (fieldsAllSelected.size() === 1)
		{
			selectionType = oFF.AuGdsContextConstants.OLAP_FIELD_SINGLE;
		}
		else
		{
			selectionType = oFF.AuGdsContextConstants.OLAP_FIELD_MULTI_CONNECTED;
		}
		var caps = queryModel.getModelCapabilities();
		for (i = 0; i < fieldList.size(); i++)
		{
			subContext = context.addSubContext();
			subContext.setType(selectionType);
			var localField = fieldList.get(i);
			subContext.setCustomObject(localField);
			subContext.setSubContextsSupplier(oFF.AuGdsQbSubContextFillerUtil.getFieldSubContextSupplier(caps, localField));
			var localDim = localField.getDimension();
			if (localDim.getFieldLayoutType() === oFF.FieldLayoutType.FIELD_BASED && oFF.XCollectionUtils.hasElements(localDim.getResultSetFields()) && localDim.getResultSetFields().get(0) === localField)
			{
				subContext = context.addSubContext();
				subContext.setType(oFF.AuGdsContextConstants.OLAP_FIELD_MAIN);
				subContext.setCustomObject(localField);
				subContext.setSubContextsSupplier(oFF.AuGdsQbSubContextFillerUtil.getFieldSubContextSupplier(caps, localField));
			}
		}
	},
	getFieldSubContextSupplier:function(caps, localField)
	{
			return  function(){
			var subSubContexts = oFF.XList.create();
			var subSubContext;
			if (caps.supportsFieldSorting(localField))
			{
				subSubContext = oFF.CMEFactory.createContext();
				subSubContext.setType(oFF.AuGdsContextConstants.OLAP_CAPABILITIES_FIELD_SORTING);
				subSubContexts.add(subSubContext);
			}
			return subSubContexts;
		}.bind(this);
	},
	extendTupleElementContext:function(tableSelectionContext, rowTupleElementsAllSelected, columnTupleElementsAllSelected)
	{
			oFF.AuGdsQbSubContextFillerUtil.extendContextList(tableSelectionContext, rowTupleElementsAllSelected, oFF.AuGdsContextConstants.OLAP_ROWS_TUPLE_ELEMENTS);
		oFF.AuGdsQbSubContextFillerUtil.extendContextList(tableSelectionContext, columnTupleElementsAllSelected, oFF.AuGdsContextConstants.OLAP_COLUMNS_TUPLE_ELEMENTS);
	},
	extendMemberContext:function(context, queryModel, membersAllSelected, selectionHasGaps)
	{
			var list = membersAllSelected.getValuesAsReadOnlyList();
		var selectionType;
		if (selectionHasGaps)
		{
			selectionType = oFF.AuGdsContextConstants.OLAP_MEMBER_MULTI_GAPS;
		}
		else if (membersAllSelected.size() === 1)
		{
			var dimension = queryModel.getDimensionByName(list.get(0).getDimension().getName());
			var dimensionType = dimension.getDimensionType();
			if (dimension.isUniversalDisplayHierarchyDimension())
			{
				selectionType = oFF.AuGdsContextConstants.OLAP_MEMBER_SINGLE_UDH;
			}
			else if (dimensionType === oFF.DimensionType.ACCOUNT)
			{
				selectionType = oFF.AuGdsContextConstants.OLAP_MEMBER_SINGLE_STRUCTURE_ACCOUNT;
			}
			else if (dimensionType === oFF.DimensionType.MEASURE_STRUCTURE)
			{
				selectionType = oFF.AuGdsContextConstants.OLAP_MEMBER_SINGLE_STRUCTURE_MEASURE;
			}
			else if (dimensionType === oFF.DimensionType.SECONDARY_STRUCTURE)
			{
				selectionType = oFF.AuGdsContextConstants.OLAP_MEMBER_SINGLE_STRUCTURE_SECONDARY;
			}
			else if (dimensionType === oFF.DimensionType.CALCULATED_DIMENSION)
			{
				selectionType = oFF.AuGdsContextConstants.OLAP_MEMBER_SINGLE_CALCULATED;
			}
			else if (dimensionType.isTypeOf(oFF.DimensionType.GENERAL_VERSION))
			{
				selectionType = oFF.AuGdsContextConstants.OLAP_MEMBER_SINGLE_VERSION;
			}
			else
			{
				selectionType = oFF.AuGdsContextConstants.OLAP_MEMBER_SINGLE_BASE;
			}
		}
		else
		{
			selectionType = oFF.AuGdsContextConstants.OLAP_MEMBER_MULTI_CONNECTED;
		}
		oFF.AuGdsQbSubContextFillerUtil.extendContextList(context, list, selectionType);
	},
	extendContextList:function(context, list, selectionType)
	{
			for (var i = 0; i < list.size(); i++)
		{
			var subContext = context.addSubContext();
			subContext.setType(selectionType);
			subContext.setCustomObject(list.get(i));
		}
	},
	decorateStructureMemberContext:function(dimension, context, membersAllSelected, hasGaps, typeSingle, typeConnected, typeGaps, typeFilter)
	{
			if (oFF.XCollectionUtils.hasElements(membersAllSelected))
		{
			var selectionType;
			if (hasGaps)
			{
				selectionType = typeGaps;
			}
			else if (membersAllSelected.size() === 1)
			{
				selectionType = typeSingle;
			}
			else
			{
				selectionType = typeConnected;
			}
			var list = membersAllSelected.getValuesAsReadOnlyList();
			for (var i = 0; i < membersAllSelected.size(); i++)
			{
				var subContext = context.addSubContext();
				subContext.setType(selectionType);
				subContext.setCustomObject(list.get(i));
			}
		}
		else
		{
			oFF.AuGdsQbSubContextFillerUtil.decorateSingleMemberContextFromFilter(context, dimension, typeFilter);
		}
	},
	decorateSingleMemberContextFromFilter:function(tableSelectionContext, dimension, contextType)
	{
			if (oFF.notNull(dimension))
		{
			var structureFilter = oFF.AuGdsQbSubContextFillerUtil.getFilterForDimension(dimension);
			if (oFF.XCollectionUtils.hasElements(structureFilter) && structureFilter.size() === 1)
			{
				var dimensionMember = structureFilter.getCartesianElement(0).getLow().getDimensionMember();
				if (oFF.notNull(dimensionMember))
				{
					var subContext = tableSelectionContext.addSubContext();
					subContext.setType(contextType);
					var structureMember = dimension.getStructureMember(dimensionMember.getName());
					if (oFF.notNull(structureMember))
					{
						subContext.setCustomObject(structureMember);
					}
					else
					{
						subContext.setCustomObject(dimensionMember);
					}
				}
			}
		}
	},
	getFilterForDimension:function(dimension)
	{
			var dynFilter = dimension.getQueryModel().getFilter().getDynamicFilter();
		var cartProd = oFF.isNull(dynFilter) ? null : dynFilter.getCartesianProduct();
		var structureFilter = oFF.isNull(cartProd) ? null : cartProd.getCartesianList(dimension);
		return structureFilter;
	},
	extendTupleContext:function(localizationProvider, context, queryModel, tuplesAllSelected, selectionHasGaps, onRow)
	{
			var selectionType = null;
		if (selectionHasGaps)
		{
			selectionType = onRow ? oFF.AuGdsContextConstants.OLAP_ROWS_TUPLE_MULTI_GAPS : oFF.AuGdsContextConstants.OLAP_COLUMNS_TUPLE_MULTI_GAPS;
		}
		else if (tuplesAllSelected.size() === 1)
		{
			selectionType = onRow ? oFF.AuGdsContextConstants.OLAP_ROWS_TUPLE_SINGLE : oFF.AuGdsContextConstants.OLAP_COLUMNS_TUPLE_SINGLE;
		}
		else
		{
			selectionType = onRow ? oFF.AuGdsContextConstants.OLAP_ROWS_TUPLE_MULTI_CONNECTED : oFF.AuGdsContextConstants.OLAP_COLUMNS_TUPLE_MULTI_CONNECTED;
		}
		for (var i = 0; i < tuplesAllSelected.size(); i++)
		{
			var subContext = context.addSubContext();
			subContext.setType(selectionType);
			var tuple = tuplesAllSelected.get(i);
			subContext.setCustomObject(tuple);
		}
		if (oFF.XCollectionUtils.hasElements(tuplesAllSelected) && tuplesAllSelected.get(0).size() === 1 && tuplesAllSelected.get(0).getTupleElementAt(0).getDimension().isUniversalDisplayHierarchyDimension())
		{
			var dimensionsForUdh = oFF.XSetOfNameObject.create();
			for (var j = 0; j < tuplesAllSelected.size(); j++)
			{
				var currentTuple = tuplesAllSelected.get(j);
				if (currentTuple.size() === 1)
				{
					dimensionsForUdh.add(currentTuple.getTupleElementAt(0).getDrillGroupDimension());
				}
			}
			if (oFF.XCollectionUtils.hasElements(dimensionsForUdh))
			{
				oFF.AuGdsQbSubContextFillerUtil.extendDimensionContext(localizationProvider, context, queryModel, dimensionsForUdh, selectionHasGaps);
			}
		}
	},
	extendDimensionContext:function(localizationProvider, context, queryModel, dimensionsAllSelected, selectionHasGaps)
	{
			var selectionType = null;
		var allDimensions = dimensionsAllSelected.getValuesAsReadOnlyList();
		if (selectionHasGaps)
		{
			selectionType = oFF.AuGdsContextConstants.OLAP_DIMENSION_MULTI_GAPS;
		}
		else if (allDimensions.size() === 1)
		{
			var dim = allDimensions.get(0);
			var dimType = dim.getDimensionType();
			if (dim.isUniversalDisplayHierarchyDimension())
			{
				selectionType = oFF.AuGdsContextConstants.OLAP_DIMENSION_UDH;
			}
			else if (dimType === oFF.DimensionType.ACCOUNT)
			{
				selectionType = oFF.AuGdsContextConstants.OLAP_DIMENSION_SINGLE_STRUCTURE_ACCOUNT;
			}
			else if (dimType === oFF.DimensionType.MEASURE_STRUCTURE)
			{
				selectionType = oFF.AuGdsContextConstants.OLAP_DIMENSION_SINGLE_STRUCTURE_MEASURE;
			}
			else if (dimType === oFF.DimensionType.SECONDARY_STRUCTURE)
			{
				selectionType = oFF.AuGdsContextConstants.OLAP_DIMENSION_SINGLE_STRUCTURE_SECONDARY;
			}
			else if (dimType === oFF.DimensionType.CALCULATED_DIMENSION)
			{
				selectionType = oFF.AuGdsContextConstants.OLAP_DIMENSION_SINGLE_CALCULATED;
			}
			else if (dimType.isTypeOf(oFF.DimensionType.GENERAL_VERSION))
			{
				selectionType = oFF.AuGdsContextConstants.OLAP_DIMENSION_SINGLE_VERSION;
			}
			else
			{
				selectionType = oFF.AuGdsContextConstants.OLAP_DIMENSION_SINGLE_BASE;
			}
		}
		else
		{
			selectionType = oFF.AuGdsContextConstants.OLAP_DIMENSION_MULTI_CONNECTED;
		}
		var subContext;
		for (var i = 0; i < allDimensions.size(); i++)
		{
			subContext = context.addSubContext();
			subContext.setType(selectionType);
			var dimension = queryModel.getDimensionByName(allDimensions.get(i).getName());
			subContext.setCustomObject(dimension);
			subContext.setName(dimension.getName());
			subContext.setText(oFF.AuGdsQbSubContextFillerUtil.getDimensionText(localizationProvider, dimension));
			oFF.AuGdsQbSubContextFillerUtil.expandDimensionSubContexts(localizationProvider, subContext, dimension, queryModel);
		}
	},
	expandQueryModelContext:function(localizationProvider, context, queryModel)
	{
			context.setSubContextsSupplier( function(){
			var subContexts = oFF.XList.create();
			var subContext = oFF.CMEFactory.createContext();
			subContext.setType(oFF.AuGdsContextConstants.OLAP_AXIS_ROWS);
			var rowsAxis = queryModel.getRowsAxis();
			subContext.setCustomObject(rowsAxis);
			var rowsIterator = rowsAxis.getIterator();
			while (rowsIterator.hasNext())
			{
				oFF.AuGdsQbSubContextFillerUtil.decorateDimensionSubContext(localizationProvider, subContext.addSubContext(), rowsIterator.next(), queryModel);
			}
			subContexts.add(subContext);
			subContext = oFF.CMEFactory.createContext();
			subContext.setType(oFF.AuGdsContextConstants.OLAP_AXIS_COLUMNS);
			var columnsAxis = queryModel.getColumnsAxis();
			subContext.setCustomObject(columnsAxis);
			var colummnsIterator = columnsAxis.getIterator();
			while (colummnsIterator.hasNext())
			{
				oFF.AuGdsQbSubContextFillerUtil.decorateDimensionSubContext(localizationProvider, subContext.addSubContext(), colummnsIterator.next(), queryModel);
			}
			subContexts.add(subContext);
			var conditionIterator = queryModel.getConditionManager() === null ? null : queryModel.getConditionManager().getIterator();
			while (oFF.notNull(conditionIterator) && conditionIterator.hasNext())
			{
				var condition = conditionIterator.next();
				if (!condition.isBackendCondition())
				{
					continue;
				}
				subContext = oFF.CMEFactory.createContext();
				subContext.setType(oFF.AuGdsContextConstants.OLAP_CONDITION_BACKEND);
				subContext.setName(condition.getName());
				subContext.setText(condition.getText());
				if (oFF.XStringUtils.isNullOrEmpty(subContext.getText()))
				{
					subContext.setText(condition.getDescription());
				}
				if (oFF.XStringUtils.isNullOrEmpty(subContext.getText()))
				{
					subContext.setText(condition.getName());
				}
				subContext.setCustomObject(condition);
				subContexts.add(subContext);
			}
			var exceptionIterator = queryModel.getExceptionManager().getIterator();
			while (exceptionIterator.hasNext())
			{
				var exception = exceptionIterator.next();
				subContext = oFF.CMEFactory.createContext();
				subContext.setType(oFF.AuGdsContextConstants.OLAP_EXCEPTION_BACKEND);
				subContext.setName(exception.getName());
				subContext.setText(exception.getText());
				if (oFF.XStringUtils.isNullOrEmpty(subContext.getText()))
				{
					subContext.setText(exception.getName());
				}
				subContext.setCustomObject(exception);
				subContexts.add(subContext);
			}
			var tupleFilters = oFF.TupleFilterApplicationUtil.getTupleFilters(queryModel, false, false);
			var keyIterator = tupleFilters.getKeysAsIteratorOfString();
			while (keyIterator.hasNext())
			{
				var key = keyIterator.next();
				subContext = oFF.CMEFactory.createContext();
				subContext.setType(oFF.AuGdsContextConstants.OLAP_FILTER_TUPLE);
				var expression = tupleFilters.getByKey(key);
				subContext.setCustomObject(expression);
				var tupleSetSign = oFF.TupleFilterApplicationUtil.getSetSignForTupleFilterExpression(expression, false);
				var tupleDimenisons = oFF.TupleFilterApplicationUtil.getDimensionsForTupleFilterExpression(expression, false);
				var tuplePrefix = tupleSetSign === oFF.SetSign.EXCLUDING ? "! " : "";
				subContext.setText(oFF.XStringUtils.concatenate2(tuplePrefix, oFF.XCollectionUtils.join(oFF.XStream.of(tupleDimenisons).collect(oFF.XStreamCollector.toListOfString( function(tdt){
					return tdt.getText();
				}.bind(this))), ", ")));
				subContext.setName(oFF.XStringUtils.concatenate2(tuplePrefix, oFF.XCollectionUtils.join(oFF.XStream.of(tupleDimenisons).collect(oFF.XStreamCollector.toListOfString( function(tdn){
					return tdn.getName();
				}.bind(this))), ", ")));
				subContexts.add(subContext);
			}
			var dimsIterator = queryModel.getDimensions().getIterator();
			while (dimsIterator.hasNext())
			{
				oFF.XCollectionUtils.addIfNotNull(subContexts, oFF.AuGdsQbSubContextFillerUtil.createDimensionSubContext(localizationProvider, dimsIterator.next(), queryModel));
			}
			var caps = queryModel.getModelCapabilities();
			if (caps.supportsMeasureSorting())
			{
				subContext = oFF.CMEFactory.createContext();
				subContext.setType(oFF.AuGdsContextConstants.OLAP_CAPABILITIES_MEASURE_SORTING);
				subContexts.add(subContext);
			}
			if (caps.supportsDataCellSorting())
			{
				subContext = oFF.CMEFactory.createContext();
				subContext.setType(oFF.AuGdsContextConstants.OLAP_CAPABILITIES_DATACELL_SORTING);
				subContexts.add(subContext);
			}
			if (caps.supportsConditionalResultVisibility())
			{
				subContext = oFF.CMEFactory.createContext();
				subContext.setType(oFF.AuGdsContextConstants.OLAP_CAPABILITIES_CONDITIONAL_RESULT_VISIBILITY);
				subContexts.add(subContext);
			}
			return subContexts;
		}.bind(this));
	},
	createDimensionSubContext:function(localizationProvider, dimension, queryModel)
	{
			if (dimension.isUniversalDisplayHierarchyDimension() || !dimension.supportsAxis(oFF.AxisType.COLUMNS) && !dimension.supportsAxis(oFF.AxisType.ROWS))
		{
			return null;
		}
		var subContext = oFF.CMEFactory.createContext();
		oFF.AuGdsQbSubContextFillerUtil.decorateDimensionSubContext(localizationProvider, subContext, dimension, queryModel);
		return subContext;
	},
	decorateDimensionSubContext:function(localizationProvider, subContext, dimension, queryModel)
	{
			subContext.setCustomObject(dimension);
		subContext.setName(dimension.getName());
		subContext.setText(oFF.AuGdsQbSubContextFillerUtil.getDimensionText(localizationProvider, dimension));
		var axisType = dimension.getAxisType();
		var dimType = dimension.getDimensionType();
		if (axisType === oFF.AxisType.ROWS)
		{
			if (dimType === oFF.DimensionType.MEASURE_STRUCTURE)
			{
				subContext.setType(oFF.AuGdsContextConstants.OLAP_DIMENSION_ROW_STRUCTURE_MEASURE);
			}
			else if (dimType === oFF.DimensionType.SECONDARY_STRUCTURE)
			{
				subContext.setType(oFF.AuGdsContextConstants.OLAP_DIMENSION_ROW_STRUCTURE_SECONDARY);
			}
			else if (dimType === oFF.DimensionType.ACCOUNT)
			{
				subContext.setType(oFF.AuGdsContextConstants.OLAP_DIMENSION_ROW_STRUCTURE_ACCOUNT);
			}
			else if (dimType === oFF.DimensionType.CALCULATED_DIMENSION)
			{
				subContext.setType(oFF.AuGdsContextConstants.OLAP_DIMENSION_ROW_CALCULATED);
			}
			else if (dimType.isTypeOf(oFF.DimensionType.GENERAL_VERSION))
			{
				subContext.setType(oFF.AuGdsContextConstants.OLAP_DIMENSION_ROW_VERSION);
			}
			else
			{
				subContext.setType(oFF.AuGdsContextConstants.OLAP_DIMENSION_ROW_BASE);
			}
		}
		else if (axisType === oFF.AxisType.COLUMNS)
		{
			if (dimType === oFF.DimensionType.MEASURE_STRUCTURE)
			{
				subContext.setType(oFF.AuGdsContextConstants.OLAP_DIMENSION_COLUMN_STRUCTURE_MEASURE);
			}
			else if (dimType === oFF.DimensionType.SECONDARY_STRUCTURE)
			{
				subContext.setType(oFF.AuGdsContextConstants.OLAP_DIMENSION_COLUMN_STRUCTURE_SECONDARY);
			}
			else if (dimType === oFF.DimensionType.ACCOUNT)
			{
				subContext.setType(oFF.AuGdsContextConstants.OLAP_DIMENSION_COLUMN_STRUCTURE_ACCOUNT);
			}
			else if (dimType === oFF.DimensionType.CALCULATED_DIMENSION)
			{
				subContext.setType(oFF.AuGdsContextConstants.OLAP_DIMENSION_COLUMN_CALCULATED);
			}
			else if (dimType.isTypeOf(oFF.DimensionType.GENERAL_VERSION))
			{
				subContext.setType(oFF.AuGdsContextConstants.OLAP_DIMENSION_COLUMN_VERSION);
			}
			else
			{
				subContext.setType(oFF.AuGdsContextConstants.OLAP_DIMENSION_COLUMN_BASE);
			}
		}
		else
		{
			if (dimType === oFF.DimensionType.MEASURE_STRUCTURE)
			{
				subContext.setType(oFF.AuGdsContextConstants.OLAP_DIMENSION_FREE_STRUCTURE_MEASURE);
			}
			else if (dimType === oFF.DimensionType.SECONDARY_STRUCTURE)
			{
				subContext.setType(oFF.AuGdsContextConstants.OLAP_DIMENSION_FREE_STRUCTURE_SECONDARY);
			}
			else if (dimType === oFF.DimensionType.ACCOUNT)
			{
				subContext.setType(oFF.AuGdsContextConstants.OLAP_DIMENSION_FREE_STRUCTURE_ACCOUNT);
			}
			else if (dimType === oFF.DimensionType.CALCULATED_DIMENSION)
			{
				subContext.setType(oFF.AuGdsContextConstants.OLAP_DIMENSION_FREE_CALCULATED);
			}
			else if (dimType.isTypeOf(oFF.DimensionType.GENERAL_VERSION))
			{
				subContext.setType(oFF.AuGdsContextConstants.OLAP_DIMENSION_FREE_VERSION);
			}
			else
			{
				subContext.setType(oFF.AuGdsContextConstants.OLAP_DIMENSION_FREE_BASE);
			}
		}
		oFF.AuGdsQbSubContextFillerUtil.expandDimensionSubContexts(localizationProvider, subContext, dimension, queryModel);
	},
	expandDimensionSubContexts:function(localizationProvider, context, dimension, queryModel)
	{
			context.setSubContextsSupplier( function(){
			var j;
			var subContext;
			var subContexts = oFF.XList.create();
			if (dimension.getFieldLayoutType() === oFF.FieldLayoutType.FIELD_BASED)
			{
				var fields = dimension.getFields();
				for (j = 0; j < fields.size(); j++)
				{
					var localField = fields.getFieldAt(j);
					subContext = oFF.CMEFactory.createContext();
					subContext.setCustomObject(localField);
					subContext.setType(localField.getAttribute() === dimension.getMainAttribute() ? oFF.AuGdsContextConstants.OLAP_FIELD_MAIN : oFF.AuGdsContextConstants.OLAP_FIELD_ITERATED);
					subContext.setName(localField.getName());
					var fieldText = localField.getText();
					if (oFF.XStringUtils.isNullOrEmpty(fieldText))
					{
						fieldText = localField.getName();
					}
					subContext.setText(fieldText);
					subContexts.add(subContext);
				}
			}
			else
			{
				var attributes = dimension.getAttributes();
				for (j = 0; j < attributes.size(); j++)
				{
					var localAttribute = attributes.getAttributeAt(j);
					subContext = oFF.CMEFactory.createContext();
					subContext.setCustomObject(localAttribute);
					subContext.setName(localAttribute.getName());
					var attributeText = localAttribute.getText();
					if (oFF.XStringUtils.isNullOrEmpty(attributeText))
					{
						attributeText = localAttribute.getName();
					}
					subContext.setText(attributeText);
					subContext.setType(localAttribute === dimension.getMainAttribute() ? oFF.AuGdsContextConstants.OLAP_ATTRIBUTE_MAIN : oFF.AuGdsContextConstants.OLAP_ATTRIBUTE_ITERATED);
					subContexts.add(subContext);
				}
			}
			if (dimension.isUniversalDisplayHierarchyDimension())
			{
				if (queryModel.getUniversalDisplayHierarchies() !== null)
				{
					var dimensionNames = dimension.getUniversalDisplayHierarchy().getDimensionNames();
					for (j = 0; j < dimensionNames.size(); j++)
					{
						subContext = oFF.CMEFactory.createContext();
						var subDimension = queryModel.getDimensionByName(dimensionNames.get(j));
						subContext.setCustomObject(subDimension);
						subContext.setName(subDimension.getName());
						subContext.setText(oFF.AuGdsQbSubContextFillerUtil.getDimensionText(localizationProvider, subDimension));
						var subDimensionType = subDimension.getDimensionType();
						if (subDimensionType === oFF.DimensionType.MEASURE_STRUCTURE)
						{
							subContext.setType(oFF.AuGdsContextConstants.OLAP_DIMENSION_ITERATED_STRUCTURE_MEASURE);
						}
						else if (subDimensionType === oFF.DimensionType.SECONDARY_STRUCTURE)
						{
							subContext.setType(oFF.AuGdsContextConstants.OLAP_DIMENSION_ITERATED_STRUCTURE_SECONDARY);
						}
						else if (subDimensionType === oFF.DimensionType.ACCOUNT)
						{
							subContext.setType(oFF.AuGdsContextConstants.OLAP_DIMENSION_ITERATED_STRUCTURE_ACCOUNT);
						}
						else if (subDimensionType === oFF.DimensionType.CALCULATED_DIMENSION)
						{
							subContext.setType(oFF.AuGdsContextConstants.OLAP_DIMENSION_ITERATED_CALCULATED);
						}
						else if (subDimensionType.isTypeOf(oFF.DimensionType.GENERAL_VERSION))
						{
							subContext.setType(oFF.AuGdsContextConstants.OLAP_DIMENSION_ITERATED_VERSION);
						}
						else
						{
							subContext.setType(oFF.AuGdsContextConstants.OLAP_DIMENSION_ITERATED_BASE);
						}
						oFF.AuGdsQbSubContextFillerUtil.expandDimensionSubContexts(localizationProvider, subContext, subDimension, queryModel);
						subContexts.add(subContext);
					}
				}
			}
			var caps = queryModel.getModelCapabilities();
			if (caps.supportsDimensionSorting(dimension, oFF.SortType.MEMBER_KEY))
			{
				subContext = oFF.CMEFactory.createContext();
				subContext.setType(oFF.AuGdsContextConstants.OLAP_CAPABILITIES_DIMENSION_SORTING_KEY);
				subContexts.add(subContext);
			}
			if (caps.supportsDimensionSorting(dimension, oFF.SortType.MEMBER_TEXT))
			{
				subContext = oFF.CMEFactory.createContext();
				subContext.setType(oFF.AuGdsContextConstants.OLAP_CAPABILITIES_DIMENSION_SORTING_TEXT);
				subContexts.add(subContext);
			}
			return subContexts;
		}.bind(this));
	},
	getDimensionText:function(localizationProvider, dimension)
	{
			var result = dimension.getText();
		var type = dimension.getDimensionType();
		if (oFF.notNull(localizationProvider))
		{
			if (type === oFF.DimensionType.MEASURE_STRUCTURE)
			{
				result = localizationProvider.getText(oFF.OlapUiCommonI18n.COMMON_MEASURES);
			}
			else if (type === oFF.DimensionType.SECONDARY_STRUCTURE)
			{
				result = localizationProvider.getText(oFF.OlapUiCommonI18n.COMMON_STRUCTURE);
			}
		}
		return result;
	}
};

