oFF.AuGdsQueryBuilderAdvancedActionsRegistrator.create = function()
{
	return new oFF.AuGdsQueryBuilderAdvancedActionsRegistrator();
};
oFF.AuGdsQueryBuilderAdvancedActionsRegistrator.moveAttributes = function(dimension, attributeList, offset)
{
	var resultSetAttributes = dimension.getResultSetAttributes();
	var dimensionName = dimension.getName();
	var index = 0;
	var i;
	for (i = attributeList.size() - 1; i >= 0; i--)
	{
		var attribute = attributeList.get(i);
		index = resultSetAttributes.getIndex(attribute);
		resultSetAttributes.removeAt(index);
		dimension.getConvenienceCommands().removeAttributeFromResultSet(dimensionName, attribute.getName());
	}
	for (i = 0; i < attributeList.size(); i++)
	{
		dimension.getConvenienceCommands().insertAttributeToResultSet(dimensionName, attributeList.get(i).getName(), index + offset + i);
	}
};
oFF.AuGdsQueryBuilderAdvancedActionsRegistrator.moveFields = function(dimension, attributeOrig, fieldList, offset)
{
	var resultSetFields = oFF.AuGdsQueryBuilderAdvancedActionsRegistrator.getResultSetFields(dimension, attributeOrig);
	var index = 0;
	var i;
	var fieldBased = dimension.getFieldLayoutType() === oFF.FieldLayoutType.FIELD_BASED;
	var attribute = attributeOrig;
	if (!fieldBased && oFF.isNull(attributeOrig))
	{
		if (dimension.getMainAttribute() !== null)
		{
			attribute = dimension.getMainAttribute();
		}
		else
		{
			fieldBased = true;
		}
	}
	var attributeName = oFF.isNull(attribute) ? null : attribute.getName();
	var dimensionName = dimension.getName();
	for (i = fieldList.size() - 1; i >= 0; i--)
	{
		var field = fieldList.get(i);
		index = resultSetFields.getIndex(field);
		if (fieldBased)
		{
			dimension.getConvenienceCommands().removeField(null, dimensionName, null, field.getName(), oFF.QContextType.RESULT_SET);
		}
		else
		{
			dimension.getConvenienceCommands().removeAttributeField(null, dimensionName, attributeName, null, field.getName(), oFF.QContextType.RESULT_SET);
		}
	}
	for (i = 0; i < fieldList.size(); i++)
	{
		if (fieldBased)
		{
			dimension.getConvenienceCommands().insertField(null, dimensionName, null, fieldList.get(i).getName(), oFF.QContextType.RESULT_SET, index + offset + i);
		}
		else
		{
			dimension.getConvenienceCommands().insertAttributeField(null, dimensionName, attributeName, null, fieldList.get(i).getName(), oFF.QContextType.RESULT_SET, index + offset + i);
		}
	}
};
oFF.AuGdsQueryBuilderAdvancedActionsRegistrator.getResultSetFields = function(dimension, attribute)
{
	if (dimension.getFieldLayoutType() === oFF.FieldLayoutType.FIELD_BASED)
	{
		return dimension.getResultSetFields();
	}
	else if (oFF.isNull(attribute))
	{
		if (dimension.getMainAttribute() === null)
		{
			return dimension.getResultSetFields();
		}
		else
		{
			return dimension.getMainAttribute().getResultSetFields();
		}
	}
	else
	{
		return attribute.getResultSetFields();
	}
};
oFF.AuGdsQueryBuilderAdvancedActionsRegistrator.getMinimumDimensionDrillLevel = function(triggerContext)
{
	var elements = oFF.AuGdsQueryBuilderAdvancedActionsRegistrator.getTupleElementsSupportingDrillState(triggerContext, oFF.DrillState.EXPANDED);
	var sortedLevelList = oFF.XStream.of(elements).map( function(te){
		return oFF.XIntegerValue.create(te.getDisplayLevel());
	}.bind(this)).sorted(oFF.XComparatorInteger.create()).collect(oFF.XStreamCollector.toList());
	return oFF.XCollectionUtils.hasElements(sortedLevelList) ? sortedLevelList.get(0).getInteger() : -1;
};
oFF.AuGdsQueryBuilderAdvancedActionsRegistrator.tryApplyDrill = function(triggerContext, drillState, relativeLevelCount)
{
	var elements = oFF.AuGdsQueryBuilderAdvancedActionsRegistrator.getTupleElementsSupportingDrillState(triggerContext, drillState);
	var success = oFF.XCollectionUtils.hasElements(elements);
	if (success)
	{
		for (var i = 0; i < elements.size(); i++)
		{
			var element = elements.get(i);
			var drillOperation = element.setNextDrillState(drillState);
			if (relativeLevelCount > -1)
			{
				if (drillState === oFF.DrillState.EXPANDED)
				{
					drillOperation.setRelativeLevelCount(oFF.XMath.max(0, relativeLevelCount - element.getDisplayLevel()));
				}
				else if (drillState === oFF.DrillState.DRILLED)
				{
					drillOperation.setRelativeLevelCount(oFF.XMath.max(0, relativeLevelCount - element.getDrillGroupDimension().getIndexOnAxis()));
				}
			}
		}
	}
	return success;
};
oFF.AuGdsQueryBuilderAdvancedActionsRegistrator.getTupleElementsSupportingDrillState = function(availableContext, drillState)
{
	var result = null;
	var dimension = oFF.AuGdsGenericContextResolveUtil.resolveSingleDimensionPreferablyUdh(availableContext);
	var tuples = oFF.AuGdsGenericContextResolveUtil.resolveTuples(availableContext);
	var checker;
	if (drillState === oFF.DrillState.DRILLED)
	{
		checker =  function(d){
			return oFF.notNull(d) && oFF.AuGdsQbInteractiveTableView.supportsTupleElementDrill(d);
		}.bind(this);
	}
	else if (drillState === oFF.DrillState.EXPANDED)
	{
		checker =  function(e){
			return oFF.notNull(e) && oFF.AuGdsQbInteractiveTableView.supportsTupleElementExpand(e);
		}.bind(this);
	}
	else
	{
		checker =  function(c){
			return oFF.notNull(c) && oFF.AuGdsQbInteractiveTableView.supportsTupleElementCollapse(c);
		}.bind(this);
	}
	if (oFF.notNull(dimension) && oFF.XCollectionUtils.hasElements(tuples))
	{
		var list = oFF.XStream.of(tuples).map( function(tu){
			return tu.getTupleElementByDimension(dimension);
		}.bind(this)).filter(checker).collect(oFF.XStreamCollector.toList());
		if (oFF.XCollectionUtils.hasElements(list))
		{
			result = list;
		}
	}
	return result;
};
