oFF.AuGdsQueryBuilderAdvancedActionsRegistrator.prototype.hasAxisTotalAlignmentBlockingUdh = function(context)
{
	var axis = oFF.AuGdsGenericContextResolveUtil.resolveSingleAxis(context);
	var blocking = false;
	if (oFF.notNull(axis) && axis.getModelCapabilities().supportsUniversalDisplayHierarchies() && !axis.getSession().hasFeature(oFF.FeatureToggleOlap.UDH_ALIGNMENT))
	{
		var udh = axis.getQueryModel().getUniversalDisplayHierarchies().getByAxisType(axis.getType());
		blocking = oFF.notNull(udh) && udh.isActive();
	}
	return blocking;
};
oFF.AuGdsQueryBuilderAdvancedActionsRegistrator.prototype.hasAxisTotalAlignmentBlockingHierarchy = function(context)
{
	var axis = oFF.AuGdsGenericContextResolveUtil.resolveSingleAxis(context);
	return oFF.XCollectionUtils.hasElements(axis) && axis.getQueryModel().getSystemType().isTypeOf(oFF.SystemType.BW) && oFF.XStream.of(axis).allMatch( function(dim){
		return dim.isHierarchyActive();
	}.bind(this));
};
oFF.AuGdsQueryBuilderAdvancedActionsRegistrator.prototype.filterResultAlignment = function(selectionAlignment)
{
	return  function(so){
		return so.getCustomObject() === selectionAlignment;
	}.bind(this);
};
oFF.AuGdsQueryBuilderAdvancedActionsRegistrator.prototype.checkResultAlignmentOptions = function(supportedAlignments)
{
	return  function(ro){
		return supportedAlignments.contains(ro.getCustomObject());
	}.bind(this);
};
