oFF.AuGdsQueryBuilderAdvancedActionsRegistrator.prototype.checkResultSetReadmodeOptions = function(availableResultSetReadModes)
{
	return  function(ro){
		return availableResultSetReadModes.contains(ro.getCustomObject());
	}.bind(this);
};
oFF.AuGdsQueryBuilderAdvancedActionsRegistrator.prototype.getFieldContainerPresentationHelper = function(fieldContainer)
{
	var presentationHelper;
	if (fieldContainer.getOlapComponentType().isTypeOf(oFF.OlapComponentType.ABSTRACT_DIMENSION))
	{
		var dimension = fieldContainer;
		var mainAttribute = dimension.getMainAttribute();
		if (oFF.isNull(mainAttribute))
		{
			presentationHelper = oFF.FieldContainerPresentationHelper.createFromFieldContainer(dimension);
			presentationHelper.applyResultSetSettings(dimension);
		}
		else
		{
			presentationHelper = oFF.FieldContainerPresentationHelper.createFromFieldContainer(mainAttribute);
			var mainRsAttribute = oFF.XStream.of(dimension.getResultSetAttributes()).filter( function(a){
				return oFF.XString.isEqual(a.getName(), mainAttribute.getName());
			}.bind(this)).findAny();
			mainRsAttribute.ifPresent( function(att){
				presentationHelper.applyResultSetSettings(att);
			}.bind(this));
		}
	}
	else
	{
		presentationHelper = oFF.FieldContainerPresentationHelper.createFromFieldContainer(fieldContainer);
		var mainRsAttribute2 = oFF.XStream.of(fieldContainer.getDimension().getResultSetAttributes()).filter( function(a2){
			return oFF.XString.isEqual(a2.getName(), fieldContainer.getName());
		}.bind(this)).findAny();
		mainRsAttribute2.ifPresent( function(att2){
			presentationHelper.applyResultSetSettings(att2);
		}.bind(this));
	}
	return presentationHelper;
};
