oFF.AuGdsQueryBuilderAdvancedActionsRegistrator.prototype.getLeadingFieldValueType = function(field)
{
	var resultField = field;
	var valueType = null;
	if (oFF.notNull(resultField))
	{
		var dimension = field.getDimension();
		if (resultField.getValueType().isString())
		{
			if (resultField === dimension.getDisplayKeyField())
			{
				resultField = dimension.getKeyField();
			}
		}
		if (resultField === dimension.getKeyField() && resultField.getValueType().isString())
		{
			valueType = dimension.getValueType();
		}
		else
		{
			valueType = resultField.getValueType();
		}
	}
	return valueType;
};
