{
	var datText = localizationProvider.getText(oFF.AuGdsQueryBuilderI18n.SORT_DESCENDING_ALPHABETICALLY);
	if (oFF.isNull(datValueType))
	{
		datText = localizationProvider.getText(oFF.AuGdsQueryBuilderI18n.SORT_DESCENDING_ALPHABETICALLY);
	}
	else if (datValueType.isDateTime())
	{
		datText = localizationProvider.getText(oFF.AuGdsQueryBuilderI18n.SORT_DESCENDING_TIME_BASED);
	}
	else if (datValueType.isNumber())
	{
		datText = localizationProvider.getText(oFF.AuGdsQueryBuilderI18n.SORT_DESCENDING_VALUE_BASED);
	}
	else if (datValueType.isString())
	{
		datText = localizationProvider.getText(oFF.AuGdsQueryBuilderI18n.SORT_DESCENDING_ALPHABETICALLY);
	}
	return datText;
};
