oFF.AuGdsQueryBuilderAdvancedActionsRegistrator.prototype.registerAdvancedHierarchySettings = function(registry, localizationProvider)
{
	var action = oFF.CMEFactory.createTriggerAction();
	action.setNameProvider( function(nameContext){
		return oFF.AuGdsQueryBuilderAdvancedActionsRegistrator.ACTION_ADVANCED_HIERARCHY_SETTINGS;
	}.bind(this));
	action.setTextProvider( function(textContext){
		return localizationProvider.getText(oFF.AuGdsQueryBuilderI18n.DRILL_ADVANCED_SETTINGS);
	}.bind(this));
	action.setAvailableProvider( function(availableContext){
		var avDim = oFF.AuGdsGenericContextResolveUtil.resolveSingleDimensionNonUdhOnRowsOrColumns(availableContext);
		return oFF.notNull(avDim) && avDim.supportsHierarchy();
	}.bind(this));
	action.setEnabledProvider( function(enabledContext){
		var enDim = oFF.AuGdsGenericContextResolveUtil.resolveSingleDimensionNonUdhOnRowsOrColumns(enabledContext);
		return oFF.notNull(enDim);
	}.bind(this));
	action.setTrigger( function(triggerContext){
		var dimension = oFF.AuGdsGenericContextResolveUtil.resolveSingleDimensionNonUdhOnRowsOrColumns(triggerContext);
		var wasHierarchyActive = oFF.notNull(dimension) && dimension.isHierarchyActive();
		var document = oFF.AuGdsGenericContextResolveUtil.resolveQueryBuilderDocument(triggerContext);
		if (oFF.notNull(document) && oFF.notNull(dimension))
		{
			oFF.AuGdsQbDialogHelper.openDimensionDialogHierarchySettings(document.getProcess(), dimension.getQueryManager(), dimension.getName(),  function(){
				if (dimension.isHierarchyActive() !== wasHierarchyActive)
				{
					oFF.FieldContainerPresentationHelper.refreshDisplayAttributesForDimension(dimension);
				}
				document.getQueryController().updateQueryResultSet();
			}.bind(this));
		}
	}.bind(this));
	registry.registerAction(oFF.AuGdsQueryBuilderAdvancedActionsRegistrator.ACTION_ADVANCED_HIERARCHY_SETTINGS, action);
};
