oFF.AuGdsQueryBuilderAdvancedActionsRegistrator.prototype.registerDimensionHierarchyLevelAction = function(registry, localizationProvider)
{
	var action = oFF.CMEFactory.createSingleSelectAction();
	action.setNameProvider( function(nameContext){
		return oFF.AuGdsQueryBuilderAdvancedActionsRegistrator.ACTION_SPECIFY_DRILL_LEVEL;
	}.bind(this));
	action.setTextProvider( function(textContext){
		return localizationProvider.getText(oFF.AuGdsQueryBuilderI18n.DRILL_INITIAL_DISPLAY_LEVEL);
	}.bind(this));
	action.setAvailableProvider( function(availableContext){
		var avDim = oFF.AuGdsGenericContextResolveUtil.resolveSingleDimensionNonUdhOnRowsOrColumns(availableContext);
		return oFF.notNull(avDim) && avDim.supportsHierarchy();
	}.bind(this));
	action.setEnabledProvider( function(enabledContext){
		var enDim = oFF.AuGdsGenericContextResolveUtil.resolveSingleDimensionNonUdhOnRowsOrColumns(enabledContext);
		return oFF.notNull(enDim) && enDim.supportsHierarchy() && enDim.isHierarchyActive() && oFF.XStringUtils.isNotNullAndNotEmpty(enDim.getHierarchyName());
	}.bind(this));
	action.setOptionsRetriever( function(retrieverContext){
		var reDim = oFF.AuGdsGenericContextResolveUtil.resolveSingleDimensionNonUdhOnRowsOrColumns(retrieverContext);
		var maximumDrillLevel = 6;
		var options = oFF.XList.create();
		if (oFF.notNull(reDim))
		{
			var hierarchy = reDim.getLeveledHierarchy(reDim.getHierarchyName());
			if (oFF.notNull(hierarchy) && hierarchy.getHierarchyLevels().size() > 0)
			{
				maximumDrillLevel = oFF.XMath.min(hierarchy.getHierarchyLevels().size(), 30);
			}
			else if (reDim.getMaxDrillLevel() > -1)
			{
				maximumDrillLevel = reDim.getMaxDrillLevel() + 1;
			}
			for (var i = -2; i < maximumDrillLevel; i++)
			{
				var option = registry.getOption(oFF.XStringUtils.concatenate3(oFF.AuGdsQueryBuilderAdvancedActionsRegistrator.ACTION_SPECIFY_DRILL_LEVEL, "_", oFF.XInteger.convertToString(i)));
				if (oFF.notNull(option))
				{
					options.add(option);
				}
			}
		}
		return options;
	}.bind(this));
	action.setSelectionRetriever( function(selectionContext){
		var sDrillLevel = -1;
		var sDimension = oFF.AuGdsGenericContextResolveUtil.resolveSingleDimensionNonUdhOnRowsOrColumns(selectionContext);
		if (oFF.notNull(sDimension))
		{
			sDrillLevel = sDimension.getInitialDrillLevel() - (sDimension.isInitialDrillLevelZeroBased() ? 0 : 1);
		}
		return registry.getOption(oFF.XStringUtils.concatenate3(oFF.AuGdsQueryBuilderAdvancedActionsRegistrator.ACTION_SPECIFY_DRILL_LEVEL, "_", oFF.XInteger.convertToString(sDrillLevel)));
	}.bind(this));
	action.setSelectionConsumer( function(selectContext, selectOption){
		var seDim = oFF.AuGdsGenericContextResolveUtil.resolveSingleDimensionNonUdhOnRowsOrColumns(selectContext);
		var document = oFF.AuGdsGenericContextResolveUtil.resolveQueryBuilderDocument(selectContext);
		if (oFF.notNull(seDim) && oFF.notNull(document))
		{
			document.getQueryManager().getConvenienceCommands().removeDrillOperationsByDimensionName(seDim.getName());
			if (document.getQueryManager().getModelCapabilities().supportsUniversalDisplayHierarchies())
			{
				var udhs = document.getQueryManager().getQueryModel().getUniversalDisplayHierarchies();
				var udh = oFF.isNull(udhs) ? null : udhs.getByAxisType(seDim.getAxisType());
				if (oFF.notNull(udh) && udh.isActive())
				{
					document.getQueryManager().getConvenienceCommands().removeDrillOperationsByAxisType(seDim.getAxisType());
					var udhZeroBased = document.getQueryManager().getModelCapabilities().supportsUniversalDisplayHierarchiesZeroBased();
					var levelTrigger = udh.getDimensionNames().getIndex(seDim.getName()) + (udhZeroBased ? 0 : 1);
					if (udh.getInitialDrillLevel() < levelTrigger)
					{
						udh.setInitialDrillLevel(levelTrigger);
					}
				}
			}
			document.getQueryManager().getConvenienceCommands().setDimensionHierarchy(seDim.getName(), seDim.getHierarchyName(), true, oFF.XInteger.convertFromString(selectOption.getName(selectContext)) + (seDim.isInitialDrillLevelZeroBased() ? 0 : 1));
			document.getQueryController().updateQueryResultSet();
		}
	}.bind(this));
	registry.registerAction(oFF.AuGdsQueryBuilderAdvancedActionsRegistrator.ACTION_SPECIFY_DRILL_LEVEL, action);
};
