oFF.AuGdsQueryBuilderAdvancedActionsRegistrator.prototype.registerUdhDrillDimension = function(registry, localizationProvider)
{
	var action = oFF.CMEFactory.createToggleAction();
	action.setNameProvider( function(nameContext){
		return oFF.AuGdsQueryBuilderAdvancedActionsRegistrator.ACTION_SPECIFY_UDH_DRILL_DIMENSION;
	}.bind(this));
	action.setTextProvider( function(textContext){
		var iterationDimensionText = oFF.AuGdsGenericContextResolveUtil.resolveSingleDimension(textContext);
		return oFF.isNull(iterationDimensionText) ? null : oFF.AuGdsQbSubContextFillerUtil.getDimensionText(localizationProvider, iterationDimensionText);
	}.bind(this));
	action.setAvailableProvider( function(availableContext){
		var iterationDimensionAvailable = oFF.AuGdsGenericContextResolveUtil.resolveSingleDimension(availableContext);
		var axisAv = oFF.isNull(iterationDimensionAvailable) ? null : iterationDimensionAvailable.getAxis();
		var queryModelAv = oFF.AuGdsGenericContextResolveUtil.resolveQueryModel(availableContext);
		var udhAv = oFF.isNull(queryModelAv) || !oFF.XCollectionUtils.hasElements(axisAv) ? null : !queryModelAv.getModelCapabilities().supportsUniversalDisplayHierarchies() ? null : queryModelAv.getUniversalDisplayHierarchies().getByAxisType(axisAv.getType());
		return oFF.notNull(udhAv) && udhAv.isActive();
	}.bind(this));
	action.setConsumer( function(triggerContext, bv){
		var iterationDimension = oFF.AuGdsGenericContextResolveUtil.resolveSingleDimension(triggerContext);
		var axisTrigger = oFF.isNull(iterationDimension) ? null : iterationDimension.getAxis();
		var queryModelTrigger = oFF.AuGdsGenericContextResolveUtil.resolveQueryModel(triggerContext);
		var indexOffsetTrigger = oFF.notNull(queryModelTrigger) && queryModelTrigger.getModelCapabilities().supportsUniversalDisplayHierarchiesZeroBased() ? 0 : 1;
		var udhTrigger = oFF.isNull(queryModelTrigger) || !oFF.XCollectionUtils.hasElements(axisTrigger) ? null : !queryModelTrigger.getModelCapabilities().supportsUniversalDisplayHierarchies() ? null : queryModelTrigger.getUniversalDisplayHierarchies().getByAxisType(axisTrigger.getType());
		var document = oFF.AuGdsGenericContextResolveUtil.resolveQueryBuilderDocument(triggerContext);
		if (oFF.notNull(udhTrigger) && oFF.notNull(document) && oFF.notNull(iterationDimension))
		{
			document.getQueryManager().getConvenienceCommands().removeDrillOperationsByAxisType(axisTrigger.getType());
			var levelTrigger = udhTrigger.getDimensionNames().getIndex(iterationDimension.getName());
			udhTrigger.setInitialDrillLevel(levelTrigger + indexOffsetTrigger);
			document.getQueryController().updateQueryResultSet();
		}
	}.bind(this));
	action.setProvider( function(providerContext){
		var iterationDimensionProvider = oFF.AuGdsGenericContextResolveUtil.resolveSingleDimension(providerContext);
		var axisProvider = oFF.isNull(iterationDimensionProvider) ? null : iterationDimensionProvider.getAxis();
		var queryModelProvider = oFF.AuGdsGenericContextResolveUtil.resolveQueryModel(providerContext);
		var indexOffsetProvider = oFF.notNull(queryModelProvider) && queryModelProvider.getModelCapabilities().supportsUniversalDisplayHierarchiesZeroBased() ? 0 : 1;
		var udhProvider = oFF.isNull(queryModelProvider) || !oFF.XCollectionUtils.hasElements(axisProvider) ? null : !queryModelProvider.getModelCapabilities().supportsUniversalDisplayHierarchies() ? null : queryModelProvider.getUniversalDisplayHierarchies().getByAxisType(axisProvider.getType());
		var result = false;
		if (oFF.notNull(udhProvider) && oFF.notNull(iterationDimensionProvider))
		{
			var levelProvider = udhProvider.getDimensionNames().getIndex(iterationDimensionProvider.getName());
			result = levelProvider + indexOffsetProvider === udhProvider.getInitialDrillLevel();
		}
		return result;
	}.bind(this));
	registry.registerAction(oFF.AuGdsQueryBuilderAdvancedActionsRegistrator.ACTION_SPECIFY_UDH_DRILL_DIMENSION, action);
};
