oFF.AuGdsQueryBuilderAdvancedActionsRegistrator.prototype.createHierarchyDialogSimple = function(document, dimension)
{
	var selectHierarchyDlg = oFF.ProgramRunner.createRunner(document.getProcess(), oFF.OuSelectHierarchyDialog.DEFAULT_PROGRAM_NAME);
	var prgArgs = selectHierarchyDlg.getCurrentStartConfig().getArguments();
	var wasHierarchyActive = dimension.isHierarchyActive();
	prgArgs.putXObject(oFF.DfOuDialogProgram.PARAM_QUERY_MANAGER, dimension.getQueryModel().getQueryManager());
	prgArgs.putXObject(oFF.DfOuDialogProgram.PARAM_OK_PROCEDURE, oFF.XProcedureHolder.create( function(){
		if (dimension.isHierarchyActive() !== wasHierarchyActive)
		{
			oFF.FieldContainerPresentationHelper.refreshDisplayAttributesForDimension(dimension);
		}
		if (dimension.getFilter() !== null && dimension.getHierarchyName() !== null && oFF.OlapUiDimensionUtil.isStructureLike(dimension))
		{
			dimension.getFilter().setHierarchyName(dimension.getHierarchyName());
		}
		document.updateQueryResultSet();
	}.bind(this)));
	prgArgs.putXObject(oFF.OuSelectHierarchyDialog.PARAM_DIMENSION, dimension);
	selectHierarchyDlg.runProgram();
};
oFF.AuGdsQueryBuilderAdvancedActionsRegistrator.prototype.createHierarchyCatalogDialog = function(document, dimension, localizationProvider)
{
	var runner = oFF.FilterDialogProgramRunnerFactory.createForHierarchyCatalog(document.getProcess(), document.getQueryManager(), dimension.getName(), localizationProvider.getText(oFF.OuHierarchyDialogI18n.TITLE));
	runner.setObjectArgument(oFF.FilterDialog.PARAM_LISTENER_CLOSE, oFF.FilterDialogLambdaCloseListener.create( function(selection){
		var newValue = oFF.XCollectionUtils.hasElements(selection) ? selection.get(0).getName() : null;
		var wasHierarchyActive = dimension.isHierarchyActive();
		document.getQueryManager().getConvenienceCommands().setDimensionHierarchy(dimension.getName(), newValue, true, dimension.getInitialDrillLevel());
		if (!wasHierarchyActive)
		{
			oFF.FieldContainerPresentationHelper.refreshDisplayAttributesForDimension(dimension);
		}
		document.getQueryController().updateQueryResultSet();
	}.bind(this), null));
	runner.runProgram();
};
oFF.AuGdsQueryBuilderAdvancedActionsRegistrator.prototype.removeDimensionFromAxis = function(cmd, dimension)
{
	if ((dimension.getAxisType() === oFF.AxisType.ROWS || dimension.getAxisType() === oFF.AxisType.COLUMNS) && dimension.supportsAxis(oFF.AxisType.FREE))
	{
		oFF.FieldContainerPresentationHelper.removeDisplayAttributesFromDimension(dimension);
		cmd.moveDimensionToAxis(dimension.getName(), oFF.AxisType.FREE);
		cmd.removeInvalidSortOperations();
	}
};
oFF.AuGdsQueryBuilderAdvancedActionsRegistrator.prototype.hasFilterableTuple = function(context, dimensions, enforceRealTuple)
{
	var result = false;
	var queryModel = oFF.AuGdsGenericContextResolveUtil.resolveQueryModel(context);
	if (oFF.notNull(queryModel))
	{
		var excludeStructureMembers = true;
		var tuples = oFF.AuGdsGenericContextResolveUtil.resolveTuples(context);
		result = oFF.TupleFilterApplicationUtil.hasRelevantTuples(tuples, dimensions, excludeStructureMembers, enforceRealTuple);
	}
	return result;
};
oFF.AuGdsQueryBuilderAdvancedActionsRegistrator.prototype.addTupleFilter = function(context, dimensions, setSign)
{
	var queryModel = oFF.AuGdsGenericContextResolveUtil.resolveQueryModel(context);
	if (oFF.notNull(queryModel))
	{
		var excludeStructureMembers = true;
		var qbDocument = oFF.AuGdsGenericContextResolveUtil.resolveQueryBuilderDocument(context);
		var tuples = oFF.AuGdsGenericContextResolveUtil.resolveTuples(context);
		if (oFF.notNull(qbDocument) && oFF.XCollectionUtils.hasElements(tuples))
		{
			oFF.TupleFilterApplicationUtil.setTupleFilter(queryModel, tuples, dimensions, setSign, true, excludeStructureMembers, false);
			qbDocument.updateQueryResultSet();
		}
	}
};
oFF.AuGdsQueryBuilderAdvancedActionsRegistrator.prototype.addExtendedFilter = function(context, triggerTupleElements, setSign)
{
	var queryModel = oFF.AuGdsGenericContextResolveUtil.resolveQueryModel(context);
	var qbDocument = oFF.AuGdsGenericContextResolveUtil.resolveQueryBuilderDocument(context);
	if (oFF.notNull(queryModel) && oFF.notNull(qbDocument) && oFF.XCollectionUtils.hasElements(triggerTupleElements))
	{
		oFF.ComplexFilterApplicationUtil.setupComplexContextFilter(queryModel, triggerTupleElements, setSign);
		qbDocument.updateQueryResultSet();
	}
};
oFF.AuGdsQueryBuilderAdvancedActionsRegistrator.prototype.exchangeDimensionsBy = function(tDimensions, freeDimension)
{
	var cmd = freeDimension.getConvenienceCommands();
	var inserter = 0;
	var axis = null;
	for (var i = 0; i < tDimensions.size(); i++)
	{
		var dimension = tDimensions.get(i);
		axis = dimension.getAxis();
		inserter = dimension.getIndexOnAxis();
		this.removeDimensionFromAxis(cmd, dimension);
	}
	this.tryMoveDimensionOnAxisTo(freeDimension, axis, inserter);
};
oFF.AuGdsQueryBuilderAdvancedActionsRegistrator.prototype.appendDimensionsAfter = function(tDimensions, freeDimension)
{
	var inserter = 0;
	var axis = null;
	for (var i = 0; i < tDimensions.size(); i++)
	{
		var dimension = tDimensions.get(i);
		if (oFF.isNull(axis))
		{
			axis = dimension.getAxis();
		}
		else if (axis !== dimension.getAxis())
		{
			axis = null;
			break;
		}
		inserter = oFF.XMath.max(dimension.getIndexOnAxis(), inserter);
	}
	this.tryMoveDimensionOnAxisTo(freeDimension, axis, inserter + 1);
};
oFF.AuGdsQueryBuilderAdvancedActionsRegistrator.prototype.prependDimensionsBefore = function(tDimensions, freeDimension)
{
	var inserter = 0;
	var axis = null;
	for (var i = 0; i < tDimensions.size(); i++)
	{
		var dimension = tDimensions.get(i);
		if (oFF.isNull(axis))
		{
			axis = dimension.getAxis();
			inserter = axis.size();
		}
		else if (axis !== dimension.getAxis())
		{
			axis = null;
			break;
		}
		inserter = oFF.XMath.min(dimension.getIndexOnAxis(), inserter);
	}
	this.tryMoveDimensionOnAxisTo(freeDimension, axis, inserter);
};
oFF.AuGdsQueryBuilderAdvancedActionsRegistrator.prototype.tryMoveDimensionOnAxisTo = function(freeDimension, axis, inserter)
{
	var cmd = freeDimension.getConvenienceCommands();
	if (oFF.notNull(axis))
	{
		var axisType = axis.getType();
		if (axisType === oFF.AxisType.ROWS || axisType === oFF.AxisType.COLUMNS)
		{
			cmd.moveDimensionOnAxisTo(freeDimension.getName(), axisType, inserter);
		}
	}
};
oFF.AuGdsQueryBuilderAdvancedActionsRegistrator.prototype.getDimensionText = function(localizationProvider, dimension)
{
	var dimensionText = dimension.getOverrideText();
	if (oFF.isNull(dimensionText))
	{
		dimensionText = oFF.AuGdsQbSubContextFillerUtil.getDimensionText(localizationProvider, dimension);
	}
	if (oFF.isNull(dimensionText))
	{
		dimensionText = dimension.getName();
	}
	return dimensionText;
};
oFF.AuGdsQueryBuilderAdvancedActionsRegistrator.prototype.highlightMemberFilter = function(context, setSign)
{
	var triggerMembers = oFF.AuGdsGenericContextResolveUtil.resolveMembers(context);
	var tableView = oFF.AuGdsGenericContextResolveUtil.resolveTableView(context);
	var tableDefinition = oFF.AuGdsGenericContextResolveUtil.resolveTableDefinition(context);
	if (oFF.notNull(triggerMembers) && oFF.notNull(tableDefinition))
	{
		this.highlightOnSelection(triggerMembers, setSign, tableDefinition, tableView);
	}
};
oFF.AuGdsQueryBuilderAdvancedActionsRegistrator.prototype.clearHighlightingByContext = function(context)
{
	var triggerMembers = oFF.AuGdsGenericContextResolveUtil.resolveMembers(context);
	var tableView = oFF.AuGdsGenericContextResolveUtil.resolveTableView(context);
	var tableDefinition = oFF.AuGdsGenericContextResolveUtil.resolveTableDefinition(context);
	if (oFF.notNull(triggerMembers) && oFF.notNull(tableDefinition))
	{
		this.clearHighlighting(tableDefinition, tableView);
	}
};
oFF.AuGdsQueryBuilderAdvancedActionsRegistrator.prototype.highlightOnSelection = function(triggerMembers, setSign, tableDefiniton, tableView)
{
	tableDefiniton.clearHighlightAreas();
	var color = setSign === oFF.SetSign.INCLUDING ? oFF.AuGdsQueryBuilderAdvancedActionsRegistrator.COLOR_HIGHLIGHT_INCLUDING : oFF.AuGdsQueryBuilderAdvancedActionsRegistrator.COLOR_HIGHLIGHT_EXCLUDING;
	var rowDimMembers = oFF.XHashMapByString.create();
	var colDimMembers = oFF.XHashMapByString.create();
	oFF.XCollectionUtils.forEach(triggerMembers,  function(member){
		var dim = member.getDimension();
		var dimName = dim.getName();
		var axis = dim.getAxisType();
		if (axis === oFF.AxisType.COLUMNS)
		{
			this.complementMemberMap(colDimMembers, dimName, member);
		}
		else if (axis === oFF.AxisType.ROWS)
		{
			this.complementMemberMap(rowDimMembers, dimName, member);
		}
	}.bind(this));
	if (oFF.XCollectionUtils.hasElements(rowDimMembers))
	{
		var rowHighlightArea = tableDefiniton.addNewHighlightArea();
		rowHighlightArea.getColumnsReference().setMatchFullDataSection(true);
		rowHighlightArea.getColumnsReference().setMatchFullHeaderSection(true);
		this.complementHighlightingPaths(rowHighlightArea.getRowsReference(), rowDimMembers);
		rowHighlightArea.setHighlightColor(color);
	}
	if (oFF.XCollectionUtils.hasElements(colDimMembers))
	{
		var colHighlightArea = tableDefiniton.addNewHighlightArea();
		colHighlightArea.getRowsReference().setMatchFullDataSection(true);
		colHighlightArea.getRowsReference().setMatchFullHeaderSection(true);
		this.complementHighlightingPaths(colHighlightArea.getColumnsReference(), colDimMembers);
		colHighlightArea.setHighlightColor(color);
	}
	tableView.applyHighlighting();
};
oFF.AuGdsQueryBuilderAdvancedActionsRegistrator.prototype.complementHighlightingPaths = function(reference, dimMemberMap)
{
	if (oFF.XCollectionUtils.hasElements(dimMemberMap))
	{
		var dims = dimMemberMap.getKeysAsReadOnlyListOfString();
		var axisPath = reference.addNewAxisPath();
		for (var i = 0; i < dims.size(); i++)
		{
			var dimI = dims.get(i);
			var axisPathElement = axisPath.addNewElement();
			axisPathElement.setDimensionName(dimI);
			oFF.XCollectionUtils.forEachString(dimMemberMap.getByKey(dimI),  function(mn){
				axisPathElement.addMemberName(mn);
			}.bind(this));
		}
	}
};
oFF.AuGdsQueryBuilderAdvancedActionsRegistrator.prototype.complementMemberMap = function(dimMembers, dimName, member)
{
	if (!dimMembers.containsKey(dimName))
	{
		dimMembers.put(dimName, oFF.XListOfString.create());
	}
	dimMembers.getByKey(dimName).add(member.getName());
};
oFF.AuGdsQueryBuilderAdvancedActionsRegistrator.prototype.clearHighlighting = function(tableDefiniton, tableView)
{
	tableDefiniton.clearHighlightAreas();
	tableView.applyHighlighting();
};

