oFF.AuGdsQueryBuilderBasicActionsRegistrator.prototype.registerOlapReset = function(registry, localizationProvider)
{
	var action = oFF.CMEFactory.createTriggerAction();
	action.setNameProvider( function(nameContext){
		return oFF.AuGdsQueryBuilderBasicActionsRegistrator.OLAP_RESET_TO_METADATA;
	}.bind(this));
	action.setTextProvider( function(textContext){
		return localizationProvider.getText(oFF.AuGdsQueryBuilderI18n.OLAP_RESET_TO_DEFAULT_METADATA);
	}.bind(this));
	action.setIconProvider( function(iconContext){
		return "reset";
	}.bind(this));
	action.setAvailableProvider( function(availableContext){
		return true;
	}.bind(this));
	action.setEnabledProvider( function(enabledContext){
		return this.isWorkingQueryAvailable(enabledContext);
	}.bind(this));
	action.setTrigger( function(triggerContext){
		this.reset(triggerContext);
	}.bind(this));
	registry.registerAction(oFF.AuGdsQueryBuilderBasicActionsRegistrator.OLAP_RESET_TO_METADATA, action);
};
