oFF.AuGdsQueryBuilderDevActionsRegistrator.prototype.styleHierarchies = function(context)
{
	var document = oFF.AuGdsGenericContextResolveUtil.resolveQueryBuilderDocument(context);
	var tgTd = oFF.AuGdsGenericContextResolveUtil.resolveTableDefinition(context);
	if (oFF.notNull(document) && oFF.notNull(tgTd))
	{
		this.addHierarchyStyle(tgTd, 0, 0, "HIER0_0", "#ff00cc", 5);
		this.addHierarchyStyle(tgTd, 1, 0, "HIER1_0", "#ff00cc", 4);
		this.addHierarchyStyle(tgTd, 2, 0, "HIER2_0", "#ff00cc", 3);
		this.addHierarchyStyle(tgTd, 3, 0, "HIER3_0", "#ff00cc", 2);
		this.addHierarchyStyle(tgTd, 4, 0, "HIER4_0", "#ff00cc", 1);
		this.addHierarchyStyle(tgTd, 0, 1, "HIER0_1", "#00ccff", 5);
		this.addHierarchyStyle(tgTd, 1, 1, "HIER1_1", "#00ccff", 4);
		this.addHierarchyStyle(tgTd, 2, 1, "HIER2_1", "#00ccff", 3);
		this.addHierarchyStyle(tgTd, 3, 1, "HIER3_1", "#00ccff", 2);
		this.addHierarchyStyle(tgTd, 4, 1, "HIER4_1", "#00ccff", 1);
		this.addHierarchyStyle(tgTd, 0, 2, "HIER0_2", "#ccff00", 5);
		this.addHierarchyStyle(tgTd, 1, 2, "HIER1_2", "#ccff00", 4);
		this.addHierarchyStyle(tgTd, 2, 2, "HIER2_2", "#ccff00", 3);
		this.addHierarchyStyle(tgTd, 3, 2, "HIER3_2", "#ccff00", 2);
		this.addHierarchyStyle(tgTd, 4, 2, "HIER4_2", "#ccff00", 1);
		document.updateQueryResultSet();
	}
};
oFF.AuGdsQueryBuilderDevActionsRegistrator.prototype.addHierarchyStyle = function(tableDefinition, hierarchyLevel, axisLevel, name, color, width)
{
	var markupHier = tableDefinition.addNewTableMarkup(name, name);
	var rowsScope1 = markupHier.getRowsScope();
	var axisPathElement1 = rowsScope1.addNewAxisPath().addNewElement();
	axisPathElement1.setExactHierarchyLevel(true);
	axisPathElement1.setAxisLevel(axisLevel);
	axisPathElement1.setHierarchyLevel(hierarchyLevel);
	var scopedStyle1 = tableDefinition.addNewScopedStyle(name, name);
	var headerScope = scopedStyle1.getOrthogonalColumnsScope().addNewHeaderSectionInfo();
	headerScope.setDimensionLevel(true);
	headerScope.setAxisLevel(axisLevel);
	var formattingStyle = tableDefinition.addNewFormattingStyle(name, name);
	var line = formattingStyle.getStyledLineTop();
	line.setColor(color);
	line.setWidth(width);
	scopedStyle1.setStyle(formattingStyle);
	markupHier.addScopedStyle(scopedStyle1);
};
