oFF.AuGdsTile.prototype.setupInternal = function(genesis, text, tooltip, icon, consumer)
{
	this.m_text = text;
	this.m_tooltip = tooltip;
	this.m_icon = icon;
	this.m_consumer = consumer;
	this.setupItem(genesis);
};
oFF.AuGdsTile.prototype.setupItem = function(genesis)
{
	this.m_gridListItem = genesis.newControl(oFF.UiType.GRID_LIST_ITEM);
	this.m_gridListItem.addCssClass("ffGdsLandingPageGridListItem");
	var innerLayout = this.m_gridListItem.setNewContent(oFF.UiType.FLEX_LAYOUT);
	innerLayout.setHeight(oFF.UiCssLength.create("116px"));
	innerLayout.setWidth(oFF.UiCssLength.create("100%"));
	innerLayout.setMargin(oFF.UiCssBoxEdges.create("0px 0px 8px 0px"));
	innerLayout.setDirection(oFF.UiFlexDirection.COLUMN);
	innerLayout.setAlignItems(oFF.UiFlexAlignItems.CENTER);
	innerLayout.setJustifyContent(oFF.UiFlexJustifyContent.CENTER);
	var iconWrapper = genesis.newControl(oFF.UiType.FLEX_LAYOUT);
	iconWrapper.useMaxSpace();
	iconWrapper.setDirection(oFF.UiFlexDirection.COLUMN);
	iconWrapper.setAlignItems(oFF.UiFlexAlignItems.CENTER);
	iconWrapper.setJustifyContent(oFF.UiFlexJustifyContent.CENTER);
	var tileIcon = iconWrapper.addNewItemOfType(oFF.UiType.ICON);
	tileIcon.addCssClass("ffGdsTileIcon");
	tileIcon.setIcon(this.m_icon);
	tileIcon.setEnabled(false);
	tileIcon.useMaxWidth();
	this.m_tile = innerLayout.addNewItemOfType(oFF.UiType.TILE);
	this.m_tile.setContent(iconWrapper);
	this.m_tile.setTooltip(this.m_tooltip);
	this.m_tile.setFrameType(oFF.UiFrameType.ONE_BY_HALF);
	this.m_tile.addCssClass("ffGdsLandingPageTile");
	this.m_tile.registerOnPress(oFF.UiLambdaPressListener.create(this.m_consumer));
	var tileLbl = innerLayout.addNewItemOfType(oFF.UiType.LABEL);
	tileLbl.addCssClass("ffGdsQbLandingPageTileContainerTileLabel");
	tileLbl.setText(this.m_text);
	tileLbl.setFontSize(oFF.UiCssLength.create("0.75rem"));
};
oFF.AuGdsTile.prototype.getItem = function()
{
	return this.m_gridListItem;
};
oFF.AuGdsTile.prototype.setText = function(text)
{
	this.m_text = text;
};
oFF.AuGdsTile.prototype.setIcon = function(icon)
{
	this.m_icon = icon;
};
oFF.AuGdsTile.prototype.setPressConsumer = function(consumer)
{
	this.m_consumer = consumer;
};
oFF.AuGdsTile.prototype.setLoadState = function(loadState)
{
	if (oFF.notNull(this.m_tile))
	{
		this.m_tile.setLoadState(loadState);
	}
};
oFF.AuGdsTile.prototype.setTooltip = function(tooltip)
{
	this.m_tooltip = tooltip;
	if (this.getItem() !== null)
	{
		this.getItem().setTooltip(tooltip);
	}
};
oFF.AuGdsTile.prototype.releaseObject = function()
{
	this.m_gridListItem = oFF.XObjectExt.release(this.m_gridListItem);
	this.m_tile = oFF.XObjectExt.release(this.m_tile);
	oFF.XObject.prototype.releaseObject.call( this );
};

