oFF.AuChartActionsRegistrator.create = function()
{
	return new oFF.AuChartActionsRegistrator();
};
oFF.AuChartActionsRegistrator.prototype.registerActions = function(registry, localizationProvider)
{
	this.registerChartTypeActions(registry, localizationProvider);
	this.registerChartOrientationActions(registry, localizationProvider);
	this.registerChartStacking(registry, localizationProvider);
	var valuePredicate =  function(ctpv, ctsv){
		return oFF.XBooleanValue.create(ctpv === oFF.ChartType.BAR_COLUMN || ctpv === oFF.ChartType.LINE || ctpv === oFF.ChartType.AREA || ctpv === oFF.ChartType.SCATTER_PLOT || ctpv === oFF.ChartType.BUBBLE || ctpv === oFF.ChartType.VARI_WIDE);
	}.bind(this);
	var valueSecondaryPredicate =  function(ctpvs, ctsvs){
		return oFF.XBooleanValue.create(ctpvs === oFF.ChartType.BAR_COLUMN && ctsvs !== oFF.ChartType.NONE || ctpvs === oFF.ChartType.SCATTER_PLOT || ctpvs === oFF.ChartType.BUBBLE || ctpvs === oFF.ChartType.VARI_WIDE);
	}.bind(this);
	var weightPredicate =  function(ctpw, ctsw){
		return oFF.XBooleanValue.create(ctpw === oFF.ChartType.TREE_MAP);
	}.bind(this);
	var sizePredicate =  function(ctps, ctss){
		return oFF.XBooleanValue.create(ctps === oFF.ChartType.BUBBLE || ctps === oFF.ChartType.PIE || ctps === oFF.ChartType.DOUGHNUT);
	}.bind(this);
	var colorPredicate =  function(ctpc, ctsc){
		return oFF.XBooleanValue.create(ctpc === oFF.ChartType.TREE_MAP || ctpc === oFF.ChartType.HEAT_MAP);
	}.bind(this);
	this.registerKeyFigureSelection(registry, localizationProvider, oFF.VisualizationValueType.VALUE, oFF.AuChartActionsRegistrator.SELECTION_VISUALIZATION_VALUE_TYPE_VALUE, oFF.AuChartViewI18n.I18N_CV_CHART_VALUE, valuePredicate);
	this.registerKeyFigureSelection(registry, localizationProvider, oFF.VisualizationValueType.VALUE_B, oFF.AuChartActionsRegistrator.SELECTION_VISUALIZATION_VALUE_TYPE_VALUE_SECONDARY, oFF.AuChartViewI18n.I18N_CV_CHART_VALUE_SECONDARY, valueSecondaryPredicate);
	this.registerKeyFigureSelection(registry, localizationProvider, oFF.VisualizationValueType.WEIGHT, oFF.AuChartActionsRegistrator.SELECTION_VISUALIZATION_VALUE_TYPE_WEIGHT, oFF.AuChartViewI18n.I18N_CV_CHART_WEIGHT, weightPredicate);
	this.registerKeyFigureSelection(registry, localizationProvider, oFF.VisualizationValueType.SIZE, oFF.AuChartActionsRegistrator.SELECTION_VISUALIZATION_VALUE_TYPE_SIZE, oFF.AuChartViewI18n.I18N_CV_CHART_SIZE, sizePredicate);
	this.registerKeyFigureSelection(registry, localizationProvider, oFF.VisualizationValueType.COLOR, oFF.AuChartActionsRegistrator.SELECTION_VISUALIZATION_VALUE_TYPE_COLOR, oFF.AuChartViewI18n.I18N_CV_CHART_COLOR, colorPredicate);
};
oFF.AuChartActionsRegistrator.prototype.registerKeyFigureSelection = function(registry, localizationProvider, valueType, menuName, localizationKey, availabilityPredicate)
{
	var action = oFF.CMEFactory.createMultiSelectAction();
	action.setNameProvider( function(nameContext){
		return menuName;
	}.bind(this));
	action.setTextProvider( function(textContext){
		return localizationProvider.getText(localizationKey);
	}.bind(this));
	action.setAvailableProvider( function(availabilityContext){
		var avChartDefinition = oFF.AuChartContextUtil.resolveChartDefinition(availabilityContext);
		var avChartSetting = oFF.isNull(avChartDefinition) ? null : avChartDefinition.getChartSetting();
		return oFF.notNull(avChartSetting) && availabilityPredicate(avChartSetting.getChartType(), avChartSetting.getChartType2()).getBoolean();
	}.bind(this));
	action.setSelectionRetriever( function(retrieverContext){
		var retrieverChartDefinition = oFF.AuChartContextUtil.resolveChartDefinition(retrieverContext);
		var selectedOptions = oFF.XList.create();
		if (oFF.notNull(retrieverChartDefinition))
		{
			selectedOptions = oFF.XStream.of(retrieverChartDefinition.getChartSetting().getTypedValueSelectionsForType(valueType)).map( function(retrieverKfs){
				var retrieverOption = oFF.CMEFactory.createSelectionOption();
				retrieverOption.setNameProvider( function(ron){
					return retrieverKfs.getDimensionMember().getName();
				}.bind(this));
				retrieverOption.setTextProvider( function(rot){
					return retrieverKfs.getDimensionMember().getText();
				}.bind(this));
				retrieverOption.setCustomObject(retrieverKfs.getDimensionMember());
				return retrieverOption;
			}.bind(this)).collect(oFF.XStreamCollector.toList());
		}
		return selectedOptions;
	}.bind(this));
	action.setSelectionConsumer( function(consumerContext, consumerOption, consumerValue){
		var consumerChartDefinition = oFF.AuChartContextUtil.resolveChartDefinition(consumerContext);
		var consumerChartView = oFF.AuChartContextUtil.resolveChartView(consumerContext);
		if (oFF.notNull(consumerChartView) && oFF.notNull(consumerChartDefinition))
		{
			var consumerChartSetting = consumerChartDefinition.getChartSetting();
			var consumerChartType = consumerChartSetting.getChartType();
			if (consumerChartType === oFF.ChartType.BUBBLE || consumerChartType === oFF.ChartType.PACKED_BUBBLE || consumerChartType === oFF.ChartType.PIE || consumerChartType === oFF.ChartType.HEAT_MAP || consumerChartType === oFF.ChartType.TREE_MAP || consumerChartType === oFF.ChartType.SCATTER_PLOT || consumerChartType === oFF.ChartType.VARI_WIDE && valueType === oFF.VisualizationValueType.VALUE_B)
			{
				consumerChartSetting.clearTypedValueSelectionsForType(valueType);
			}
			consumerChartSetting.addTypedValueSelection(valueType, oFF.QKeyFigureSelection.create(consumerChartDefinition.getContext(), consumerOption.getCustomObject(), consumerChartDefinition, valueType));
			consumerChartView.updateChart();
		}
	}.bind(this));
	action.setOptionsRetriever( function(optionsContext){
		var optionsChartConfiguration = oFF.AuChartContextUtil.resolveChartDefinition(optionsContext);
		var availableOptions = oFF.XList.create();
		if (oFF.notNull(optionsChartConfiguration))
		{
			var keyFigureDimension = optionsChartConfiguration.getKeyFigureDimension();
			var structureMembers = keyFigureDimension.getAllStructureMembers();
			availableOptions = oFF.XStream.of(structureMembers).map( function(optionsKfs){
				var availableOption = oFF.CMEFactory.createSelectionOption();
				availableOption.setNameProvider( function(aon){
					return optionsKfs.getName();
				}.bind(this));
				availableOption.setTextProvider( function(aot){
					return optionsKfs.getText();
				}.bind(this));
				availableOption.setCustomObject(optionsKfs);
				return availableOption;
			}.bind(this)).collect(oFF.XStreamCollector.toList());
		}
		return availableOptions;
	}.bind(this));
	registry.registerAction(menuName, action);
};
