	var chartOrientationVertical = oFF.CMEFactory.createSelectionOption();
	chartOrientationVertical.setNameProvider( function(verticalName){
		return oFF.AuChartActionsRegistrator.SELECTION_CHART_ORIENTATION_VERTICAL;
	}.bind(this));
	chartOrientationVertical.setTextProvider( function(verticalText){
		return localizationProvider.getText(oFF.AuChartViewI18n.I18N_CV_CHART_ORIENTATION_VERTICAL);
	}.bind(this));
	chartOrientationVertical.setCustomObject(oFF.ChartOrientation.VERTICAL);
	registry.registerOption(oFF.AuChartActionsRegistrator.SELECTION_CHART_ORIENTATION_VERTICAL, chartOrientationVertical);
	var primarySelectOptions = oFF.XList.create();
	primarySelectOptions.add(chartOrientationHorizontal);
	primarySelectOptions.add(chartOrientationVertical);
	var chartOrientation = oFF.CMEFactory.createSingleSelectAction();
	chartOrientation.setNameProvider( function(chartOrientationName){
		return oFF.AuChartActionsRegistrator.SELECTION_CHART_ORIENTATION;
	}.bind(this));
	chartOrientation.setTextProvider( function(chartOrientationText){
		return localizationProvider.getText(oFF.AuChartViewI18n.I18N_CV_CHART_ORIENTATION);
	}.bind(this));
	chartOrientation.setOptionsRetriever( function(coo){
		return primarySelectOptions;
	}.bind(this));
	chartOrientation.setSelectionRetriever( function(cosr){
		var chartDefinitionCOSR = oFF.AuChartContextUtil.resolveChartDefinition(cosr);
		var cosrResult = chartOrientationHorizontal;
		if (oFF.notNull(chartDefinitionCOSR))
		{
			cosrResult = oFF.XStream.of(primarySelectOptions).find( function(pspo){
				return pspo.getCustomObject() === chartDefinitionCOSR.getChartSetting().getChartOrientation();
			}.bind(this)).orElse(chartOrientationHorizontal);
		}
		return cosrResult;
	}.bind(this));
	chartOrientation.setSelectionConsumer( function(cosc, coso){
		var chartDefinitionCOSC = oFF.AuChartContextUtil.resolveChartDefinition(cosc);
		var chartViewCOSC = oFF.AuChartContextUtil.resolveChartView(cosc);
		if (oFF.notNull(chartDefinitionCOSC) && oFF.notNull(chartViewCOSC))
		{
			chartDefinitionCOSC.getChartSetting().setChartOrientation(coso.getCustomObject());
			chartViewCOSC.updateChart();
		}
	}.bind(this));
	registry.registerAction(oFF.AuChartActionsRegistrator.SELECTION_CHART_ORIENTATION, chartOrientation);
