oFF.AuGdsDocumentsIdsAddListener.prototype.m_documentId = null;
oFF.AuGdsDocumentsIdsAddListener.prototype.m_commentingController = null;
oFF.AuGdsDocumentsIdsAddListener.prototype.m_application = null;
oFF.AuGdsDocumentsIdsAddListener.prototype.releaseObject = function()
{
	oFF.XObject.prototype.releaseObject.call( this );
	this.m_application = null;
	this.m_commentingController = oFF.XObjectExt.release(this.m_commentingController);
	this.m_documentId = null;
	this.m_columnsTupleIndex = -1;
	this.m_documentsService = null;
	this.m_tableView = null;
};
oFF.AuGdsDocumentsIdsAddListener.prototype.onCommandProcessed = function(extPlanningCommandResult)
{
	if (extPlanningCommandResult.isValid())
	{
		this.m_tableView.refreshView();
	}
	else
	{
		this.m_tableView.getMessageCenter().showErrorToast(extPlanningCommandResult.getFirstError().getText());
	}
	this.m_commentingController.close();
};
oFF.AuGdsDocumentsIdsAddListener.prototype.onQueryExecuted = function(extResult, resultSetContainer, customIdentifier)
{
	if (extResult.isValid())
	{
		var resultSet = resultSetContainer.getCursorResultSet();
		if (oFF.notNull(resultSet) && resultSet.getState().hasData())
		{
			this.m_documentId = resultSet.getDataCell(this.m_columnsTupleIndex, 0).getDocumentId();
			if (oFF.notNull(this.m_documentId))
			{
				this.openCommentingDialog();
			}
			else
			{
				this.m_tableView.getMessageCenter().showErrorToast("Commenting not possible for this cell");
			}
		}
	}
	else
	{
		this.m_tableView.getMessageCenter().showErrorToast(extResult.getFirstError().getText());
	}
};
oFF.AuGdsDocumentsIdsAddListener.prototype.openCommentingDialog = function()
{
	var displayManager = oFF.OlapUiDisplayFactory.createFactoryForDialog(this.m_application.getProcess().getUiManager());
	var context = oFF.OlapUiContext.createContext(this.m_application.getProcess().getUiManager(), displayManager);
	this.m_commentingController = context.getCommentingController();
	var documentContent = this.m_documentsService.getContentForFile(this.m_documentId);
	var documentContentString = "";
	if (oFF.notNull(documentContent))
	{
		documentContentString = documentContent.getString();
	}
	this.m_commentingController.openCommentingDialog("Edit comment:", documentContentString, false, this);
};
oFF.AuGdsDocumentsIdsAddListener.prototype.onCommentingOk = function(hasChanged, text)
{
	if (hasChanged)
	{
		this.m_documentsService.addToPutList(this.m_documentId, oFF.XContent.createStringContent(oFF.ContentType.TEXT_PLAIN, text));
		this.m_documentsService.addToFetchList(this.m_documentId);
		this.m_documentsService.performRequests(oFF.SyncType.NON_BLOCKING, this, null);
	}
	else if (oFF.XStringUtils.isNullOrEmpty(text))
	{
		this.resetCommentId();
	}
};
oFF.AuGdsDocumentsIdsAddListener.prototype.onCommentingCancel = function()
{
	this.resetCommentId();
};
oFF.AuGdsDocumentsIdsAddListener.prototype.resetCommentId = function()
{
	var dataAreaCommand = this.m_tableView.getQueryManager().createDataAreaCommandDocReset();
	dataAreaCommand.processCommand(oFF.SyncType.NON_BLOCKING, this, null);
};
oFF.AuGdsDocumentsIdsAddListener.prototype.onProviderFetch = function(extResult, documentsServiceResponse, customIdentifier)
{
	if (extResult.isValid())
	{
		var dataAreaCommand = this.m_tableView.getQueryManager().createDataAreaCommandDocSave();
		dataAreaCommand.processCommand(oFF.SyncType.NON_BLOCKING, this, null);
	}
	else
	{
		this.m_tableView.getMessageCenter().showErrorToast(extResult.getFirstError().getText());
	}
};

