oFF.AuGdsQbQueryController.prototype.setInitialColumnWindowSize = function(initialColumnWindowSize)
{
	this.m_initialColumnWindowSize = initialColumnWindowSize;
};
oFF.AuGdsQbQueryController.prototype.updateVariable = function(varName, valueList)
{
	if (oFF.isNull(varName))
	{
		return false;
	}
	var variableIsSet = false;
	var variable = this.getQueryManager().getVariable(varName);
	if (oFF.notNull(variable))
	{
		variable.clear();
		if (oFF.notNull(valueList) && valueList.size() > 0)
		{
			var variableType = variable.getVariableType();
			if (variableType.isTypeOf(oFF.VariableType.DIMENSION_MEMBER_VARIABLE))
			{
				var dimVar = variable;
				var memberFilter = dimVar.getMemberFilter();
				oFF.XCollectionUtils.forEachString(valueList,  function(val){
					var filterEle = memberFilter.addNewCartesianElement();
					filterEle.setComparisonOperator(oFF.ComparisonOperator.EQUAL);
					filterEle.setSetSign(oFF.SetSign.INCLUDING);
					filterEle.getLow().setString(val);
				}.bind(this));
				variableIsSet = true;
			}
		}
	}
	return variableIsSet;
};
oFF.AuGdsQbQueryController.prototype.submitManualVariables = function()
{
	this.setBusyState(true);
	this.getQueryManager().submitVariables(this.getApplication().getDefaultSyncType(), oFF.VariableProcessorCallbackLambda.createSingleUse( function(extResult){
		this.updateQueryResultSet();
	}.bind(this)), null);
};
oFF.AuGdsQbQueryController.prototype.setFilter = function(dimName, valueList, useExclude)
{
	if (this.updateFilter(dimName, valueList, useExclude))
	{
		this.updateQueryResultSet();
	}
};
oFF.AuGdsQbQueryController.prototype.setFilters = function(filters)
{
	if (oFF.isNull(filters) || filters.isEmpty())
	{
		return;
	}
	var queryManager = this.getQueryManager();
	if (oFF.isNull(queryManager))
	{
		this.m_initialFilters = filters;
	}
	else
	{
		var updatedFilters = oFF.XCollectionUtils.filter(filters,  function(f){
			return this.updateFilter(f.getDimensionId(), f.getMemberIds(), f.shouldUseExclude());
		}.bind(this));
		if (updatedFilters.size() > 0)
		{
			this.updateQueryResultSet();
		}
	}
};
oFF.AuGdsQbQueryController.prototype.updateFilter = function(dimName, valueList, useExclude)
{
	if (oFF.isNull(dimName))
	{
		return false;
	}
	var dimension = this.getQueryManager().getQueryModel().getDimensionByName(dimName);
	var filterIsSet = false;
	if (oFF.notNull(dimension))
	{
		this.getQueryManager().getConvenienceCommands().clearFiltersByDimension(dimension);
		if (oFF.notNull(valueList) && valueList.size() > 0)
		{
			oFF.XCollectionUtils.forEachString(valueList,  function(val){
				var filterOp = this.getQueryManager().getQueryModel().getFilter().getDynamicFilter().addSingleMemberFilterByDimension(dimension, val, oFF.ComparisonOperator.EQUAL);
				filterOp.setSetSign(useExclude ? oFF.SetSign.EXCLUDING : oFF.SetSign.INCLUDING);
			}.bind(this));
			filterIsSet = true;
		}
	}
	return filterIsSet;
};
oFF.AuGdsQbQueryController.prototype.setDataSourceText = function(dataSourceText)
{
	if (oFF.isNull(dataSourceText))
	{
		return;
	}
	var queryManager = this.getQueryManager();
	if (oFF.isNull(queryManager))
	{
		this.m_initialDataSourceText = dataSourceText;
	}
	else
	{
		var queryModel = this.getQueryManager().getQueryModel();
		queryModel.setText(dataSourceText);
	}
};
oFF.AuGdsQbQueryController.prototype.onQueryManagerCreated = function(extResult, queryManager, customIdentifier)
{
	if (extResult.hasErrors())
	{
		this.m_messageManager.addAllMessages(extResult);
		this.notifyCriticalError(oFF.AuGdsQbQueryControllerCriticalErrorType.QUERY_MANAGER_CREATION_FAILED);
		this.setStatus(oFF.AuGdsQbQueryControllerStatus.SETUP_ERROR, extResult.getSummary());
		if (oFF.UiCredentialsProviderHelper.hasAuthenticationFailed(this.m_messageManager.getMessages()))
		{
			this.notifySetupInterrupt(oFF.AuGdsQbQueryControllerContants.GDF_QB_QC_AUTHENTICATION_FAILED);
		}
		else
		{
			this.notifySetupInterrupt(oFF.AuGdsQbQueryControllerContants.GDF_QB_QC_COULD_NOT_OPEN_QUERY);
		}
		return;
	}
	if (extResult.hasWarnings())
	{
		this.m_messageManager.addAllMessages(extResult);
		this.notifyMessage(oFF.UiMessageType.WARNING, oFF.MessageUtil.getMessageStringFromList(this.getMessageManager(), "Query Opened with warnings:"));
	}
	var newQueryManager = extResult.getData();
	this.checkConsistencyForNewQueryManager(newQueryManager);
	this.setupNewQueryManager(newQueryManager, false);
};
oFF.AuGdsQbQueryController.prototype.checkConsistencyForNewQueryManager = function(newQueryManager)
{
	if (oFF.notNull(newQueryManager) && newQueryManager.getQueryModel() !== null && newQueryManager.getQueryModel().getMeasureDimension() === null)
	{
		var message = this.getLocalization().getText(oFF.AuGdsQueryBuilderI18n.MSG_QUERY_DOES_NOT_CONTAIN_MEASURES);
		this.notifyMessage(oFF.UiMessageType.WARNING, message);
	}
};
oFF.AuGdsQbQueryController.prototype.onQueryExecuted = function(extResult, resultSetContainer, customIdentifier)
{
	this.setBusyState(false);
	this.m_listener.onBackendRequestFinished();
	this.m_activeResultSetContainer = null;
	if (extResult.hasErrors())
	{
		if (!this.m_canceledUpdate)
		{
			oFF.XLogger.println(oFF.XStringUtils.concatenate2("ext result has errors: ", extResult.getSummary()));
			var detailedMessages = oFF.MessageUtil.getMessageStringFromList(extResult, this.getLocalization().getText(oFF.AuGdsQueryBuilderI18n.MSG_QUERY_EXECUTED_WITH_ERRORS));
			this.notifyResultEmpty();
			this.setStatus(oFF.AuGdsQbQueryControllerStatus.SYNC_ERROR, detailedMessages);
		}
	}
	else
	{
		if (resultSetContainer.getSyncState().isInSync() && !resultSetContainer.hasErrors())
		{
			var resultSet = resultSetContainer.getCursorResultSet();
			var state = resultSet.getState();
			if (state.hasData())
			{
				if (!this.hasPendingResultSetUpdates())
				{
					this.updateDocumentStoreService(resultSet);
				}
			}
			else
			{
				if (!this.m_canceledUpdate)
				{
					this.notifyResultEmpty();
					if (state === oFF.ResultSetState.INVALID_VARIABLE_VALUES)
					{
						this.notifyMessage(oFF.UiMessageType.ERROR, oFF.AuGdsQueryResultMessageMapper.getMessageStringRsState(this.getLocalization(), state));
					}
				}
			}
		}
		else
		{
			oFF.XLogger.println("Result set container is not in sync");
			this.notifyResultEmpty();
		}
		if (this.getQueryManager().getConvenienceCommands().getOffsetRows() === 0)
		{
			var customIdentifierStrVal = customIdentifier;
			if (oFF.isNull(customIdentifierStrVal) || !oFF.XString.isEqual(customIdentifierStrVal.getString(), oFF.AuGdsQbQueryController.UNDO_REDO_ACTION_ID))
			{
				this.getApplication().getProcess().notifyInterruptStep(oFF.XInterruptStep.create(), false);
			}
			this.notifyQueryStateChanged();
		}
		this.setStatus(oFF.AuGdsQbQueryControllerStatus.IN_SYNC, null);
	}
	this.m_pendingUpdates = false;
	this.m_canceledUpdate = false;
};
oFF.AuGdsQbQueryController.prototype.onBeforeQueryExecuted = function(customIdentifier)
{
	this.setBusyState(true);
	this.setStatus(oFF.AuGdsQbQueryControllerStatus.SYNC_IN_PROGRESS, null);
	this.m_listener.onBackendRequestStarted();
	var queryModel = this.getQueryModel();
	var visualizationManager = oFF.isNull(queryModel) ? null : queryModel.getVisualizationManager();
	if (oFF.notNull(visualizationManager) && !visualizationManager.areAllVisualizationContainersInSync())
	{
		this.resetPaging();
	}
	this.m_activeResultSetContainer = this.getQueryManager().getActiveResultSetContainer();
};
oFF.AuGdsQbQueryController.prototype.onOk = function()
{
	this.loadSfx();
	if (!this.m_isQueryManagerSetupFinished)
	{
		this.loadRepoState();
		this.finalizeQueryManagerSetup();
	}
	else
	{
		this.updateQueryResultSet();
	}
};
oFF.AuGdsQbQueryController.prototype.onCancel = function()
{
	if (!this.m_isQueryManagerSetupFinished)
	{
		this.notifySetupInterrupt(oFF.AuGdsQbQueryControllerContants.GDF_QB_QC_INITIAL_VARIABLES_NOT_SET);
		this.setStatus(oFF.AuGdsQbQueryControllerStatus.SETUP_ERROR, null);
	}
};
oFF.AuGdsQbQueryController.prototype.onReinit = function(success, extResult) {};
oFF.AuGdsQbQueryController.prototype.onCancelReinit = function()
{
	this.m_variableDialog.close();
	this.onCancel();
};
oFF.AuGdsQbQueryController.prototype.onBeforeSubmit = function(values, valuesJson)
{
	oFF.VdImportExport.setValuesToProcessor(this.m_queryManager, values);
	this.m_variableDialog.close();
	if (!this.m_isQueryManagerSetupFinished)
	{
		this.finalizeQueryManagerSetup();
	}
	else
	{
		this.updateQueryResultSet();
	}
};
oFF.AuGdsQbQueryController.prototype.onAfterSubmit = function(success, extResult, values, valuesJson) {};
oFF.AuGdsQbQueryController.prototype.getLocalization = function()
{
	return oFF.UiLocalizationCenter.getCenter();
};
oFF.AuGdsQbQueryController.prototype.onServiceCreation = function(extResult, service, customIdentifier)
{
	if (extResult.isValid())
	{
		this.getQueryModel().setPlanningMode(oFF.PlanningMode.FOR_PRIVATE_VERSIONS_ONLY);
	}
	this.continueQueryManagerFinalization();
};

oFF.AuGdsQbConditionalFormattingFilterItemTokenUpdater = function() {};
oFF.AuGdsQbConditionalFormattingFilterItemTokenUpdater.prototype = new oFF.XObject();
oFF.AuGdsQbConditionalFormattingFilterItemTokenUpdater.prototype._ff_c = "AuGdsQbConditionalFormattingFilterItemTokenUpdater";

oFF.AuGdsQbConditionalFormattingFilterItemTokenUpdater.create = function(filterToken)
{
	var updater = new oFF.AuGdsQbConditionalFormattingFilterItemTokenUpdater();
	updater.m_filterToken = filterToken;
	return updater;
};
oFF.AuGdsQbConditionalFormattingFilterItemTokenUpdater.prototype.m_filterToken = null;
oFF.AuGdsQbConditionalFormattingFilterItemTokenUpdater.prototype.updateFilterItemMemberText = function()
{
	var dimension = this.m_filterToken.getFilterItem().getDimension();
	dimension.processValueHelp(oFF.SyncType.NON_BLOCKING, this, null);
};
oFF.AuGdsQbConditionalFormattingFilterItemTokenUpdater.prototype.onValuehelpExecuted = function(extResult, resultSetContainer, customIdentifier)
{
	if (extResult.hasErrors())
	{
		oFF.XException.createRuntimeException(oFF.XStringUtils.concatenate3("Error getting descriptions for dimension members for dimension named '", this.m_filterToken.getFilterItem().getDimension().getName(), "'"));
	}
	var nodes = extResult.getData();
	var listDisplayTexts = oFF.XList.create();
	oFF.XStream.of(this.m_filterToken.getFilterItem().getValues()).forEach( function(value){
		var nodeMatch = oFF.XStream.of(nodes).find( function(node){
			return node.getDimensionMember().getValue().isEqualTo(value);
		}.bind(this));
		if (nodeMatch.isPresent())
		{
			var dimensionMemberText = nodeMatch.get().getDimensionMember().getText();
			if (oFF.notNull(dimensionMemberText) && oFF.XString.size(dimensionMemberText) > 0)
			{
				listDisplayTexts.add(oFF.XStringValue.create(dimensionMemberText));
			}
			else
			{
				listDisplayTexts.add(oFF.XStringValue.create(nodeMatch.get().getDimensionMember().getName()));
			}
		}
	}.bind(this));
	var displayTokenDesc = this.constructText(listDisplayTexts);
	this.m_filterToken.setText(displayTokenDesc);
};
oFF.AuGdsQbConditionalFormattingFilterItemTokenUpdater.prototype.constructText = function(listDisplayTexts)
{
	var fullText = "";
	for (var i = 0; i < listDisplayTexts.size() - 1; )
	{
		var displayText = listDisplayTexts.get(i);
		if (listDisplayTexts.size() === 1)
		{
			continue;
		}
		fullText = oFF.XStringUtils.concatenate3(fullText, displayText.getStringRepresentation(), ", ");
		listDisplayTexts.removeElement(displayText);
	}
	if (listDisplayTexts.size() > 0)
	{
		fullText = oFF.XStringUtils.concatenate2(fullText, listDisplayTexts.get(0).getStringRepresentation());
	}
	return fullText;
};

