oFF.AuGdsDimensionMemberDescriptionRetriever = function() {};
oFF.AuGdsDimensionMemberDescriptionRetriever.prototype = new oFF.XObject();
oFF.AuGdsDimensionMemberDescriptionRetriever.prototype._ff_c = "AuGdsDimensionMemberDescriptionRetriever";

oFF.AuGdsDimensionMemberDescriptionRetriever.create = function(dimension, descriptionCache)
{
	var instance = new oFF.AuGdsDimensionMemberDescriptionRetriever();
	instance.m_dimension = oFF.XObjectExt.assertNotNull(dimension);
	instance.m_descriptionCache = oFF.XObjectExt.assertNotNull(descriptionCache);
	return instance;
};
oFF.AuGdsDimensionMemberDescriptionRetriever.prototype.m_dimension = null;
oFF.AuGdsDimensionMemberDescriptionRetriever.prototype.m_mainPromise = null;
oFF.AuGdsDimensionMemberDescriptionRetriever.prototype.m_linkedResolve = null;
oFF.AuGdsDimensionMemberDescriptionRetriever.prototype.m_descriptionCache = null;
oFF.AuGdsDimensionMemberDescriptionRetriever.prototype.releaseObject = function()
{
	this.m_mainPromise = null;
	this.m_linkedResolve = null;
	this.m_dimension = null;
	this.m_descriptionCache = null;
	oFF.XObject.prototype.releaseObject.call( this );
};
oFF.AuGdsDimensionMemberDescriptionRetriever.prototype.retrieve = function(dimensionMembers)
{
	oFF.XObjectExt.assertNotNull(dimensionMembers);
	this.m_dimension.clearSelectorFilter();
	for (var k = 0; k < dimensionMembers.size(); k++)
	{
		this.m_dimension.addSelectorFilterForKey(dimensionMembers.get(k).getKey(), oFF.ComparisonOperator.EQUAL);
	}
	this.m_mainPromise = oFF.XPromise.create( function(resolve, reject){
		this.m_linkedResolve = resolve;
	}.bind(this));
	this.m_dimension.processValueHelp(oFF.SyncType.NON_BLOCKING, this, null);
	return this.m_mainPromise;
};
oFF.AuGdsDimensionMemberDescriptionRetriever.prototype.onValuehelpExecuted = function(extResult, resultSetContainer, customIdentifier)
{
	if (extResult.hasErrors())
	{
		oFF.XException.createRuntimeException(oFF.XStringUtils.concatenate3("Error getting descriptions for dimension members for dimension named '", this.m_dimension.getName(), "'"));
	}
	var nodes = extResult.getData();
	var result = oFF.XHashMapByString.create();
	for (var j = 0; j < nodes.size(); j++)
	{
		var dimensionMemberValueExtractor = oFF.AuGdsDimensionMemberValueExtractor.create(nodes.get(j).getDimensionMember());
		var key = dimensionMemberValueExtractor.getKey();
		var memberDetails = oFF.AuGdsDimensionMemberDetails.create(key, dimensionMemberValueExtractor.getDisplayId(), dimensionMemberValueExtractor.getDescription());
		memberDetails.setDimension(this.m_dimension);
		result.put(key, memberDetails);
		this.m_descriptionCache.addDescription(memberDetails.getDimension().getName(), memberDetails.getKey(), memberDetails.getDescription());
	}
	this.m_linkedResolve(result);
};
oFF.AuGdsDimensionMemberDescriptionRetriever.prototype.setHierarchySelector = function(hierarchyName)
{
	if (oFF.notNull(hierarchyName))
	{
		this.m_dimension.setSelectorHierarchyName(hierarchyName);
	}
};

