{
	return this.m_selectedDimensions;
};
oFF.AuGdsFilterLineDimensionFilterManager.prototype.updateFilterLine = function()
{
	this.m_selectedDimensions.clear();
	var filter = this.m_queryManager.getQueryModel().getFilter();
	var cartesianProduct = filter.getDynamicFilter().getCartesianProduct();
	if (oFF.notNull(cartesianProduct))
	{
		var cartesianProductIter = oFF.AuGdsIQFilterCartesianProductFiltered.create(cartesianProduct).getIterator();
		while (cartesianProductIter.hasNext())
		{
			var fliBuilder = oFF.AuGdsFilterLineItemBuilder.create();
			fliBuilder.setManager(this);
			var cartesianChild = cartesianProductIter.next();
			var cartesianChildDimension = cartesianChild.getDimension();
			fliBuilder.setDimension(cartesianChildDimension);
			var displayTypeRetriever = oFF.AuGdsFilterLineDimensionDisplayTypeRetriever.create(cartesianChildDimension, this.m_filterLineConfig);
			fliBuilder.setDisplayType(displayTypeRetriever.getDisplayType(true).get());
			var readModeRetriever = oFF.AuGdsFilterLineDimensionReadModeRetriever.create(cartesianChildDimension, this.m_filterLineConfig);
			fliBuilder.setReadMode(readModeRetriever.getReadMode(true).get());
			for (var j = 0; j < cartesianChild.size(); j++)
			{
				var detailsGenerator = oFF.AuGdsDimensionMemberDetailsGenerator.create(cartesianChild, cartesianChild.getOp(j), cartesianChildDimension);
				var detailsLow = detailsGenerator.generateFromLow();
				var detailsHigh = detailsGenerator.generateFromHigh();
				var filterOperation = cartesianChild.getOp(j);
				var targetFilterType = filterOperation.getOlapComponentType() === oFF.FilterComponentType.DATE_RANGE_OPERATION ? oFF.AuGdsFilterLineItemType.DATE_DIMENSION : oFF.AuGdsFilterLineItemType.DIMENSION;
				var presentationType = cartesianChild.getField().getPresentationType();
				var member = oFF.AuGdsFilterLineItemMember.create(filterOperation.getSetSign(), filterOperation.getComparisonOperator(), detailsLow, detailsHigh, targetFilterType, null, presentationType);
				fliBuilder.addMember(member);
			}
			fliBuilder.setFilterType(this.getStoredFilterTypeForFilterDialog(cartesianChildDimension));
			var fli = fliBuilder.build();
			var fliUiElement = oFF.AuGdsFilterLine.createFilterLineItemUiElement(this.m_genesis, this.m_grid, fli, this.createDeleteButtonCallbackProcedureForDimension(cartesianProduct, cartesianChild), this.m_updateCommand);
			this.m_grid.addItem(fliUiElement);
			this.m_selectedDimensions.add(cartesianChildDimension.getName());
			var hierarchyName = cartesianChildDimension.supportsHierarchy() && cartesianChild.getHierarchyName() !== null && !oFF.XString.isEqual(cartesianChildDimension.getHierarchyName(), cartesianChild.getHierarchyName()) ? cartesianChild.getHierarchyName() : null;
			this.m_descriptionUpdater.update(fli, fliUiElement, hierarchyName);
			var filterType = this.determineFilterType(fli.getMembers());
			if (filterType.isPresent())
			{
				this.storeTypeOfFilterInPersistedConfiguration(cartesianChildDimension, filterType.get());
			}
		}
	}
};
oFF.AuGdsFilterLineDimensionFilterManager.prototype.determineFilterType = function(members)
{
	var result = oFF.XOptional.empty();
	for (var i = 0; i < members.size(); i++)
	{
		if (members.get(i).isRangeFilter())
		{
			result = oFF.XOptional.of(oFF.FilterDialogViewType.RANGE);
		}
		else
		{
			result = oFF.XOptional.of(oFF.FilterDialogViewType.LIST);
		}
	}
	return result;
};
oFF.AuGdsFilterLineDimensionFilterManager.prototype.storeTypeOfFilterInPersistedConfiguration = function(dimension, filterType)
{
	this.m_filterLineConfig.setFilterTypeForDimension(dimension.getName(), filterType.getName());
};
oFF.AuGdsFilterLineDimensionFilterManager.prototype.openFilterDialogWithoutContext = function(dimension)
{
	this.openFilterDialog(null, null, dimension);
};
oFF.AuGdsFilterLineDimensionFilterManager.prototype.openFilterDialog = function(context, filterLineItem, dimension)
{
	oFF.XObjectExt.assertNotNullExt(dimension, "A valid dimension must be specified, current value is null!");
	if (oFF.notNull(context) && oFF.notNull(filterLineItem) && dimension.isCompound() && filterLineItem.containsNonCompoundField())
	{
		oFF.AuGdsFilterLinePopover.create(context, this.m_genesis, filterLineItem.getToolTip()).open();
	}
	else
	{
		this.openDialog(dimension);
	}
};
oFF.AuGdsFilterLineDimensionFilterManager.prototype.openDialog = function(dimension)
{
	var filterDialogTitle = this.getLocalization().getTextWithPlaceholder(oFF.AuGdsFilterLineI18n.FD_TITLE, dimension.getText());
	var filterViewType = this.getStoredFilterTypeForFilterDialog(dimension);
	var storedDisplayInfoForFilterDialog = this.getStoredDisplayInfoForFilterDialog(dimension);
	var versionName = this.m_queryManager.getQueryModel().getVersionDimensionName();
	var isVersionDim = oFF.XString.isEqual(versionName, dimension.getName()) && !this.isVersionDimensionPresentOnAxis();
	var runner = oFF.FilterDialogProgramRunnerFactory.createForDimension(this.m_queryManager.getProcess(), this.m_queryManager, dimension.getName(), filterDialogTitle);
	runner.setBooleanArgument(oFF.FilterDialog.PARAM_OPEN_WITH_DYNAMIC_FILTER, true);
	runner.setBooleanArgument(oFF.FilterDialog.PARAM_OFFER_READMODE_CHANGE, true);
	runner.setBooleanArgument(oFF.FilterDialog.PARAM_OFFER_CLIPBOARD, true);
	runner.setBooleanArgument(oFF.FilterDialog.PARAM_OFFER_EXCLUDE, true);
	runner.setBooleanArgument(oFF.FilterDialog.PARAM_OFFER_HIERARCHY_CHANGE, true);
	runner.setBooleanArgument(oFF.FilterDialog.PARAM_OFFER_LIST_VIEW, filterViewType === oFF.FilterDialogViewType.LIST);
	runner.setBooleanArgument(oFF.FilterDialog.PARAM_OFFER_RANGE_VIEW, filterViewType === oFF.FilterDialogViewType.RANGE);
	runner.setBooleanArgument(oFF.FilterDialog.PARAM_SELECTION_REQUIRED, isVersionDim);
	runner.setArgument(oFF.FilterDialog.PARAM_SELECTION_MODE, isVersionDim ? oFF.UiSelectionMode.SINGLE_SELECT_LEFT.getName() : oFF.UiSelectionMode.MULTI_SELECT.getName());
	runner.setArgument(oFF.FilterDialog.PARAM_DIMENSION_DISPLAY_INFO, storedDisplayInfoForFilterDialog.isPresent() ? storedDisplayInfoForFilterDialog.get().getName() : null);
	if (this.m_featureManager.isActive(oFF.AuGdsFilterLineFeature.CASCADING_FILTERS))
	{
		runner.setBooleanArgument(oFF.FilterDialog.PARAM_OFFER_READMODE_EXTENDED_SETTINGS, true);
		var storedReadMode = this.getStoredReadModeForFilterDialog(dimension);
		runner.setArgument(oFF.FilterDialog.PARAM_READMODE, storedReadMode.isPresent() ? storedReadMode.get().getName() : null);
	}
	runner.setObjectArgument(oFF.FilterDialog.PARAM_LISTENER_BEFORE_FILTER_CHANGE, this.m_beforeFilterChangeListenerFunction(dimension));
	runner.setObjectArgument(oFF.FilterDialog.PARAM_LISTENER_CLOSE, oFF.FilterDialogLambdaCloseListener.create( function(selection){
		this.m_updateCommand();
	}.bind(this), null));
	runner.runProgram();
};
oFF.AuGdsFilterLineDimensionFilterManager.prototype.getStoredDisplayInfoForFilterDialog = function(dimension)
{
	var dimensionName = oFF.notNull(dimension) ? dimension.getName() : null;
	var returnValue = oFF.XOptional.empty();
	if (oFF.notNull(dimensionName))
	{
		returnValue = oFF.AuGdsFilterLineDimensionDisplayTypeRetriever.create(dimension, this.m_filterLineConfig).getDisplayType(false);
	}
	return returnValue;
};
oFF.AuGdsFilterLineDimensionFilterManager.prototype.getStoredReadModeForFilterDialog = function(dimension)
{
	var dimensionName = oFF.notNull(dimension) ? dimension.getName() : null;
	var returnValue = oFF.XOptional.empty();
	if (oFF.notNull(dimensionName))
	{
		returnValue = oFF.AuGdsFilterLineDimensionReadModeRetriever.create(dimension, this.m_filterLineConfig).getReadMode(false);
	}
	return returnValue;
};
oFF.AuGdsFilterLineDimensionFilterManager.prototype.createDeleteButtonCallbackProcedureForDimension = function(cartesianProduct, cartesianChild)
{
	return  function(){
		cartesianProduct.removeElement(cartesianChild);
	}.bind(this);
};
oFF.AuGdsFilterLineDimensionFilterManager.prototype.getStoredFilterTypeForFilterDialog = function(dimension)
{
	var supportNumericDimensions = this.m_featureManager.isActive(oFF.AuGdsFilterLineFeature.NUMERIC_DIMENSION_FILTER_SUPPORT);
	if (!supportNumericDimensions)
	{
		return oFF.FilterDialogViewType.LIST;
	}
	return oFF.AuGdsFilterLineFdFilterTypeRetriever.create(dimension, this.m_filterLineConfig).getFilterType();
};
oFF.AuGdsFilterLineDimensionFilterManager.prototype.getLocalization = function()
{
	return oFF.UiLocalizationCenter.getCenter();
};
oFF.AuGdsFilterLineDimensionFilterManager.prototype.openFilter = function(context, filterLineItem)
{
	this.openFilterDialog(context, filterLineItem, filterLineItem.getDimension());
};
oFF.AuGdsFilterLineDimensionFilterManager.prototype.onQueryExecuted = function(extResult, resultSetContainer, customIdentifier)
{
	this.disableVersionFilterTokenDelete(resultSetContainer);
};
oFF.AuGdsFilterLineDimensionFilterManager.prototype.disableVersionFilterTokenDelete = function(resultSetContainer)
{
	var versionDimensionName = this.m_queryManager.getQueryModel().getVersionDimensionName();
	if (oFF.notNull(versionDimensionName))
	{
		var fliVersion = this.m_grid.getFliTokenByDimensionName(versionDimensionName);
		var isVersionDimPresent = this.isVersionDimensionPresentOnAxis();
		if (oFF.notNull(fliVersion))
		{
			fliVersion.setVisibleDeleteButton(isVersionDimPresent);
		}
	}
};
oFF.AuGdsFilterLineDimensionFilterManager.prototype.isVersionDimensionPresentOnAxis = function()
{
	var versionDimensionName = this.m_queryManager.getQueryModel().getVersionDimensionName();
	var colDimension = this.m_queryManager.getQueryModel().getColumnsAxis().getDimensionByName(versionDimensionName);
	var rowDimension = this.m_queryManager.getQueryModel().getRowsAxis().getDimensionByName(versionDimensionName);
	return oFF.notNull(colDimension) || oFF.notNull(rowDimension);
};
oFF.AuGdsFilterLineDimensionFilterManager.prototype.setCascadeBehaviourForFilters = function(cascadingSetting)
{
	oFF.XObjectExt.assertNotNullExt(cascadingSetting, "Cascading setting should be provided");
	if (cascadingSetting !== oFF.AuGdsFilterLineCascadingSetting.NONE)
	{
		var readModeToSet = cascadingSetting === oFF.AuGdsFilterLineCascadingSetting.ALWAYS ? oFF.OlapUiReadMode.BOOKED_CASCADING : oFF.OlapUiReadMode.QUERY_DEFAULT;
		oFF.XCollectionUtils.forEachString(this.m_selectedDimensions.getValuesAsReadOnlyListOfString(),  function(dimensionName){
			this.m_filterLineConfig.setReadModeForDimension(dimensionName, readModeToSet.getName());
		}.bind(this));
		this.m_filterLineConfig.setCascadingSetting(cascadingSetting);
	}
};

oFF.AuGdsFilterLineComplexFilterAlgebraNode = function() {};
oFF.AuGdsFilterLineComplexFilterAlgebraNode.prototype = new oFF.DfAuGdsFilterLineComplexFilterNode();
oFF.AuGdsFilterLineComplexFilterAlgebraNode.prototype._ff_c = "AuGdsFilterLineComplexFilterAlgebraNode";

oFF.AuGdsFilterLineComplexFilterAlgebraNode.create = function(filterElement)
{
	var instance = new oFF.AuGdsFilterLineComplexFilterAlgebraNode();
	instance.setupInternal(filterElement);
	return instance;
};
oFF.AuGdsFilterLineComplexFilterAlgebraNode.prototype.m_children = null;
oFF.AuGdsFilterLineComplexFilterAlgebraNode.prototype.setupInternal = function(filterElement)
{
	this.setupCommon(filterElement);
	this.m_children = oFF.XList.create();
	var children = this.m_filterElement.getChildren();
	while (children.hasNext())
	{
		var next = children.next();
		this.m_children.add(oFF.AuGdsFilterLineComplexFilterNodeFactory.create(next));
	}
};
oFF.AuGdsFilterLineComplexFilterAlgebraNode.prototype.getDimensionMembersDetails = function()
{
	var memberDetailsList = oFF.XList.create();
	for (var i = 0; i < this.m_children.size(); i++)
	{
		memberDetailsList.addAll(this.m_children.get(i).getDimensionMembersDetails());
	}
	return memberDetailsList;
};
oFF.AuGdsFilterLineComplexFilterAlgebraNode.prototype.getDimensionList = function()
{
	var dimensionList = oFF.XList.create();
	for (var i = 0; i < this.m_children.size(); i++)
	{
		oFF.XCollectionUtils.addAllIfNotPresent(dimensionList, this.m_children.get(i).getDimensionList());
	}
	return dimensionList;
};
oFF.AuGdsFilterLineComplexFilterAlgebraNode.prototype.updateDimensionMemberDetails = function(dimensionMemberDetails)
{
	for (var i = 0; i < this.m_children.size(); i++)
	{
		this.m_children.get(i).updateDimensionMemberDetails(dimensionMemberDetails);
	}
};
oFF.AuGdsFilterLineComplexFilterAlgebraNode.prototype.toString = function()
{
	var str = "";
	var children = this.m_children.getIterator();
	while (children.hasNext())
	{
		var next = children.next();
		str = oFF.XStringUtils.concatenate4(str, " (", next.toString(), ") ");
		if (children.hasNext())
		{
			if (next.getComponentType().isTypeOf(oFF.FilterComponentType.BOOLEAN_ALGEBRA))
			{
				str = oFF.XStringUtils.concatenate2(str, oFF.AuGdsFilterLineComplexFilterHTMLStringUtils.wrapTextInHTMLBreaks(this.getBooleanAlgebraFilterPart(this.m_filterElement), 2));
			}
			else
			{
				str = oFF.XStringUtils.concatenate3(str, "<br/>", this.getBooleanAlgebraFilterPart(this.m_filterElement));
			}
		}
	}
	if (this.isExclude() && oFF.XStringUtils.isNotNullAndNotEmpty(str))
	{
		str = oFF.XStringUtils.concatenate4(oFF.AuGdsFilterLineComplexFilterHTMLStringUtils.wrapTextInColorFormattedSpan("NOT"), " (", oFF.AuGdsFilterLineComplexFilterHTMLStringUtils.wrapTextInHTMLBreaks(str, 2), ")");
	}
	return str;
};
oFF.AuGdsFilterLineComplexFilterAlgebraNode.prototype.getBooleanAlgebraFilterPart = function(filterElement)
{
	var componentType = filterElement.getOlapComponentType();
	var filterPart = oFF.XString.toUpperCase(componentType.getName());
	if (componentType.isTypeOf(oFF.FilterComponentType.CARTESIAN_PRODUCT) || componentType.isTypeOf(oFF.FilterComponentType.CARTESIAN_LIST))
	{
		filterPart = oFF.XString.toUpperCase(componentType.getParent().getName());
	}
	return oFF.AuGdsFilterLineComplexFilterHTMLStringUtils.wrapTextInColorFormattedSpan(filterPart);
};

oFF.AuGdsFilterLineComplexFilterOperationNode = function() {};
oFF.AuGdsFilterLineComplexFilterOperationNode.prototype = new oFF.DfAuGdsFilterLineComplexFilterNode();
oFF.AuGdsFilterLineComplexFilterOperationNode.prototype._ff_c = "AuGdsFilterLineComplexFilterOperationNode";

oFF.AuGdsFilterLineComplexFilterOperationNode.create = function(filterElement)
{
	var instance = new oFF.AuGdsFilterLineComplexFilterOperationNode();
	instance.setupInternal(filterElement);
	return instance;
};
oFF.AuGdsFilterLineComplexFilterOperationNode.prototype.m_filterOperation = null;
oFF.AuGdsFilterLineComplexFilterOperationNode.prototype.m_dimensionMember = null;
oFF.AuGdsFilterLineComplexFilterOperationNode.prototype.setupInternal = function(filterElement)
{
	this.setupCommon(filterElement);
	this.m_filterOperation = this.m_filterElement;
	var detailsGenerator = oFF.AuGdsDimensionMemberDetailsGenerator.create(null, this.m_filterOperation, this.getDimension());
	this.m_dimensionMember = detailsGenerator.generateFromLow();
	this.setIsExclude(this.m_filterOperation.getSetSign() === oFF.SetSign.EXCLUDING);
};
oFF.AuGdsFilterLineComplexFilterOperationNode.prototype.updateDimensionMemberDetails = function(dimensionMemberDetails)
{
	var originalDimension = this.m_dimensionMember.getDimension();
	var comparedDimension = dimensionMemberDetails.getDimension();
	var isSameDimension = originalDimension.isEqualTo(comparedDimension) || oFF.notNull(comparedDimension) && oFF.XString.isEqual(originalDimension.getName(), comparedDimension.getName());
	var isSameMember = oFF.XString.isEqual(dimensionMemberDetails.getKey(), this.m_dimensionMember.getKey());
	if (isSameDimension && isSameMember)
	{
		this.m_dimensionMember = dimensionMemberDetails;
	}
};
oFF.AuGdsFilterLineComplexFilterOperationNode.prototype.getDimensionMembersDetails = function()
{
	var memberDetailsList = oFF.XList.create();
	if (oFF.notNull(this.m_dimensionMember))
	{
		memberDetailsList.add(this.m_dimensionMember);
	}
	return memberDetailsList;
};
oFF.AuGdsFilterLineComplexFilterOperationNode.prototype.getDimensionList = function()
{
	var dimensionList = oFF.XList.create();
	dimensionList.add(this.getDimension());
	return dimensionList;
};
oFF.AuGdsFilterLineComplexFilterOperationNode.prototype.getDimension = function()
{
	return this.m_filterOperation.getDimension();
};
oFF.AuGdsFilterLineComplexFilterOperationNode.prototype.toString = function()
{
	var dimension = this.getDimension();
	var dimensionText = oFF.XStringUtils.isNotNullAndNotEmpty(dimension.getText()) ? dimension.getText() : dimension.getName();
	var formattedMemberText = oFF.AuGdsFilterLineComplexFilterHTMLStringUtils.wrapTextInEmboldenedFormattedSpan(this.m_dimensionMember.getDescription());
	var str = oFF.XStringUtils.concatenate5(dimensionText, " ", this.getComparisonOperatorText(this.m_filterOperation.getComparisonOperator()), " ", formattedMemberText);
	if (this.isExclude() && oFF.XStringUtils.isNotNullAndNotEmpty(str))
	{
		str = oFF.XStringUtils.concatenate4(oFF.AuGdsFilterLineComplexFilterHTMLStringUtils.wrapTextInColorFormattedSpan("NOT"), " (", oFF.AuGdsFilterLineComplexFilterHTMLStringUtils.wrapTextInHTMLBreaks(str, 2), ")");
	}
	return str;
};
oFF.AuGdsFilterLineComplexFilterOperationNode.prototype.getComparisonOperatorText = function(comparisonOperator)
{
	var comparisonOperatorText = oFF.XString.toLowerCase(comparisonOperator.getName());
	if (comparisonOperator.isTypeOf(oFF.ComparisonOperator.EQUAL))
	{
		comparisonOperatorText = "equals";
	}
	return oFF.AuGdsFilterLineComplexFilterHTMLStringUtils.wrapTextInColorFormattedSpan(comparisonOperatorText);
};

oFF.AuGdsComplexFilterLineItemDescriptionUpdater = function() {};
