oFF.AuGdsComplexFilterLineItemDescriptionUpdater.prototype._ff_c = "AuGdsComplexFilterLineItemDescriptionUpdater";

oFF.AuGdsComplexFilterLineItemDescriptionUpdater.create = function()
{
	var instance = new oFF.AuGdsComplexFilterLineItemDescriptionUpdater();
	instance.setupCommon();
	return instance;
};
oFF.AuGdsComplexFilterLineItemDescriptionUpdater.prototype.update = function(fli)
{
	var memberDetailsMissingDescriptionWithoutCache = fli.getMemberDetailsNeedingDescriptionRetrieval();
	if (memberDetailsMissingDescriptionWithoutCache.isEmpty())
	{
		return;
	}
	this.setMemberDetailsList(memberDetailsMissingDescriptionWithoutCache);
	this.updateInternal(fli);
};
oFF.AuGdsComplexFilterLineItemDescriptionUpdater.prototype.getAllMemberDetailsByDimension = function()
{
	var memberDetailsByDimension = oFF.XSimpleMap.create();
	oFF.XCollectionUtils.forEach(this.m_memberDetailsList,  function(memberDetails){
		var dimension = memberDetails.getDimension();
		if (!memberDetailsByDimension.containsKey(dimension))
		{
			memberDetailsByDimension.put(dimension, oFF.XList.create());
		}
		memberDetailsByDimension.getByKey(dimension).add(memberDetails);
	}.bind(this));
	return memberDetailsByDimension;
};
oFF.AuGdsComplexFilterLineItemDescriptionUpdater.prototype.updateFLI = function(fli, membersDetailsWithDescriptions)
{
	oFF.XCollectionUtils.forEach(membersDetailsWithDescriptions.getValuesAsReadOnlyList(),  function(memberDetailsList){
		oFF.XCollectionUtils.forEach(memberDetailsList.getValuesAsReadOnlyList(),  function(memberDetails){
			fli.getComplexTree().updateDimensionMemberDetails(memberDetails);
		}.bind(this));
	}.bind(this));
	return fli;
};

