oFF.AuGdsFilterLineItemAccountMember = function() {};
oFF.AuGdsFilterLineItemAccountMember.prototype = new oFF.DfAuGdsFilterLineItemMember();
oFF.AuGdsFilterLineItemAccountMember.prototype._ff_c = "AuGdsFilterLineItemAccountMember";

oFF.AuGdsFilterLineItemAccountMember.create = function(setSign, comparisonOperator, detailsLow, detailsHigh, targetFilterType, accountDimensionMember, measureContext, presentationType)
{
	var instance = new oFF.AuGdsFilterLineItemAccountMember();
	instance.setSetSign(oFF.XObjectExt.assertNotNull(setSign));
	instance.setComparisonOperator(oFF.XObjectExt.assertNotNull(comparisonOperator));
	instance.setDimensionMemberDetailsLow(oFF.XObjectExt.assertNotNull(detailsLow));
	instance.setDimensionMemberDetailsHigh(detailsHigh);
	instance.setTargetFilterType(targetFilterType);
	instance.setPresentationType(presentationType);
	instance.m_measureContext = measureContext;
	instance.m_accountDimensionMember = accountDimensionMember;
	return instance;
};
oFF.AuGdsFilterLineItemAccountMember.prototype.m_measureContext = null;
oFF.AuGdsFilterLineItemAccountMember.prototype.m_accountDimensionMember = null;
oFF.AuGdsFilterLineItemAccountMember.prototype.releaseObject = function()
{
	this.m_measureContext = null;
	this.m_accountDimensionMember = null;
	oFF.DfAuGdsFilterLineItemMember.prototype.releaseObject.call( this );
};
oFF.AuGdsFilterLineItemAccountMember.prototype.getDisplayIdInternal = function()
{
	var displayId = oFF.notNull(this.m_accountDimensionMember) ? oFF.XStringUtils.concatenate2(this.m_accountDimensionMember, ", ") : "";
	displayId = oFF.XStringUtils.concatenate3(displayId, this.m_measureContext, " ");
	if (this.getComparisonOperator() === oFF.ComparisonOperator.BETWEEN)
	{
		return oFF.XStringUtils.concatenate4(displayId, this.getDimensionMemberDetailsLow().getDisplayId(), " - ", this.getDimensionMemberDetailsHigh().getDisplayId());
	}
	else if (this.getComparisonOperator() === oFF.ComparisonOperator.LESS_THAN)
	{
		return oFF.XStringUtils.concatenate3(displayId, "< ", this.getDimensionMemberDetailsLow().getDisplayId());
	}
	else if (this.getComparisonOperator() === oFF.ComparisonOperator.GREATER_THAN)
	{
		return oFF.XStringUtils.concatenate3(displayId, "> ", this.getDimensionMemberDetailsLow().getDisplayId());
	}
	else if (this.getComparisonOperator() === oFF.ComparisonOperator.LESS_EQUAL)
	{
		return oFF.XStringUtils.concatenate3(displayId, "<= ", this.getDimensionMemberDetailsLow().getDisplayId());
	}
	else if (this.getComparisonOperator() === oFF.ComparisonOperator.GREATER_EQUAL)
	{
		return oFF.XStringUtils.concatenate3(displayId, ">= ", this.getDimensionMemberDetailsLow().getDisplayId());
	}
	return this.getDimensionMemberDetailsLow().getDisplayId();
};

