oFF.AuGdsFilterLineItemMember.prototype.getDisplayIdInternal = function()
{
	var displayId = "";
	if (this.getTargetFilterType() === oFF.AuGdsFilterLineItemType.MEASURE)
	{
		displayId = oFF.XStringUtils.concatenate2(this.m_measureContext, " ");
	}
	if (this.getTargetFilterType() === oFF.AuGdsFilterLineItemType.DATE_DIMENSION)
	{
		return this.getDimensionMemberDetailsLow().getDisplayId();
	}
	else if (this.getComparisonOperator() === oFF.ComparisonOperator.BETWEEN)
	{
		return oFF.XStringUtils.concatenate4(displayId, this.getDimensionMemberDetailsLow().getDisplayId(), " - ", this.getDimensionMemberDetailsHigh().getDisplayId());
	}
	else if (this.getComparisonOperator() === oFF.ComparisonOperator.LESS_THAN)
	{
		return oFF.XStringUtils.concatenate3(displayId, "< ", this.getDimensionMemberDetailsLow().getDisplayId());
	}
	else if (this.getComparisonOperator() === oFF.ComparisonOperator.GREATER_THAN)
	{
		return oFF.XStringUtils.concatenate3(displayId, "> ", this.getDimensionMemberDetailsLow().getDisplayId());
	}
	else if (this.getComparisonOperator() === oFF.ComparisonOperator.LESS_EQUAL)
	{
		return oFF.XStringUtils.concatenate3(displayId, "\u2264 ", this.getDimensionMemberDetailsLow().getDisplayId());
	}
	else if (this.getComparisonOperator() === oFF.ComparisonOperator.GREATER_EQUAL)
	{
		return oFF.XStringUtils.concatenate3(displayId, "\u2265 ", this.getDimensionMemberDetailsLow().getDisplayId());
	}
	return this.getDimensionMemberDetailsLow().getDisplayId();
};
oFF.AuGdsFilterLineItemMember.prototype.isRangeFilter = function()
{
	return this.getComparisonOperator() === oFF.ComparisonOperator.BETWEEN || this.getComparisonOperator() === oFF.ComparisonOperator.LESS_THAN || this.getComparisonOperator() === oFF.ComparisonOperator.GREATER_THAN || this.getComparisonOperator() === oFF.ComparisonOperator.LESS_EQUAL || this.getComparisonOperator() === oFF.ComparisonOperator.GREATER_EQUAL;
};

