oFF.AuGdsQbConditionalFormattingRuleParser.RULE_EVALUATE_TYPE_PARAM = "evaluateType";
oFF.AuGdsQbConditionalFormattingRuleParser.RULE_STYLE_PARAM = "style";
oFF.AuGdsQbConditionalFormattingRuleParser.RULE_EDITABLE_PARAM = "editable";
oFF.AuGdsQbConditionalFormattingRuleParser.RULE_THRESHOLD_PARAM = "threshold";
oFF.AuGdsQbConditionalFormattingRuleParser.RULE_THRESHOLD_COMPARE_TYPE_PARAM = "compareType";
oFF.AuGdsQbConditionalFormattingRuleParser.RULE_THRESHOLD_REF_MEASURE = "refMeasure";
oFF.AuGdsQbConditionalFormattingRuleParser.RULE_RANGES_PARAM = "ranges";
