oFF.AuGdsQbConditionalFormattingRuleParser.RANGE_LOWERBOUND_PARAM = "lowerBound";
oFF.AuGdsQbConditionalFormattingRuleParser.RANGE_LOWERBOUND_OPERATOR_PARAM = "lowerBoundOperator";
oFF.AuGdsQbConditionalFormattingRuleParser.RANGE_UPPERBOUND_PARAM = "upperBound";
oFF.AuGdsQbConditionalFormattingRuleParser.RANGE_UPPERBOUND_OPERATOR_PARAM = "upperBoundOperator";
oFF.AuGdsQbConditionalFormattingRuleParser.RULE_FILTERS_PARAM = "filters";
oFF.AuGdsQbConditionalFormattingRuleParser.RULE_FILTER_DIMENSION_NAME_PARAM = "dimensionName";
oFF.AuGdsQbConditionalFormattingRuleParser.RULE_FILTER_VALUE_PARAM = "value";
oFF.AuGdsQbConditionalFormattingRuleParser.parseRules = function(jsonRules, queryModel)
{
	var rules = oFF.XList.create();
	var ruleList = jsonRules.asList();
	var measureStructureDimension = queryModel.getAccountDimension() !== null ? queryModel.getAccountDimension() : queryModel.getMeasureDimension();
	var ruleIterator = ruleList.getIterator();
	while (ruleIterator.hasNext())
	{
		var rule = ruleIterator.next().asStructure();
		var ruleBuilder = oFF.AuGdsQbConditionalFormattingRuleBuilder.create();
		if (rule.hasStringByKey(oFF.AuGdsQbConditionalFormattingRuleParser.RULE_ID_PARAM))
		{
			ruleBuilder.setId(rule.getStringByKey(oFF.AuGdsQbConditionalFormattingRuleParser.RULE_ID_PARAM));
		}
		ruleBuilder.setName(rule.getStringByKey(oFF.AuGdsQbConditionalFormattingRuleParser.RULE_NAME_PARAM));
		ruleBuilder.setStructureMember(measureStructureDimension.getStructureMember(rule.getStringByKey(oFF.AuGdsQbConditionalFormattingRuleParser.RULE_STRUCTURE_MEMBER_NAME_PARAM)));
		ruleBuilder.setEvaluateType(oFF.QExceptionEvalType.lookupExceptionEvalType(rule.getStringByKey(oFF.AuGdsQbConditionalFormattingRuleParser.RULE_EVALUATE_TYPE_PARAM)));
		ruleBuilder.setStyle(oFF.AuGdsQbConditionalFormattingStyleType.lookup(rule.getStringByKey(oFF.AuGdsQbConditionalFormattingRuleParser.RULE_STYLE_PARAM)).get());
		ruleBuilder.setIsEditable(rule.getBooleanByKey(oFF.AuGdsQbConditionalFormattingRuleParser.RULE_EDITABLE_PARAM));
		var threshold = rule.getStructureByKey(oFF.AuGdsQbConditionalFormattingRuleParser.RULE_THRESHOLD_PARAM);
		var rangeIterator = threshold.getListByKey(oFF.AuGdsQbConditionalFormattingRuleParser.RULE_RANGES_PARAM).getIterator();
		var ranges = oFF.XList.create();
		while (rangeIterator.hasNext())
		{
			var range = rangeIterator.next().asStructure();
			ranges.add(oFF.AuGdsQbConditionalFormattingRuleParser.parseRange(range));
		}
		var refMeasure = null;
		if (threshold.containsKey(oFF.AuGdsQbConditionalFormattingRuleParser.RULE_THRESHOLD_REF_MEASURE))
		{
			var refMeasureName = threshold.getStringByKey(oFF.AuGdsQbConditionalFormattingRuleParser.RULE_THRESHOLD_REF_MEASURE);
			refMeasure = measureStructureDimension.getStructureMember(refMeasureName);
		}
		ruleBuilder.setThreshold(oFF.AuGdsQbConditionalFormattingThreshold.create(oFF.AuGdsQbConditionalFormattingThresholdCompareType.lookup(threshold.getStringByKey(oFF.AuGdsQbConditionalFormattingRuleParser.RULE_THRESHOLD_COMPARE_TYPE_PARAM)).get(), ranges, refMeasure));
		var filterList = rule.getListByKey(oFF.AuGdsQbConditionalFormattingRuleParser.RULE_FILTERS_PARAM);
		if (oFF.notNull(filterList))
		{
			var filterIterator = filterList.getIterator();
			var filters = oFF.XHashMapByString.create();
			while (filterIterator.hasNext())
			{
				oFF.AuGdsQbConditionalFormattingRuleParser.parseFilterAndAdd(filters, filterIterator.next().asStructure());
			}
			oFF.XStream.ofString(filters.getKeysAsReadOnlyListOfString()).forEach( function(filterDimensionName){
				ruleBuilder.addFilter(oFF.AuGdsQbConditionalFormattingFilterItem.create(queryModel.getDimensionByName(filterDimensionName.getString()), filters.getByKey(filterDimensionName.getString())));
			}.bind(this));
		}
		rules.add(ruleBuilder.build());
	}
	return rules;
};
oFF.AuGdsQbConditionalFormattingRuleParser.parseRulesToMapByName = function(jsonRules, queryModel)
{
	var ruleList = oFF.AuGdsQbConditionalFormattingRuleParser.parseRules(jsonRules, queryModel);
	var ruleMap = oFF.XHashMapByString.create();
	var ruleIterator = ruleList.getIterator();
	while (ruleIterator.hasNext())
	{
		var rule = ruleIterator.next();
		ruleMap.put(rule.getName(), rule);
	}
	return ruleMap;
};
oFF.AuGdsQbConditionalFormattingRuleParser.parseRange = function(range)
{
	var rangeBuilder = oFF.AuGdsQbConditionalFormattingRangeBuilder.create();
	if (range.hasStringByKey(oFF.AuGdsQbConditionalFormattingRuleParser.RANGE_ID_PARAM))
	{
		rangeBuilder.setId(range.getStringByKey(oFF.AuGdsQbConditionalFormattingRuleParser.RANGE_ID_PARAM));
	}
	rangeBuilder.setName(range.getStringByKey(oFF.AuGdsQbConditionalFormattingRuleParser.RANGE_NAME_PARAM));
	rangeBuilder.setColor(range.getStringByKey(oFF.AuGdsQbConditionalFormattingRuleParser.RANGE_COLOR_PARAM));
	rangeBuilder.setIcon(oFF.AlertSymbol.lookup(range.getStringByKey(oFF.AuGdsQbConditionalFormattingRuleParser.RANGE_ICON_PARAM)));
	if (range.containsKey(oFF.AuGdsQbConditionalFormattingRuleParser.RANGE_LOWERBOUND_PARAM))
	{
		rangeBuilder.setLowerBound(oFF.XDoubleValue.create(range.getDoubleByKey(oFF.AuGdsQbConditionalFormattingRuleParser.RANGE_LOWERBOUND_PARAM)));
	}
	rangeBuilder.setLowerBoundOperator(oFF.ComparisonOperator.lookup(range.getStringByKey(oFF.AuGdsQbConditionalFormattingRuleParser.RANGE_LOWERBOUND_OPERATOR_PARAM)));
	if (range.containsKey(oFF.AuGdsQbConditionalFormattingRuleParser.RANGE_UPPERBOUND_PARAM))
	{
		rangeBuilder.setUpperBound(oFF.XDoubleValue.create(range.getDoubleByKey(oFF.AuGdsQbConditionalFormattingRuleParser.RANGE_UPPERBOUND_PARAM)));
	}
	rangeBuilder.setUpperBoundOperator(oFF.ComparisonOperator.lookup(range.getStringByKey(oFF.AuGdsQbConditionalFormattingRuleParser.RANGE_UPPERBOUND_OPERATOR_PARAM)));
	return rangeBuilder.build();
};
oFF.AuGdsQbConditionalFormattingRuleParser.parseFilterAndAdd = function(filters, filter)
{
	var dimensionName = filter.getStringByKey(oFF.AuGdsQbConditionalFormattingRuleParser.RULE_FILTER_DIMENSION_NAME_PARAM);
	if (!filters.containsKey(dimensionName))
	{
		filters.put(dimensionName, oFF.XList.create());
	}
	var filterValue = filter.getStringByKey(oFF.AuGdsQbConditionalFormattingRuleParser.RULE_FILTER_VALUE_PARAM);
	filters.getByKey(dimensionName).add(oFF.isNull(filterValue) ? null : oFF.XStringValue.create(filterValue));
};

