oFF.AuProteusEngine.prototype.parseDocument = function()
{
	this.m_parsingErrors.clear();
	if (oFF.notNull(this.m_quasarJsonContent))
	{
		var strBuf = oFF.XStringBuffer.create();
		strBuf.appendLine("<mvc:View");
		strBuf.appendLine("\txmlns=\"sap.m\"");
		strBuf.appendLine("\txmlns:core=\"sap.ui.core\"");
		strBuf.appendLine("\txmlns:mvc=\"sap.ui.core.mvc\"");
		strBuf.appendLine("\txmlns:df=\"sap.sac.df\">");
		var contentElement = this.m_quasarJsonContent.getStructureByKey(oFF.UiQuasarConstants.QSA_CONTENT);
		if (oFF.isNull(contentElement))
		{
			contentElement = this.m_quasarJsonContent;
		}
		this.m_parsingDepth = 1;
		this.parseControl(contentElement, strBuf, null);
		strBuf.appendLine("</mvc:View>");
		return strBuf.toString();
	}
	else
	{
		this.addParsingError("Missing quasar json document!");
	}
	return null;
};
oFF.AuProteusEngine.prototype.addDefaultProperties = function(ui5ControlName, strBuf)
{
	var defaultPropertiesMap = this.m_defaultPropertiesMap.getByKey(ui5ControlName);
	if (oFF.notNull(defaultPropertiesMap))
	{
		var propertyNames = defaultPropertiesMap.getKeysAsIteratorOfString();
		while (propertyNames.hasNext())
		{
			var name = propertyNames.next();
			this.parseProperty(name, defaultPropertiesMap.getByKey(name), strBuf);
		}
	}
};
oFF.AuProteusEngine.prototype.parseControl = function(controlElement, strBuf, itemType)
{
	var controlNameStr = controlElement.getStringByKey(oFF.UiQuasarConstants.QSA_CTYPE);
	var uiType = oFF.UiType.lookupUiType(controlNameStr);
	if (oFF.isNull(uiType) && oFF.notNull(itemType))
	{
		uiType = itemType;
	}
	if (oFF.notNull(uiType))
	{
		var ui5PControlStr = this.getUi5NameForUiType(uiType);
		if (oFF.XStringUtils.isNotNullAndNotEmpty(ui5PControlStr))
		{
			var hasAggregations = false;
			var indents = oFF.XStringUtils.leftPad("", "\t", this.m_parsingDepth);
			strBuf.append(oFF.XStringUtils.concatenate2(indents, "<"));
			strBuf.append(ui5PControlStr);
			var keys = controlElement.getKeysAsReadOnlyListOfString();
			this.addDefaultProperties(ui5PControlStr, strBuf);
			for (var i = 0; i < keys.size(); i++)
			{
				var key = keys.get(i);
				var tmpProp = oFF.UiProperty.lookup(key);
				var propertyValue = oFF.UiUtils.getElementAsString(controlElement, key);
				if (oFF.notNull(tmpProp) && tmpProp !== oFF.UiProperty.ID)
				{
					var propertyName = this.getUi5PropertyForUiProperty(tmpProp);
					this.parseProperty(propertyName, propertyValue, strBuf);
				}
				else if (oFF.isNull(tmpProp) && oFF.XString.isEqual(key, "Binding"))
				{
					this.parseProperty(key, propertyValue, strBuf);
				}
				var tmpAgr = oFF.UiAggregation.lookup(key);
				if (oFF.notNull(tmpAgr))
				{
					if (!hasAggregations)
					{
						this.m_parsingDepth++;
						hasAggregations = true;
						strBuf.appendLine(">");
					}
					var aggregationItems = controlElement.getListByKey(key);
					if (oFF.notNull(aggregationItems) && aggregationItems.size() > 0)
					{
						for (var m = 0; m < aggregationItems.size(); m++)
						{
							var docAgrItem = aggregationItems.getStructureAt(m);
							this.parseControl(docAgrItem, strBuf, uiType.getDefaultItemType());
						}
						this.m_parsingDepth--;
					}
				}
			}
			if (hasAggregations)
			{
				strBuf.append(oFF.XStringUtils.concatenate2(indents, "<"));
				strBuf.append("/");
				strBuf.append(ui5PControlStr);
				strBuf.appendLine(">");
			}
			else
			{
				strBuf.appendLine("/>");
			}
		}
		else
		{
			this.addParsingError(oFF.XStringUtils.concatenate2("Cannot parse control: ", controlNameStr));
		}
	}
	else
	{
		this.addParsingError(oFF.XStringUtils.concatenate2("Cannot find control: ", controlNameStr));
	}
};
oFF.AuProteusEngine.prototype.parseProperty = function(propName, propValue, strBuf)
{
	var propertyName = propName;
	var propertyValue = propValue;
	if (oFF.XStringUtils.isNotNullAndNotEmpty(propertyName))
	{
		switch (propertyName)
		{
			case "Icon":
				if (!oFF.XString.startsWith(propertyValue, "http"))
				{
					propertyValue = oFF.XStringUtils.concatenate2("sap-icon://", propertyValue);
				}
				break;

			case "Binding":
				propertyName = "dataSource";
				var dataProviderName = oFF.XStringUtils.stripStart(propertyValue, "%");
				var dataProviders = this.m_quasarJsonContent.getListByKey(oFF.UiQuasarConstants.QSA_DATA_PROVIDERS);
				if (oFF.notNull(dataProviders) && dataProviders.size() > 0)
				{
					var boundDataProvider = oFF.XCollectionUtils.findFirst(dataProviders,  function(provider){
						return oFF.XString.isEqual(provider.asStructure().getStringByKey(oFF.UiQuasarConstants.QSA_NAME), dataProviderName);
					}.bind(this));
					if (oFF.notNull(boundDataProvider))
					{
						propertyValue = boundDataProvider.asStructure().getStringByKey(oFF.UiQuasarConstants.QSA_DATA_SOURCE);
						if (oFF.XString.match(propertyValue, "query:\\[[^\\]].*\\]"))
						{
							propertyValue = oFF.XString.replace(propertyValue, "query:[", "query:[][][");
						}
					}
					else
					{
						this.addParsingError(oFF.XStringUtils.concatenate2("Cannot find data provider: ", dataProviderName));
					}
				}
				else
				{
					this.addParsingError("Cannot find data provider configuration");
				}
				break;
		}
		strBuf.append(" ");
		strBuf.append(propertyName);
		strBuf.append("=\"");
		strBuf.append(propertyValue);
		strBuf.append("\"");
	}
	else
	{
		this.addParsingError(oFF.XStringUtils.concatenate2("Cannot parse property: ", propertyName));
	}
};
oFF.AuProteusEngine.prototype.getUi5NameForUiType = function(uiType)
{
	return this.m_controlTypesMap.getByKey(uiType.getName());
};
oFF.AuProteusEngine.prototype.getUi5PropertyForUiProperty = function(uiProp)
{
	return this.m_propertyNamesMap.getByKey(uiProp.getName());
};
oFF.AuProteusEngine.prototype.addParsingError = function(parsingError)
{
	this.m_parsingErrors.add(parsingError);
};

