oFF.AuGdsDfDocument.prototype.updateTitle = function()
{
	var customTitle = this.getDocumentCustomTitle();
	var customToolName = this.getCustomToolName();
	if (oFF.XStringUtils.isNotNullAndNotEmpty(this.getDocumentName()))
	{
		this.setTitle(this.getDocumentName());
		this.setTabItemTooltip(this.getDocumentType().getDisplayName());
	}
	else if (this.hasFile())
	{
		this.setTitle(this.getFile().getUri().getPathContainer().getFileName());
		this.setTabItemTooltip(this.getFile().getUri().getPath());
	}
	else if (oFF.XStringUtils.isNotNullAndNotEmpty(customTitle))
	{
		this.setTitle(customTitle);
		this.setTabItemTooltip(customTitle);
	}
	else if (oFF.XStringUtils.isNotNullAndNotEmpty(customToolName))
	{
		this.setTitle(customToolName);
		this.setTabItemTooltip(customToolName);
	}
	else
	{
		this.setTitle(this.getDocumentType().getDisplayName());
		this.setTabItemTooltip(this.getDocumentType().getDescription());
	}
};
