oFF.AuGdsDfDocument.prototype.markPristine = function()
{
	var previousState = this.m_isDirty;
	this.m_isDirty = false;
	if (oFF.notNull(this.m_documentTabItem))
	{
		this.m_documentTabItem.setModified(false);
	}
	if (this.m_isDirty !== previousState)
	{
		this.notifyDirtyStateChanged();
	}
};
oFF.AuGdsDfDocument.prototype.markDirty = function()
{
	var previousState = this.m_isDirty;
	this.m_isDirty = true;
	if (oFF.notNull(this.m_documentTabItem))
	{
		this.m_documentTabItem.setModified(true);
	}
	if (this.m_isDirty !== previousState)
	{
		this.notifyDirtyStateChanged();
	}
};
