{
	if (oFF.notNull(this.m_listener))
	{
		this.m_listener.onDocumentDirtyStateChanged(this, this.isDirty());
	}
};
oFF.AuGdsDfDocument.prototype.notifyDocumentFileChanged = function()
{
	if (oFF.notNull(this.m_listener))
	{
		var docSaveJson = oFF.notNull(this.m_docContent) ? this.getDocContent().getFileStructure() : null;
		this.m_listener.onDocumentFileChanged(this, docSaveJson, this.getFile());
	}
};
oFF.AuGdsDfDocument.prototype.openFile = function(file)
{
	this.setBusy(true);
	var openFilePromise = this.getFileManager().loadJsonFromFile(file).then( function(loadedJson){
		var success = this.initDocContentAndFile(loadedJson, file);
		if (!success)
		{
			throw oFF.XException.createRuntimeException("Unknown document");
		}
		return file;
	}.bind(this),  function(errMsg){
		this.getMessageCenter().logError(errMsg.getText());
	}.bind(this)).onFinally( function(){
		this.setBusy(false);
	}.bind(this));
	return openFilePromise;
};
oFF.AuGdsDfDocument.prototype.updateCurrentDocumentFileAndJson = function(docJson, docFile)
{
	if (oFF.notNull(docJson))
	{
		this.setupDocContentAndFile(docJson, docFile);
		if (!this.isEmptyDocument())
		{
			this.handleNewDocContentLoaded();
		}
	}
};
