oFF.AuGdsDfDocument.prototype.isValidDocumentContent = function(docContent)
{
	if (!docContent.isValid())
	{
		return false;
	}
	var docVersion = docContent.getDocumentVersion();
	if (!oFF.XString.isEqual(docVersion, this.getDocumentVersion()))
	{
		this.getMessageCenter().showWarningToast(oFF.AuGdsQbTextContants.OUTDATED_DOCUMENT_VERSION);
	}
	return true;
};
