oFF.AuGdsDfDocument.prototype.setFile = function(file)
{
	var didFileChange = this.m_file !== file;
	if (didFileChange)
	{
		this.m_file = file;
		this.updateFileArgument(file);
		if (oFF.notNull(file))
		{
			this.setTabItemTooltip(file.getUri().getPath());
			if (oFF.XStringUtils.isNullOrEmpty(this.getDocumentName()))
			{
				this.setTitle(file.getUri().getPathContainer().getFileName());
			}
		}
		this.notifyDocumentFileChanged();
	}
};
