oFF.AuGdsDfDocument.prototype.executeSave = function(consumer)
{
	if (this.hasFile() && this.hasSaveData())
	{
		this.getFileManager().saveDocument(this,  function(extResult){
			this.onFileSave(extResult, consumer);
		}.bind(this));
	}
	else
	{
		consumer(oFF.ExtResult.createWithErrorMessage("Document has no file or missing save data!"));
	}
};
