{
	if (this.hasSaveData())
	{
		var didPresentDialog = this.presentSaveDialog();
		if (!didPresentDialog)
		{
			this.getFileManager().presentSaveAsPopup(this,  function(extResult){
				this.onFileSave(extResult, consumer);
			}.bind(this));
		}
	}
};
