oFF.AuGdsDfDocument.prototype.getSaveFileName = function()
{
	var fileName = null;
	if (this.hasFile())
	{
		fileName = this.getFile().getUri().getPathContainer().getFileName();
	}
	else
	{
		fileName = this.generateFileName();
	}
	if (oFF.XStringUtils.isNullOrEmpty(fileName))
	{
		var docNameLower = oFF.XString.toLowerCase(this.getDocumentType().getName());
		fileName = oFF.XStringUtils.concatenate3(docNameLower, "Document.", oFF.AuGdsFileType.GDS_DOCUMENT_FILE.getExtension());
	}
	else
	{
		if (!oFF.XString.endsWith(fileName, oFF.AuGdsFileType.GDS_DOCUMENT_FILE.getExtension()))
		{
			fileName = oFF.XStringUtils.concatenate3(fileName, ".", oFF.AuGdsFileType.GDS_DOCUMENT_FILE.getExtension());
		}
	}
	return fileName;
};
