oFF.AuGdsDfDocument.prototype.getDocumentFileType = function(fileJson, file)
{
	if (oFF.AuGdsFileType.GDS_DOCUMENT_FILE.validate(fileJson, file))
	{
		return oFF.AuGdsFileType.GDS_DOCUMENT_FILE;
	}
	var foundFileType = oFF.AuGdsFileType.determineFileType(fileJson, file);
	if (oFF.notNull(foundFileType))
	{
		if (foundFileType.getDocumentType() !== null && foundFileType.getDocumentType() !== this.getDocumentType())
		{
			return null;
		}
	}
	return foundFileType;
};
oFF.AuGdsDfDocument.prototype.initDocContentAndFile = function(fileJson, file)
{
	var fileType = this.getDocumentFileType(fileJson, file);
	if (fileType === oFF.AuGdsFileType.GDS_DOCUMENT_FILE)
	{
		this.setupDocContentAndFile(fileJson, file);
		if (!this.isEmptyDocument())
		{
			this.handleExistingDocContent(this.getDocContent());
			return true;
		}
	}
	else if (oFF.notNull(fileType))
	{
		this.handleExternalFileType(fileType, fileJson, file);
		return true;
	}
	else
	{
		this.getMessageCenter().showWarningToast(oFF.AuGdsQbTextContants.FILE_CONTENT_NOT_RECOGNIZED);
	}
	return false;
};
oFF.AuGdsDfDocument.prototype.setupDocContentAndFile = function(extDoc, file)
{
	var isDocumentValid = false;
	if (oFF.notNull(extDoc))
	{
		var docContent = this.createDocumentContent(extDoc);
		isDocumentValid = this.isValidDocumentContent(docContent);
		if (isDocumentValid)
		{
			if (oFF.notNull(file))
			{
				this.markPristine();
			}
			else
			{
				this.markDirty();
			}
			this.setFile(file);
			var documentName = docContent.getDocumentName();
			if (oFF.XStringUtils.isNotNullAndNotEmpty(documentName))
			{
				this.setDocumentName(documentName);
			}
			this.m_docContent = docContent;
			this.m_isEmptyDocument = false;
		}
	}
	if (!isDocumentValid)
	{
		this.getMessageCenter().showErrorToast(oFF.AuGdsQbTextContants.INVALID_DOCUMENT);
	}
};
oFF.AuGdsDfDocument.prototype.createDocumentView = function(genesis)
{
	if (oFF.notNull(genesis))
	{
		this.m_documentView = genesis.newControl(oFF.UiType.CONTENT_WRAPPER);
		this.m_documentView.setName(this.m_uuid);
		this.m_documentView.addCssClass(this.getDocumentCssClass());
		this.m_documentView.useMaxSpace();
	}
};
oFF.AuGdsDfDocument.prototype.setTabItemTooltip = function(tooltip)
{
	if (oFF.notNull(this.m_documentTabItem))
	{
		this.m_documentTabItem.setTooltip(tooltip);
	}
};
oFF.AuGdsDfDocument.prototype.getDocumentCssClass = function()
{
	var docTypeName = "Unknown";
	if (this.getDocumentType() !== null)
	{
		docTypeName = this.getDocumentType().getName();
	}
	return oFF.XStringUtils.concatenate3("ffGds", docTypeName, "DocumentWrapper");
};
oFF.AuGdsDfDocument.prototype.setStatus = function(newMessage, newMessageType)
{
	this.m_statusMessage = newMessage;
	this.m_statusMessageType = newMessageType;
	if (this.getStatusBarManager() !== null)
	{
		this.getStatusBarManager().setStatus(newMessage, newMessageType);
	}
};
oFF.AuGdsDfDocument.prototype.onFileSave = function(extResult, consumer)
{
	if (!extResult.hasErrors())
	{
		this.handleDocumentSaved(extResult.getData());
	}
	if (oFF.notNull(consumer))
	{
		consumer(extResult);
	}
};
oFF.AuGdsDfDocument.prototype.addRecentDocumentVersionToDocument = function()
{
	if (oFF.notNull(this.m_docContent))
	{
		this.m_docContent.setDocumentVersion(this.getDocumentVersion());
	}
};
oFF.AuGdsDfDocument.prototype.isEmptyDocument = function()
{
	return this.m_isEmptyDocument;
};
oFF.AuGdsDfDocument.prototype.initDocumentArguments = function(argStructure)
{
	this.m_documentArguments = oFF.PrFactory.createStructureDeepCopy(argStructure);
	if (oFF.isNull(this.m_documentArguments))
	{
		this.m_documentArguments = this.getArgumentsManager().newDocumentArgumentsStructure(this.getDocumentType());
		this.m_documentArguments.putString(oFF.AuGdsConstants.PARAM_DOC_TYPE, this.getDocumentType().getName());
		this.addDocumentArguments();
	}
};
oFF.AuGdsDfDocument.prototype.addDocumentArguments = function()
{
	this.getArgumentsManager().addDocumentArguments(this.m_documentArguments);
};
oFF.AuGdsDfDocument.prototype.removeDocumentArguments = function()
{
	this.getArgumentsManager().removeDocumentArguments(this.m_documentArguments);
};
oFF.AuGdsDfDocument.prototype.updateFileArgument = function(file)
{
	if (oFF.notNull(file))
	{
		this.getDocumentArgStruct().putString(oFF.DfProgram.PARAM_FILE, file.getUri().getPath());
	}
	else
	{
		this.getDocumentArgStruct().remove(oFF.DfProgram.PARAM_FILE);
	}
	this.onFileArgumentUpdated(file);
	this.updateArgs();
};
oFF.AuGdsDfDocument.prototype.getCustomToolName = function()
{
	return this.getArgumentsManager().getArguments().getStringByKey(oFF.AuGdsConstants.PARAM_TOOL_NAME);
};
oFF.AuGdsDfDocument.prototype.getMenuSettingsConfiguration = function()
{
	if (this.getConfiguration().getConfigJson().containsKey(oFF.AuGdsQbConstants.CONFIG_MENU_SETTINGS))
	{
		return this.getConfiguration().getConfigJson().getStructureByKey(oFF.AuGdsQbConstants.CONFIG_MENU_SETTINGS);
	}
	else if (this.getDocumentConfigJson().containsKey(oFF.AuGdsQbConstants.CONFIG_MENU_SETTINGS))
	{
		return this.getDocumentConfigJson().getStructureByKey(oFF.AuGdsQbConstants.CONFIG_MENU_SETTINGS);
	}
	return null;
};
oFF.AuGdsDfDocument.prototype.getDefaultSettings = function()
{
	if (this.getDocumentConfigJson().containsKey(oFF.AuGdsQbConstants.DEFAULT_SETTINGS))
	{
		return this.getDocumentConfigJson().getStructureByKey(oFF.AuGdsQbConstants.DEFAULT_SETTINGS);
	}
	else if (this.getDocumentConfigJson().containsKey(oFF.AuGdsQbConstants.DEFAULT_SETTINGS))
	{
		return this.getDocumentConfigJson().getStructureByKey(oFF.AuGdsQbConstants.DEFAULT_SETTINGS);
	}
	return null;
};

