oFF.AuGdsQbTableStylingTemplateManager.prototype.setupManager = function()
{
	this.m_templatesMap = oFF.XHashMapByString.create();
	this.m_linkableTableDefinitions = oFF.XHashMapByString.create();
	this.m_activeTemplate = oFF.AuGdsQbTableStylingTemplateManager.DEFAULT_NAME;
	if (oFF.notNull(this.m_templateConfig))
	{
		this.log("process config");
	}
	var structure = oFF.JsonParserFactory.createFromString(oFF.AuGdsQbTableStylingTemplateManager.TEMPLATE_DEFAULT).asStructure();
	var tableDefinition = oFF.QFactory.createTableDefinition();
	tableDefinition.deserializeFromElementExt(oFF.QModelFormat.INA_REPOSITORY, structure);
	this.m_templatesMap.put(oFF.AuGdsQbTableStylingTemplateManager.DEFAULT_NAME, structure);
	this.m_linkableTableDefinitions.put(oFF.AuGdsQbTableStylingTemplateManager.DEFAULT_NAME, tableDefinition);
	structure = oFF.JsonParserFactory.createFromString(oFF.AuGdsQbTableStylingTemplateManager.TEMPLATE_BASIC).asStructure();
	tableDefinition = oFF.QFactory.createTableDefinition();
	tableDefinition.deserializeFromElementExt(oFF.QModelFormat.INA_REPOSITORY, structure);
	this.m_templatesMap.put(oFF.AuGdsQbTableStylingTemplateManager.BASIC_NAME, structure);
	this.m_linkableTableDefinitions.put(oFF.AuGdsQbTableStylingTemplateManager.BASIC_NAME, tableDefinition);
	if (this.hasActiveStylingFeature(oFF.AuGdsQbConstants.CONFIG_TABLE_STYLING_REPORT))
	{
		structure = oFF.JsonParserFactory.createFromString(oFF.AuGdsQbTableStylingTemplateManager.TEMPLATE_REPORT).asStructure();
		tableDefinition = oFF.QFactory.createTableDefinition();
		tableDefinition.deserializeFromElementExt(oFF.QModelFormat.INA_REPOSITORY, structure);
		this.m_templatesMap.put(oFF.AuGdsQbTableStylingTemplateManager.REPORT_NAME, structure);
		this.m_linkableTableDefinitions.put(oFF.AuGdsQbTableStylingTemplateManager.REPORT_NAME, tableDefinition);
	}
	if (this.hasActiveStylingFeature(oFF.AuGdsQbConstants.CONFIG_TABLE_STYLING_EXCEPTIONS))
	{
		structure = oFF.JsonParserFactory.createFromString(oFF.AuGdsQbTableStylingTemplateManager.EXCEPTIONS_FILL_COLOR).asStructure();
		tableDefinition = oFF.QFactory.createTableDefinition();
		tableDefinition.deserializeFromElementExt(oFF.QModelFormat.INA_REPOSITORY, structure);
		this.m_templatesMap.put(oFF.AuGdsQbTableStylingTemplateManager.FILL_COLOR_NAME, structure);
		this.m_linkableTableDefinitions.put(oFF.AuGdsQbTableStylingTemplateManager.FILL_COLOR_NAME, tableDefinition);
		structure = oFF.JsonParserFactory.createFromString(oFF.AuGdsQbTableStylingTemplateManager.EXCEPTIONS_FONT_COLOR).asStructure();
		tableDefinition = oFF.QFactory.createTableDefinition();
		tableDefinition.deserializeFromElementExt(oFF.QModelFormat.INA_REPOSITORY, structure);
		this.m_templatesMap.put(oFF.AuGdsQbTableStylingTemplateManager.FONT_COLOR_NAME, structure);
		this.m_linkableTableDefinitions.put(oFF.AuGdsQbTableStylingTemplateManager.FONT_COLOR_NAME, tableDefinition);
		structure = oFF.JsonParserFactory.createFromString(oFF.AuGdsQbTableStylingTemplateManager.EXCEPTIONS_SYMBOL).asStructure();
		tableDefinition = oFF.QFactory.createTableDefinition();
		tableDefinition.deserializeFromElementExt(oFF.QModelFormat.INA_REPOSITORY, structure);
		this.m_templatesMap.put(oFF.AuGdsQbTableStylingTemplateManager.SYMBOL_NAME, structure);
		this.m_linkableTableDefinitions.put(oFF.AuGdsQbTableStylingTemplateManager.SYMBOL_NAME, tableDefinition);
	}
	this.m_alternatingRowsTemplate = oFF.JsonParserFactory.createFromString(oFF.AuGdsQbTableStylingTemplateManager.TEMPLATE_ALTERNATING).asStructure();
	this.m_alternatingDefinition = oFF.QFactory.createTableDefinition();
	this.m_alternatingDefinition.deserializeFromElementExt(oFF.QModelFormat.INA_REPOSITORY, this.m_alternatingRowsTemplate);
};
oFF.AuGdsQbTableStylingTemplateManager.prototype.destroyManager = function()
{
	this.m_templatesMap = oFF.XCollectionUtils.releaseEntriesAndCollectionIfNotNull(this.m_templatesMap);
};
oFF.AuGdsQbTableStylingTemplateManager.prototype.getTemplateForName = function(templateName)
{
	return this.m_templatesMap.getByKey(templateName);
};
oFF.AuGdsQbTableStylingTemplateManager.prototype.getAllTemplateNames = function()
{
	return this.m_templatesMap.getKeysAsReadOnlyListOfString();
};
oFF.AuGdsQbTableStylingTemplateManager.prototype.getAlternatingRowsTemplate = function()
{
	return this.m_alternatingRowsTemplate;
};
oFF.AuGdsQbTableStylingTemplateManager.prototype.getTableDefinition = function()
{
	return this.m_tableDefinition;
};
oFF.AuGdsQbTableStylingTemplateManager.prototype.setTableDefinition = function(tableDefinition)
{
	this.m_tableDefinition = tableDefinition;
	if (oFF.notNull(this.m_tableDefinition))
	{
		var templateLinkName = this.m_tableDefinition.getLinkedDefinitionName(oFF.AuGdsQbTableStylingTemplateManager.TEMPLATE_LINK);
		if (oFF.notNull(templateLinkName))
		{
			this.m_activeTemplate = oFF.XStream.ofString(this.m_linkableTableDefinitions.getKeysAsReadOnlyListOfString()).find( function(key){
				return oFF.XString.isEqual(this.m_linkableTableDefinitions.getByKey(key.getString()).getName(), templateLinkName);
			}.bind(this)).orElse(oFF.XStringValue.create(this.m_activeTemplate)).getString();
			this.m_alternatingRows = this.m_tableDefinition.getLinkedDefinitionName(oFF.AuGdsQbTableStylingTemplateManager.ALTERNATING_LINK) !== null;
		}
	}
	this.applyTemplate();
	this.applyAlternatingRows();
};
oFF.AuGdsQbTableStylingTemplateManager.prototype.isAlternatingRowsActive = function()
{
	return this.m_alternatingRows;
};
oFF.AuGdsQbTableStylingTemplateManager.prototype.setAlternatingRowsActive = function(active)
{
	this.m_alternatingRows = active;
	this.applyAlternatingRows();
};
oFF.AuGdsQbTableStylingTemplateManager.prototype.applyAlternatingRows = function()
{
	if (oFF.notNull(this.m_tableDefinition))
	{
		if (this.m_alternatingRows)
		{
			this.m_tableDefinition.putLinkedDefinition(oFF.AuGdsQbTableStylingTemplateManager.ALTERNATING_LINK, this.m_alternatingDefinition);
		}
		else
		{
			this.m_tableDefinition.unlinkDefinition(oFF.AuGdsQbTableStylingTemplateManager.ALTERNATING_LINK);
		}
	}
};
oFF.AuGdsQbTableStylingTemplateManager.prototype.activateTemplate = function(templateName)
{
	this.m_activeTemplate = templateName;
	this.applyTemplate();
};
oFF.AuGdsQbTableStylingTemplateManager.prototype.activateExceptionFormatting = function(exceptionFormattingName)
{
	this.m_activeExceptionConditionalFormatting = exceptionFormattingName;
	this.applyExceptionConditionalFormatting();
};
oFF.AuGdsQbTableStylingTemplateManager.prototype.applyTemplate = function()
{
	if (oFF.notNull(this.m_tableDefinition) && this.m_linkableTableDefinitions.containsKey(this.m_activeTemplate))
	{
		var linkedDefinition = this.m_linkableTableDefinitions.getByKey(this.m_activeTemplate);
		this.m_tableDefinition.putLinkedDefinition(oFF.AuGdsQbTableStylingTemplateManager.TEMPLATE_LINK, linkedDefinition);
		if (oFF.XString.isEqual(this.m_activeTemplate, oFF.AuGdsQbTableStylingTemplateManager.REPORT_NAME))
		{
			this.m_tableDefinition.getQueryModel().getRowsAxis().setLowerLevelNodeAlignment(oFF.Alignment.CHILDREN_ABOVE_PARENT);
		}
	}
};
oFF.AuGdsQbTableStylingTemplateManager.prototype.applyExceptionConditionalFormatting = function()
{
	if (oFF.notNull(this.m_tableDefinition))
	{
		if (this.m_linkableTableDefinitions.containsKey(this.m_activeExceptionConditionalFormatting))
		{
			var linkedDefinition = this.m_linkableTableDefinitions.getByKey(this.m_activeExceptionConditionalFormatting);
			this.m_tableDefinition.putLinkedDefinition(oFF.AuGdsQbTableStylingTemplateManager.EXCEPTIONS_LINK, linkedDefinition);
		}
		else
		{
			this.m_tableDefinition.unlinkDefinition(oFF.AuGdsQbTableStylingTemplateManager.EXCEPTIONS_LINK);
		}
	}
};
oFF.AuGdsQbTableStylingTemplateManager.prototype.getActiveExceptionFormattingName = function()
{
	return this.m_activeExceptionConditionalFormatting;
};
oFF.AuGdsQbTableStylingTemplateManager.prototype.getActiveTemplateName = function()
{
	return this.m_activeTemplate;
};
oFF.AuGdsQbTableStylingTemplateManager.prototype.getReportReadingLines = function()
{
	var reportStyle = this.m_linkableTableDefinitions.getByKey(oFF.AuGdsQbTableStylingTemplateManager.REPORT_NAME);
	var readingLines = -2;
	if (oFF.notNull(reportStyle))
	{
		readingLines = reportStyle.getScopedStyle(oFF.AuGdsQbTableStylingTemplateManager.READING_LINE).getOrthogonalRowsScope().getMatchModulo();
	}
	return readingLines;
};
oFF.AuGdsQbTableStylingTemplateManager.prototype.setReportReadingLines = function(readingLines)
{
	var reportStyle = this.m_linkableTableDefinitions.getByKey(oFF.AuGdsQbTableStylingTemplateManager.REPORT_NAME);
	if (oFF.notNull(reportStyle))
	{
		reportStyle.getScopedStyle(oFF.AuGdsQbTableStylingTemplateManager.READING_LINE).getOrthogonalRowsScope().setMatchModulo(readingLines);
		this.m_tableDefinition.markNeedsReapplyFormatting();
	}
};
oFF.AuGdsQbTableStylingTemplateManager.prototype.setTemplateConfig = function(templateConfig)
{
	this.m_templateConfig = templateConfig;
};
oFF.AuGdsQbTableStylingTemplateManager.prototype.hasActiveStylingFeature = function(stylingConfigKey)
{
	return oFF.notNull(this.m_templateConfig) && this.m_templateConfig.getBooleanByKey(stylingConfigKey);
};

