oFF.AuGdsQbChartView.prototype.getVisualizationDefinition = function()
{
	var visDefId = oFF.XStringUtils.isNotNullAndNotEmpty(this.m_visDefId) ? this.m_visDefId : this.getUuid();
	var definition = this.getQueryController().getVisualizationDefinitionForId(visDefId);
	var chartSetting = definition.getChartSetting();
	if (chartSetting.getChartType() === null)
	{
		chartSetting.setChartType(oFF.ChartType.BAR_COLUMN);
	}
	if (chartSetting.getChartType2() === null)
	{
		chartSetting.setChartType2(oFF.ChartType.NONE);
	}
	if (chartSetting.getChartStackingType() === null)
	{
		chartSetting.setChartStackingType(oFF.ChartStackingType.NONE);
	}
	if (chartSetting.getChartOrientation() === null)
	{
		chartSetting.setChartOrientation(oFF.ChartOrientation.VERTICAL);
	}
	return definition;
};
