oFF.AuGdsQbStylingSerializationView.openDialog = function(application, tableDefinition, updateProcedure)
{
	var serializationView = oFF.AuGdsQbStylingSerializationView.create(tableDefinition);
	var uiMgr = application.getUiManager();
	var displayFactory = oFF.OlapUiDisplayFactory.createFactoryForDialog(uiMgr);
	var context = oFF.OlapUiContext.createContext(uiMgr, displayFactory);
	var display = context.getDisplayFactory().getInstance();
	var okButton = display.addNewButton();
	okButton.setName("OK_BUTTON");
	okButton.setText("OK");
	okButton.setButtonType(oFF.UiButtonType.PRIMARY);
	okButton.registerOnPress(oFF.AuGdsLambdaListenerWithEvent.create( function(ev){
		serializationView.m_tableDefinition.deserializeSilentExt(oFF.QModelFormat.INA_REPOSITORY, serializationView.m_textInput.getValue());
		updateProcedure();
		display.close();
	}.bind(this)));
	var genesis = display.getGenesis();
	serializationView.initView(genesis);
	display.setHeight(oFF.UiCssLength.create("100%"));
	display.setWidth(oFF.UiCssLength.create("100%"));
	display.getGenesis().setRoot(serializationView.getView());
	display.open();
	serializationView.m_textInput.prettyPrint();
};
