oFF.DfAuGdsFilterLineTreeMenu.prototype.getCommonPageHeight = function(listSize)
{
	var listSizeWithMinimum = listSize > 0 ? listSize : 1;
	var searchFieldPadding = this.isSearchFieldShown() ? oFF.DfAuGdsFilterLineTreeMenu.SEARCH_FIELD_PADDING : 0;
	var settingsItemPadding = this.isSettingsMenuShown() ? oFF.DfAuGdsFilterLineTreeMenu.ITEM_HEIGHT : 0;
	var maxScrollableListHeight = oFF.DfAuGdsFilterLineTreeMenu.MAX_LIST_SIZE_CUTOFF * oFF.DfAuGdsFilterLineTreeMenu.ITEM_HEIGHT;
	var maxHeightBeforeScroll = searchFieldPadding + maxScrollableListHeight + settingsItemPadding;
	var heightPaddingWithOrWithoutSearchFieldOrSettings = this.getHeaderHeight() + searchFieldPadding + settingsItemPadding;
	return oFF.XMath.minDouble(maxHeightBeforeScroll, heightPaddingWithOrWithoutSearchFieldOrSettings + listSizeWithMinimum * oFF.DfAuGdsFilterLineTreeMenu.ITEM_HEIGHT);
};
