oFF.DfAuGdsFilterLineTreeMenu.prototype.createDimensionMenuItem = function(dimension)
{
	var name = dimension.getName();
	var textToShow = this.getPresentationType().getDisplayValueByType(dimension);
	var item = this.createMenuItem(name, textToShow);
	if (this.shouldShowGrouping(dimension))
	{
		this.createParentNodeItem(dimension, item);
	}
	else
	{
		if (this.isRangeMemberItem(dimension))
		{
			this.createRangeMemberItems(item, dimension);
		}
		else
		{
			item.registerOnPress(oFF.UiLambdaPressListener.create( function(event){
				this.m_openFilterDialogWithDimensionConsumer(dimension, oFF.FilterDialogViewType.LIST);
			}.bind(this)));
		}
	}
	this.m_dimensionListItemToNameMap.put(item, oFF.XStringValue.create(name));
	return item;
};
oFF.DfAuGdsFilterLineTreeMenu.prototype.isRangeMemberItem = function(dimension)
{
	var areNumericDimensionsSupported = this.m_featureManager.isActive(oFF.AuGdsFilterLineFeature.NUMERIC_DIMENSION_FILTER_SUPPORT);
	var isRangeSupported = oFF.FilterDialogViewType.RANGE.isSupportedByDim(dimension, false);
	var isListSupported = oFF.FilterDialogViewType.LIST.isSupportedByDim(dimension, false);
	return areNumericDimensionsSupported && isRangeSupported && isListSupported;
};
oFF.DfAuGdsFilterLineTreeMenu.prototype.shouldShowGrouping = function(dimension)
{
	if (this.isTimeDimension(dimension))
	{
		return false;
	}
	var groupedDimensions = dimension.getGroupedDimensions();
	for (var i = 0; i < groupedDimensions.size(); i++)
	{
		var dim = groupedDimensions.get(i);
		if (this.shouldDimensionBeShownInFilterSelector(dim))
		{
			return true;
		}
	}
	return false;
};
