{
	var children = treeItem.getItems();
	oFF.XCollectionUtils.forEach(children,  function(child){
		this.removeCollapsedItems(child, visibleTreeItemIds);
		visibleTreeItemIds.removeElement(child.getId());
	}.bind(this));
};
