oFF.DfAuGdsFilterLineTreeMenu.prototype.shouldDimensionBeShownInFilterSelector = function(dim)
{
	if (!dim.getConvenienceCommands().isDimensionSupportingRowsOrColumns(dim.getName()))
	{
		return false;
	}
	if (!oFF.FilterDialogValueUtils.supportsFilterOnDimension(dim))
	{
		return false;
	}
	if (dim.isMeasureStructure())
	{
		return false;
	}
	if (oFF.OlapUiDimensionUtil.isStructureLike(dim))
	{
		return false;
	}
	return oFF.OlapUiDimensionUtil.shouldDimensionBeShown(dim, true);
};
