oFF.DfAuGdsFilterLineTreeMenu.prototype.createDimensionSettingsSection = function()
{
	if (oFF.isNull(this.m_settingsSection))
	{
		this.m_settingsList = this.getGenesis().newControl(oFF.UiType.LIST);
		this.m_settingsList.setSelectionMode(oFF.UiSelectionMode.NONE);
		var settingsMenuListItem = this.getGenesis().newControl(oFF.UiType.LIST_ITEM);
		settingsMenuListItem.setListItemType(oFF.UiListItemType.NAVIGATION);
		settingsMenuListItem.addCssClass("ffFdsFilterLineMenuItems");
		settingsMenuListItem.setText(this.getLocalization().getText(oFF.AuGdsFilterLineI18n.MENU_SETTINGS));
		settingsMenuListItem.setTooltip(this.getLocalization().getText(oFF.AuGdsFilterLineI18n.MENU_SETTINGS_TOOLTIP));
		this.m_defaultCascadeListItem = this.buildDefaultCascadeListItem();
		this.m_settingsList.addItem(this.m_defaultCascadeListItem);
		this.m_alwaysCascadeListItem = this.buildAlwaysCascadeListItem();
		this.m_settingsList.addItem(this.m_alwaysCascadeListItem);
		this.m_settingsList.registerOnSelectionChange(oFF.UiLambdaSelectionChangeListener.create( function(selectionEvent){
			var selectedItem = selectionEvent.getSelectedItem();
			if (selectedItem.isEqualTo(this.m_defaultCascadeListItem))
			{
				this.onDefaultCascade();
			}
			else if (selectedItem.isEqualTo(this.m_alwaysCascadeListItem))
			{
				this.onAlwaysCascade();
			}
		}.bind(this)));
		var subMenuContainer = this.getGenesis().newControl(oFF.UiType.FLEX_LAYOUT);
		subMenuContainer.setDirection(oFF.UiFlexDirection.COLUMN);
		subMenuContainer.addItem(this.buildCascadingFilterTitleSection());
		subMenuContainer.addItem(this.m_settingsList);
		var settingsPopover = this.getGenesis().newControl(oFF.UiType.POPOVER);
		settingsPopover.setShowArrow(false);
		settingsPopover.setPlacement(oFF.UiPlacementType.RIGHT);
		settingsPopover.setContent(subMenuContainer);
		settingsPopover.offset(0, 30);
		settingsMenuListItem.registerOnPress(oFF.UiLambdaPressListener.create( function(dimensionPressEvent){
			settingsPopover.openAt(settingsMenuListItem);
		}.bind(this)));
		this.m_settingsSection = this.getGenesis().newControl(oFF.UiType.LIST);
		this.m_settingsSection.addCssClass("ffFdsFilterLineSeparator");
		this.m_settingsSection.addItem(settingsMenuListItem);
	}
	var cascadingSettingOptional = oFF.AuGdsFilterLineCascadingSettingRetriever.create(this.m_filterLineConfig).getCascadingSetting();
	var cascadingSetting = cascadingSettingOptional.isPresent() ? cascadingSettingOptional.get() : null;
	if (cascadingSetting === oFF.AuGdsFilterLineCascadingSetting.NONE)
	{
		this.m_settingsList.setSelectionMode(oFF.UiSelectionMode.NONE);
	}
	else
	{
		this.m_settingsList.setSelectionMode(oFF.UiSelectionMode.SINGLE_SELECT_MASTER);
		this.m_defaultCascadeListItem.setSelected(cascadingSetting === oFF.AuGdsFilterLineCascadingSetting.DEFAULT);
		this.m_alwaysCascadeListItem.setSelected(cascadingSetting === oFF.AuGdsFilterLineCascadingSetting.ALWAYS);
	}
	return this.m_settingsSection;
};
