oFF.AuGdsFilterLineMenuSearchableTreeView.prototype.getListItems = function()
{
	var tmpList = oFF.XList.create();
	oFF.XCollectionUtils.forEach(this.m_tree.getItems(),  function(tmpItem){
		tmpList.add(tmpItem);
	}.bind(this));
	return tmpList;
};
oFF.AuGdsFilterLineMenuSearchableTreeView.prototype.expandList = function()
{
	this.m_tree.expand();
};
oFF.AuGdsFilterLineMenuSearchableTreeView.prototype.selectItem = function(listItem)
{
	if (this.checkListIsNotNullAndHasItems())
	{
		this.m_tree.clearSelectedItems();
		var indexToSelect = this.m_tree.getIndexOfItem(listItem);
		if (indexToSelect !== -1)
		{
			this.m_tree.setSelectedItem(listItem);
		}
	}
};
oFF.AuGdsFilterLineMenuSearchableTreeView.prototype.checkListIsNotNullAndHasItems = function()
{
	return oFF.notNull(this.m_tree) && this.m_tree.hasItems();
};
oFF.AuGdsFilterLineMenuSearchableTreeView.prototype.setListSelectionMode = function(mode)
{
	this.m_tree.setSelectionMode(mode);
};
oFF.AuGdsFilterLineMenuSearchableTreeView.prototype.fillList = function(listItems)
{
	if (oFF.notNull(this.m_tree))
	{
		this.m_tree.clearItems();
		this.m_searchInput.setVisible(listItems.size() >= 10 || this.m_showSearch);
		this.m_searchInput.setValue("");
		if (listItems.hasElements())
		{
			for (var i = 0; i < listItems.size(); i++)
			{
				this.m_tree.addItem(listItems.get(i));
				this.m_allListItems.add(listItems.get(i));
			}
		}
	}
};
oFF.AuGdsFilterLineMenuSearchableTreeView.prototype.filterList = function(searchText, clearButtonPressed)
{
	if (!clearButtonPressed && !oFF.XStringUtils.isNullOrEmpty(searchText))
	{
		this.restoreList();
		var items = this.m_tree.getItems();
		var iter = items.getIterator();
		var result = oFF.XList.create();
		while (iter.hasNext())
		{
			var treeItem = iter.next();
			result.addAll(this.filter(searchText, treeItem));
		}
		this.m_tree.clearItems();
		for (var x = 0; x < result.size(); x++)
		{
			this.m_tree.addItem(result.get(x));
		}
	}
	else
	{
		this.restoreList();
	}
};
oFF.AuGdsFilterLineMenuSearchableTreeView.prototype.restoreList = function()
{
	this.m_tree.clearItems();
	oFF.XCollectionUtils.forEach(this.m_allListItems,  function(listItem){
		this.m_tree.addItem(listItem);
	}.bind(this));
};
oFF.AuGdsFilterLineMenuSearchableTreeView.prototype.filter = function(searchText, treeItem)
{
	var list = oFF.XList.create();
	if (oFF.XString.containsString(oFF.XString.toLowerCase(treeItem.getText()), oFF.XString.toLowerCase(searchText)))
	{
		list.add(this.copyItem(treeItem));
	}
	var items = treeItem.getItems();
	oFF.XStream.of(items).forEach( function(i){
		list.addAll(this.filter(searchText, i));
	}.bind(this));
	return list;
};
oFF.AuGdsFilterLineMenuSearchableTreeView.prototype.copyItem = function(item)
{
	var copyItem = this.getGenesis().newControl(oFF.UiType.TREE_ITEM);
	copyItem.setText(item.getText());
	copyItem.setTooltip(item.getTooltip());
	copyItem.setName(item.getName());
	copyItem.registerOnPress(item.getListenerOnPress());
	copyItem.setListItemType(oFF.UiListItemType.ACTIVE);
	copyItem.addCssClass("ffFdsFilterLineMenuItems");
	return copyItem;
};
oFF.AuGdsFilterLineMenuSearchableTreeView.prototype.handleSearch = function(controlEvent)
{
	if (oFF.notNull(controlEvent))
	{
		var didPressClearButton = controlEvent.getParameters().getBooleanByKeyExt(oFF.UiEventParams.PARAM_CLEAR_BUTTON_PRESSED, false);
		var searchText = controlEvent.getParameters().getStringByKeyExt(oFF.UiEventParams.PARAM_SEARCH_TEXT, "");
		this.filterList(searchText, didPressClearButton);
	}
};
oFF.AuGdsFilterLineMenuSearchableTreeView.prototype.handleSelect = function(event)
{
	if (oFF.notNull(event))
	{
		var selectedListItem = event.getSelectedItem();
		this.selectItem(selectedListItem);
	}
};

