oFF.AuGdsFilterLineMenuSearchableView.prototype.setListItems = function(listItems)
{
	this.fillList(listItems);
};
oFF.AuGdsFilterLineMenuSearchableView.prototype.getListItems = function()
{
	var tmpList = oFF.XList.create();
	oFF.XCollectionUtils.forEach(this.m_list.getItems(),  function(tmpItem){
		tmpList.add(tmpItem);
	}.bind(this));
	return tmpList;
};
oFF.AuGdsFilterLineMenuSearchableView.prototype.selectItem = function(listItem)
{
	if (this.checkListIsNotNullAndHasItems())
	{
		this.m_list.clearSelectedItems();
		var indexToSelect = this.m_list.getIndexOfItem(listItem);
		if (indexToSelect !== -1)
		{
			this.m_list.setSelectedItem(listItem);
		}
	}
};
oFF.AuGdsFilterLineMenuSearchableView.prototype.setSearchFieldPlaceholder = function(placeholder)
{
	if (oFF.notNull(this.m_searchInput))
	{
		this.m_searchInput.setPlaceholder(placeholder);
	}
};
oFF.AuGdsFilterLineMenuSearchableView.prototype.selectItemByName = function(itemName)
{
	if (this.checkListIsNotNullAndHasItems())
	{
		var listItem = this.m_list.getItemByName(itemName);
		this.selectItem(listItem);
	}
};
oFF.AuGdsFilterLineMenuSearchableView.prototype.scrollToItem = function(listItem)
{
	if (this.checkListIsNotNullAndHasItems())
	{
		var indexToSelect = this.m_list.getIndexOfItem(listItem);
		if (indexToSelect !== -1)
		{
			this.m_list.scrollToIndex(indexToSelect);
		}
	}
};
oFF.AuGdsFilterLineMenuSearchableView.prototype.scrollToItemByName = function(itemName)
{
	if (this.checkListIsNotNullAndHasItems())
	{
		var listItem = this.m_list.getItemByName(itemName);
		this.scrollToItem(listItem);
	}
};
oFF.AuGdsFilterLineMenuSearchableView.prototype.checkListIsNotNullAndHasItems = function()
{
	return oFF.notNull(this.m_list) && this.m_list.hasItems();
};
oFF.AuGdsFilterLineMenuSearchableView.prototype.setListChangdConsumer = function(consumer)
{
	this.m_listChangedConsumer = consumer;
};
oFF.AuGdsFilterLineMenuSearchableView.prototype.setListItemSelectedConsumer = function(consumer)
{
	this.m_listItemSelectedConsumer = consumer;
};
oFF.AuGdsFilterLineMenuSearchableView.prototype.setListSelectionMode = function(mode)
{
	this.m_list.setSelectionMode(mode);
};
oFF.AuGdsFilterLineMenuSearchableView.prototype.setupExtraListSections = function(extraListSections)
{
	if (oFF.notNull(extraListSections))
	{
		oFF.XCollectionUtils.forEach(extraListSections,  function(extraListSection){
			this.getView().addItem(extraListSection);
		}.bind(this));
	}
};
oFF.AuGdsFilterLineMenuSearchableView.prototype.setSearchInputPlaceholder = function(placeholder)
{
	this.m_searchInput.setPlaceholder(placeholder);
};
oFF.AuGdsFilterLineMenuSearchableView.prototype.fillList = function(listItems)
{
	if (oFF.notNull(this.m_list))
	{
		this.m_list.clearItems();
		this.m_searchInput.setVisible(listItems.size() >= 8);
		this.m_searchInput.setValue("");
		this.m_allListItems.clear();
		if (listItems.hasElements())
		{
			oFF.XCollectionUtils.forEach(listItems,  function(listItem){
				this.m_list.addItem(listItem);
				this.m_allListItems.add(listItem);
			}.bind(this));
		}
	}
};
oFF.AuGdsFilterLineMenuSearchableView.prototype.filterList = function(searchText, clearButtonPressed)
{
	this.m_list.clearItems();
	if (clearButtonPressed === false)
	{
		for (var a = 0; a < this.m_allListItems.size(); a++)
		{
			var tmpListItem = this.m_allListItems.get(a);
			if (oFF.XString.containsString(oFF.XString.toLowerCase(tmpListItem.getText()), oFF.XString.toLowerCase(searchText)))
			{
				this.m_list.addItem(tmpListItem);
			}
		}
	}
	else
	{
		oFF.XCollectionUtils.forEach(this.m_allListItems,  function(listItem){
			this.m_list.addItem(listItem);
		}.bind(this));
	}
	if (oFF.notNull(this.m_listChangedConsumer))
	{
		this.m_listChangedConsumer(this.m_allListItems);
	}
};
oFF.AuGdsFilterLineMenuSearchableView.prototype.handleSearch = function(controlEvent)
{
	if (oFF.notNull(controlEvent))
	{
		var didPressClearButton = controlEvent.getParameters().getBooleanByKeyExt(oFF.UiEventParams.PARAM_CLEAR_BUTTON_PRESSED, false);
		var searchText = controlEvent.getParameters().getStringByKeyExt(oFF.UiEventParams.PARAM_SEARCH_TEXT, "");
		this.filterList(searchText, didPressClearButton);
	}
};
oFF.AuGdsFilterLineMenuSearchableView.prototype.handleSelect = function(event)
{
	if (oFF.notNull(event))
	{
		var selectedListItem = event.getSelectedItem();
		this.selectItem(selectedListItem);
		if (oFF.notNull(selectedListItem) && oFF.notNull(this.m_listItemSelectedConsumer))
		{
			this.m_listItemSelectedConsumer(selectedListItem);
		}
	}
};

