{
	this.m_menuPopulator = menuPopulator;
	this.checkRegisterActions();
};
oFF.AuHiChartView.prototype.setMenuActionConfigHandler = function(configHandler)
{
	this.m_menuActionConfigHandler = configHandler;
	this.checkRegisterActions();
};
oFF.AuHiChartView.prototype.setupBaseContext = function(event)
{
	oFF.XObjectExt.release(this.m_chartContext);
	this.m_chartContext = oFF.CMEFactory.createContext();
	oFF.XStream.of(this.m_contextFillers).forEach( function(cf){
		cf.fillContext(this.m_chartContext);
	}.bind(this));
	var viewContext = this.m_chartContext.addSubContext();
	viewContext.setType(oFF.AuChartContextUtil.VIEW_CHART);
	viewContext.setCustomObject(this);
	var visualizationContext = this.m_chartContext.addSubContext();
	visualizationContext.setType(oFF.AuChartContextUtil.VISUALIZATION_DEFINITION_CHART);
	visualizationContext.setCustomObject(this.getChartDefinition());
};
oFF.AuHiChartView.prototype.checkRegisterActions = function()
{
	if (!this.m_actionsRegistered && oFF.notNull(this.m_menuActionConfigHandler))
	{
		this.m_menuActionConfigHandler.registerActions(oFF.AuChartActionsRegistrator.create(), oFF.UiLocalizationCenter.getCenter().getLocalizationProviderByName("AuChartView"));
		this.m_actionsRegistered = true;
		this.m_menuActionConfigHandler.loadPluginMenuConfiguration(oFF.AuChartInlineConfigs.CONFIG_NAME, oFF.JsonParserFactory.createFromString(oFF.AuChartInlineConfigs.CONFIG_VALUE).asStructure());
	}
};
oFF.AuHiChartView.prototype.updateChartDefinition = function()
{
	var visualizationManager = this.getQueryManager().getQueryModel().getVisualizationManager();
	var currentActiveVisualizationDefinition = visualizationManager.getCurrentActiveVisualizationDefinition();
	if (this.m_chartDefinition === currentActiveVisualizationDefinition)
	{
		this.m_chartDefinition.getChartSetting().processCurrentQMState(this.m_chartDefinition);
	}
};
oFF.AuHiChartView.prototype.updateChart = function()
{
	oFF.XTimeout.timeout(30,  function(){
		if (oFF.notNull(this.m_chart) && this.getQueryManager() !== null && this.getChartDefinition() !== null)
		{
			this.m_chart.setModelJson(this.m_chartDefinition.getAbstractRendering());
		}
	}.bind(this));
};
oFF.AuHiChartView.prototype.onContextMenu = function(event)
{
	this.setupBaseContext(event);
	var showMenu =  function(md, menu){
		if (oFF.notNull(md) && md.hasEffectiveSubItems() && oFF.notNull(menu))
		{
			var clickX = event.getParameters().getIntegerByKeyExt(oFF.UiEventParams.PARAM_CLICK_X, 0);
			var clickY = event.getParameters().getIntegerByKeyExt(oFF.UiEventParams.PARAM_CLICK_Y, 0);
			menu.openAtPosition(clickX, clickY);
		}
	}.bind(this);
	this.m_menuPopulator.createContextMenu(this.getGenesis(), this.m_chartContext, oFF.AuChartContextUtil.UI_CONTEXT_GDS_QB_CHART_CONTEXT_MENU, showMenu);
};

