oFF.AuDataProviderToolkitPlugin.PLUGIN_NAME = "DataProviderToolkit";
oFF.AuDataProviderToolkitPlugin.PARAM_DEFAULT_SYSTEM_NAME = "defaultSystemName";
oFF.AuDataProviderToolkitPlugin.PARAM_DATA_PROVIDER = "dataProvider";
oFF.AuDataProviderToolkitPlugin.PARAM_DATA_PROVIDER_DATASOURCE_REPO = "datasourceRepo";
oFF.AuDataProviderToolkitPlugin.PARAM_DATA_PROVIDER_DATASOURCE_FQN = "fullQualifiedName";
oFF.AuDataProviderToolkitPlugin.PARAM_DATA_PROVIDER_DATASOURCE_SYSTEM = "systemName";
oFF.AuDataProviderToolkitPlugin.PARAM_DATA_PROVIDER_ADD_TO_LIST = "addToList";
oFF.AuDataProviderToolkitPlugin.PARAM_DATA_PROVIDER_SAVE_AS_KEY = "saveAsKey";
oFF.AuDataProviderToolkitPlugin.CMD_POPULATE = "populate";
oFF.AuDataProviderToolkitPlugin.prototype.getPluginName = function()
{
	return oFF.AuDataProviderToolkitPlugin.PLUGIN_NAME;
};
oFF.AuDataProviderToolkitPlugin.prototype.getDisplayName = function()
{
	return oFF.AuDataProviderToolkitPlugin.PLUGIN_NAME;
};
oFF.AuDataProviderToolkitPlugin.prototype.getDescription = function()
{
	return "Offers different actions for data providers";
};
oFF.AuDataProviderToolkitPlugin.prototype.getPluginCategory = function()
{
	return oFF.HuHorizonPluginCategory.OLAP;
};
oFF.AuDataProviderToolkitPlugin.prototype.setupPlugin = function(controller)
{
	oFF.HuDfCommandPlugin.prototype.setupPlugin.call( this , controller);
	var config = controller.getConfigJson();
	var providerElement = config.getByKey(oFF.AuDataProviderToolkitPlugin.PARAM_DATA_PROVIDER);
	if (providerElement.isList())
	{
		oFF.XCollectionUtils.forEach(providerElement.asList(),  function(provider){
			this.setupProviderFromStructure(provider.asStructure());
		}.bind(this));
	}
	else if (providerElement.isStructure())
	{
		this.setupProviderFromStructure(providerElement.asStructure());
	}
	return null;
};
oFF.AuDataProviderToolkitPlugin.prototype.setupProviderFromStructure = function(providerStruct)
{
	var singleDataSource = this.getDataSourceFromProvider(providerStruct);
	var saveAsKey = providerStruct.getStringByKey(oFF.AuDataProviderToolkitPlugin.PARAM_DATA_PROVIDER_SAVE_AS_KEY);
	var addToList = providerStruct.getStringByKey(oFF.AuDataProviderToolkitPlugin.PARAM_DATA_PROVIDER_ADD_TO_LIST);
	this.setupProvider(this.getDataSpace(), singleDataSource, saveAsKey, addToList);
};
oFF.AuDataProviderToolkitPlugin.prototype.registerActions = function(commandController)
{
	commandController.registerAction(oFF.AuDataProviderToolkitPlugin.CMD_POPULATE,  function(context, data){
		return this.setupProvider(context.getDataSpace(), data, null, null);
	}.bind(this));
};
oFF.AuDataProviderToolkitPlugin.prototype.setupProvider = function(dataSpace, dataSource, saveAsKey, addToList)
{
	if (oFF.isNull(dataSource))
	{
		return oFF.XPromise.reject(oFF.XError.create("DataSource could not be read"));
	}
	return oFF.XPromise.create( function(resolve, reject){
		var serviceConfig = oFF.QueryServiceConfig.createWithDataSource(this.getController().getApplication(), dataSource.getSystemName(), dataSource);
		serviceConfig.processQueryManagerCreation(oFF.SyncType.NON_BLOCKING, oFF.OuQueryManagerCreationListenerLambda.createSingleUse( function(result){
			var queryManager = result.getData();
			if (oFF.XStringUtils.isNotNullAndNotEmpty(saveAsKey))
			{
				dataSpace.putXObject(saveAsKey, queryManager);
				oFF.OuHorizonDataSpaceConventions.setDataProviderKey(queryManager, saveAsKey);
			}
			if (oFF.XStringUtils.isNotNullAndNotEmpty(addToList))
			{
				var dataProviderList = dataSpace.getXObjectByKey(addToList);
				if (oFF.isNull(dataProviderList))
				{
					dataProviderList = oFF.XList.create();
				}
				dataProviderList.add(queryManager);
				dataSpace.putXObject(addToList, dataProviderList);
			}
			resolve(queryManager);
		}.bind(this)), null);
	}.bind(this));
};
oFF.AuDataProviderToolkitPlugin.prototype.getDataSourceFromProvider = function(provider)
{
	var dataSource = null;
	if (provider.containsKey(oFF.AuDataProviderToolkitPlugin.PARAM_DATA_PROVIDER_DATASOURCE_REPO))
	{
		var datasourceRepo = provider.getByKey(oFF.AuDataProviderToolkitPlugin.PARAM_DATA_PROVIDER_DATASOURCE_REPO);
		dataSource = oFF.QFactory.createDataSource();
		dataSource.deserializeFromElementExt(oFF.QModelFormat.INA_REPOSITORY, datasourceRepo);
	}
	else if (provider.containsKey(oFF.AuDataProviderToolkitPlugin.PARAM_DATA_PROVIDER_DATASOURCE_FQN))
	{
		var fullQualifiedName = provider.getStringByKey(oFF.AuDataProviderToolkitPlugin.PARAM_DATA_PROVIDER_DATASOURCE_FQN);
		var systemName = provider.getStringByKey(oFF.AuDataProviderToolkitPlugin.PARAM_DATA_PROVIDER_DATASOURCE_SYSTEM);
		dataSource = oFF.QDataSource.create();
		dataSource.setFullQualifiedName(fullQualifiedName);
		dataSource.setSystemName(systemName);
	}
	if (oFF.isNull(dataSource))
	{
		return null;
	}
	if (oFF.XStringUtils.isNullOrEmpty(dataSource.getSystemName()) && this.getConfig().containsKey(oFF.AuDataProviderToolkitPlugin.PARAM_DEFAULT_SYSTEM_NAME))
	{
		dataSource.setSystemName(this.getConfig().getStringByKey(oFF.AuDataProviderToolkitPlugin.PARAM_DEFAULT_SYSTEM_NAME));
	}
	return dataSource;
};

