oFF.AuGdsQuasarDocument.prototype.onLiveChange = function(event)
{
	this.markDirty();
	if (this.isRunning())
	{
		this.clearTimeout();
		this.m_timerId = oFF.XTimeout.timeout(2000,  function(){
			var documentStr = event.getParameters().getStringByKeyExt(oFF.UiEventParams.PARAM_VALUE, null);
			this.executeApp(documentStr);
		}.bind(this));
	}
};

