oFF.AuGdsQueryBuilderDocument.prototype.createViewMenuBarEntries = function(viewMenu)
{
	viewMenu.addNewItem().setText("Show Filter Line").setIcon(this.m_filterLine.isVisible() ? "accept" : null).setEnabled(this.getQueryManager() !== null).setSectionStart(true).registerOnPress(oFF.UiLambdaPressListener.create( function(controlEvent){
		this.toggleFilterLine();
	}.bind(this)));
	var panelsMenuItem = viewMenu.addNewItem().setText("Panels").setIcon("form").setSectionStart(true).setEnabled(this.getQueryManager() !== null).registerOnPress(null);
	this.preparePanelsMenu(panelsMenuItem);
	if (this.areMultiViewsEnabled())
	{
		var addMenuItem = viewMenu.addNewItem().setText("Add view").setIcon("switch-views").setEnabled(this.getQueryManager() !== null).registerOnPress(null);
		this.prepareViewAddMenu(addMenuItem);
		oFF.XCollectionUtils.forEach(this.m_views,  function(tmpView){
			viewMenu.addNewItem().setText(tmpView.getViewName()).setIcon(this.m_activeView === tmpView ? "accept" : null).setSectionStart(viewMenu.getItemCount() === 3).registerOnPress(oFF.UiLambdaPressListener.create( function(controlEvent2){
				var lambdaInnerView = tmpView;
				this.selectViewTab(lambdaInnerView);
			}.bind(this)));
		}.bind(this));
		viewMenu.addNewItem().setText("Close active view").setIcon("decline").setEnabled(this.m_activeView.getViewType() !== oFF.AuGdsViewType.TABLE).setSectionStart(true).registerOnPress(oFF.UiLambdaPressListener.create( function(controlEvent3){
			this.closeActiveView();
		}.bind(this)));
		viewMenu.addNewItem().setText("View settings...").setIcon("settings").setEnabled(true).setSectionStart(true).registerOnPress(oFF.UiLambdaPressListener.create( function(controlEvent4){
			this.presentViewSettings();
		}.bind(this)));
	}
};
