oFF.AuGdsQueryBuilderDocument.prototype.handleStartupWithEmptyDocument = function()
{
	if (oFF.notNull(this.m_externalQueryManagerInstance))
	{
		this.markDirty();
		this.m_queryController.initWithExistingQueryManager(this.m_externalQueryManagerInstance);
	}
	else if (oFF.notNull(this.m_dataSource))
	{
		this.markDirty();
		this.m_queryController.setInaRepoJson(null);
		this.m_queryController.initQueryManagerFromDataSource(this.getApplication(), this.m_dataSource);
	}
	else if (oFF.notNull(this.m_model))
	{
		this.markDirty();
		this.m_queryController.setInaRepoJson(null);
		this.m_queryController.setForceInitialVariableDialog(false);
		this.openFile(this.getModelFile(this.m_model)).onCatch( function(errMsg){
			this.handleCriticalStartupError(this.getLocalizationProvider().getText(oFF.AuGdsQueryBuilderI18n.CANNOT_OPEN_MODEL_MSG));
		}.bind(this));
	}
	else
	{
		this.showLandingPage(true);
	}
};
oFF.AuGdsQueryBuilderDocument.prototype.getModelFile = function(model)
{
	var environment = this.getProcess().getEnvironment();
	var docConfig = this.getDocumentConfigJson();
	var defaultRootPath = oFF.isNull(docConfig) ? "" : docConfig.getStringByKeyExt(oFF.AuGdsQbConstants.CONFIG_MODEL_DIRECTORY, "");
	var modelPath = oFF.XString.containsString(model, "/") || oFF.XStringUtils.isNullOrEmpty(defaultRootPath) ? model : oFF.XStringUtils.concatenate3(environment.resolvePath(defaultRootPath), "/", model);
	var modelFile = oFF.XFile.createByUrl(this.getProcess(), modelPath);
	var fileAttributes = modelFile.getAttributes();
	if (oFF.XStringUtils.isNullOrEmpty(fileAttributes.getStringByKey(oFF.XFileAttribute.NODE_TYPE.getName())))
	{
		fileAttributes.putString(oFF.XFileAttribute.NODE_TYPE.getName(), oFF.ContentlibConstants.V_RESOURCE_TYPE_CUBE);
	}
	return modelFile;
};
oFF.AuGdsQueryBuilderDocument.prototype.handleExistingDocContent = function(docContent)
{
	var qbDocContent = docContent;
	var system = qbDocContent.getSystemName();
	var inaRepoJson = qbDocContent.getInaRepoStructure();
	this.m_viewsFromFile = qbDocContent.getViews();
	var filterLineConfig = qbDocContent.getFilterLineConfig();
	this.setFilterLineConfig(filterLineConfig);
	var queryDetailsConfig = qbDocContent.getQueryDetailsConfig();
	this.setQueryDetailsConfig(queryDetailsConfig);
	var dataSource = oFF.QFactory.createDataSource();
	dataSource.deserializeFromElementExt(oFF.QModelFormat.INA_REPOSITORY, inaRepoJson);
	dataSource.setSystemName(system);
	this.m_dataSource = dataSource;
	this.m_queryController.setInaRepoJson(inaRepoJson);
	this.m_queryController.setForceInitialVariableDialog(qbDocContent.getForcePrompt());
	this.m_queryController.setSuppressExitVariables(qbDocContent.getSuppressExitVariables());
	var model = this.getDocContent().getModel();
	if (oFF.XStringUtils.isNotNullAndNotEmpty(model))
	{
		var fileManager = this.getFileManager();
		var modelFile = this.getModelFile(model);
		fileManager.loadDocument(modelFile,  function(docType, file, jsonObj){
			this.openModelForInsight(jsonObj, file);
		}.bind(this));
	}
	else
	{
		if (qbDocContent.getCustomStructure(oFF.AuGdsQbOrcaInteropConstants.GDF_QD_ORCA_INTEROP_SETTTINGS_KEY) !== null)
		{
			oFF.AuGdsQbOrcaInteropHandler.addModelInformationToDocContenIfExists(docContent);
		}
		this.m_queryController.initQueryManagerFromDataSource(this.getApplication(), this.m_dataSource);
	}
};
oFF.AuGdsQueryBuilderDocument.prototype.handleExternalFileType = function(fileType, fileJson, file)
{
	if (fileType === oFF.AuGdsFileType.INSIGHT)
	{
		this.openInsight(file, fileJson);
	}
	else if (fileType === oFF.AuGdsFileType.MODEL)
	{
		if (this.openModel(fileJson, file))
		{
			oFF.AuGdsQbExternalConfiguration.getInstance().fireFileLoadedCallback(this, fileType, file);
		}
		else
		{
			this.handleCriticalStartupError(null);
		}
	}
};
oFF.AuGdsQueryBuilderDocument.prototype.handleNewDocContentLoaded = function()
{
	var loadingText = "Loading document...";
	if (this.getFile() !== null)
	{
		loadingText = oFF.XStringUtils.concatenate2("Loading ", this.getFile().getName());
	}
	else if (oFF.XStringUtils.isNotNullAndNotEmpty(this.getDocumentName()))
	{
		loadingText = oFF.XStringUtils.concatenate2("Loading ", this.getDocumentName());
	}
	this.cleanMainView();
	this._setContentBusy(loadingText);
	this.handleExistingDocContent(this.getDocContent());
};
oFF.AuGdsQueryBuilderDocument.prototype.handleStartupWithFileLoadingError = function(file)
{
	if (file.hasErrors() && file.getFirstError().hasCode() && file.getFirstError().getCode() === oFF.HttpStatusCode.SC_INTERNAL_SERVER_ERROR)
	{
		this.handleCriticalStartupError(this.getLocalizationProvider().getText(oFF.AuGdsQueryBuilderI18n.INVALID_RESOURCE_ID_MSG));
	}
	else
	{
		this.handleCriticalStartupError(this.getLocalizationProvider().getText(oFF.AuGdsQueryBuilderI18n.MSG_ERROR));
	}
};
