oFF.AuGdsQueryBuilderDocument.prototype.generateFileName = function()
{
	var filename = "unnamed";
	if (this.hasFile())
	{
		filename = this.getFile().getUri().getPathContainer().getFileName();
	}
	else if (this.getQueryManager() !== null)
	{
		filename = oFF.XStringUtils.concatenate3(this.getQueryManager().getQueryModel().getDataSource().getSystemName(), "_", this.getQueryManager().getQueryModel().getDataSource().getName());
		filename = oFF.XString.toLowerCase(filename);
	}
	return filename;
};
oFF.AuGdsQueryBuilderDocument.prototype.getDocumentCustomTitle = function()
{
	if (oFF.notNull(this.m_dataSource))
	{
		return oFF.XStringUtils.concatenate3(this.m_dataSource.getSystemName(), " - ", this.m_dataSource.getName());
	}
	if (oFF.notNull(this.m_externalQueryManagerInstance))
	{
		return oFF.XStringUtils.concatenate3(this.m_externalQueryManagerInstance.getQueryModel().getSystemName(), " - ", this.m_externalQueryManagerInstance.getQueryModel().getName());
	}
	return null;
};
oFF.AuGdsQueryBuilderDocument.prototype.setDocumentTitle = function(documentTitle)
{
	this.m_documentTitle = documentTitle;
};
oFF.AuGdsQueryBuilderDocument.prototype.getDocumentTitle = function()
{
	if (oFF.notNull(this.m_documentTitle))
	{
		return this.m_documentTitle;
	}
	var niceTitle = null;
	var modelInfo = this.getDocContent().getCustomStructure(oFF.AuGdsQbSacContentlibConstants.MODEL_INFO);
	if (oFF.XCollectionUtils.hasElements(modelInfo) && oFF.XStringUtils.isNotNullAndNotEmpty(modelInfo.getStringByKey(oFF.OuQueryInformationDialogConstants.MODEL_DISPLAY_NAME_KEY)))
	{
		niceTitle = modelInfo.getStringByKey(oFF.OuQueryInformationDialogConstants.MODEL_DISPLAY_NAME_KEY);
	}
	if (oFF.XStringUtils.isNullOrEmpty(niceTitle) && this.getQueryController() !== null)
	{
		niceTitle = this.getQueryController().getQueryName();
	}
	return niceTitle;
};
