oFF.AuGdsQueryBuilderDocument.prototype.updateDocContentForSave = function()
{
	var queryManager = this.getQueryManager();
	if (oFF.notNull(queryManager))
	{
		var chartsEnabled = this.getDocumentConfigJson().getBooleanByKey(oFF.AuGdsQbConstants.CONFIG_ENABLE_CHARTING);
		if (chartsEnabled)
		{
			queryManager.getQueryModel().getVisualizationManager().setRepoSerializationActive(true);
		}
		var docContent = this.getQueryBuilderDocContent();
		docContent.setSystemName(queryManager.getQueryModel().getDataSource().getSystemName());
		docContent.setDataSource(queryManager.getQueryModel().getDataSource().getFullQualifiedName());
		docContent.setInaRepoStructure(queryManager.getQueryModel().serializeToElement(oFF.QModelFormat.INA_REPOSITORY_DELTA));
		if (!chartsEnabled)
		{
			var allViews = oFF.PrFactory.createList();
			oFF.XCollectionUtils.forEach(this.m_views,  function(qbView){
				var viewData = qbView.getViewSaveData();
				var viewSaveStruct = oFF.PrFactory.createStructure();
				viewSaveStruct.put(oFF.AuGdsQbConstants.GDF_QD_FILE_VIEWS_VIEW_DATA_KEY, viewData);
				viewSaveStruct.putInteger(oFF.AuGdsQbConstants.GDF_QD_FILE_VIEWS_VIEW_INDEX_KEY, this.getViewIndex(qbView));
				allViews.add(viewSaveStruct);
			}.bind(this));
			docContent.setViews(allViews);
		}
		docContent.setSelectedViewIndex(this.getSelectedViewIndex());
		if (oFF.notNull(this.m_filterLine))
		{
			docContent.setFilterLineConfig(this.m_filterLine.getConfig());
		}
		if (oFF.notNull(this.m_queryDetails))
		{
			docContent.setQueryDetailsConfig(this.m_queryDetails.getConfig());
		}
		var modelName = this.getModelName();
		if (oFF.XStringUtils.isNotNullAndNotEmpty(modelName))
		{
			docContent.setModel(modelName);
		}
	}
};
oFF.AuGdsQueryBuilderDocument.prototype.getModelName = function()
{
	var modelName = null;
	if (this.getQueryManager() !== null && this.getQueryBuilderDocContent().getCustomStructure(oFF.AuGdsQbSacContentlibConstants.MODEL_DEPENDENCY) !== null)
	{
		var epmObject = this.getQueryManager().getQueryModel() === null ? null : this.getQueryManager().getQueryModel().getDatasetEpmObject();
		if (oFF.notNull(epmObject))
		{
			modelName = oFF.XStringUtils.concatenate3(epmObject.getPackageName(), ":", epmObject.getName());
		}
	}
	return modelName;
};
oFF.AuGdsQueryBuilderDocument.prototype.isActionAvailable = function(actionId)
{
	if (oFF.XString.isEqual(actionId, oFF.AuGdsConstants.ACTION_ADD_VIEW_CHART) && this.areMultiViewsEnabled())
	{
		return true;
	}
	if (oFF.XString.isEqual(actionId, oFF.AuGdsConstants.ACTION_ADD_VIEW_SPREADSHEET) && this.areMultiViewsEnabled())
	{
		return true;
	}
	if (oFF.XString.isEqual(actionId, oFF.AuGdsConstants.ACTION_RESET_INSIGHT) && this.getApplication().getUndoManager().getAvailableUndoStepCount() > 0)
	{
		return true;
	}
	if (oFF.XString.isEqual(actionId, oFF.AuGdsConstants.ACTION_OPEN_TOPN_DIALOG))
	{
		var defaultSettings = this.getDefaultSettings();
		return this.getQueryManager() !== null && (this.getQueryManager().getSystemType().isTypeOf(oFF.SystemType.BW) || oFF.isNull(defaultSettings) || !defaultSettings.getBooleanByKey(oFF.AuGdsQbConstants.DEFAULT_SETTINGS_RESTRICT_TOPN_TO_BW));
	}
	return false;
};
oFF.AuGdsQueryBuilderDocument.prototype.executeAction = function(actionId)
{
	if (oFF.XString.isEqual(actionId, oFF.AuGdsConstants.ACTION_ADD_VIEW_CHART) && this.areMultiViewsEnabled())
	{
		this.addChartView(null, null);
	}
	else if (oFF.XString.isEqual(actionId, oFF.AuGdsConstants.ACTION_ADD_VIEW_SPREADSHEET) && this.areMultiViewsEnabled())
	{
		this.addSpreadsheetView();
	}
	else if (oFF.XString.isEqual(actionId, oFF.AuGdsConstants.ACTION_RESET_INSIGHT) && this.getApplication().getUndoManager().getAvailableUndoStepCount() > 0)
	{
		this.resetInsight();
	}
};
