oFF.AuGdsQueryBuilderDocument.prototype.presentExportDialog = function(exportType)
{
	var okHandler =  function(config){
		this._setContentBusy(this.getLocalizationProvider().getText(oFF.AuGdsQueryBuilderI18n.MSG_EXPORTING_DATA));
		if (this.getQueryManager().getSystemType().isTypeOf(oFF.SystemType.ORCA))
		{
			config.setDefaultDatasourceName(this.getDocumentTitle());
		}
		var onError =  function(msg){
			this._setContentBusy(null);
			this.getMessageCenter().showErrorToast(msg);
		}.bind(this);
		var onComplete =  function(result){
			this._setContentBusy(null);
			if (result.success())
			{
				if (result.hasWarnings())
				{
					var warning = oFF.DataExportHelper.getDisplayMessageFromResult(result);
					this.getMessageCenter().showWarningToast(warning);
				}
				else
				{
					var successMsg = this.getLocalizationProvider().getTextWithPlaceholder(oFF.AuGdsQueryBuilderI18n.MSG_EXPORT_DATA_SUCCESS, config.getFileName());
					this.getMessageCenter().showSuccessToast(successMsg);
				}
				oFF.AuGdsQbExternalConfiguration.getInstance().fireDocumentExportedCallback(this, config);
			}
		}.bind(this);
		var dataExportHelper = oFF.DataExportHelper.create(this.getQueryController().getQueryManager(), this.m_tableView.getTableDefinition(), onError, onComplete);
		dataExportHelper.exportData(config);
	}.bind(this);
	var exportDialogRunner = oFF.ProgramRunner.createRunner(this.getProcess(), oFF.SuExportDialog.DEFAULT_PROGRAM_NAME);
	exportDialogRunner.setArgument(oFF.SuExportDialog.PARAM_EXPORT_TYPE, exportType);
	exportDialogRunner.setArgument(oFF.SuExportDialog.PARAM_FILE_NAME, this.getDocumentTitle());
	exportDialogRunner.setBooleanArgument(oFF.SuExportDialog.PARAM_FIT_TABLE_TO_PAGE_WIDTH_FEATURE_ENABLED, oFF.DataExportHelper.isFitTableToPageWidthFeatureEnabled(this.getDocumentConfigJson()));
	exportDialogRunner.runProgram().then( function(dialog){
		var expDialog = dialog;
		expDialog.setOkHandler(okHandler);
		return expDialog;
	}.bind(this),  function(error){
		this.getGenesis().showErrorToast(error.getText());
	}.bind(this));
};
oFF.AuGdsQueryBuilderDocument.prototype.openFilterDialog = function(dimension)
{
	var localizationProvider = this.getLocalizationProvider();
	var dimensionText = oFF.XStringUtils.isNotNullAndNotEmpty(dimension.getText()) ? dimension.getText() : dimension.getName();
	if (dimension.getQueryManager().getSystemType().isTypeOf(oFF.SystemType.BW))
	{
		if (dimension.getDimensionType() === oFF.DimensionType.MEASURE_STRUCTURE)
		{
			dimensionText = localizationProvider.getText(oFF.OlapUiCommonI18n.COMMON_MEASURES);
		}
		else if (dimension.getDimensionType() === oFF.DimensionType.SECONDARY_STRUCTURE)
		{
			dimensionText = localizationProvider.getText(oFF.OlapUiCommonI18n.COMMON_STRUCTURE);
		}
	}
	var dialogTitle = localizationProvider.getTextWithPlaceholder(oFF.AuGdsQueryBuilderI18n.FILTER_DIALOG_TITLE, dimensionText);
	var runner = oFF.FilterDialogProgramRunnerFactory.createForDimension(this.getApplication().getProcess(), dimension.getQueryManager(), dimension.getName(), dialogTitle);
	runner.setArgument(oFF.FilterDialog.PARAM_SELECTION_MODE, oFF.UiSelectionMode.MULTI_SELECT.getName());
	runner.setBooleanArgument(oFF.FilterDialog.PARAM_OPEN_WITH_DYNAMIC_FILTER, true);
	runner.setBooleanArgument(oFF.FilterDialog.PARAM_OFFER_CLIPBOARD, true);
	runner.setBooleanArgument(oFF.FilterDialog.PARAM_OFFER_EXCLUDE, true);
	runner.setBooleanArgument(oFF.FilterDialog.PARAM_OFFER_HIERARCHY_CHANGE, true);
	runner.setObjectArgument(oFF.FilterDialog.PARAM_LISTENER_CLOSE, oFF.FilterDialogLambdaCloseListener.create( function(selection){
		this.getQueryController().updateQueryResultSet();
	}.bind(this), null));
	runner.setBooleanArgument(oFF.FilterDialog.PARAM_OFFER_READMODE_CHANGE, true);
	if (this.isCascadingFiltersEnabled())
	{
		runner.setBooleanArgument(oFF.FilterDialog.PARAM_OFFER_READMODE_EXTENDED_SETTINGS, true);
		if (oFF.notNull(this.m_filterLine))
		{
			var storedReadMode = this.m_filterLine.getReadModeForDimension(dimension);
			runner.setArgument(oFF.FilterDialog.PARAM_READMODE, storedReadMode.isPresent() ? storedReadMode.get().getName() : null);
		}
	}
	runner.setObjectArgument(oFF.FilterDialog.PARAM_LISTENER_BEFORE_FILTER_CHANGE, oFF.AuGdsLambdaFdBeforeFilterChangeListener.create( function(settings){
		oFF.UiPerformanceCenter.getCenter().startMeasure("[Dragonfly][Filter Dimension]");
		if (oFF.notNull(this.m_filterLine))
		{
			this.m_filterLine.getBeforeFilterChangeListener(dimension).onBeforeChange(settings);
		}
	}.bind(this)));
	runner.runProgram();
};
