oFF.AuGdsQueryBuilderDocument.prototype.showLandingPage = function(suppressDataSourcePicker)
{
	this.m_dataSource = null;
	this.m_viewsFromFile = null;
	var onlyRefreshUrl = this.getQueryBuilderDocContent().getCustomStructure(oFF.AuGdsQbSacContentlibConstants.DOCUMENT_STATE_FLAG) !== null ? false : true;
	this.clearDatasourceArguments();
	this.getQueryController().reset();
	this.resetDocContent();
	this.setFile(null);
	this.markPristine();
	this.getStatusBarManager().hideNetworkActivityIndicator();
	if (this.isFeatureEnabled(oFF.AuGdsConstants.PARAM_SUPPRESS_LANDING_PAGE))
	{
		return;
	}
	this.cleanMainView();
	var shouldShowWelcomeDialog = this.isFeatureEnabled(oFF.AuGdsConstants.PARAM_SHOW_WELCOME_DIALOG) && !this.m_didShowWelcomeDialog;
	this.m_didShowWelcomeDialog = shouldShowWelcomeDialog;
	this.m_landingPage = oFF.AuGdsQbLandingPage.create(this, shouldShowWelcomeDialog);
	this.m_landingPage.setFromDataSourceLegacyPressedProcedure( function(){
		this.presentLegacyDataSourcePicker();
	}.bind(this));
	this.m_landingPage.setFromDataSourcePressedProcedure( function(){
		this.presentNewDataSourcePicker();
	}.bind(this));
	this.m_landingPage.setOpenInsightPressedProcedure( function(){
		this.presentInsightPicker();
	}.bind(this));
	this.m_landingPage.setFromModelPressedProcedure( function(){
		this.presentModelPicker();
	}.bind(this));
	this.m_landingPage.setRecentFileSelectedConsumer( function(recentFile){
		this.openFile(recentFile);
	}.bind(this));
	this.m_contentLayout.addItem(this.m_landingPage.getView());
	this.getToolbarManager().setToolbarVisible(false);
	this.setStatusInfo("Create a new dragonfly document...");
	this.setTitle(this.getDocumentType().getDisplayName());
	this.updateQuickActionToolbar();
	if (this.isAutoOpenDataSourcePicker() && !suppressDataSourcePicker)
	{
		this.presentDataSourcePicker();
	}
	oFF.AuGdsQbExternalConfiguration.getInstance().fireLandingPageShownCallback(onlyRefreshUrl);
};
