oFF.AuGdsQueryBuilderDocument.prototype.resetInsight = function()
{
	this.getApplication().getUndoManager().reset();
	this.markPristine();
	if (this.hasFile())
	{
		this.openFile(this.getFile());
	}
	else if (oFF.XStringUtils.isNotNullAndNotEmpty(this.getModelName()))
	{
		this.m_queryController.setInaRepoJson(this.getDocContent().getInaRepoStructure());
		this.m_queryController.setForceInitialVariableDialog(false);
		this.openFile(this.getModelFile(this.getModelName())).onCatch( function(errMsg){
			this.getQueryManager().getConvenienceCommands().resetToDefault();
			this.updateQueryResultSet();
		}.bind(this));
	}
	else if (oFF.notNull(this.m_dataSource))
	{
		this.m_queryController.resetToDataSource(this.m_dataSource, this.getDocContent().getInaRepoStructure());
	}
	else if (this.getQueryManager() !== null)
	{
		this.getQueryManager().getConvenienceCommands().resetToDefault();
		this.updateQueryResultSet();
	}
};
