oFF.AuGdsQueryBuilderDocument.prototype.handleQueryControllerMessage = function(msgType, msg)
{
	if (msgType === oFF.UiMessageType.WARNING)
	{
		this.getMessageCenter().showWarningToast(msg);
	}
	else if (msgType === oFF.UiMessageType.ERROR)
	{
		this.getMessageCenter().showErrorToast(msg);
	}
	else if (msgType === oFF.UiMessageType.SUCCESS)
	{
		this.getMessageCenter().showSuccessToast(msg);
	}
	else if (msgType === oFF.UiMessageType.INFORMATION)
	{
		this.getMessageCenter().showInfoToast(msg);
	}
	else
	{
		this.getMessageCenter().showInfoToast(msg);
	}
};
oFF.AuGdsQueryBuilderDocument.prototype.handleQueryControllerStatusChanged = function(status, message)
{
	if (status === oFF.AuGdsQbQueryControllerStatus.NOT_IN_SYNC)
	{
		if (!this._isAutoUpdatesEnabledInternal())
		{
			this._setContentBusy(null);
		}
		if (oFF.notNull(this.m_viewContainer))
		{
			this.m_viewContainer.addCssClass("ffGdsQbTableNotInSync");
		}
	}
	else
	{
		if (oFF.notNull(this.m_viewContainer))
		{
			this.m_viewContainer.removeCssClass("ffGdsQbTableNotInSync");
		}
	}
	if (status === oFF.AuGdsQbQueryControllerStatus.SETUP_IN_PROGRESS)
	{
		this._setContentBusy(this.getLocalizationProvider().getText(oFF.AuGdsQueryBuilderI18n.MSG_LOADING_QUERY));
	}
	else if (status === oFF.AuGdsQbQueryControllerStatus.SYNC_ERROR)
	{
		if (this.getFeatureManager().isUi5Integration())
		{
			this._setCriticalError(message);
		}
		else
		{
			this.getMessageCenter().showErrorToast(message);
		}
		this.setStatusError(message);
	}
	else if (status === oFF.AuGdsQbQueryControllerStatus.INIT_ERROR)
	{
		if (oFF.XStringUtils.isNotNullAndNotEmpty(message))
		{
			this.getMessageCenter().showErrorToast(message);
		}
	}
	else if (status === oFF.AuGdsQbQueryControllerStatus.IN_SYNC)
	{
		if (oFF.isNull(this.m_tableView))
		{
			this.cleanMainView();
			this.createAndRenderNewTableView();
		}
		this.m_tableView.refreshView();
		if (oFF.notNull(this.m_queryDetails))
		{
			this.m_queryDetails.setTransientDefaultTitle(this.getDocumentTitle());
			this.m_queryDetails.onResultReady();
		}
	}
};
oFF.AuGdsQueryBuilderDocument.prototype.handleQueryControllerSetupStepChanged = function(setupStep)
{
	if (setupStep === oFF.AuGdsQbQueryControllerSetupStep.BEFORE_QUERY_MODEL_DESERIALIZATION)
	{
		oFF.AuGdsQbOrcaInteropHandler.applyOrcaSfxMetadataToQueryManager(this.getQueryBuilderDocContent(), this.getQueryManager());
	}
	else if (setupStep === oFF.AuGdsQbQueryControllerSetupStep.INITIAL_VARIABLE_DIALOG_PRESENTED)
	{
		this.setStatusWarning(this.getLocalizationProvider().getText(oFF.AuGdsQueryBuilderI18n.MSG_SELECT_INITIAL_VARIABLES));
	}
};
oFF.AuGdsQueryBuilderDocument.prototype.handleQueryControllerCriticalError = function(criticalErrorType)
{
	if (criticalErrorType === oFF.AuGdsQbQueryControllerCriticalErrorType.QUERY_MANAGER_CREATION_FAILED)
	{
		var detailedMessages = oFF.MessageUtil.getMessageStringFromList(this.getQueryController().getMessageManager(), "Could not open query. Please ask your administrator.");
		this._setCriticalError(detailedMessages);
	}
	else if (criticalErrorType === oFF.AuGdsQbQueryControllerCriticalErrorType.MISSING_QUERY_MANAGER)
	{
		this._setCriticalError(this.getLocalizationProvider().getText(oFF.AuGdsQueryBuilderI18n.MSG_MISSING_QUERY_MANAGER));
	}
};
oFF.AuGdsQueryBuilderDocument.prototype.handleQueryControllerSetupInterrupt = function(reason)
{
	this.m_postponedPanelActions.clear();
	var errorText = this.getErrorText(reason);
	if (oFF.AuGdsQbExternalConfiguration.getInstance().fireCriticalErrorHandler(errorText))
	{
		return;
	}
	if (oFF.XString.isEqual(reason, oFF.AuGdsQbQueryControllerContants.GDF_QB_QC_VARIABLE_SUBMIT_FAILED))
	{
		this.getMessageCenter().showErrorToast(errorText);
		this.showInitialVariablesNotSetView();
	}
	else if (oFF.XString.isEqual(reason, oFF.AuGdsQbQueryControllerContants.GDF_QB_QC_INITIAL_VARIABLES_NOT_SET))
	{
		this.showInitialVariablesNotSetView();
	}
	else if (oFF.XString.isEqual(reason, oFF.AuGdsQbQueryControllerContants.GDF_QB_QC_AUTHENTICATION_FAILED))
	{
		oFF.UiCredentialsProviderHelper.handleAuthenticationErrors(this.getGenesis(), this.m_queryController.getMessageManager().getMessages());
		this.handleCriticalStartupError(errorText);
	}
	else
	{
		this.handleCriticalStartupError(errorText);
	}
};
oFF.AuGdsQueryBuilderDocument.prototype.getErrorText = function(reason)
{
	if (oFF.XString.isEqual(reason, oFF.AuGdsQbQueryControllerContants.GDF_QB_QC_VARIABLE_SUBMIT_FAILED))
	{
		return this.getLocalizationProvider().getText(oFF.AuGdsQueryBuilderI18n.MSG_COULD_NOT_SUBMIT_VARIABLES);
	}
	else if (oFF.XString.isEqual(reason, oFF.AuGdsQbQueryControllerContants.GDF_QB_QC_COULD_NOT_OPEN_QUERY))
	{
		return this.getLocalizationProvider().getText(oFF.AuGdsQueryBuilderI18n.CANNOT_OPEN_DATA_SOURCE_MSG);
	}
	return null;
};
oFF.AuGdsQueryBuilderDocument.prototype.handleCriticalStartupError = function(errorText)
{
	if (oFF.AuGdsQbExternalConfiguration.getInstance().fireCriticalErrorHandler(errorText))
	{
		return;
	}
	if (oFF.notNull(errorText))
	{
		this.getMessageCenter().showErrorToast(errorText);
	}
	this.showLandingPage(true);
};
