oFF.AuGdsQueryBuilderDocument.prototype.handleInsightFileForSaveSelected = function(resourceInfo, dialog)
{
	if (oFF.notNull(resourceInfo) && !resourceInfo.isDirectory())
	{
		var file = oFF.XFile.createByUrl(this.getProcess(), resourceInfo.getUrl());
		oFF.AuGdsQbSacInsightHandler.addFileAttributes(file, resourceInfo);
		var isOpenPromptAutomatically = false;
		if (resourceInfo.get(oFF.AuGdsQbSacContentlibConstants.AUTOMATICALLY_OPEN_PROMPT) !== null)
		{
			isOpenPromptAutomatically = resourceInfo.get(oFF.AuGdsQbSacContentlibConstants.AUTOMATICALLY_OPEN_PROMPT).getBoolean();
		}
		this.getQueryBuilderDocContent().setForcePrompt(isOpenPromptAutomatically);
		var suppressExitVariables = false;
		if (resourceInfo.get(oFF.AuGdsQbSacContentlibConstants.SAVE_DYNAMIC_VARIABLES) !== null)
		{
			suppressExitVariables = resourceInfo.get(oFF.AuGdsQbSacContentlibConstants.SAVE_DYNAMIC_VARIABLES).getBoolean();
		}
		this.getQueryBuilderDocContent().setSuppressExitVariables(suppressExitVariables);
		this.saveInsightToFile(file,  function(extResult){
			if (!extResult.hasErrors())
			{
				this.handleDocumentSaved(extResult.getData());
				dialog.close();
			}
			else
			{
				var errors = extResult.getErrors();
				var iterator = errors.getIterator();
				var error = iterator.next();
				var errorText = error.getText();
				var errorKey = oFF.AuGdsQbSacContentlibErrorMessageUtil.getLocalisedMessageKey(errorText);
				errorText = this.getLocalizationProvider().getText(errorKey);
				if (oFF.isNull(errorText) || oFF.XString.isEqual(errorText, errorKey))
				{
					errorText = this.getLocalizationProvider().getText(oFF.AuGdsQueryBuilderI18n.SAVE_INSIGHT_ERROR);
				}
				dialog.showErrorMessage(errorText);
			}
		}.bind(this));
	}
	else
	{
		dialog.showErrorMessage(this.getLocalizationProvider().getText(oFF.AuGdsQueryBuilderI18n.SAVE_INSIGHT_ERROR));
	}
};
oFF.AuGdsQueryBuilderDocument.prototype.saveInsightToFile = function(fileToSave, consumer)
{
	if (this.hasSaveData())
	{
		var contentToSave = this.getSaveContent();
		var queryBuilderJson = contentToSave.getJsonContent();
		var formattedContent = oFF.AuGdsFileType.INSIGHT.format(queryBuilderJson, fileToSave);
		formattedContent = oFF.AuGdsQbSacInsightHandler.appendModelDataset(formattedContent, this.getDocContent(), this.getQueryManager());
		if (oFF.notNull(formattedContent))
		{
			var formattedContentToSave = oFF.XContent.createJsonObjectContent(oFF.ContentType.JSON, formattedContent);
			this.getFileManager().saveDocumentContentAs(formattedContentToSave, fileToSave,  function(extResult){
				if (!extResult.hasErrors())
				{
					this.handleDocumentSaved(extResult.getData());
				}
				if (oFF.notNull(consumer))
				{
					consumer(extResult);
				}
			}.bind(this));
		}
	}
	else
	{
		this.getMessageCenter().showErrorToast("No save data! Cannot save");
	}
};
