oFF.AuGdsQueryBuilderDocument.prototype.onSelect = function(event)
{
	var control = event.getControl();
	if (control === this.m_viewIconTabBar)
	{
		var selectedTab = event.getSelectedItem();
		var tmpView = selectedTab.getCustomObject();
		this.changeActiveView(tmpView);
		var currentActiveVisualizationDefinition = null;
		var visualizationManager = this.getQueryManager().getQueryModel().getVisualizationManager();
		var valuesAsReadOnlyListOfString = this.m_viewsByVisualizations.getKeysAsReadOnlyListOfString();
		for (var i = 0; i < valuesAsReadOnlyListOfString.size(); i++)
		{
			if (oFF.XString.isEqual(this.m_viewsByVisualizations.getByKey(valuesAsReadOnlyListOfString.get(i)), tmpView.getUuid()))
			{
				var key = valuesAsReadOnlyListOfString.get(i);
				currentActiveVisualizationDefinition = oFF.XCollectionUtils.findFirst(visualizationManager.getVisualizationDefinitions(),  function(visDef){
					return oFF.XString.isEqual(visDef.getName(), key);
				}.bind(this));
				break;
			}
		}
		if (oFF.isNull(currentActiveVisualizationDefinition))
		{
			currentActiveVisualizationDefinition = oFF.XCollectionUtils.findFirst(visualizationManager.getVisualizationDefinitions(),  function(visDef2){
				return visDef2.getProtocolBindingType() === oFF.ProtocolBindingType.SAC_TABLE_GRID;
			}.bind(this));
		}
		visualizationManager.setCurrentActiveVisualizationDefinition(currentActiveVisualizationDefinition);
		this.newQueryManagerReady();
	}
};
