oFF.AuGdsQbConditionalFormattingView.prototype.createAddRuleBtn = function()
{
	var i18n = oFF.AuGdsQbConditionalFormattingI18n.getLocalization();
	var addRuleBtn = oFF.AuGdsQbConditionalFormattingUiControlCreator.createIconAddBtn(this.getGenesis(), i18n.getText(oFF.AuGdsQbConditionalFormattingI18n.ADD_RULE),  function(controlEvent){
		this.m_ruleDialogRunner.runNew();
	}.bind(this));
	addRuleBtn.addCssClass("ffGdsQbSpCfAddRule");
	addRuleBtn.addCssClass("ffGdsQbSpCfHeaderAddRule");
	return addRuleBtn;
};
oFF.AuGdsQbConditionalFormattingView.prototype.buildPanelContent = function()
{
	var panelContent = this.m_rootPanel.setNewContent(oFF.UiType.VERTICAL_LAYOUT);
	this.createRulesContainer(panelContent);
};
oFF.AuGdsQbConditionalFormattingView.prototype.createRulesContainer = function(panelContent)
{
	this.m_rulesContainer = panelContent.addNewItemOfType(oFF.UiType.VERTICAL_LAYOUT);
	this.m_rulesContainer.addCssClass("ffGdsQbSpCfRulesContainer");
	var i18n = oFF.AuGdsQbConditionalFormattingI18n.getLocalization();
	this.m_noRulesMsgContainer = panelContent.addNewItemOfType(oFF.UiType.VERTICAL_LAYOUT);
	this.m_noRulesMsgContainer.addCssClass("ffGdsQbSpCfNoRulesMsgContainer");
	var noRulesMsg = this.m_noRulesMsgContainer.addNewItemOfType(oFF.UiType.FORMATTED_TEXT);
	noRulesMsg.setText(i18n.getText(oFF.AuGdsQbConditionalFormattingI18n.NO_RULES_MSG));
};
oFF.AuGdsQbConditionalFormattingView.prototype.getQueryManager = function()
{
	return this.m_queryManager;
};
oFF.AuGdsQbConditionalFormattingView.prototype.setQueryManager = function(queryManager)
{
	oFF.XObjectExt.assertNotNullExt(queryManager, "Query Manager shouldn't be null!");
	this.m_queryManager = queryManager;
	this.m_CRUDLAPI = oFF.AuGdsQbConditionalFormattingCRUDLAPI.create(queryManager.getQueryModel());
	this.m_dataProvider = oFF.AuGdsQbConditionalFormattingRuleDataProviderFactory.create(queryManager);
	this.m_ruleDialogRunner = oFF.AuGdsQbConditionalFormattingRuleDialogRunner.create(this.m_parentProcess, queryManager, this.m_cfConfigHelper);
	this.m_ruleDialogRunner.setOnOkProcedure( function(){
		this.onUpdateQueryManager();
	}.bind(this));
	this.m_activationManager = oFF.AuGdsQbConditionalFormattingRuleActivationManager.create(queryManager.getQueryModel());
	this.updateUi();
};
oFF.AuGdsQbConditionalFormattingView.prototype.updateUi = function()
{
	var initialized = oFF.notNull(this.m_queryManager);
	this.m_rootPanel.setBusy(!initialized);
	if (oFF.notNull(this.m_queryManager))
	{
		this.loadCards();
	}
};
oFF.AuGdsQbConditionalFormattingView.prototype.onUpdateQueryManager = function()
{
	this.updateUi();
	this.notifyChangeListeners();
};
oFF.AuGdsQbConditionalFormattingView.prototype.loadCards = function()
{
	this.m_rulesContainer.clearItems();
	this.m_cardWidgetList.clear();
	var cardsLoaded = oFF.AuGdsQbConditionalFormattingView.AGGREGATED_RULE_CARDS ? this.loadMeasureRulesCards() : this.loadRulesCards();
	this.m_noRulesMsgContainer.setVisible(!cardsLoaded);
};
oFF.AuGdsQbConditionalFormattingView.prototype.loadRulesCards = function()
{
	var rules = this.m_CRUDLAPI.listAllRules();
	for (var i = 0; i < rules.size(); i++)
	{
		var cardWidget = this.createRuleCard(rules.get(i));
		this.m_cardWidgetList.add(cardWidget);
		this.m_rulesContainer.addItem(cardWidget.getView());
	}
	return rules.size() > 0;
};
oFF.AuGdsQbConditionalFormattingView.prototype.resetAllWarningMessage = function()
{
	oFF.XStream.of(this.m_cardWidgetList).forEach( function(cardWidget){
		cardWidget.resetMessage();
	}.bind(this));
};
oFF.AuGdsQbConditionalFormattingView.prototype.onCardActivationToggle = function(cardWidget)
{
	this.resetAllWarningMessage();
	if (cardWidget.isActive())
	{
		var cardRule = cardWidget.getRule();
		var overlapRules = this.m_activationManager.findActiveOverlapRules(cardRule.getStructureMember(), cardRule.getId());
		if (overlapRules.isPresent())
		{
			oFF.XStream.of(overlapRules.get()).forEach( function(ruleToDeactivate){
				this.deactivateRuleAndShowWarning(ruleToDeactivate, cardRule);
			}.bind(this));
		}
	}
	this.notifyChangeListeners();
};
oFF.AuGdsQbConditionalFormattingView.prototype.deactivateRuleAndShowWarning = function(ruleToDeactivate, rule)
{
	this.m_activationManager.disableRuleForMember(ruleToDeactivate.getStructureMember(), ruleToDeactivate.getId());
	var warningMsg = oFF.AuGdsQbConditionalFormattingI18n.getLocalization().getTextWithPlaceholder(oFF.AuGdsQbConditionalFormattingI18n.RULE_CARD_DEACTIVATE_MESSAGE, rule.getName());
	oFF.XStream.of(this.m_cardWidgetList).filter( function(cardWidget){
		return ruleToDeactivate.isEqualTo(cardWidget.getRule());
	}.bind(this)).forEach( function(cardWidgetByRule){
		cardWidgetByRule.setWarningMessage(warningMsg);
	}.bind(this));
};
oFF.AuGdsQbConditionalFormattingView.prototype.loadMeasureRulesCards = function()
{
	var measures = this.m_dataProvider.getMeasureList();
	var iter = measures.getIterator();
	var cardsLoaded = false;
	while (iter.hasNext())
	{
		var structureMember = iter.next();
		var rules = this.m_CRUDLAPI.listAllRulesForMember(structureMember);
		if (rules.size() > 0)
		{
			var cardWidget = this.createMeasureCard(structureMember, rules);
			cardWidget.attachOnDelete( function(deletedRule){
				this.onUpdateQueryManager();
			}.bind(this));
			cardWidget.attachOnChange( function(changedRuleEvent){
				var changedRule = changedRuleEvent;
				this.m_selectedRules.put(changedRule.getStructureMember().getName(), changedRule.getId());
			}.bind(this));
			cardWidget.attachOnSelect( function(selectedRuleEvent){
				var selectedRule = selectedRuleEvent;
				this.m_selectedRules.put(selectedRule.getStructureMember().getName(), selectedRule.getId());
				this.notifyChangeListeners();
			}.bind(this));
			this.m_rulesContainer.addItem(cardWidget.getView());
			cardsLoaded = true;
		}
		else
		{
			if (this.m_selectedRules.containsKey(structureMember.getName()))
			{
				this.m_selectedRules.remove(structureMember.getName());
			}
			cardsLoaded = false;
		}
	}
	return cardsLoaded;
};
oFF.AuGdsQbConditionalFormattingView.prototype.createRuleCard = function(rule)
{
	var card = oFF.AuGdsQbConditionalFormattingRuleCard.create(this.m_CRUDLAPI, this.m_activationManager, rule, this.m_ruleDialogRunner);
	card.renderView(this.getGenesis());
	card.attachOnDelete( function(deletedRule){
		this.onUpdateQueryManager();
	}.bind(this));
	card.attachOnChange( function(changedRuleEvent){
		this.onCardActivationToggle(card);
	}.bind(this));
	return card;
};
oFF.AuGdsQbConditionalFormattingView.prototype.createMeasureCard = function(structureMember, rules)
{
	var card = oFF.AuGdsQbConditionalFormattingMeasureCard.create(this.m_CRUDLAPI, this.m_activationManager, structureMember, this.m_ruleDialogRunner);
	card.renderView(this.getGenesis());
	card.addRules(rules, this.m_selectedRules.getByKey(structureMember.getName()));
	return card;
};
oFF.AuGdsQbConditionalFormattingView.prototype.setExpanded = function(expanded)
{
	this.m_expanded = expanded;
	if (oFF.notNull(this.m_rootPanel))
	{
		this.m_rootPanel.setExpanded(expanded);
	}
};
oFF.AuGdsQbConditionalFormattingView.prototype.notifyChangeListeners = function()
{
	if (oFF.notNull(this.m_onChange))
	{
		this.m_onChange();
	}
};
oFF.AuGdsQbConditionalFormattingView.prototype.setOnChange = function(onChange)
{
	this.m_onChange = onChange;
};

