oFF.AuGdsConditionalFormattingThresholdIcon.prototype.getColor = function()
{
	return this.m_color;
};
oFF.AuGdsConditionalFormattingThresholdIcon.prototype.setColor = function(color)
{
	this.m_color = color;
	this.updateUi();
};
oFF.AuGdsConditionalFormattingThresholdIcon.prototype.getSymbol = function()
{
	return this.m_symbol;
};
oFF.AuGdsConditionalFormattingThresholdIcon.prototype.setSymbol = function(symbol)
{
	this.m_symbol = symbol;
	this.updateUi();
};
oFF.AuGdsConditionalFormattingThresholdIcon.prototype.getIcon = function()
{
	if (this.m_symbol === oFF.AlertSymbol.GOOD)
	{
		return oFF.AuGdsConditionalFormattingThresholdIcon.SQUARE_ICON;
	}
	if (this.m_symbol === oFF.AlertSymbol.WARNING)
	{
		return oFF.AuGdsConditionalFormattingThresholdIcon.TRIANGLE_ICON;
	}
	if (this.m_symbol === oFF.AlertSymbol.ALERT)
	{
		return oFF.AuGdsConditionalFormattingThresholdIcon.CIRCLE_ICON;
	}
	if (this.m_symbol === oFF.AlertSymbol.DIAMOND)
	{
		return oFF.AuGdsConditionalFormattingThresholdIcon.DIAMOND_ICON;
	}
	return oFF.AuGdsConditionalFormattingThresholdIcon.SQUARE_ICON;
};
oFF.AuGdsConditionalFormattingThresholdIcon.prototype.updateUi = function()
{
	var icon = this.getView();
	if (oFF.notNull(icon))
	{
		icon.setIcon(this.getIcon());
		icon.setColor(this.m_color);
		if (!this.checkContrast())
		{
			oFF.XObjectExt.assertNotNull(icon);
		}
	}
};
oFF.AuGdsConditionalFormattingThresholdIcon.prototype.checkContrast = function()
{
	var l1 = this.m_backgroundLuminance + .05;
	var l2 = this.getLuminance(this.m_color) + .05;
	var ratio = l1 / l2;
	if (l2 > l1)
	{
		ratio = 1 / ratio;
	}
	return ratio >= 3;
};
oFF.AuGdsConditionalFormattingThresholdIcon.prototype.getLuminance = function(color)
{
	var RsRGB = oFF.XInteger.convertToDouble(color.getRed()) / 255;
	var GsRGB = oFF.XInteger.convertToDouble(color.getGreen()) / 255;
	var BsRGB = oFF.XInteger.convertToDouble(color.getBlue()) / 255;
	var R = this.getSRGB(RsRGB);
	var G = this.getSRGB(GsRGB);
	var B = this.getSRGB(BsRGB);
	return 0.2126 * R + 0.7152 * G + 0.0722 * B;
};
oFF.AuGdsConditionalFormattingThresholdIcon.prototype.getSRGB = function(val)
{
	if (val <= 0.03928)
	{
		return val / 12.92;
	}
	else
	{
		return oFF.XMath.pow((val + 0.055) / 1.055, 2.4);
	}
};
