{
	this.m_consumersHandler.attachEventConsumer(oFF.UiEvent.ON_CLICK.getName(), consumer);
};
oFF.AuGdsConditionalFormattingThresholdIcon.prototype.detachOnClick = function(consumer)
{
	this.m_consumersHandler.detachEventConsumer(oFF.UiEvent.ON_CLICK.getName(), consumer);
};
oFF.AuGdsConditionalFormattingThresholdIcon.prototype.getConsumersOnClick = function()
{
	return this.m_consumersHandler.getEventConsumers(oFF.UiEvent.ON_CLICK.getName());
};

