oFF.AuGdsQbConditionalFormattingThresholdRange.prototype.validateState = function()
{
	var validState = true;
	if (oFF.XStringUtils.isNullOrEmpty(this.m_nameInput.getValue()))
	{
		oFF.AuGdsQbConditionalFormattingUiErrorProcessor.displayInlineError(this.m_nameInput, oFF.AuGdsQbConditionalFormattingI18n.RULE_DIALOG_ERR_NAME_MANDATORY);
		validState = false;
	}
	else
	{
		oFF.AuGdsQbConditionalFormattingUiErrorProcessor.clearInlineError(this.m_nameInput);
	}
	var validNumbers = true;
	try
	{
		this.getLowerBound();
		oFF.AuGdsQbConditionalFormattingUiErrorProcessor.clearInlineError(this.m_lowerValueInput);
	}
	catch (el)
	{
		oFF.AuGdsQbConditionalFormattingUiErrorProcessor.displayInlineError(this.m_lowerValueInput, oFF.AuGdsQbConditionalFormattingI18n.RULE_DIALOG_ERR_THRESHOLD_RANGE_NAN);
		validNumbers = false;
	}
	try
	{
		this.getUpperBound();
		oFF.AuGdsQbConditionalFormattingUiErrorProcessor.clearInlineError(this.m_upperValueInput);
	}
	catch (eu)
	{
		oFF.AuGdsQbConditionalFormattingUiErrorProcessor.displayInlineError(this.m_upperValueInput, oFF.AuGdsQbConditionalFormattingI18n.RULE_DIALOG_ERR_THRESHOLD_RANGE_NAN);
		validNumbers = false;
	}
	if (!validNumbers)
	{
		this.m_validWidgetState = oFF.XBooleanValue.create(false);
		return;
	}
	var validationResult = oFF.AuGdsQbConditionalFormattingRuleUIValidator.getRangeValidation(this.getState());
	if (validationResult === oFF.AuGdsQbCfRuleValidationState.VALID && oFF.notNull(this.m_globalRuleValidationState))
	{
		validationResult = this.m_globalRuleValidationState;
	}
	validState = validState && validationResult === oFF.AuGdsQbCfRuleValidationState.VALID;
	if (validationResult === oFF.AuGdsQbCfRuleValidationState.VALID || validationResult === oFF.AuGdsQbCfRuleValidationState.NULL)
	{
		oFF.AuGdsQbConditionalFormattingUiErrorProcessor.clearInlineError(this.m_upperValueInput);
		oFF.AuGdsQbConditionalFormattingUiErrorProcessor.clearInlineError(this.m_lowerValueInput);
	}
	else if (validationResult === oFF.AuGdsQbCfRuleValidationState.INVALID)
	{
		oFF.AuGdsQbConditionalFormattingUiErrorProcessor.displayInlineError(this.m_lowerValueInput, oFF.AuGdsQbConditionalFormattingI18n.RULE_DIALOG_ERR_THRESHOLD_RANGE_INVALID);
		oFF.AuGdsQbConditionalFormattingUiErrorProcessor.displayInlineError(this.m_upperValueInput, oFF.AuGdsQbConditionalFormattingI18n.RULE_DIALOG_ERR_THRESHOLD_RANGE_INVALID);
	}
	else if (validationResult === oFF.AuGdsQbCfRuleValidationState.OVERLAP_TOTAL)
	{
		oFF.AuGdsQbConditionalFormattingUiErrorProcessor.displayInlineError(this.m_lowerValueInput, oFF.AuGdsQbConditionalFormattingI18n.RULE_DIALOG_ERR_THRESHOLD_RANGE_OVERLAP);
		oFF.AuGdsQbConditionalFormattingUiErrorProcessor.displayInlineError(this.m_upperValueInput, oFF.AuGdsQbConditionalFormattingI18n.RULE_DIALOG_ERR_THRESHOLD_RANGE_OVERLAP);
	}
	else if (validationResult === oFF.AuGdsQbCfRuleValidationState.OVERLAP_LOWER)
	{
		oFF.AuGdsQbConditionalFormattingUiErrorProcessor.displayInlineError(this.m_lowerValueInput, oFF.AuGdsQbConditionalFormattingI18n.RULE_DIALOG_ERR_THRESHOLD_RANGE_OVERLAP);
		oFF.AuGdsQbConditionalFormattingUiErrorProcessor.clearInlineError(this.m_upperValueInput);
	}
	else if (validationResult === oFF.AuGdsQbCfRuleValidationState.OVERLAP_UPPER)
	{
		oFF.AuGdsQbConditionalFormattingUiErrorProcessor.displayInlineError(this.m_upperValueInput, oFF.AuGdsQbConditionalFormattingI18n.RULE_DIALOG_ERR_THRESHOLD_RANGE_OVERLAP);
		oFF.AuGdsQbConditionalFormattingUiErrorProcessor.clearInlineError(this.m_lowerValueInput);
	}
	else
	{
		throw oFF.XException.createIllegalStateException(oFF.XStringUtils.concatenate2("illegale error state: ", validationResult.getName()));
	}
	this.m_validWidgetState = oFF.XBooleanValue.create(validState);
};
