oFF.AuGdsQbConditionalFormattingMeasureCard.prototype.buildErrorPopover = function(errors)
{
	var onErrorIconPress = oFF.UiLambdaPressListener.create( function(onErrorIconPressEvent){
		var errorPopover = this.getGenesis().newControl(oFF.UiType.POPOVER);
		var layout = this.getGenesis().newControl(oFF.UiType.VERTICAL_LAYOUT);
		errorPopover.setContent(layout);
		layout.addCssClass("ffAuGdsCFCardValidatePopover");
		var footerToolbar = this.getGenesis().newControl(oFF.UiType.TOOLBAR);
		footerToolbar.addNewItemOfType(oFF.UiType.SPACER).setWidth(oFF.UiCssLength.create("10rem"));
		var footerActionButton = footerToolbar.addNewItemOfType(oFF.UiType.BUTTON);
		footerActionButton.setText(this.getLocalization().getText(oFF.AuGdsQbConditionalFormattingI18n.RULE_CARD_POPOVER_BUTTON_REMOVE_THRESHOLD));
		footerActionButton.registerOnPress(oFF.UiLambdaPressListener.create( function(onRemoveThresholdButtonPressEvent){
			this.m_cardDropDown.openDeleteRulePopover();
		}.bind(this)));
		errorPopover.setFooter(footerToolbar);
		if (errors.size() > 0)
		{
			oFF.XStream.of(errors).forEach( function(error){
				var errorText = layout.addNewItemOfType(oFF.UiType.LABEL);
				errorText.setWrapping(true);
				errorText.setWidth(oFF.UiCssLength.create("100%"));
				errorText.setText(error.getText());
			}.bind(this));
		}
		errorPopover.setPlacement(oFF.UiPlacementType.TOP);
		errorPopover.openAt(this.m_errorIcon);
	}.bind(this));
	this.m_errorIcon.registerOnPress(onErrorIconPress);
};
