oFF.AuGdsQbConditionalFormattingMeasureCardDropdown.prototype.setRuleList = function(rules)
{
	this.m_rules.clear();
	this.m_rules.addAll(rules);
	if (rules.size() > 0)
	{
		this.setSelectedRule(rules.get(0));
	}
	var editableRules = oFF.XList.create();
	var notEditableRules = oFF.XList.create();
	var iter = rules.getIterator();
	while (iter.hasNext())
	{
		var rule = iter.next();
		if (rule.isEditable())
		{
			editableRules.add(rule);
		}
		else
		{
			notEditableRules.add(rule);
		}
	}
	this.populateRuleList(editableRules, "ffAuGdsCFCardRuleEditable");
	this.populateRuleList(notEditableRules, "ffAuGdsCFCardRuleNotEditable");
};
oFF.AuGdsQbConditionalFormattingMeasureCardDropdown.prototype.openDeleteRulePopover = function()
{
	var rule = this.getSelectedRule();
	var warningPopup = this.getDeleteWarningPopup(rule.getName(),  function(){
		if (oFF.XString.isEqual(rule.getId(), this.getSelectedRule().getId()))
		{
			var fallBackRule = oFF.XStream.of(this.m_rules).find( function(currentRule){
				return !oFF.XString.isEqual(currentRule.getId(), rule.getId());
			}.bind(this));
			if (fallBackRule.isPresent())
			{
				this.fireOnChange(fallBackRule.get());
			}
		}
		this.m_conditionalFormattingCRUDLAPI.deleteRule(rule.getId());
		this.m_consumersHandler.fireEvent(oFF.UiEvent.ON_DELETE.getName(), rule);
	}.bind(this));
	warningPopup.open();
};
oFF.AuGdsQbConditionalFormattingMeasureCardDropdown.prototype.populateRuleList = function(listRules, cssClass)
{
	if (listRules.size() > 0)
	{
		this.sortRuleList(listRules);
		for (var i = 0; i < listRules.size(); i++)
		{
			var rule = listRules.get(i);
			var ddItem = this.m_ruleCombobox.addNewItem();
			ddItem.setText(rule.getName());
			ddItem.setCustomObject(rule);
			ddItem.addCssClass(cssClass);
		}
	}
};
oFF.AuGdsQbConditionalFormattingMeasureCardDropdown.prototype.sortRuleList = function(ruleList)
{
	ruleList.sortByComparator(oFF.XComparatorLambda.create( function(item1, item2){
		return oFF.XIntegerValue.create(oFF.XString.compare(oFF.XString.toLowerCase(item1.getName()), oFF.XString.toLowerCase(item2.getName())));
	}.bind(this)));
};
