	var deleteConfirmPopup = oFF.UtConfirmPopup.create(this.getGenesis(), this.getLocalization().getText(oFF.UiCommonI18n.DELETE), this.getLocalization().getTextWithPlaceholder(oFF.AuGdsQbConditionalFormattingI18n.RULE_CARD_DELETE_MESSAGE, ruleName));
