oFF.AuGdsQbNumberFormattingView.prototype.clearLoadedValues = function()
{
	this.m_loadedValueMember = oFF.AuGdsQbNumberFormattingView.EMPTY_KEY;
	this.m_loadedValueShift = oFF.AuGdsQbNumberFormattingView.EMPTY_KEY;
	this.m_loadedValueScale = oFF.AuGdsQbNumberFormattingView.EMPTY_KEY;
	this.m_loadedValueFormat = oFF.AuGdsQbNumberFormattingView.EMPTY_KEY;
	this.m_loadedValueSign = oFF.AuGdsQbNumberFormattingView.EMPTY_KEY;
};
oFF.AuGdsQbNumberFormattingView.prototype.loadState = function(memberName)
{
	this.clearLoadedValues();
	if (this.getLeadingStructure() === null)
	{
		return;
	}
	this.m_loadedValueMember = memberName;
	if (oFF.XString.isEqual(this.m_loadedValueMember, oFF.AuGdsQbNumberFormattingView.EMPTY_KEY))
	{
		return;
	}
	if (oFF.XString.isEqual(this.m_loadedValueMember, oFF.AuGdsQbNumberFormattingView.ALL_KEY))
	{
		this.loadStateOfAllMeasures();
	}
	else
	{
		var structure = this.getLeadingStructure();
		var member = structure.getStructureMember(memberName);
		this.loadStateOfMeasure(member);
	}
};
oFF.AuGdsQbNumberFormattingView.prototype.loadStateOfMeasure = function(member)
{
	var numericShift = this.getStringValue(member.getNumericShiftExt(true), member.isNumericShiftDefaultExt(true));
	var numericScale = this.getStringValue(member.getNumericScale(), member.isNumericScaleDefault());
	var format = this.getConstantValue(member.getScaleFormat(), member.isScaleFormatDefault());
	var sign = this.getConstantValue(member.getSignPresentation(), member.isSignPresentationDefault());
	this.m_loadedValueMember = member.getName();
	this.m_loadedValueShift = numericShift;
	this.m_loadedValueScale = numericScale;
	this.m_loadedValueFormat = format;
	this.m_loadedValueSign = sign;
	this.m_loadedValueType = this.getEffectiveCellValueTypeOfMember(member);
};
oFF.AuGdsQbNumberFormattingView.prototype.loadStateOfAllMeasures = function()
{
	var numericShiftAll = null;
	var numericScaleAll = null;
	var formatAll = null;
	var signAll = null;
	var positionAll = null;
	var valueTypeAll = null;
	var members = this.getStructureMembers();
	if (oFF.XCollectionUtils.hasElements(members))
	{
		valueTypeAll = this.getEffectiveCellValueTypeOfMember(members.get(0));
	}
	for (var i = 0; i < members.size(); i++)
	{
		var member = members.get(i);
		var cellValueType = this.getEffectiveCellValueTypeOfMember(member);
		if (valueTypeAll !== cellValueType)
		{
			valueTypeAll = null;
		}
		if (cellValueType !== oFF.XValueType.PERCENT)
		{
			var numericShift = this.getStringValue(member.getNumericShiftExt(true), member.isNumericShiftDefaultExt(true));
			numericShiftAll = this.determineAllValue(numericShiftAll, numericShift);
			var numericScale = this.getStringValue(member.getNumericScale(), member.isNumericScaleDefault());
			numericScaleAll = this.determineAllValue(numericScaleAll, numericScale);
			var format = this.getConstantValue(member.getScaleFormat(), member.isScaleFormatDefault());
			formatAll = this.determineAllValue(formatAll, format);
		}
		var sign = this.getConstantValue(member.getSignPresentation(), member.isSignPresentationDefault());
		signAll = this.determineAllValue(signAll, sign);
		var position = this.getConstantValue(member.getScaleAndUnitPlacement(), member.isScaleAndUnitPlacementDefault());
		positionAll = this.determineAllValue(positionAll, position);
	}
	this.m_loadedValueMember = oFF.AuGdsQbNumberFormattingView.ALL_KEY;
	this.m_loadedValueShift = numericShiftAll;
	this.m_loadedValueScale = numericScaleAll;
	this.m_loadedValueFormat = formatAll;
	this.m_loadedValueSign = signAll;
	this.m_loadedValueType = valueTypeAll;
};
oFF.AuGdsQbNumberFormattingView.prototype.determineAllValue = function(currentAll, currentValue)
{
	if (oFF.isNull(currentAll))
	{
		return currentValue;
	}
	if (!oFF.XString.isEqual(currentValue, currentAll) && !oFF.XString.isEqual(currentValue, oFF.AuGdsQbNumberFormattingView.MIXED_KEY))
	{
		return oFF.AuGdsQbNumberFormattingView.MIXED_KEY;
	}
	return currentAll;
};
oFF.AuGdsQbNumberFormattingView.prototype.applyStateToUi = function()
{
	this.setDropdownValue(oFF.AuGdsQbNumberFormattingView.MEMBER, this.getMemberOptions(), this.m_loadedValueMember);
	this.setDropdownValue(oFF.AuGdsQbNumberFormattingView.SHIFT, this.getShiftOptions(), this.m_loadedValueShift);
	this.setDropdownValue(oFF.AuGdsQbNumberFormattingView.FORMAT, this.getFormatOptions(), this.m_loadedValueFormat);
	this.setDropdownValue(oFF.AuGdsQbNumberFormattingView.SCALE, this.getScaleOptions(), this.m_loadedValueScale);
	this.setDropdownValue(oFF.AuGdsQbNumberFormattingView.SIGN, this.getSignOptions(), this.m_loadedValueSign);
	this.m_form.getFormItemByKey(oFF.AuGdsQbNumberFormattingView.SHIFT).setVisible(this.m_loadedValueType !== oFF.XValueType.PERCENT);
	this.m_form.getFormItemByKey(oFF.AuGdsQbNumberFormattingView.FORMAT).setVisible(this.m_loadedValueType !== oFF.XValueType.PERCENT);
};
oFF.AuGdsQbNumberFormattingView.prototype.setDropdownValue = function(name, options, key)
{
	var dropdown = this.m_form.getFormItemByKey(name);
	if (!options.containsKey(key))
	{
		options.put(key, "-");
	}
	dropdown.setDropdownItems(options);
	dropdown.setValue(oFF.XStringValue.create(key));
};
oFF.AuGdsQbNumberFormattingView.prototype.getStringValue = function(modelValue, isDefault)
{
	if (isDefault)
	{
		return oFF.AuGdsQbNumberFormattingView.DEFAULT_KEY;
	}
	if (oFF.isNull(modelValue))
	{
		return oFF.AuGdsQbNumberFormattingView.DEFAULT_KEY;
	}
	var stringValue = modelValue.getStringRepresentation();
	if (oFF.isNull(stringValue))
	{
		return oFF.AuGdsQbNumberFormattingView.DEFAULT_KEY;
	}
	return stringValue;
};
oFF.AuGdsQbNumberFormattingView.prototype.getConstantValue = function(constant, isDefault)
{
	if (isDefault)
	{
		return oFF.AuGdsQbNumberFormattingView.DEFAULT_KEY;
	}
	if (oFF.isNull(constant))
	{
		return oFF.AuGdsQbNumberFormattingView.DEFAULT_KEY;
	}
	return constant.getName();
};
oFF.AuGdsQbNumberFormattingView.prototype.saveState = function()
{
	var jsonModel = this.m_form.getJsonModel();
	if (this.getLeadingStructure() === null)
	{
		return;
	}
	var allMembers = this.getStructureMembers();
	var memberName = jsonModel.getStringByKey(oFF.AuGdsQbNumberFormattingView.MEMBER);
	if (oFF.XString.isEqual(memberName, oFF.AuGdsQbNumberFormattingView.EMPTY_KEY))
	{
		return;
	}
	else if (oFF.XString.isEqual(memberName, oFF.AuGdsQbNumberFormattingView.ALL_KEY))
	{
		for (var i = 0; i < allMembers.size(); i++)
		{
			this.saveMemberState(jsonModel, allMembers.get(i));
		}
	}
	else
	{
		this.saveMemberState(jsonModel, allMembers.getByKey(memberName));
	}
	this.notifyChangeListeners();
};
oFF.AuGdsQbNumberFormattingView.prototype.saveMemberState = function(jsonModel, member)
{
	var numericShift = jsonModel.getStringByKey(oFF.AuGdsQbNumberFormattingView.SHIFT);
	var numericScale = jsonModel.getStringByKey(oFF.AuGdsQbNumberFormattingView.SCALE);
	var format = jsonModel.getStringByKey(oFF.AuGdsQbNumberFormattingView.FORMAT);
	var sign = jsonModel.getStringByKey(oFF.AuGdsQbNumberFormattingView.SIGN);
	if (!this.isPercentMember(member))
	{
		if (oFF.XString.isEqual(numericShift, oFF.AuGdsQbNumberFormattingView.DEFAULT_KEY))
		{
			member.resetToDefaultNumericShift();
		}
		else if (!oFF.XString.isEqual(numericShift, oFF.AuGdsQbNumberFormattingView.MIXED_KEY))
		{
			member.setNumericShiftExt(oFF.XInteger.convertFromString(numericShift), true);
		}
		if (oFF.XString.isEqual(format, oFF.AuGdsQbNumberFormattingView.DEFAULT_KEY))
		{
			member.resetToDefaultScaleFormat();
		}
		else if (!oFF.XString.isEqual(format, oFF.AuGdsQbNumberFormattingView.MIXED_KEY))
		{
			member.setScaleFormat(oFF.ScaleFormat.lookup(format));
		}
	}
	if (oFF.XString.isEqual(numericScale, oFF.AuGdsQbNumberFormattingView.DEFAULT_KEY))
	{
		member.resetToDefaultNumericScale();
	}
	else if (!oFF.XString.isEqual(numericScale, oFF.AuGdsQbNumberFormattingView.MIXED_KEY))
	{
		member.setNumericScale(oFF.XInteger.convertFromString(numericScale));
	}
	if (oFF.XString.isEqual(sign, oFF.AuGdsQbNumberFormattingView.DEFAULT_KEY))
	{
		member.resetToDefaultSignPresentation();
	}
	else if (!oFF.XString.isEqual(sign, oFF.AuGdsQbNumberFormattingView.MIXED_KEY))
	{
		member.setSignPresentation(oFF.SignPresentation.lookup(sign));
	}
};
oFF.AuGdsQbNumberFormattingView.prototype.isPercentMember = function(member)
{
	return member.getCellValueType() === oFF.XValueType.PERCENT || member.getQueryManager().getSystemType().isTypeOf(oFF.SystemType.HANA) && member.getNumericShiftExt(true) !== null && member.getNumericShiftExt(true).getInteger() === 2;
};
oFF.AuGdsQbNumberFormattingView.prototype.getEffectiveCellValueTypeOfMember = function(member)
{
	return this.isPercentMember(member) ? oFF.XValueType.PERCENT : member.getCellValueType();
};
oFF.AuGdsQbNumberFormattingView.prototype.getLeadingStructure = function()
{
	var queryModel = this.m_queryManager.getQueryModel();
	if (queryModel.isLeadingStructureAccount())
	{
		return queryModel.getAccountDimension();
	}
	return queryModel.getMeasureDimension();
};
oFF.AuGdsQbNumberFormattingView.prototype.getStructureMembers = function()
{
	var result = oFF.XListOfNameObject.create();
	var leadingStructure = this.getLeadingStructure();
	if (oFF.isNull(leadingStructure))
	{
		return result;
	}
	var allStructureMembers = leadingStructure.getAllStructureMembers();
	for (var i = 0; i < allStructureMembers.size(); i++)
	{
		var member = allStructureMembers.get(i);
		if (member.getCellValueType() !== null && member.getCellValueType().isDateTime())
		{
			continue;
		}
		result.add(member);
	}
	return result;
};
oFF.AuGdsQbNumberFormattingView.prototype.getMemberOptions = function()
{
	var memberItems = oFF.XHashMapOfStringByString.create();
	var allStructureMembers = this.getStructureMembers();
	if (allStructureMembers.size() > 1)
	{
		var i18n = this.getLocalizationProvider();
		memberItems.put(oFF.AuGdsQbNumberFormattingView.ALL_KEY, i18n.getText(oFF.AuGdsQbNumberFormattingI18n.STYLE_MEASURE_ALL));
	}
	for (var i = 0; i < allStructureMembers.size(); i++)
	{
		var member = allStructureMembers.get(i);
		memberItems.put(member.getName(), member.getText());
	}
	return memberItems;
};
