oFF.AuGdsQbTablePropertiesView.prototype.updateUi = function()
{
	var templateDropdown = this.m_form.getFormItemByKey(oFF.AuGdsQbTablePropertiesView.TEMPLATE);
	var unitPosDropdown = this.m_form.getFormItemByKey(oFF.AuGdsQbTablePropertiesView.UNIT_POSITION);
	var alternatingSwitch = this.m_form.getFormItemByKey(oFF.AuGdsQbTablePropertiesView.ALTERNATING);
	var exceptionDropdown = this.m_form.getFormItemByKey(oFF.AuGdsQbTablePropertiesView.EXCEPTIONS);
	var readingLinesDropdown = this.m_form.getFormItemByKey(oFF.AuGdsQbTablePropertiesView.READING_LINES);
	templateDropdown.setValueChangedConsumer(null);
	unitPosDropdown.setValueChangedConsumer(null);
	alternatingSwitch.setValueChangedConsumer(null);
	var templateOptions = oFF.XLinkedHashMapOfStringByString.create();
	var i18n = this.getLocalizationProvider();
	templateOptions.put(oFF.AuGdsQbTableStylingTemplateManager.DEFAULT_NAME, i18n.getText(oFF.AuGdsQbTablePropertiesI18n.STYLE_TABLE_TEMPLATE_DEFAULT));
	templateOptions.put(oFF.AuGdsQbTableStylingTemplateManager.BASIC_NAME, i18n.getText(oFF.AuGdsQbTablePropertiesI18n.STYLE_TABLE_TEMPLATE_BASIC));
	if (oFF.notNull(this.m_templateManager) && this.m_templateManager.hasActiveStylingFeature(oFF.AuGdsQbConstants.CONFIG_TABLE_STYLING_REPORT))
	{
		templateOptions.put(oFF.AuGdsQbTableStylingTemplateManager.REPORT_NAME, i18n.getText(oFF.AuGdsQbTablePropertiesI18n.STYLE_TABLE_TEMPLATE_REPORT));
	}
	templateDropdown.setDropdownItems(templateOptions);
	if (oFF.notNull(exceptionDropdown))
	{
		exceptionDropdown.setValueChangedConsumer(null);
	}
	if (oFF.notNull(readingLinesDropdown))
	{
		readingLinesDropdown.setValueChangedConsumer(null);
	}
	if (oFF.isNull(this.m_templateManager) || oFF.isNull(this.m_queryManager))
	{
		return;
	}
	templateDropdown.setValue(oFF.XStringValue.create(this.m_templateManager.getActiveTemplateName()));
	templateDropdown.setValueChangedConsumer( function(formItemKey, optionKey){
		this.m_templateManager.activateTemplate(optionKey.getStringRepresentation());
		this.updateReadingLineDropdownVisibility(readingLinesDropdown);
		this.notifyRerenderListeners();
	}.bind(this));
	if (oFF.notNull(readingLinesDropdown))
	{
		this.updateReadingLineDropdownVisibility(readingLinesDropdown);
		readingLinesDropdown.setValue(oFF.XStringValue.create(oFF.XInteger.convertToString(this.m_templateManager.getReportReadingLines())));
		readingLinesDropdown.setValueChangedConsumer( function(readingKey, readingOption){
			this.m_templateManager.setReportReadingLines(oFF.XInteger.convertFromString(readingOption.getStringRepresentation()));
			this.notifyRerenderListeners();
		}.bind(this));
	}
	if (oFF.notNull(exceptionDropdown))
	{
		var exceptionVisible = oFF.notNull(this.m_templateManager) && this.m_templateManager.hasActiveStylingFeature(oFF.AuGdsQbConstants.CONFIG_TABLE_STYLING_EXCEPTIONS);
		exceptionDropdown.setVisible(exceptionVisible);
		if (exceptionVisible)
		{
			exceptionDropdown.setValue(oFF.XStringValue.create(this.m_templateManager.getActiveExceptionFormattingName()));
			exceptionDropdown.setValueChangedConsumer( function(formItemKey1, optionKey1){
				this.m_templateManager.activateExceptionFormatting(optionKey1.getStringRepresentation());
				this.notifyRerenderListeners();
			}.bind(this));
		}
	}
	unitPosDropdown.setVisible(this.m_queryManager.getModelCapabilities().supportsUniqueAxisProperties());
	unitPosDropdown.setValue(oFF.XStringValue.create(this.getPosition()));
	unitPosDropdown.setValueChangedConsumer( function(formItemKey2, positionKey){
		this.setPosition(positionKey.getStringRepresentation());
		this.notifyChangeListeners();
	}.bind(this));
	alternatingSwitch.setValue(oFF.XBooleanValue.create(this.m_templateManager.isAlternatingRowsActive()));
	alternatingSwitch.setValueChangedConsumer( function(formItemKey3, newValue){
		var booleanValue = newValue;
		this.m_templateManager.setAlternatingRowsActive(booleanValue.getBoolean());
		this.notifyRerenderListeners();
	}.bind(this));
};
