oFF.AuGdsQbTablePropertiesView.prototype.getPosition = function()
{
	var cmd = this.m_queryManager.getConvenienceCommands();
	if (cmd.getModelCapabilities().supportsUniqueAxisProperties())
	{
		var uniqueAxisProperties = cmd.getQueryModel().getReturnedUniqueAxisProperties();
		if (!oFF.XCollectionUtils.hasElements(uniqueAxisProperties.getColumnProperties()) || !oFF.XCollectionUtils.hasElements(uniqueAxisProperties.getRowProperties()))
		{
			return oFF.AuGdsQbTablePropertiesView.DEFAULT_KEY;
		}
		if (!cmd.hasUniqueAxisProperties(oFF.AxisType.ROWS, oFF.ReturnedDataSelection.NUMERIC_SHIFT) && !cmd.hasUniqueAxisProperties(oFF.AxisType.COLUMNS, oFF.ReturnedDataSelection.NUMERIC_SHIFT))
		{
			return oFF.ScaleAndUnitPlacement.CELL.getName();
		}
		if (!cmd.hasUniqueAxisProperties(oFF.AxisType.ROWS, oFF.ReturnedDataSelection.NUMERIC_SHIFT) && !cmd.hasUniqueAxisProperties(oFF.AxisType.COLUMNS, oFF.ReturnedDataSelection.NUMERIC_SHIFT))
		{
			return oFF.ScaleAndUnitPlacement.CELL.getName();
		}
		if (cmd.hasUniqueAxisProperties(oFF.AxisType.ROWS, oFF.ReturnedDataSelection.NUMERIC_SHIFT))
		{
			return oFF.ScaleAndUnitPlacement.ROWS.getName();
		}
		if (cmd.hasUniqueAxisProperties(oFF.AxisType.COLUMNS, oFF.ReturnedDataSelection.NUMERIC_SHIFT))
		{
			return oFF.ScaleAndUnitPlacement.COLUMNS.getName();
		}
	}
	return oFF.AuGdsQbTablePropertiesView.DEFAULT_KEY;
};
oFF.AuGdsQbTablePropertiesView.prototype.setPosition = function(position)
{
	var cmd = this.m_queryManager.getConvenienceCommands();
	if (oFF.XString.isEqual(position, oFF.AuGdsQbTablePropertiesView.DEFAULT_KEY))
	{
		var primaryCalculationAxis = cmd.getQueryModel().getPrimaryCalculationDimension().getAxisType();
		if (primaryCalculationAxis.isVisible())
		{
			cmd.clearUniqueAxisPropertiesForAxis(primaryCalculationAxis.getOrthogonalAxisType());
			cmd.toggleUniqueAxisProperties(primaryCalculationAxis, oFF.ReturnedDataSelection.NUMERIC_SHIFT, true);
			cmd.toggleUniqueAxisProperties(primaryCalculationAxis, oFF.ReturnedDataSelection.UNIT_INDEX, true);
			cmd.toggleUniqueAxisProperties(primaryCalculationAxis, oFF.ReturnedDataSelection.CELL_VALUE_TYPES, true);
		}
	}
	else if (oFF.XString.isEqual(position, oFF.ScaleAndUnitPlacement.CELL.getName()))
	{
		cmd.toggleUniqueAxisProperties(oFF.AxisType.ROWS, oFF.ReturnedDataSelection.NUMERIC_SHIFT, false);
		cmd.toggleUniqueAxisProperties(oFF.AxisType.ROWS, oFF.ReturnedDataSelection.UNIT_INDEX, false);
		cmd.toggleUniqueAxisProperties(oFF.AxisType.ROWS, oFF.ReturnedDataSelection.CELL_VALUE_TYPES, false);
		cmd.toggleUniqueAxisProperties(oFF.AxisType.COLUMNS, oFF.ReturnedDataSelection.NUMERIC_SHIFT, false);
		cmd.toggleUniqueAxisProperties(oFF.AxisType.COLUMNS, oFF.ReturnedDataSelection.UNIT_INDEX, false);
		cmd.toggleUniqueAxisProperties(oFF.AxisType.COLUMNS, oFF.ReturnedDataSelection.CELL_VALUE_TYPES, false);
	}
	else if (oFF.XString.isEqual(position, oFF.ScaleAndUnitPlacement.ROWS.getName()))
	{
		cmd.toggleUniqueAxisProperties(oFF.AxisType.ROWS, oFF.ReturnedDataSelection.NUMERIC_SHIFT, true);
		cmd.toggleUniqueAxisProperties(oFF.AxisType.ROWS, oFF.ReturnedDataSelection.UNIT_INDEX, true);
		cmd.toggleUniqueAxisProperties(oFF.AxisType.ROWS, oFF.ReturnedDataSelection.CELL_VALUE_TYPES, true);
		cmd.toggleUniqueAxisProperties(oFF.AxisType.COLUMNS, oFF.ReturnedDataSelection.NUMERIC_SHIFT, false);
		cmd.toggleUniqueAxisProperties(oFF.AxisType.COLUMNS, oFF.ReturnedDataSelection.UNIT_INDEX, false);
		cmd.toggleUniqueAxisProperties(oFF.AxisType.COLUMNS, oFF.ReturnedDataSelection.CELL_VALUE_TYPES, false);
	}
	else if (oFF.XString.isEqual(position, oFF.ScaleAndUnitPlacement.COLUMNS.getName()))
	{
		cmd.toggleUniqueAxisProperties(oFF.AxisType.ROWS, oFF.ReturnedDataSelection.NUMERIC_SHIFT, false);
		cmd.toggleUniqueAxisProperties(oFF.AxisType.ROWS, oFF.ReturnedDataSelection.UNIT_INDEX, false);
		cmd.toggleUniqueAxisProperties(oFF.AxisType.ROWS, oFF.ReturnedDataSelection.CELL_VALUE_TYPES, false);
		cmd.toggleUniqueAxisProperties(oFF.AxisType.COLUMNS, oFF.ReturnedDataSelection.NUMERIC_SHIFT, true);
		cmd.toggleUniqueAxisProperties(oFF.AxisType.COLUMNS, oFF.ReturnedDataSelection.UNIT_INDEX, true);
		cmd.toggleUniqueAxisProperties(oFF.AxisType.COLUMNS, oFF.ReturnedDataSelection.CELL_VALUE_TYPES, true);
	}
};

