oFF.AuGdsQbLandingPage.prototype.filterRecentFiles = function(searchText, clearButtonPressed)
{
	this.m_recentFileTable.clearResponsiveTableRows();
	if (clearButtonPressed === false)
	{
		for (var a = 0; a < this.m_allRecentFileEntries.size(); a++)
		{
			var responsiveTableRow = this.m_allRecentFileEntries.get(a);
			if (this.isTextInRow(responsiveTableRow, searchText))
			{
				this.m_recentFileTable.addResponsiveTableRow(responsiveTableRow);
			}
		}
	}
	else
	{
		oFF.XCollectionUtils.forEach(this.m_allRecentFileEntries,  function(tmpRow){
			this.m_recentFileTable.addResponsiveTableRow(tmpRow);
		}.bind(this));
	}
	this.updateRecentFilesLabel(this.m_recentFileTable.numberOfResponsiveTableRows());
};
oFF.AuGdsQbLandingPage.prototype.updateRecentFilesLabel = function(count)
{
	this.m_recentFileLabel.setText(this.getLocalization().getTextWithPlaceholder(oFF.AuGdsQueryBuilderI18n.LANDING_PAGE_RECENT_FILES_TITLE, oFF.XInteger.convertToString(count)));
};
oFF.AuGdsQbLandingPage.prototype.isTextInRow = function(row, searchText)
{
	if (oFF.isNull(row))
	{
		return false;
	}
	if (oFF.XStringUtils.isNullOrEmpty(searchText))
	{
		return true;
	}
	var nameLbl = row.getResponsiveTableCell(0).getCustomObject();
	var descriptionLbl = row.getResponsiveTableCell(1);
	var createbByLbl = row.getResponsiveTableCell(2);
	var createbOnLbl = row.getResponsiveTableCell(3);
	var changebByLbl = row.getResponsiveTableCell(4);
	var changebOnLbl = row.getResponsiveTableCell(5);
	var nameLower = oFF.XString.toLowerCase(nameLbl.getText());
	var descLower = oFF.XString.toLowerCase(descriptionLbl.getText());
	var createbByLower = oFF.XString.toLowerCase(createbByLbl.getText());
	var createbOnLower = oFF.XString.toLowerCase(createbOnLbl.getText());
	var changebByLower = oFF.XString.toLowerCase(changebByLbl.getText());
	var changebOnLower = oFF.XString.toLowerCase(changebOnLbl.getText());
	var searchTextLower = oFF.XString.toLowerCase(searchText);
	if (oFF.XString.containsString(nameLower, searchTextLower))
	{
		return true;
	}
	if (oFF.XString.containsString(descLower, searchTextLower))
	{
		return true;
	}
	if (oFF.XString.containsString(createbByLower, searchTextLower))
	{
		return true;
	}
	if (oFF.XString.containsString(createbOnLower, searchTextLower))
	{
		return true;
	}
	if (oFF.XString.containsString(changebByLower, searchTextLower))
	{
		return true;
	}
	if (oFF.XString.containsString(changebOnLower, searchTextLower))
	{
		return true;
	}
	return false;
};
