oFF.AuGdsQbInteractiveTableView.supportsTupleElementExpand = function(tupleElement)
{
	var drillState = tupleElement.getDrillState();
	var isUniversalDisplayHierarchy = tupleElement.getDimension().isUniversalDisplayHierarchyDimension();
	return drillState === oFF.DrillState.COLLAPSED && !isUniversalDisplayHierarchy || drillState === oFF.DrillState.COLLAPSED_EXPAND_AND_DRILLDOWN_ALLOWED || drillState === oFF.DrillState.LEAF_UDH_EXPAND_ALLOWED;
};
oFF.AuGdsQbInteractiveTableView.supportsTupleElementDrill = function(tupleElement)
{
	var drillState = tupleElement.getDrillState();
	var isUniversalDisplayHierarchy = tupleElement.getDimension().isUniversalDisplayHierarchyDimension();
	return drillState === oFF.DrillState.COLLAPSED_EXPAND_AND_DRILLDOWN_ALLOWED || drillState === oFF.DrillState.EXPANDED && isUniversalDisplayHierarchy || drillState === oFF.DrillState.COLLAPSED && isUniversalDisplayHierarchy || drillState === oFF.DrillState.LEAF_DRILLDOWN_ALLOWED;
};
oFF.AuGdsQbInteractiveTableView.supportsTupleElementCollapse = function(tupleElement)
{
	var drillState = tupleElement.getDrillState();
	return drillState === oFF.DrillState.EXPANDED || drillState === oFF.DrillState.DRILLED || drillState === oFF.DrillState.DRILL_DOWN || drillState === oFF.DrillState.LEAF_UDH;
};
oFF.AuGdsQbInteractiveTableView.getFirstNonMainAttributeFieldIndex = function(dimension, resultSetFields)
{
	var firstNonMainAttributeIndex = 0;
	for (; firstNonMainAttributeIndex < resultSetFields.size(); firstNonMainAttributeIndex++)
	{
		var fnmaf = resultSetFields.get(firstNonMainAttributeIndex);
		if (fnmaf.getAttribute() !== dimension.getMainAttribute() || fnmaf !== dimension.getKeyField() && fnmaf !== dimension.getTextField())
		{
			break;
		}
	}
	return firstNonMainAttributeIndex;
};
