		applicationSettings.putOverwriteText(oFF.SacTableConstants.S_TOTAL_INCLUDING_MEMBER_OVERWRITE_TEXT, this.m_localizationProvider.getText(oFF.AuGdsQueryBuilderI18n.TOTALS_INCLUDING));
		applicationSettings.putOverwriteText(oFF.SacTableConstants.S_TOTAL_REMAINING_MEMBER_OVERWRITE_TEXT, this.m_localizationProvider.getText(oFF.AuGdsQueryBuilderI18n.TOTALS_REMAINING));
