		applicationSettings.putOverwriteText(oFF.SacTableConstants.S_VALUE_EXCEPTION_UNDEFINED, this.m_localizationProvider.getText(oFF.AuGdsQueryBuilderI18n.VALUE_EXCEPTION_UNDEFINED));
