oFF.AuGdsQbInteractiveTableView.prototype.processDropEvent = function(dropEvent)
{
	var parameters = dropEvent.getParameters();
	var targetColumn = parameters.getIntegerByKeyExt(oFF.UiEventParams.PARAM_TARGET_COLUMN, -1);
	var targetRow = parameters.getIntegerByKeyExt(oFF.UiEventParams.PARAM_TARGET_ROW, -1);
	var beforeCell = dropEvent.getRelativeDropPosition() === oFF.UiRelativeDropPosition.BEFORE;
	var resolver = this.getTableControl().getCustomObject();
	var payload = dropEvent.getDraggedControl().getCustomObject();
	var cmd = this.getQueryManager().getConvenienceCommands();
	if (oFF.notNull(payload))
	{
		var component = payload.getModelComponent();
		var componentType = component.getOlapComponentType();
		var queryModel = this.getQueryManager().getQueryModel();
		var sourceField = null;
		var sourceAttribute = null;
		var sourceDimension = null;
		if (componentType === oFF.OlapComponentType.FIELD)
		{
			sourceField = component;
			sourceAttribute = sourceField.getAttribute();
			sourceDimension = sourceField.getDimension();
		}
		else if (componentType === oFF.OlapComponentType.ATTRIBUTE)
		{
			sourceAttribute = component;
			sourceDimension = sourceAttribute.getDimension();
		}
		else if (componentType.isTypeOf(oFF.DimensionType.DIMENSION))
		{
			sourceDimension = component;
		}
		var targetFieldName = resolver.getHeaderFieldName(targetColumn, targetRow);
		var targetField = queryModel.getFieldByName(targetFieldName);
		var targetAxisType = resolver.getTargetDropAxisType(targetColumn, targetRow);
		if (oFF.notNull(sourceAttribute))
		{
			cmd.addAttributeToResultSet(sourceDimension.getName(), sourceAttribute.getName());
		}
		if (oFF.notNull(sourceAttribute) && oFF.notNull(targetField) && sourceDimension === targetField.getDimension())
		{
			this.moveAttributes(beforeCell, sourceAttribute, targetField, sourceDimension);
		}
		else if (oFF.notNull(sourceDimension) && oFF.notNull(targetField))
		{
			this.moveDimensions(beforeCell, sourceDimension, targetField.getDimension());
		}
		else if (oFF.notNull(sourceDimension) && oFF.notNull(targetAxisType))
		{
			cmd.moveDimensionToAxis(sourceDimension.getName(), targetAxisType);
			this.m_updateProcedure();
		}
	}
};
