	saveData.putString(oFF.AuGdsQbConstants.QD_VIEW_DATA_VIEW_TYPE, this.getViewType().getName());
	saveData.putString(oFF.AuGdsQbConstants.QD_VIEW_DATA_VIEW_NAME, this.getViewName());
	saveData.put(oFF.AuGdsQbConstants.QD_VIEW_SAVE_VIEW_STATE, oFF.notNull(viewState) ? viewState : oFF.PrFactory.createStructure());
	return saveData;
