oFF.AuGdsQbInteractiveTableView.prototype.onClick = function(event) {};
oFF.AuGdsQbInteractiveTableView.prototype.onButtonPress = function(event)
{
	var parameters = event.getParameters();
	var pressedButtonType = oFF.UiPressedButtonType.lookup(parameters.getStringByKey(oFF.UiEventParams.PARAM_PRESSED_BUTTON_TYPE));
	var column = parameters.getIntegerByKey(oFF.UiEventParams.PARAM_COLUMN);
	var row = parameters.getIntegerByKey(oFF.UiEventParams.PARAM_ROW);
	var resolver = event.getControl().getCustomObject();
	var tupleElement;
	if (pressedButtonType === oFF.UiPressedButtonType.DRILL)
	{
		tupleElement = resolver.getColumnTupleElement(column, row);
		if (oFF.isNull(tupleElement))
		{
			tupleElement = resolver.getRowTupleElement(column, row);
		}
		if (oFF.notNull(tupleElement))
		{
			if (oFF.AuGdsQbInteractiveTableView.supportsTupleElementCollapse(tupleElement))
			{
				tupleElement.setNextDrillState(oFF.DrillState.COLLAPSED);
			}
			else if (oFF.AuGdsQbInteractiveTableView.supportsTupleElementExpand(tupleElement))
			{
				tupleElement.setNextDrillState(oFF.DrillState.EXPANDED);
			}
			else if (oFF.AuGdsQbInteractiveTableView.supportsTupleElementDrill(tupleElement))
			{
				tupleElement.setNextDrillState(oFF.DrillState.DRILLED);
			}
		}
		this.m_updateProcedure();
	}
	else if (pressedButtonType === oFF.UiPressedButtonType.ICON)
	{
		var tuple = resolver.getRowTuple(row);
		tupleElement = resolver.getRowTupleElement(column, row);
		if (oFF.isNull(tuple))
		{
			tuple = resolver.getColumnTuple(column);
			tupleElement = resolver.getColumnTupleElement(column, row);
		}
		var fieldName = resolver.getColumnTupleFieldName(row);
		if (oFF.isNull(fieldName))
		{
			fieldName = resolver.getRowTupleFieldName(column);
		}
		var finalSelectedMeasure = null;
		var selectedSortPath = null;
		var caps = this.getQueryManager().getModelCapabilities();
		if (oFF.notNull(tuple))
		{
			if (caps.supportsDataCellSorting() && tuple.getTupleElementAt(tuple.getElements().size() - 1) === tupleElement)
			{
				selectedSortPath = oFF.XStream.of(tuple.getTupleElementAt(tuple.getElements().size() - 1).getDrillPath()).map( function(pathElement){
					return pathElement;
				}.bind(this)).collect(oFF.XStreamCollector.toList());
			}
			else if (caps.supportsMeasureSorting())
			{
				finalSelectedMeasure = this.getStructureMember(tuple);
				if (oFF.notNull(finalSelectedMeasure) && !finalSelectedMeasure.getDimension().isMeasureStructure())
				{
					finalSelectedMeasure = null;
				}
			}
		}
		var field = this.getQueryManager().getQueryModel().getFieldByName(fieldName);
		var sortDirection = oFF.AuGdsQbInteractiveTableContextActionsHelper.getSortDirection(this.getQueryManager(), field, selectedSortPath, finalSelectedMeasure);
		var targetSortDirection = oFF.XSortDirection.ASCENDING;
		if (sortDirection === oFF.XSortDirection.ASCENDING)
		{
			targetSortDirection = oFF.XSortDirection.DESCENDING;
		}
		else if (sortDirection === oFF.XSortDirection.DESCENDING)
		{
			targetSortDirection = oFF.XSortDirection.DEFAULT_VALUE;
		}
		oFF.AuGdsQbInteractiveTableContextActionsHelper.sortInDirection(this.getQueryManager(), targetSortDirection, field, selectedSortPath, finalSelectedMeasure);
		this.m_updateProcedure();
	}
};
