oFF.AuGdsQbInteractiveTableView.prototype.onResizeCell = function(event, biConsumer)
{
	if (oFF.notNull(this.m_tableDefinition))
	{
		var parameters = event.getParameters();
		var newSizes = parameters.getStringByKey(oFF.UiEventParams.PARAM_NEW_SIZES);
		if (oFF.XStringUtils.isNotNullAndNotEmpty(newSizes))
		{
			var sizes = oFF.JsonParserFactory.createFromString(newSizes);
			if (sizes.isList())
			{
				var sizesList = sizes.asList();
				var sizesSize = sizesList.size();
				for (var i = 0; i < sizesSize; i++)
				{
					var sizesElement = sizesList.get(i);
					if (sizesElement.isStructure())
					{
						this.acceptSize(sizesElement.asStructure(), biConsumer);
					}
				}
			}
		}
	}
	this.reRenderTableStyling();
};
oFF.AuGdsQbInteractiveTableView.prototype.acceptSize = function(element, biConsumer)
{
	if (element.containsKey(oFF.SacTableConstants.I_INDEX) && element.containsKey(oFF.SacTableConstants.I_SIZE))
	{
		biConsumer(oFF.XIntegerValue.create(element.getIntegerByKey(oFF.SacTableConstants.I_INDEX)), oFF.XIntegerValue.create(element.getIntegerByKey(oFF.SacTableConstants.I_SIZE)));
	}
};
oFF.AuGdsQbInteractiveTableView.prototype.onVisualizationObjectFilled = function(extResult, visualisationContainer, customIdentifier)
{
	var nullListener = null;
	var renderAction = oFF.AuGdsLambdaSyncAction.create(this.getApplication().getSession(), nullListener,  function(){
		if (oFF.notNull(this.m_preloadFinishedProcedure))
		{
			this.m_preloadFinishedProcedure(visualisationContainer.getVisualizationData());
			this.m_preloadFinishedProcedure = null;
		}
		var offsetRows = this.getQueryManager().getConvenienceCommands().getOffsetRows();
		var offsetColumns = this.getQueryManager().getConvenienceCommands().getOffsetColumns();
		var modelJson = null;
		var control = this.getTableControl();
		if (!this.hasPendingTableUpdates() && oFF.notNull(control))
		{
			modelJson = this.m_renderer.render(this.m_tableDefinition.getActiveTableContainer());
			if (!this.hasPendingTableUpdates())
			{
				control.setCustomObject(this.m_tableDefinition.getActiveTableContainer());
				this.m_activeSynchronizer = null;
				this.setTableModelJson(modelJson);
				this.correctScrollingPoints(visualisationContainer);
				if (offsetRows === 0 && this.m_rowScrollReferencePoint > 0 || offsetColumns === 0 && this.m_colScrollReferencePoint > 0)
				{
					this.reschedulePendingScroll();
				}
				else
				{
					this.processSelection();
				}
			}
			else
			{
				oFF.XLogger.println("Do not render, as table updates are pending (INNER)");
			}
		}
		else
		{
			oFF.XLogger.println("Do not render, as table updates are pending (OUTER)");
		}
		return modelJson;
	}.bind(this), 30);
	this.m_activeSynchronizer = renderAction;
	renderAction.processSyncAction(oFF.SyncType.NON_BLOCKING, null, null);
};
oFF.AuGdsQbInteractiveTableView.prototype.correctScrollingPoints = function(visualisationContainer)
{
	var visualizationData = oFF.isNull(visualisationContainer) ? null : visualisationContainer.getVisualizationData();
	if (oFF.notNull(visualizationData))
	{
		var dataRowsCountTotal = visualizationData.getDataRowsTotalCount() + (visualizationData.totalRowsCountMayBeInaccurate() ? this.getRowsWindowSize() * 3 : 0);
		var dataColsCountTotal = oFF.XMath.min(visualizationData.getDataColumnsTotalCount() + (visualizationData.totalColumnsCountMayBeInaccurate() ? this.getColumnsWindowSize() * 3 : 0), this.getColumnsMaxLoad());
		this.m_rowScrollReferencePoint = oFF.XMath.max(0, oFF.XMath.min(dataRowsCountTotal - 1, this.m_rowScrollReferencePoint));
		this.m_rowScrollEndReferencePoint = oFF.XMath.max(0, oFF.XMath.min(dataRowsCountTotal - 1, this.m_rowScrollEndReferencePoint));
		this.m_colScrollReferencePoint = oFF.XMath.max(0, oFF.XMath.min(dataColsCountTotal - 1, this.m_colScrollReferencePoint));
		this.m_colScrollEndReferencePoint = oFF.XMath.max(0, oFF.XMath.min(dataColsCountTotal - 1, this.m_colScrollEndReferencePoint));
	}
};
