oFF.AuGdsFilterLineMenuHana.prototype.createMenuItemsInternal = function(queryManager)
{
	if (this.m_featureManager.isActive(oFF.AuGdsFilterLineFeature.MEASURE_FILTER_SUPPORT))
	{
		var measureDimension = queryManager.getQueryModel().getMeasureDimension();
		if (oFF.notNull(measureDimension))
		{
			this.m_measuresList = oFF.XList.create();
			oFF.XCollectionUtils.forEach(measureDimension.getAllStructureMembers(),  function(measure){
				if (this.isMeasureVisible(measure))
				{
					this.m_measuresList.add(this.createMeasureMenuItem(measure));
				}
			}.bind(this));
			this.m_measuresList.sortByComparator(oFF.XComparatorLambda.create( function(item1, item2){
				return oFF.XIntegerValue.create(oFF.XString.compare(oFF.XString.toLowerCase(item1.getText()), oFF.XString.toLowerCase(item2.getText())));
			}.bind(this)));
		}
	}
};
oFF.AuGdsFilterLineMenuHana.prototype.isMeasureVisible = function(measure)
{
	return measure.getResultVisibility() !== oFF.ResultVisibility.HIDDEN;
};
oFF.AuGdsFilterLineMenuHana.prototype.createMeasureMenuItem = function(measure)
{
	var item = this.createMenuItem(measure.getText(), measure.getText());
	item.registerOnPress(oFF.UiLambdaPressListener.create( function(event){
		this.m_openFilterDialogWithMeasureConsumer(measure);
	}.bind(this)));
	this.m_allMeasures.put(item, oFF.XStringValue.create(measure.getName()));
	return item;
};
oFF.AuGdsFilterLineMenuHana.prototype.onBack = function(event)
{
	this.setPopoverHeightMax(false);
	this.navToRootPage();
};
oFF.AuGdsFilterLineMenuHana.prototype.updateMenuItemsInternal = function(selected)
{
	if (this.m_featureManager.isActive(oFF.AuGdsFilterLineFeature.MEASURE_FILTER_SUPPORT))
	{
		if (oFF.notNull(this.m_measuresList))
		{
			var measureItems = this.getMeasureMenuItems();
			var measureItemIterator = measureItems.getIterator();
			while (measureItemIterator.hasNext())
			{
				var measureItem = measureItemIterator.next();
				var measureName = this.m_allMeasures.getByKey(measureItem);
				measureItem.setEnabled(!selected.contains(measureName.toString()));
			}
		}
	}
};

