oFF.AuGdsArgumentsManager = function() {};
oFF.AuGdsArgumentsManager.prototype = new oFF.AuGdsDfManager();
oFF.AuGdsArgumentsManager.prototype._ff_c = "AuGdsArgumentsManager";

oFF.AuGdsArgumentsManager.GOD_MODE_VALUE = "expert";
oFF.AuGdsArgumentsManager.create = function(controller)
{
	var manager = new oFF.AuGdsArgumentsManager();
	manager.setupWithController(controller);
	return manager;
};
oFF.AuGdsArgumentsManager.prototype.m_allPossibleArguments = null;
oFF.AuGdsArgumentsManager.prototype.m_globalArguments = null;
oFF.AuGdsArgumentsManager.prototype.m_documentList = null;
oFF.AuGdsArgumentsManager.prototype.releaseObject = function()
{
	this.m_globalArguments = oFF.XObjectExt.release(this.m_globalArguments);
	this.m_allPossibleArguments = oFF.XObjectExt.release(this.m_allPossibleArguments);
	this.m_documentList = oFF.XObjectExt.release(this.m_documentList);
	oFF.AuGdsDfManager.prototype.releaseObject.call( this );
};
oFF.AuGdsArgumentsManager.prototype.setupManager = function()
{
	this.initPossibleArguments();
	this.m_documentList = this.getArguments().getListByKey(oFF.AuGdsConstants.PARAM_DOCUMENTS);
	if (oFF.isNull(this.m_documentList))
	{
		this.m_documentList = this.getArguments().putNewList(oFF.AuGdsConstants.PARAM_DOCUMENTS);
	}
	this.adjustArguments();
};
oFF.AuGdsArgumentsManager.prototype.getArguments = function()
{
	return this.getController().getArguments();
};
oFF.AuGdsArgumentsManager.prototype.getObjectArgument = function(name)
{
	return this.getArguments().getXObjectByKey(name);
};
oFF.AuGdsArgumentsManager.prototype.hasFileContentArgument = function()
{
	return this.getArguments().containsKey(oFF.AuGdsConstants.PARAM_FILE_CONTENT);
};
oFF.AuGdsArgumentsManager.prototype.getFileContentArgument = function()
{
	return this.getArguments().getStringByKeyExt(oFF.AuGdsConstants.PARAM_FILE_CONTENT, null);
};
oFF.AuGdsArgumentsManager.prototype.getFileArgumentName = function()
{
	return oFF.DfProgram.PARAM_FILE;
};
oFF.AuGdsArgumentsManager.prototype.hasValidDocumentArguments = function()
{
	return this.getArguments().containsKey(oFF.AuGdsConstants.PARAM_DOCUMENTS) && this.m_documentList.hasElements();
};
oFF.AuGdsArgumentsManager.prototype.processDocumentsArgument = function(consumer)
{
	oFF.XCollectionUtils.forEach(this.m_documentList,  function(docElement){
		if (docElement.isStructure())
		{
			var tmpDocArgs = docElement;
			var docFile = this.getArgumentFile(tmpDocArgs);
			var docType = this.getArgumentDocType(tmpDocArgs);
			consumer(tmpDocArgs, docFile, docType);
		}
	}.bind(this));
};
oFF.AuGdsArgumentsManager.prototype.getCustomFileSystem = function()
{
	return this.getArguments().getStringByKey(oFF.AuGdsConstants.PARAM_FILE_SYSTEM);
};
oFF.AuGdsArgumentsManager.prototype.newDocumentArgumentsStructure = function(docType)
{
	var newDocArguments = oFF.PrFactory.createStructure();
	if (this.getArguments() !== null)
	{
		oFF.XCollectionUtils.forEachString(docType.getDocumentSpecificArgumentNames(),  function(tmpArg){
			if (this.getArguments().containsKey(tmpArg))
			{
				newDocArguments.put(tmpArg, this.getArguments().getByKey(tmpArg));
			}
		}.bind(this));
	}
	return newDocArguments;
};
oFF.AuGdsArgumentsManager.prototype.addDocumentArguments = function(argStruct)
{
	this.m_documentList.add(argStruct);
	this.getProcess().notifyProcessEvent(oFF.ProcessEventType.START_CFG_CHANGED);
};
oFF.AuGdsArgumentsManager.prototype.removeDocumentArguments = function(argStruct)
{
	for (var a = 0; a < this.m_documentList.size(); a++)
	{
		var tmpArgDoc = this.m_documentList.get(a);
		if (tmpArgDoc === argStruct)
		{
			this.m_documentList.removeAt(a);
			break;
		}
	}
	this.getProcess().notifyProcessEvent(oFF.ProcessEventType.START_CFG_CHANGED);
};
oFF.AuGdsArgumentsManager.prototype.refreshAruments = function()
{
	this.getProcess().notifyProcessEvent(oFF.ProcessEventType.START_CFG_CHANGED);
};
oFF.AuGdsArgumentsManager.prototype.clearAllArguments = function()
{
	oFF.XStream.ofString(this.m_allPossibleArguments).forEach( function(strObj){
		var tmpArgName = strObj.getString();
		if (!this.isGlobalArgument(tmpArgName))
		{
			this.getArguments().remove(tmpArgName);
		}
	}.bind(this));
	this.refreshAruments();
};
oFF.AuGdsArgumentsManager.prototype.isJailbreakEnabled = function()
{
	var godModeValue = this.getProcess().getEnvironment().getStringByKey(oFF.XEnvironmentConstants.FIREFLY_GDS_MODE);
	return oFF.XString.isEqual(godModeValue, oFF.AuGdsArgumentsManager.GOD_MODE_VALUE);
};
oFF.AuGdsArgumentsManager.prototype.initPossibleArguments = function()
{
	this.m_globalArguments = oFF.XListOfString.create();
	this.m_allPossibleArguments = oFF.XListOfString.create();
	this.m_globalArguments.add(oFF.AuGdsConstants.PARAM_DOCUMENTS);
	this.m_globalArguments.add(oFF.AuGdsConstants.PARAM_FILE_CONTENT);
	this.m_globalArguments.add(oFF.AuGdsConstants.PARAM_DEBUG);
	this.m_globalArguments.add(oFF.AuGdsConstants.PARAM_ADVANCED_FEATURES);
	this.m_globalArguments.add(oFF.AuGdsConstants.PARAM_BLEEDING_EDGE);
	if (!this.isJailbreakEnabled())
	{
		this.m_globalArguments.add(oFF.AuGdsConstants.PARAM_TOOL_NAME);
		this.m_globalArguments.add(oFF.AuGdsConstants.PARAM_HIDE_MENU_BAR);
		this.m_globalArguments.add(oFF.AuGdsConstants.PARAM_HIDE_STATUS_BAR);
		this.m_globalArguments.add(oFF.AuGdsConstants.PARAM_HIDE_TOOLBAR);
		this.m_globalArguments.add(oFF.AuGdsConstants.PARAM_MULTI_DOCUMENTS);
		this.m_globalArguments.add(oFF.AuGdsConstants.PARAM_INTEGRATION);
		this.m_globalArguments.add(oFF.AuGdsConstants.PARAM_CONFIGURATION);
		this.m_globalArguments.add(oFF.AuGdsConstants.PARAM_CONFIG_FILE);
		this.m_globalArguments.add(oFF.AuGdsConstants.PARAM_MODE);
		this.m_globalArguments.add(oFF.AuGdsConstants.PARAM_FILE_SYSTEM);
	}
	this.m_allPossibleArguments.addAll(this.m_globalArguments);
	this.m_allPossibleArguments.add(this.getFileArgumentName());
	this.m_allPossibleArguments.add(oFF.AuGdsConstants.PARAM_DOC_TYPE);
	oFF.XCollectionUtils.forEach(oFF.AuGdsDocumentType.getAllTypes(),  function(docType){
		this.m_allPossibleArguments.addAll(docType.getDocumentSpecificArgumentNames());
	}.bind(this));
};
oFF.AuGdsArgumentsManager.prototype.adjustArguments = function()
{
	var tmpStruct = oFF.PrStructure.create();
	var argsKeysIterator = this.getArguments().getKeysAsIteratorOfString();
	while (argsKeysIterator.hasNext())
	{
		var tmpArgkey = argsKeysIterator.next();
		if (!this.isGlobalArgument(tmpArgkey))
		{
			if (this.m_allPossibleArguments.contains(tmpArgkey))
			{
				var tmpElement = this.getArguments().getByKey(tmpArgkey);
				if (oFF.notNull(tmpElement))
				{
					tmpStruct.put(tmpArgkey, tmpElement);
				}
			}
			this.getArguments().remove(tmpArgkey);
		}
	}
	if (tmpStruct.hasElements())
	{
		this.m_documentList.add(tmpStruct);
	}
	else
	{
		oFF.XObjectExt.release(tmpStruct);
	}
};
oFF.AuGdsArgumentsManager.prototype.getArgumentFile = function(docStructure)
{
	return this.getController().getFileManager().createFileByPath(docStructure.getStringByKey(oFF.DfProgram.PARAM_FILE));
};
oFF.AuGdsArgumentsManager.prototype.getArgumentDocType = function(docStructure)
{
	return oFF.AuGdsDocumentType.lookup(docStructure.getStringByKey(oFF.AuGdsConstants.PARAM_DOC_TYPE));
};
oFF.AuGdsArgumentsManager.prototype.isGlobalArgument = function(tmpArg)
{
	if (this.m_globalArguments.contains(tmpArg))
	{
		return true;
	}
	return false;
};

oFF.AuGdsClipboardManager = function() {};
oFF.AuGdsClipboardManager.prototype = new oFF.AuGdsDfManager();
oFF.AuGdsClipboardManager.prototype._ff_c = "AuGdsClipboardManager";

oFF.AuGdsClipboardManager.create = function(controller)
{
	var settingsManager = new oFF.AuGdsClipboardManager();
	settingsManager.setupWithController(controller);
	return settingsManager;
};
oFF.AuGdsClipboardManager.prototype.m_clipboardData = null;
oFF.AuGdsClipboardManager.prototype.m_consumers = null;
oFF.AuGdsClipboardManager.prototype.releaseObject = function()
{
	oFF.AuGdsDfManager.prototype.releaseObject.call( this );
};
oFF.AuGdsClipboardManager.prototype.setupManager = function()
{
	this.m_consumers = oFF.XHashMapByString.create();
	this.m_clipboardData = null;
};
oFF.AuGdsClipboardManager.prototype.setClipboardData = function(newData)
{
	var didChange = !oFF.XString.isEqual(newData, this.m_clipboardData);
	this.m_clipboardData = newData;
	if (didChange)
	{
		this.fireClipboardChangedEvent();
	}
};
oFF.AuGdsClipboardManager.prototype.getClipboardData = function()
{
	return this.m_clipboardData;
};
oFF.AuGdsClipboardManager.prototype.clearClipboardData = function()
{
	var didChange = oFF.notNull(this.m_clipboardData);
	this.m_clipboardData = null;
	if (didChange)
	{
		this.fireClipboardChangedEvent();
	}
};
oFF.AuGdsClipboardManager.prototype.hasClipboardData = function()
{
	return oFF.XStringUtils.isNotNullAndNotEmpty(this.m_clipboardData);
};
oFF.AuGdsClipboardManager.prototype.registerClipboardChanged = function(listenerId, consumer)
{
	var consumerHolder = oFF.XConsumerHolder.create(consumer);
	this.m_consumers.put(listenerId, consumerHolder);
};
oFF.AuGdsClipboardManager.prototype.deregisterClipboardChanged = function(listenerId)
{
	this.m_consumers.remove(listenerId);
};
oFF.AuGdsClipboardManager.prototype.generateCutMenuItem = function(name, document)
{
	var cutMenuItem = this.getGenesis().newControl(oFF.UiType.MENU_ITEM);
	cutMenuItem.setName(name);
	cutMenuItem.setText("Cut");
	cutMenuItem.setIcon("scissors");
	cutMenuItem.setEnabled(oFF.notNull(document) && document.canClipboardCut());
	cutMenuItem.registerOnPress(oFF.UiLambdaPressListener.create( function(controlEvent){
		if (oFF.notNull(document))
		{
			var cutData = document.executeClipboardCut();
			if (oFF.XStringUtils.isNotNullAndNotEmpty(cutData))
			{
				this.m_clipboardData = cutData;
			}
		}
	}.bind(this)));
	return cutMenuItem;
};
oFF.AuGdsClipboardManager.prototype.generateCopyMenuItem = function(name, document)
{
	var copyMenuItem = this.getGenesis().newControl(oFF.UiType.MENU_ITEM);
	copyMenuItem.setName(name);
	copyMenuItem.setText("Copy");
	copyMenuItem.setIcon("copy");
	copyMenuItem.setEnabled(oFF.notNull(document) && document.canClipboardCopy());
	copyMenuItem.registerOnPress(oFF.UiLambdaPressListener.create( function(controlEvent){
		if (oFF.notNull(document))
		{
			var copyData = document.executeClipboardCopy();
			if (oFF.XStringUtils.isNotNullAndNotEmpty(copyData))
			{
				this.m_clipboardData = copyData;
			}
		}
	}.bind(this)));
	return copyMenuItem;
};
oFF.AuGdsClipboardManager.prototype.generatePasteMenuItem = function(name, document)
{
	var pasteMenuItem = this.getGenesis().newControl(oFF.UiType.MENU_ITEM);
	pasteMenuItem.setName(name);
	pasteMenuItem.setText("Paste");
	pasteMenuItem.setIcon("paste");
	pasteMenuItem.setEnabled(oFF.notNull(document) && document.canClipboardPaste());
	pasteMenuItem.registerOnPress(oFF.UiLambdaPressListener.create( function(controlEvent){
		if (oFF.notNull(document))
		{
			document.executeClipboardPaste(this.m_clipboardData);
		}
	}.bind(this)));
	return pasteMenuItem;
};
oFF.AuGdsClipboardManager.prototype.getGenesis = function()
{
	return this.getUiTools().getGenesis();
};
oFF.AuGdsClipboardManager.prototype.fireClipboardChangedEvent = function()
{
	oFF.XCollectionUtils.forEach(this.m_consumers,  function(consumerHolder){
		try
		{
			consumerHolder.accept(this);
		}
		catch (e)
		{
			this.getMessageCenter().showErrorToast("Error during clipboard event execution!");
		}
	}.bind(this));
};

oFF.AuGdsConfiguration = function() {};
oFF.AuGdsConfiguration.prototype = new oFF.AuGdsDfManager();
oFF.AuGdsConfiguration.prototype._ff_c = "AuGdsConfiguration";

oFF.AuGdsConfiguration.create = function(controller)
{
	var manager = new oFF.AuGdsConfiguration();
	manager.setupWithController(controller);
	return manager;
};
oFF.AuGdsConfiguration.prototype.m_configurationJson = null;
oFF.AuGdsConfiguration.prototype.releaseObject = function()
{
	this.m_configurationJson = oFF.XObjectExt.release(this.m_configurationJson);
	oFF.AuGdsDfManager.prototype.releaseObject.call( this );
};
oFF.AuGdsConfiguration.prototype.setupManager = function()
{
	var modeConfigStruct = this.getModeConfig();
	var userConfigStruct = this.getUserConfig();
	this.m_configurationJson = this.mergeModeWithConfig(modeConfigStruct, userConfigStruct);
	if (oFF.isNull(this.m_configurationJson))
	{
		this.m_configurationJson = oFF.PrFactory.createStructure();
	}
};
oFF.AuGdsConfiguration.prototype.getConfigJson = function()
{
	return this.m_configurationJson;
};
oFF.AuGdsConfiguration.prototype.getConfigJsonForDocumentType = function(docType)
{
	var documentConfiguration = null;
	if (oFF.notNull(docType))
	{
		documentConfiguration = this.getConfigJson().getStructureByKey(docType.getName());
	}
	if (oFF.isNull(documentConfiguration))
	{
		documentConfiguration = oFF.PrFactory.createStructure();
	}
	return documentConfiguration;
};
oFF.AuGdsConfiguration.prototype.getUserConfigurationString = function()
{
	var configString = this.getArgumentsManager().getArguments().getStringByKeyExt(oFF.AuGdsConstants.PARAM_CONFIGURATION, null);
	if (oFF.XStringUtils.isNullOrEmpty(configString))
	{
		var fileName = this.getArgumentsManager().getArguments().getStringByKeyExt(oFF.AuGdsConstants.PARAM_CONFIG_FILE, null);
		if (oFF.notNull(fileName))
		{
			var file = oFF.XFile.createWithVars(this.getProcess(), fileName);
			var content = oFF.isNull(file) || file.hasErrors() ? null : file.loadAsByteArray();
			configString = oFF.isNull(content) ? null : oFF.XByteArray.convertToStringWithCharset(content, oFF.XCharset.UTF8);
		}
	}
	if (oFF.isNull(configString))
	{
		configString = "";
	}
	return configString;
};
oFF.AuGdsConfiguration.prototype.parseString = function(strToParse)
{
	var parser = oFF.JsonParserFactory.newInstance();
	var tmpElement = parser.parse(strToParse);
	var tmpStruct = null;
	if (oFF.notNull(tmpElement) && tmpElement.isStructure())
	{
		tmpStruct = tmpElement;
	}
	oFF.XObjectExt.release(parser);
	return tmpStruct;
};
oFF.AuGdsConfiguration.prototype.getModeConfig = function()
{
	var modeConfigStruct = null;
	var mode = this.getArgumentsManager().getArguments().getStringByKeyExt(oFF.AuGdsConstants.PARAM_MODE, null);
	var modeConfigStr = oFF.AuGdsDefaultInlineConfigs.getConfigsForMode(mode);
	if (oFF.XStringUtils.isNotNullAndNotEmpty(modeConfigStr))
	{
		try
		{
			modeConfigStruct = this.parseString(modeConfigStr);
		}
		catch (e)
		{
			this.log("Could not parse mode configuration json!");
		}
	}
	return modeConfigStruct;
};
oFF.AuGdsConfiguration.prototype.getUserConfig = function()
{
	var userConfigStruct = null;
	var configStr = this.getUserConfigurationString();
	if (oFF.XStringUtils.isNotNullAndNotEmpty(configStr))
	{
		try
		{
			userConfigStruct = this.parseString(configStr);
		}
		catch (e)
		{
			this.log("Could not parse user configuration json!");
		}
	}
	return userConfigStruct;
};
oFF.AuGdsConfiguration.prototype.mergeModeWithConfig = function(modeConfigStruct, userConfigStruct)
{
	var finalConfigStruct = null;
	if (oFF.notNull(modeConfigStruct) && oFF.isNull(userConfigStruct))
	{
		finalConfigStruct = modeConfigStruct;
	}
	else if (oFF.isNull(modeConfigStruct) && oFF.notNull(userConfigStruct))
	{
		finalConfigStruct = userConfigStruct;
	}
	else if (oFF.notNull(modeConfigStruct) && oFF.notNull(userConfigStruct))
	{
		var tmpStruct = oFF.PrFactory.createStructure();
		tmpStruct.putAll(modeConfigStruct);
		oFF.XCollectionUtils.forEachString(userConfigStruct.getKeysAsReadOnlyListOfString(),  function(tmpConfigKey){
			if (oFF.XString.isEqual(tmpConfigKey, oFF.AuGdsConstants.CONFIG_RESOURCE_EXPLORER))
			{
				oFF.SuConfigWrapperBase.deepMerge(userConfigStruct, tmpStruct);
			}
			else
			{
				var docType = oFF.AuGdsDocumentType.lookup(tmpConfigKey);
				if (oFF.isNull(docType))
				{
					tmpStruct.put(tmpConfigKey, userConfigStruct.getByKey(tmpConfigKey));
				}
			}
		}.bind(this));
		oFF.XCollectionUtils.forEach(oFF.AuGdsDocumentType.getAllTypes(),  function(tmpDocType){
			var docTypeName = tmpDocType.getName();
			var docTypeConfigStruct = userConfigStruct.getStructureByKey(docTypeName);
			if (oFF.notNull(docTypeConfigStruct))
			{
				var tmpDocStruct = tmpStruct.getStructureByKey(docTypeName);
				if (oFF.isNull(tmpDocStruct))
				{
					tmpDocStruct = tmpStruct.putNewStructure(docTypeName);
				}
				tmpDocStruct.putAll(docTypeConfigStruct);
			}
		}.bind(this));
		finalConfigStruct = tmpStruct;
	}
	return finalConfigStruct;
};

