{
	var settingsManager = new oFF.AuGdsFileManager();
	settingsManager.setupWithController(controller);
	return settingsManager;
};
oFF.AuGdsFileManager.prototype.releaseObject = function()
{
	oFF.AuGdsDfManager.prototype.releaseObject.call( this );
};
oFF.AuGdsFileManager.prototype.setupManager = function() {};
oFF.AuGdsFileManager.prototype.createFileByPath = function(filePathStr)
{
	var gdfFile = null;
	if (oFF.XStringUtils.isNotNullAndNotEmpty(filePathStr))
	{
		var process = this.getProcess();
		gdfFile = oFF.XFile.createWithVars(process, filePathStr);
	}
	return gdfFile;
};
oFF.AuGdsFileManager.prototype.loadJsonFromFile = function(file)
{
	return this.loadJsonFileInternal(file);
};
oFF.AuGdsFileManager.prototype.loadDocument = function(documentFile, consumer)
{
	this.loadJsonFileInternal(documentFile).then( function(loadedJson){
		var docType = null;
		if (oFF.notNull(documentFile) && oFF.notNull(loadedJson))
		{
			docType = this.determineDocumentType(loadedJson, documentFile);
		}
		consumer(docType, documentFile, loadedJson);
		return loadedJson;
	}.bind(this),  function(errMsg){
		consumer(null, null, null);
	}.bind(this));
};
oFF.AuGdsFileManager.prototype.loadDocumentByPath = function(docFilePath, consumer)
{
	var docFile = this.createFileByPath(docFilePath);
	if (oFF.notNull(docFile))
	{
		this.loadDocument(docFile, consumer);
	}
	else
	{
		consumer(null, null, null);
	}
};
oFF.AuGdsFileManager.prototype.determineDocumentType = function(documentJson, file)
{
	var foundType = oFF.AuGdsFileType.getDocumentTypeForJson(documentJson, file);
	if (oFF.isNull(foundType))
	{
		if (oFF.AuGdsFileType.GDS_DOCUMENT_FILE.validate(documentJson, file))
		{
			var docType = documentJson.getStringByKeyExt(oFF.AuGdsConstants.GDF_FILE_DOC_TYPE, null);
			foundType = oFF.AuGdsDocumentType.lookup(docType);
		}
	}
	return foundType;
};
oFF.AuGdsFileManager.prototype.presentSaveAsPopup = function(document, consumer)
{
	this.showSaveAsDialog(document, consumer);
};
oFF.AuGdsFileManager.prototype.saveDocumentAs = function(document, outputFile, consumer)
{
	var contentToSave = document.getSaveContent();
	this.saveDocumentContentAs(contentToSave, outputFile, consumer);
};
oFF.AuGdsFileManager.prototype.saveDocumentContentAs = function(contentToSave, outputFile, consumer)
{
	if (this.isFileAndContentValidForSave(outputFile, contentToSave))
	{
		this.saveContentToFile(outputFile, contentToSave, consumer);
	}
};
oFF.AuGdsFileManager.prototype.saveDocument = function(document, consumer)
{
	var outputFile = document.getFile();
	this.saveDocumentAs(document, outputFile, consumer);
};
oFF.AuGdsFileManager.prototype.getGenesis = function()
{
	return this.getUiTools().getGenesis();
};
oFF.AuGdsFileManager.prototype.showSaveAsDialog = function(document, consumer)
{
	var docSaveFileName = document.getSaveFileName();
	var title = this.getController().getGlobalLocalization().getText(oFF.AuGalaxyDataStudioI18n.RESOURCE_EXPLORER_TITLE_SAVE_DOCUMENT);
	var initialPath = null;
	if (document.hasFile())
	{
		var directory = document.getFile().getParent();
		initialPath = oFF.notNull(directory) ? directory.getUri().getPath() : null;
	}
	var resExplorerSaveRunner = oFF.AuGdsResourceExplorerProgramFactory.createResourceExplorerGdsDocumentSave(this.getProcess(), title, this.getConfiguration(), docSaveFileName, oFF.SuResourceExplorerListener.createOK( function(resourceInfo, dialog){
		if (oFF.notNull(resourceInfo) && !resourceInfo.isDirectory())
		{
			var newFile = oFF.XFile.createByUrl(this.getProcess(), resourceInfo.getUrl());
			if (oFF.notNull(newFile))
			{
				newFile.getAttributes().putString(oFF.XFileAttribute.DESCRIPTION.getName(), resourceInfo.getDescription());
			}
			this.handleSaveAs(document, newFile, false,  function(extResult){
				if (extResult.hasErrors())
				{
					this.getMessageCenter().showErrorToast(extResult.getSummary());
				}
				dialog.close();
				if (oFF.notNull(consumer))
				{
					consumer(extResult);
				}
			}.bind(this));
		}
		else
		{
			dialog.showErrorMessage(this.getController().getGlobalLocalization().getText(oFF.AuGalaxyDataStudioI18n.SAVE_RESOURCE_ERROR));
		}
	}.bind(this)), initialPath);
	resExplorerSaveRunner.runProgram();
};
oFF.AuGdsFileManager.prototype.loadJsonFileInternal = function(file)
{
	return oFF.UtFilePromise.loadJsonContent(file);
};
oFF.AuGdsFileManager.prototype.isFileAndContentValidForSave = function(outputFile, contentToSave)
{
	if (oFF.isNull(outputFile))
	{
		this.getMessageCenter().showWarningToast("Cannot save! No file specified!");
		return false;
	}
	if (oFF.isNull(contentToSave))
	{
		this.getMessageCenter().showWarningToast("Cannot save! No content to save!");
		return false;
	}
	return true;
};
oFF.AuGdsFileManager.prototype.saveContentToFile = function(outputFile, contentToSave, consumer)
{
	outputFile.processSave(oFF.SyncType.NON_BLOCKING, oFF.UiLambdaFileSavedListener.create( function(extResult){
		if (!extResult.hasErrors())
		{
			var fileName = oFF.SuResourceWrapper.create(extResult.getData()).getTranslatedDisplayName();
			var msg = this.getController().getGlobalLocalization().getTextWithPlaceholder(oFF.AuGalaxyDataStudioI18n.SAVE_RESOURCE_SUCCESS, fileName);
			this.getMessageCenter().showSuccessToast(msg);
		}
		if (oFF.notNull(consumer))
		{
			consumer(extResult);
		}
	}.bind(this)), null, contentToSave, oFF.CompressionType.NONE);
};
oFF.AuGdsFileManager.prototype.handleSaveAs = function(document, outputFile, showFileExistsWarning, consumer)
{
	var contentToSave = document.getSaveContent();
	if (this.isFileAndContentValidForSave(outputFile, contentToSave))
	{
		if (showFileExistsWarning && outputFile.isExisting())
		{
			this.presentFileExistsPopup(outputFile, contentToSave, consumer);
		}
		else
		{
			this.saveContentToFile(outputFile, contentToSave, consumer);
		}
	}
};
oFF.AuGdsFileManager.prototype.presentFileExistsPopup = function(outputFile, contentToSave, consumer)
{
	var existsMsg = oFF.XStringUtils.concatenate3("The file ", outputFile.getUri().getPath(), " already exists. Do you want to overwrite it?");
	var fileExists = oFF.UtConfirmPopup.create(this.getGenesis(), "File already exists!", existsMsg);
	fileExists.setCancelButtonIcon("sys-cancel-2");
	fileExists.setCancelButtonText("Cancel");
	fileExists.setConfirmButtonIcon("sys-enter-2");
	fileExists.setConfirmButtonText("Overwrite");
	fileExists.setConfirmButtonType(oFF.UiButtonType.DESTRUCTIVE);
	fileExists.setConfirmProcedure( function(){
		this.saveContentToFile(outputFile, contentToSave, consumer);
	}.bind(this));
	fileExists.open();
};

