oFF.AuGdsSettingsManager.GDS_RECENT_FILES_SEPARATOR = ",";
oFF.AuGdsSettingsManager.GDS_RECENT_FILES_KEY = "recentFiles";
oFF.AuGdsSettingsManager.create = function(controller)
{
	var settingsManager = new oFF.AuGdsSettingsManager();
	settingsManager.setupWithController(controller);
	return settingsManager;
};
oFF.AuGdsSettingsManager.prototype.m_recentFiles = null;
oFF.AuGdsSettingsManager.prototype.releaseObject = function()
{
	oFF.AuGdsDfManager.prototype.releaseObject.call( this );
};
oFF.AuGdsSettingsManager.prototype.setupManager = function()
{
	this.reloadRecentFiles();
};
oFF.AuGdsSettingsManager.prototype.getRecentFilesList = function()
{
	return this.m_recentFiles;
};
oFF.AuGdsSettingsManager.prototype.addRecentFileEntry = function(file)
{
	if (oFF.notNull(file) && oFF.notNull(this.m_recentFiles))
	{
		this.reloadRecentFiles();
		var filePathStr = file.getUrl();
		this.m_recentFiles.removeElement(filePathStr);
		this.m_recentFiles.insert(0, filePathStr);
		this.saveRecentFileList();
	}
};
oFF.AuGdsSettingsManager.prototype.removeRecentFileEntry = function(file)
{
	if (oFF.notNull(file) && oFF.notNull(this.m_recentFiles))
	{
		this.reloadRecentFiles();
		var filePathStr = file.getUrl();
		this.m_recentFiles.removeElement(filePathStr);
		this.saveRecentFileList();
	}
};
oFF.AuGdsSettingsManager.prototype.clearRecentFiles = function()
{
	this.m_recentFiles.clear();
	this.saveRecentFileList();
};
oFF.AuGdsSettingsManager.prototype.getLocalStorage = function()
{
	return this.getController().getProcess().getLocalStorage();
};
oFF.AuGdsSettingsManager.prototype.saveRecentFileList = function()
{
	var recentItemsStr = "";
	for (var a = 0; a < this.m_recentFiles.size(); a++)
	{
		var tmpRecentStr = this.m_recentFiles.get(a);
		recentItemsStr = oFF.XStringUtils.concatenate2(recentItemsStr, tmpRecentStr);
		if (a !== this.m_recentFiles.size() - 1)
		{
			recentItemsStr = oFF.XStringUtils.concatenate2(recentItemsStr, oFF.AuGdsSettingsManager.GDS_RECENT_FILES_SEPARATOR);
		}
	}
	this.getLocalStorage().putString(oFF.AuGdsSettingsManager.GDS_RECENT_FILES_KEY, recentItemsStr);
};
oFF.AuGdsSettingsManager.prototype.reloadRecentFiles = function()
{
	if (oFF.notNull(this.m_recentFiles))
	{
		this.m_recentFiles.clear();
		this.m_recentFiles = oFF.XObjectExt.release(this.m_recentFiles);
	}
	var recentItemsStr = this.getLocalStorage().getStringByKeyExt(oFF.AuGdsSettingsManager.GDS_RECENT_FILES_KEY, "");
	if (oFF.XStringUtils.isNotNullAndNotEmpty(recentItemsStr))
	{
		this.m_recentFiles = oFF.XStringTokenizer.splitString(recentItemsStr, oFF.AuGdsSettingsManager.GDS_RECENT_FILES_SEPARATOR);
	}
	else
	{
		this.m_recentFiles = oFF.XListOfString.create();
	}
};

