		this.m_statusBarWrapper.setPadding(oFF.UiCssBoxEdges.create("5px"));
		this.m_statusBarWrapper.setMaxHeight(oFF.UiCssLength.create("30px"));
		this.m_statusLabel = this.m_statusBarWrapper.addNewItemOfType(oFF.UiType.LABEL);
		this.m_statusLabel.setFlex("auto");
		this.m_networkActivityIndicator = this.m_statusBarWrapper.addNewItemOfType(oFF.UiType.ACTIVITY_INDICATOR);
		this.m_networkActivityIndicator.setIconSize(oFF.UiCssLength.create("1rem"));
