oFF.AuDataProviderListViewPlugin.prototype.buildPluginUi = function(genesis)
{
	this.m_list = genesis.newRoot(oFF.UiType.LIST);
	this.m_list.setSelectionMode(oFF.UiSelectionMode.SINGLE_SELECT);
	this.m_list.setBusy(oFF.XStringUtils.isNotNullAndNotEmpty(this.m_watchListKey));
	this.m_list.setShowNoData(!this.m_list.isBusy());
	if (oFF.XStringUtils.isNotNullAndNotEmpty(this.m_focusedProviderKey))
	{
		this.m_list.registerOnSelectionChange(oFF.UiLambdaSelectionChangeListener.create( function(evt){
			this.getDataSpace().putXObject(this.m_focusedProviderKey, this.m_list.getSelectedItem().getCustomObject());
		}.bind(this)));
	}
	this.getController().addDataSpaceChangedListener( function(changedKey){
		if (oFF.XString.isEqual(changedKey, this.m_watchListKey))
		{
			this.updateList();
		}
		else if (oFF.XString.isEqual(changedKey, this.m_focusedProviderKey))
		{
			var focusedProvider = this.getDataSpace().getXObjectByKey(this.m_focusedProviderKey);
			var focusedId = oFF.OuHorizonDataSpaceConventions.getDataProviderKey(focusedProvider);
			this.m_list.setSelectedName(focusedId);
		}
	}.bind(this));
	this.updateList();
};
oFF.AuDataProviderListViewPlugin.prototype.updateList = function()
{
	this.m_list.clearItems();
	var allDataProvider = this.getDataSpace().getXObjectByKey(this.m_watchListKey);
	if (!oFF.XCollectionUtils.hasElements(allDataProvider))
	{
		return;
	}
	this.m_list.setBusy(false);
	oFF.XStream.of(allDataProvider).forEach( function(provider){
		var item = this.m_list.addNewItem();
		var dataProviderKey = oFF.OuHorizonDataSpaceConventions.getDataProviderKey(provider);
		item.setName(dataProviderKey);
		item.setTooltip(dataProviderKey);
		item.setText(provider.getDataSource().getObjectName());
		item.setCustomObject(provider);
	}.bind(this));
};

