oFF.AuGalaxyDataStudio.prototype.setupProgram = function()
{
	this.m_openDocuments = oFF.XHashMapByString.create();
	this.m_menuTreeGenerator = oFF.CMEFactory.createMenuTreeGenerator();
	this.m_settingsManager = oFF.AuGdsSettingsManager.create(this);
	this.m_fileManager = oFF.AuGdsFileManager.create(this);
	this.m_argumentsManager = oFF.AuGdsArgumentsManager.create(this);
	this.m_clipboardManager = oFF.AuGdsClipboardManager.create(this);
	this.m_uiTools = oFF.AuGdsUiTools.create(this);
	this.m_messageCenter = oFF.AuGdsMessageCenter.create(this);
	this.m_featureManger = oFF.AuGdsFeatureManager.create(this);
	this.m_configuration = oFF.AuGdsConfiguration.create(this);
	this.m_toolbarManager = oFF.AuGdsToolbarManager.create(this);
	this.m_menuManager = oFF.AuGdsMenuManager.create(this);
	this.m_panelManager = oFF.AuGdsPanelManager.create(this);
	this.m_statusBarManager = oFF.AuGdsStatusBarManager.create(this);
	this.getSession().activateFeatureToggle(oFF.FeatureToggleOlap.INA_REPOSITORY_DELTA);
	this.activateFileSystemIfNeeded();
	return null;
};
oFF.AuGalaxyDataStudio.prototype.buildUi = function(genesis)
{
	this.m_mainLayout = genesis.newControl(oFF.UiType.FLEX_LAYOUT);
	this.m_mainLayout.setDirection(oFF.UiFlexDirection.COLUMN);
	this.m_mainLayout.useMaxSpace();
	this.m_mainLayout.setBackgroundDesign(oFF.UiBackgroundDesign.SOLID);
	this.m_mainLayout.setOverflow(oFF.UiOverflow.HIDDEN);
	this.m_widgetToolbarLayout = this.m_mainLayout.addNewItemOfType(oFF.UiType.FLEX_LAYOUT);
	this.m_widgetToolbarLayout.setDirection(oFF.UiFlexDirection.ROW);
	this.m_widgetToolbarLayout.useMaxWidth();
	this.m_widgetToolbarLayout.setHeight(oFF.UiCssLength.AUTO);
	this.m_widgetToolbarLayout.setMaxHeight(oFF.UiCssLength.create("2.5rem"));
	this.m_widgetToolbarLayout.setFlex("initial");
	this.m_widgetContainer = this.m_widgetToolbarLayout.addNewItemOfType(oFF.UiType.FLEX_LAYOUT);
	this.m_widgetContainer.setDirection(oFF.UiFlexDirection.COLUMN);
	this.m_widgetContainer.setHeight(oFF.UiCssLength.AUTO);
	this.m_widgetContainer.setFlex("initial");
	var mainToolbar = this.getToolbarManager().getToolbarView();
	mainToolbar.setFlex("0 0 auto");
	this.m_widgetToolbarLayout.addItem(mainToolbar);
	this.m_contentLayout = this.m_mainLayout.addNewItemOfType(oFF.UiType.FLEX_LAYOUT);
	this.m_contentLayout.setDirection(oFF.UiFlexDirection.COLUMN);
	this.m_contentLayout.useMaxWidth();
	this.m_contentLayout.setHeight(oFF.UiCssLength.AUTO);
	this.m_contentLayout.setFlex("auto");
	this.m_contentLayout.setMinHeight(oFF.UiCssLength.create("0"));
	this.m_contentLayout.registerOnFileDrop(oFF.UiLambdaFileDropListener.create( function(controlEvent){
		this.handleFileDrop(controlEvent);
	}.bind(this)));
	var statusBar = this.getStatusBarManager().getStatusBarControl();
	this.m_mainLayout.addItem(statusBar);
	genesis.setRoot(this.m_mainLayout);
	if (this.getFeatureManager().shouldHideMenuBar())
	{
		this.showMenuBar(false);
	}
	this.createPersistentMenuBar();
	this.createPersistentToolbarItems();
	this.handleStartup();
};
oFF.AuGalaxyDataStudio.prototype.createPersistentMenuBar = function()
{
	this.addMenuBarButton("File", null, oFF.AuGalaxyDataStudio.PERSISTENT_ITEM_TAG,  function(controlEvent){
		this.createFileMenuBarMenu(controlEvent.getControl());
	}.bind(this));
	this.addMenuBarButton("Edit", null, oFF.AuGalaxyDataStudio.PERSISTENT_ITEM_TAG,  function(controlEvent2){
		this.createEditMenuBarMenu(controlEvent2.getControl());
	}.bind(this));
	this.addMenuBarButton("View", null, oFF.AuGalaxyDataStudio.PERSISTENT_ITEM_TAG,  function(controlEvent3){
		this.createViewMenuBarMenu(controlEvent3.getControl());
	}.bind(this));
	this.m_menuBarDocumentBtn = this.addMenuBarButton("Document", null, oFF.AuGalaxyDataStudio.PERSISTENT_ITEM_TAG,  function(controlEvent4){
		this.createDocumentMenuBarMenu(controlEvent4.getControl());
	}.bind(this));
	if (this.getFeatureManager().isDebug() || this.getFeatureManager().isSupportUserRole())
	{
		this.addMenuBarButton("Tools", null, oFF.AuGalaxyDataStudio.PERSISTENT_ITEM_TAG,  function(controlEvent5){
			this.createToolsMenuBarMenu(controlEvent5.getControl());
		}.bind(this));
	}
};
oFF.AuGalaxyDataStudio.prototype.createPersistentToolbarItems = function()
{
	var mainPersistentGroup = this.getToolbarManager().addNewPersistentToolbarGroup();
	if (this.getFeatureManager().areMultipleDocumentsEnabled())
	{
		this.m_toolbarNewBtn = mainPersistentGroup.addButton("New", null, "New", "document");
		this.m_toolbarNewBtn.setPressConsumer( function(controlEvent){
			this.newToolbarItemPressed(controlEvent.getControl());
		}.bind(this));
	}
	this.m_toolbarOpenBtn = mainPersistentGroup.addButton("Open", null, "Open", "open-folder");
	this.m_toolbarOpenBtn.setPressConsumer( function(controlEvent2){
		this.openPressed();
	}.bind(this));
	this.m_toolbarSaveAsBtn = mainPersistentGroup.addButton("SaveAs", null, "Save as...", "save");
	this.m_toolbarSaveAsBtn.setPressConsumer( function(controlEvent3){
		this.saveAsPressed();
	}.bind(this));
	this.m_toolbarSaveAsBtn.setEnabled(oFF.notNull(this.m_activeDocument) && this.m_activeDocument.hasSaveData());
	if (this.getFeatureManager().areMultipleDocumentsEnabled())
	{
		this.m_toolbarCloseDocBtn = mainPersistentGroup.addButton("CloseDocument", null, "Close document", "decline");
		this.m_toolbarCloseDocBtn.setPressConsumer( function(controlEvent4){
			this.closeActiveDocumentSafe();
		}.bind(this));
	}
	var undoRedoPersistentGroup = this.getToolbarManager().addNewPersistentToolbarGroup();
	this.m_toolbarUndoBtn = undoRedoPersistentGroup.addButton("Undo", null, "Undo last action...", "undo");
	this.m_toolbarUndoBtn.setPressConsumer( function(controlEvent5){
		this.undoPressed();
	}.bind(this));
	this.m_toolbarUndoBtn.setEnabled(false);
	this.m_toolbarRedoBtn = undoRedoPersistentGroup.addButton("Redo", null, "Redo last action...", "redo");
	this.m_toolbarRedoBtn.setPressConsumer( function(controlEvent6){
		this.redoPressed();
	}.bind(this));
	this.m_toolbarRedoBtn.setEnabled(false);
};
