	this.m_serializationFormats.setName(text);
	this.m_serializationFormats.addAllItems(this.createDropdownElements(this.m_serializationFormats));
	this.m_serializationFormats.registerOnSelect(this);
	listLayout.addItem(this.m_serializationFormats);
	this.m_serializationJSON = listLayout.addNewItemOfType(oFF.UiType.TEXT_AREA);
	this.m_serializationJSON.setName("serializedData");
	this.m_serializationJSON.setBackgroundColor(oFF.UiColor.WHITE);
	this.m_serializationJSON.setSize(oFF.UiSize.createByCss("100%", "100%"));
