oFF.AuGdsQbSerializationPanel.prototype.createDropdownElements = function(dropdown)
{
	var dropdownValues = oFF.XList.create();
	dropdownValues.add(oFF.XPairOfString.create("Select", null));
	dropdownValues.add(oFF.XPairOfString.create(oFF.QModelFormat.INA_DATA.getName(), oFF.QModelFormat.INA_DATA.getName()));
	dropdownValues.add(oFF.XPairOfString.create(oFF.QModelFormat.INA_REPOSITORY.getName(), oFF.QModelFormat.INA_REPOSITORY.getName()));
	dropdownValues.add(oFF.XPairOfString.create(oFF.QModelFormat.INA_REPOSITORY_DATA.getName(), oFF.QModelFormat.INA_REPOSITORY_DATA.getName()));
	dropdownValues.add(oFF.XPairOfString.create(oFF.QModelFormat.INA_REPOSITORY_DELTA.getName(), oFF.QModelFormat.INA_REPOSITORY_DELTA.getName()));
	var items = oFF.XList.create();
	var size = dropdownValues.size();
	for (var i = 0; i < size; i++)
	{
		var presentation = dropdownValues.get(i);
		var text = presentation.getFirstString();
		var name = presentation.getSecondString();
		var dropdownItem = dropdown.newItem();
		dropdownItem.setName(name);
		dropdownItem.setText(text);
		items.add(dropdownItem);
	}
	return items;
};
oFF.AuGdsQbSerializationPanel.prototype.releaseObject = function()
{
	this.m_queryManager = null;
	this.m_root = oFF.XObjectExt.release(this.m_root);
	oFF.AuGdsDfQbPanel.prototype.releaseObject.call( this );
};
oFF.AuGdsQbSerializationPanel.prototype.getQueryManager = function()
{
	return this.m_queryManager;
};
oFF.AuGdsQbSerializationPanel.prototype.setQueryManager = function(manager)
{
	this.m_queryManager = manager;
	if (oFF.notNull(this.m_selectedSerializationFormat))
	{
		var lookup = oFF.ContentType.lookup(this.m_selectedSerializationFormat);
		var prElement = this.m_queryManager.serializeToElement(lookup);
		this.m_serializationJSON.setValue(oFF.PrUtils.serialize(prElement, true, true, 4));
	}
};
oFF.AuGdsQbSerializationPanel.prototype.onSelect = function(event)
{
	var controlName = event.getControl().getName();
	if (oFF.XString.isEqual(controlName, this.m_serializationFormats.getName()))
	{
		var selectedFormat = this.m_serializationFormats.getSelectedItem().getName();
		if (oFF.isNull(selectedFormat))
		{
			this.m_selectedSerializationFormat = selectedFormat;
			this.m_serializationJSON.setValue("");
		}
		else if (!oFF.XString.isEqual(this.m_selectedSerializationFormat, selectedFormat))
		{
			this.m_selectedSerializationFormat = selectedFormat;
			var lookup = oFF.ContentType.lookup(selectedFormat);
			var prElement = this.m_queryManager.serializeToElement(lookup);
			this.m_serializationJSON.setValue(oFF.PrUtils.serialize(prElement, true, true, 4));
		}
	}
};

