oFF.AuGdsFilterLine.prototype.setQueryManager = function(queryManager, updateCommand)
{
	if (oFF.isNull(updateCommand))
	{
		throw oFF.XException.createIllegalArgumentException("Command must not be null");
	}
	this.m_queryManager = oFF.XObjectExt.assertNotNull(queryManager);
	this.m_updateCommand = updateCommand;
	this.m_filterLineManagers = oFF.XList.create();
	this.m_dimensionFilterManager = oFF.AuGdsFilterLineDimensionFilterManager.create(this.m_queryManager, this.getGenesis(), this.m_grid, this.m_filterLineConfig, this.m_featureManager, this.m_updateCommand, oFF.AuGdsDimensionFilterLineItemDescriptionUpdater.create(), this.getBeforeFilterChangeListenerGenerator());
	this.m_measureFilterManager = oFF.AuGdsFilterLineMeasureFilterManager.create(this.m_queryManager, this.getGenesis(), this.m_grid, this.m_featureManager, this.m_updateCommand);
	this.m_accountDimensionFilterManager = oFF.AuGdsFilterLineAccountDimensionFilterManager.create(this.m_queryManager, this.getGenesis(), this.m_grid, this.m_updateCommand);
	this.m_complexFilterManager = oFF.AuGdsFilterLineComplexFilterManager.create(this.m_queryManager, this.getGenesis(), this.m_grid, this.m_featureManager, this.m_updateCommand, oFF.AuGdsComplexFilterLineItemDescriptionUpdater.create());
	this.m_filterLineManagers.add(this.m_dimensionFilterManager);
	this.m_filterLineManagers.add(this.m_measureFilterManager);
	this.m_filterLineManagers.add(this.m_accountDimensionFilterManager);
	this.m_filterLineManagers.add(this.m_complexFilterManager);
	var openFilterDialogWithDimensionConsumer =  function(dimension, filterType){
		this.m_filterLineConfig.setFilterTypeForDimension(dimension.getName(), filterType.getName());
		this.m_dimensionFilterManager.openFilterDialogWithoutContext(dimension);
	}.bind(this);
	var openFilterDialogWithMeasureConsumer =  function(measure){
		this.m_measureFilterManager.openFilterDialog(measure, oFF.XStringUtils.concatenate2(measure.getName(), "-MeasureBasedFilter"));
	}.bind(this);
	var openFilterDialogWithAccountDimensionConsumer =  function(measureName, measureText){
		this.m_accountDimensionFilterManager.openFilterDialog(measureName, measureText, oFF.XStringUtils.concatenate2(measureName, "-MeasureBasedFilter"));
	}.bind(this);
	var modelCapabilities = this.m_queryManager.getModelCapabilities();
	var isBW = oFF.notNull(modelCapabilities) && (modelCapabilities.getSystemType().isTypeOf(oFF.SystemType.BW) || modelCapabilities.getSystemType().isTypeOf(oFF.SystemType.VIRTUAL_INA));
	var accountDimension = this.m_queryManager.getQueryModel().getAccountDimension();
	var isAccount = oFF.notNull(accountDimension);
	if (this.m_filterLineConfig.getConfig().getBooleanByKey(oFF.AuGdsQbConstants.CONFIG_SHOW_FILTER_LINE_MENU_TREE))
	{
		var setCascadeBehaviourForFilters =  function(cascadingSetting){
			this.m_dimensionFilterManager.setCascadeBehaviourForFilters(cascadingSetting);
		}.bind(this);
		this.m_menu = oFF.AuGdsFilterLineMenuFactory.createTreeMenu(this.getGenesis(), isBW, isAccount, this.m_featureManager, openFilterDialogWithDimensionConsumer, openFilterDialogWithMeasureConsumer, openFilterDialogWithAccountDimensionConsumer, setCascadeBehaviourForFilters, this.m_filterLineConfig);
	}
	else
	{
		this.m_menu = oFF.AuGdsFilterLineMenuFactory.create(this.getGenesis(), isBW, isAccount, this.m_featureManager, openFilterDialogWithDimensionConsumer, openFilterDialogWithMeasureConsumer, openFilterDialogWithAccountDimensionConsumer);
	}
	this.m_addFilterButtonLayout.clearItems();
	this.m_addFilterButtonLayout.addItem(this.m_menu.getFilterLineMenuButton());
	this.m_menu.createMenuItems(this.m_queryManager);
	this.m_queryManager.getQueryModel().getFilter().registerChangedListener(this, null);
	this.updateFilterLine();
};
