oFF.AuGdsFilterLine.prototype.hasFilters = function()
{
	return this.m_grid.getItemCount() > 0;
};
oFF.AuGdsFilterLine.prototype.getCascadingSetting = function()
{
	var returnValue = oFF.XOptional.empty();
	if (this.m_featureManager.isActive(oFF.AuGdsFilterLineFeature.CASCADING_FILTERS))
	{
		returnValue = oFF.AuGdsFilterLineCascadingSettingRetriever.create(this.m_filterLineConfig).getCascadingSetting();
	}
	return returnValue;
};
oFF.AuGdsFilterLine.prototype.getReadModeForDimension = function(dimension)
{
	return this.m_dimensionFilterManager.getStoredReadModeForFilterDialog(dimension);
};
oFF.AuGdsFilterLine.prototype.getDisplayInfoForDimension = function(dimension)
{
	return this.m_dimensionFilterManager.getStoredDisplayInfoForFilterDialog(dimension);
};
oFF.AuGdsFilterLine.prototype.getBeforeFilterChangeListener = function(dimension)
{
	return oFF.AuGdsLambdaFdBeforeFilterChangeListener.create( function(settings){
		if (oFF.notNull(settings) && oFF.notNull(dimension))
		{
			if (settings.getDisplayInfo() !== null)
			{
				this.m_filterLineConfig.setDisplayTypeForDimension(dimension.getName(), settings.getDisplayInfo().getName());
			}
			if (this.m_featureManager.isActive(oFF.AuGdsFilterLineFeature.CASCADING_FILTERS) && settings.getReadMode() !== null)
			{
				var newReadMode = settings.getReadMode();
				var oldReadModeInOptional = this.getReadModeForDimension(dimension);
				var oldReadMode = oldReadModeInOptional.isPresent() ? oldReadModeInOptional.get() : null;
				if (oldReadMode !== newReadMode)
				{
					this.m_filterLineConfig.setCascadingSetting(oFF.AuGdsFilterLineCascadingSetting.NONE);
				}
				this.m_filterLineConfig.setReadModeForDimension(dimension.getName(), settings.getReadMode().getName());
			}
		}
	}.bind(this));
};
oFF.AuGdsFilterLine.prototype.getBeforeFilterChangeListenerGenerator = function()
{
	return  function(dimension){
		return this.getBeforeFilterChangeListener(dimension);
	}.bind(this);
};
oFF.AuGdsFilterLine.prototype.updateFilterLine = function()
{
	this.m_grid.clearItems();
	oFF.XStream.of(this.m_filterLineManagers).forEach( function(filterLineManager){
		filterLineManager.updateFilterLine();
	}.bind(this));
	this.m_grid.setGridVisible(this.hasFilters());
	var selected = this.m_measureFilterManager.getSelected().size() > 0 ? this.m_measureFilterManager.getSelected() : this.m_accountDimensionFilterManager.getSelected();
	this.m_menu.updateMenuItemsStatus(this.m_dimensionFilterManager.getSelected(), selected);
};

