oFF.AuGdsQueryDetails.prototype.setConfig = function(queryDetailsConfig)
{
	if (oFF.notNull(queryDetailsConfig))
	{
		if (queryDetailsConfig.hasStringByKey(oFF.AuGdsQueryDetails.TITLE_TEXT))
		{
			this.setTitle(queryDetailsConfig.getStringByKey(oFF.AuGdsQueryDetails.TITLE_TEXT));
		}
		this.setVisible(queryDetailsConfig.getBooleanByKey(oFF.AuGdsQueryDetails.WIDGET_VISIBLE));
		this.setTableTitleVisible(queryDetailsConfig.getBooleanByKey(oFF.AuGdsQueryDetails.TITLE_VISIBLE));
		this.setModelDetailsVisible(queryDetailsConfig.getBooleanByKey(oFF.AuGdsQueryDetails.DETAILS_VISIBLE));
	}
};
oFF.AuGdsQueryDetails.prototype.getConfig = function()
{
	var result = oFF.PrFactory.createStructure();
	result.putStringNotNullAndNotEmpty(oFF.AuGdsQueryDetails.TITLE_TEXT, this.m_title);
	result.putBoolean(oFF.AuGdsQueryDetails.WIDGET_VISIBLE, this.isVisible());
	result.putBoolean(oFF.AuGdsQueryDetails.TITLE_VISIBLE, this.isTableTitleVisible());
	result.putBoolean(oFF.AuGdsQueryDetails.DETAILS_VISIBLE, this.isModelDetailsVisible());
	return result;
};
