oFF.AuDatasourcePicker.prototype.isSACInternalSystem = function(systemDescription)
{
	var systemProperties = systemDescription.getProperties();
	if (oFF.isNull(systemProperties))
	{
		return false;
	}
	if (!systemProperties.isValueDefined(oFF.ConnectionParameters.FPA_IS_CONNECTED))
	{
		return false;
	}
	var isConnected = systemProperties.getBooleanByKey(oFF.ConnectionParameters.FPA_IS_CONNECTED);
	var hasConnectionType = systemProperties.isValueDefined(oFF.ConnectionParameters.FPA_CONNECTION_TYPE);
	return isConnected && !hasConnectionType;
};
oFF.AuDatasourcePicker.prototype.prepareProgramMetadata = function(metadata)
{
	metadata.addParameter(oFF.AuDatasourcePicker.PARAM_APPLICATION, "The application to use.");
	metadata.addParameter(oFF.AuDatasourcePicker.PARAM_SYSTEM, "The system that was picked earlier.");
	metadata.addParameter(oFF.AuDatasourcePicker.PARAM_LISTENER, "The system that was picked earlier.");
};
oFF.AuDatasourcePicker.prototype.processArguments = function(args)
{
	var prgArgs = this.getArguments();
	this.m_app = prgArgs.getXObjectByKey(oFF.AuDatasourcePicker.PARAM_APPLICATION);
	this.m_startSystemName = prgArgs.getStringByKeyExt(oFF.AuDatasourcePicker.PARAM_SYSTEM, null);
	this.m_listener = prgArgs.getXObjectByKey(oFF.AuDatasourcePicker.PARAM_LISTENER);
};
oFF.AuDatasourcePicker.prototype.setupProgram = function()
{
	if (oFF.isNull(this.m_app))
	{
		this.m_app = this.getApplication();
	}
	this.m_systemsByType = oFF.XHashMapByString.create();
	var systemLandscape = this.getProcess().getSystemLandscape();
	var systemIt = systemLandscape.getSystemNames().getIterator();
	while (systemIt.hasNext())
	{
		var systemName = systemIt.next();
		var systemDescription = systemLandscape.getSystemDescription(systemName);
		var systemTypeName = systemDescription.getSystemType().getName();
		var systems = this.m_systemsByType.getByKey(systemTypeName);
		if (!this.isSACInternalSystem(systemDescription))
		{
			if (oFF.isNull(systems))
			{
				systems = oFF.XList.create();
				this.m_systemsByType.put(systemTypeName, systems);
			}
			systems.add(systemDescription);
		}
	}
	oFF.XObjectExt.release(systemIt);
	return null;
};
