		{
			var selectedItems = this.m_recentTbl.getSelectedItems();
			for (var i = 0; i < selectedItems.size(); i++)
			{
				this.m_recentTbl.removeRow(selectedItems.get(i));
			}
		}
		this.m_recentTbl.setSelectionMode(oFF.UiSelectionMode.SINGLE_SELECT);
