oFF.AuGdsQbChartSettingsPanel.prototype.updateControlByCurrentChartType = function()
{
	this.m_root.clearItems();
	this.m_root.addItem(this.m_listLayouts.getByKey(oFF.AuGdsQbChartSettingsPanel.CHART_TYPE));
	var primaryChartType = this.getChartSetting().getChartType();
	var secondaryChartType = this.getChartSetting().getChartType2();
	if (primaryChartType === oFF.ChartType.BAR_COLUMN || primaryChartType === oFF.ChartType.AREA || primaryChartType === oFF.ChartType.LINE)
	{
		if (primaryChartType === oFF.ChartType.BAR_COLUMN)
		{
			this.m_root.addItem(this.m_listLayouts.getByKey(oFF.AuGdsQbChartSettingsPanel.SECONDARY_CHART_TYPE));
		}
		this.m_root.addItem(this.m_listLayouts.getByKey(oFF.AuGdsQbChartSettingsPanel.ORIENTATION));
		this.m_root.addItem(this.m_listLayouts.getByKey(oFF.AuGdsQbChartSettingsPanel.STACKING_TYPE));
		this.m_root.addItem(this.m_listLayouts.getByKey(oFF.VisualizationValueType.VALUE.getName()));
		if (secondaryChartType !== oFF.ChartType.NONE)
		{
			this.m_root.addItem(this.m_listLayouts.getByKey(oFF.VisualizationValueType.VALUE_B.getName()));
		}
	}
	else if (primaryChartType === oFF.ChartType.RADAR)
	{
		this.m_root.addItem(this.m_listLayouts.getByKey(oFF.VisualizationValueType.VALUE.getName()));
	}
	else if (primaryChartType === oFF.ChartType.BOX_PLOT)
	{
		this.m_root.addItem(this.m_listLayouts.getByKey(oFF.AuGdsQbChartSettingsPanel.ORIENTATION));
		this.m_root.addItem(this.m_listLayouts.getByKey(oFF.VisualizationAxisType.CATEGORY_X.getName()));
		this.m_root.addItem(this.m_listLayouts.getByKey(oFF.VisualizationValueType.VALUE.getName()));
	}
	else if (primaryChartType === oFF.ChartType.TIME_SERIES)
	{
		this.m_root.addItem(this.m_listLayouts.getByKey(oFF.AuGdsQbChartSettingsPanel.ORIENTATION));
		this.m_root.addItem(this.m_listLayouts.getByKey(oFF.AuGdsQbChartSettingsPanel.STACKING_TYPE));
		this.m_root.addItem(this.m_listLayouts.getByKey(oFF.VisualizationValueType.VALUE.getName()));
	}
	else if (primaryChartType === oFF.ChartType.HEAT_MAP)
	{
		this.m_root.addItem(this.m_listLayouts.getByKey(oFF.AuGdsQbChartSettingsPanel.ORIENTATION));
		this.m_root.addItem(this.m_listLayouts.getByKey(oFF.VisualizationValueType.COLOR.getName()));
	}
	else if (primaryChartType === oFF.ChartType.PACKED_BUBBLE || primaryChartType === oFF.ChartType.BUBBLE || primaryChartType === oFF.ChartType.SCATTER_PLOT || primaryChartType === oFF.ChartType.VARI_WIDE)
	{
		this.m_root.addItem(this.m_listLayouts.getByKey(oFF.AuGdsQbChartSettingsPanel.ORIENTATION));
		if (primaryChartType === oFF.ChartType.VARI_WIDE)
		{
			this.m_root.addItem(this.m_listLayouts.getByKey(oFF.AuGdsQbChartSettingsPanel.STACKING_TYPE));
		}
		this.m_root.addItem(this.m_listLayouts.getByKey(oFF.VisualizationValueType.VALUE.getName()));
		this.m_root.addItem(this.m_listLayouts.getByKey(oFF.VisualizationValueType.VALUE_B.getName()));
		if (primaryChartType === oFF.ChartType.BUBBLE || primaryChartType === oFF.ChartType.PACKED_BUBBLE)
		{
			this.m_root.addItem(this.m_listLayouts.getByKey(oFF.VisualizationValueType.SIZE.getName()));
		}
	}
	else if (primaryChartType === oFF.ChartType.METRIC)
	{
		this.m_root.addItem(this.m_listLayouts.getByKey(oFF.VisualizationValueType.VALUE.getName()));
		this.m_root.addItem(this.m_listLayouts.getByKey(oFF.VisualizationValueType.VALUE_B.getName()));
	}
	else if (primaryChartType === oFF.ChartType.PIE || primaryChartType === oFF.ChartType.DOUGHNUT)
	{
		this.m_root.addItem(this.m_listLayouts.getByKey(oFF.VisualizationValueType.SIZE.getName()));
	}
	else if (primaryChartType === oFF.ChartType.TREE_MAP)
	{
		this.m_root.addItem(this.m_listLayouts.getByKey(oFF.AuGdsQbChartSettingsPanel.ORIENTATION));
		this.m_root.addItem(this.m_listLayouts.getByKey(oFF.VisualizationValueType.COLOR.getName()));
		this.m_root.addItem(this.m_listLayouts.getByKey(oFF.VisualizationValueType.WEIGHT.getName()));
	}
};
