oFF.AuGdsQbChartSettingsPanel.prototype.updateQbPanelUi = function()
{
	this.m_category.clearItems();
	this.m_secondaryCategory.clearItems();
	this.m_colorCategory.clearItems();
	this.m_texture.clearItems();
	this.m_shape.clearItems();
	this.m_distribution.clearItems();
	this.m_time.clearItems();
	this.m_values.clearItems();
	this.m_secondaryValues.clearItems();
	this.m_colorValue.clearItems();
	this.m_size.clearItems();
	this.m_weight.clearItems();
	if (oFF.isNull(this.m_visualizationDefinition))
	{
		return;
	}
	if (this.getChartSetting().getChartType() === null)
	{
		this.getChartSetting().setChartType(oFF.ChartType.BAR_COLUMN);
	}
	if (this.getChartSetting().getChartType2() === null)
	{
		this.getChartSetting().setChartType2(oFF.ChartType.NONE);
	}
	if (this.getChartSetting().getChartOrientation() === null)
	{
		this.getChartSetting().setChartOrientation(oFF.ChartOrientation.HORIZONTAL);
	}
	if (this.getChartSetting().getChartStackingType() === null)
	{
		this.getChartSetting().setChartStackingType(oFF.ChartStackingType.NONE);
	}
	this.m_stackingType.setSelectedName(this.getChartSetting().getChartStackingType().getName());
	this.m_orientation.setSelectedName(this.getChartSetting().getChartOrientation().getName());
	this.m_chartType.setSelectedName(this.getChartSetting().getChartType().getName());
	this.m_secondaryChartType.setSelectedName(this.getChartSetting().getChartType2().getName());
	this.updateValuesList(this.m_values, oFF.VisualizationValueType.VALUE);
	this.updateValuesList(this.m_secondaryValues, oFF.VisualizationValueType.VALUE_B);
	this.updateValuesList(this.m_size, oFF.VisualizationValueType.SIZE);
	this.updateValuesList(this.m_weight, oFF.VisualizationValueType.WEIGHT);
	this.updateValuesList(this.m_colorValue, oFF.VisualizationValueType.COLOR);
	this.updateControlByCurrentChartType();
	this.updateLabels();
};
oFF.AuGdsQbChartSettingsPanel.prototype.updateValuesList = function(list, valueType)
{
	var values = this.getChartSetting().getTypedValueSelectionsForType(valueType);
	for (var i = 0; i < values.size(); i++)
	{
		var val = values.get(i);
		var dragItem = this.buildValueItem(val);
		list.addItem(dragItem);
	}
	if (oFF.notNull(this.m_visualizationDefinition))
	{
		list.setDropInfo(oFF.UiDropInfo.create(oFF.UiDropPosition.BETWEEN, oFF.UiDropEffect.MOVE, oFF.UiDropLayout.DEFAULT, oFF.UiAggregation.ITEMS, null, this.getChartConfiguration().getKeyFigureDimension().getName()));
	}
};
