{
	var measures = this.m_dataProvider.getMeasureList();
	for (var i = 0; i < measures.size(); i++)
	{
		this.createNewMeasureDropdownItem(combobox, measures.get(i));
	}
};
oFF.AuGdsQbConditionalFormattingRuleDialog.prototype.createNewMeasureDropdownItem = function(combobox, measure)
{
	var measureCBItem = combobox.addNewItem();
	measureCBItem.setCustomObject(measure);
	var text = oFF.QueryPresentationUtils.DESCRIPTION.getDisplayValueByType(measure);
	measureCBItem.setText(text);
};
oFF.AuGdsQbConditionalFormattingRuleDialog.prototype.onCancelPressed = function()
{
	this.notifyCancelPressed();
	this.terminate();
};
oFF.AuGdsQbConditionalFormattingRuleDialog.prototype.onOkPressed = function()
{
	this.updateQueryModel();
	this.notifyOkPressed();
	this.terminate();
};
oFF.AuGdsQbConditionalFormattingRuleDialog.prototype.updateQueryModel = function()
{
	var rule = this.buildState();
	if (this.isEdit())
	{
		this.m_ruleAPI.updateRule(rule);
	}
	else
	{
		this.m_ruleAPI.createRule(rule);
	}
	this.m_activationManager.disableRuleForMember(rule.getStructureMember(), rule.getId());
};

